INSERT INTO `emailtemplates` (`id`, `name`, `description`, `status`, `type`) VALUES
(1, 'Student Registration', '<p>Hi, $studentName</p><p>Your signup email: $email</p><p>Your password: $password</p><p>Please click the following link to finish up registration:</p><p><a href="$url" target="_blank">$url</a></p><p><strong>Note: If the link does not open directly, please copy and paste the url into your internet browser.</strong></p><p>Verification Code: $code</p><p>Sincerely,</p><p>$siteName</p><p>$siteEmailContact</p>', 'Published', 'SRN'),
(2, 'Re-send Verification', '<p>Hi, $studentName</p><p>Your signup email: $email</p><p>Please click the following link to finish up registration:</p><p><a href="$url" target="_blank">$url</a></p><p><strong>Note: If the link does not open directly, please copy and paste the url into your internet browser.</strong></p><p>Verification Code: $code</p><p>Sincerely,</p><p>$siteName</p><p>$siteEmailContact</p>', 'Published', 'RVN'),
(4, 'Student Forgot Password', '<p>Dear $studentName,</p><p>Please click the following link to finish forgot password:</p><p><a href="$url" target="_blank">$url</a></p><p><strong>Note: If the link does not open directly, please copy and paste the url into your internet browser.</strong></p><p>Verification Code: $code</p><p>Sincerely,</p><p>$siteName</p><p>$siteEmailContact</p>', 'Published', 'SFP'),
(5, 'Admin Forgot Password', '<p>Dear $name,</p><p>Please click the following link to finish forgot password:</p><p><a href="$url" target="_blank">$url</a></p><p><strong>Note: If the link does not open directly, please copy and paste the url into your internet browser.</strong></p><p>Verification Code: $code</p><p>Sincerely,</p><p>$siteName</p><p>$siteEmailContact</p>', 'Published', 'AFP'),
(6, 'Admin Forgot Username', '<p>Dear $name,</p><p>You have forgot User Name. your username is $userName</p><p>Sincerely,</p><p>$siteName</p><p>$siteEmailContact</p>', 'Published', 'AFU'),
(7, 'Student Login Credentials', '<p>Dear $studentName,</p><p>Congratulations! Your $siteName account is now active.</p><p>Email Address : $email</p><p>Password: $password</p><p>If you need, you can reset your password at any time.</p><p>To get started, log on:<a href="$url" target="_blank">$url</a></p><p>If you have any questions or need assistance, please contact us.</p><p> </p><p>Best Regards,</p><p>$siteName</p><p>$siteEmailContact</p>', 'Published', 'SLC'),
(8, 'User Login Credentials', '<p>Dear $name,</p><p>Congratulations! Your $siteName account is now active.</p><p>Email Address : $email</p><p>Username : $userName</p><p>Password: $password</p><p>If you need, you can reset your password at any time.</p><p>To get started, log on:<a href="$url" target="_blank">$url</a></p><p>If you have any questions or need assistance, please contact us.</p><p> </p><p>Best Regards,</p><p>$siteName</p><p>$siteEmailContact</p>', 'Published', 'ULC'),
(9, 'Exam Activation', '<p>Dear $studentName,</p><p>Exam Name $examName Type $type is active and start on $startDate end on $endDate</p><p>Sincerely,</p><p>$siteName</p><p>$siteEmailContact</p>', 'Published', 'EAN'),
(10, 'Exam Finalized', '<p>Dear $studentName,</p><p>Name: $examName</p><p>Result: $result</p><p>Rank: $rank</p><p>Obtained Marks: $obtainedMarks</p><p>Question Attempt: $questionAttempt</p><p>Time Taken: $timeTaken</p><p>Percentage: $percent</p><p> </p><p>Sincerely,</p><p>$siteName</p><p>$siteEmailContact</p>', 'Published', 'EFD'),
(11, 'Exam Result', '<p>Dear $studentName,</p><p>Name: $examName</p><p>Result: $result</p><p>Obtained Marks: $obtainedMarks</p><p>Question Attempt: $questionAttempt</p><p>Time Taken: $timeTaken</p><p>Percentage: $percent %</p><p> </p><p>Sincerely,</p><p>$siteName</p><p>$siteEmailContact</p>', 'Published', 'ERT');
INSERT INTO `exams` (`id`, `name`, `instruction`, `duration`, `start_date`, `end_date`, `passing_percent`, `negative_marking`, `attempt_count`, `declare_result`, `finish_result`, `ques_random`, `paid_exam`, `browser_tolrance`, `instant_result`, `option_shuffle`, `amount`, `status`, `type`, `user_id`, `expiry`, `finalized_time`, `created`, `modified`) VALUES
(4, 'FREE DEMO TEST SERIES', '<p><em><span style="font-size: 12pt; font-family: arial,helvetica,sans-serif;"><strong>Candidate are advised to read exam instruction before start the exam</strong></span></em></p>\r\n<ul style="list-style-type: disc;">\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>You are going to appear a Demo exam of JAIIB/CAIIB Test Series. </strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>There are 30 multiple choice questions (MCQ) with no negative mark, each question will carry 1 marks </strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>Candidates are advice to select one correct answer. </strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>Durance of Test will be 20 minutes.</strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong> On the right hand site of test page there will be remaining time and attempted &amp; non attempted question appear. </strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>At the end of the test should select finish button on the right hand side. </strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>After submission of test, candidate are advised to check his/her result in result page which appears in candidate''s profile page. </strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>Candidate can check his section wise result in graphical representation. </strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>There is explanation for each question. </strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>Candidate can check his AIR (All India Ranking). </strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>Only top 5 performer name will be appeared. </strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>Passing cut off has been set 90% for this Demo test.</strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>Test once submitted can''t be restored </strong>\r\n</ul>', 20, '2015-03-17 01:26:00', '2016-07-31 01:26:00', 90, 'No', 1, 'Yes', '1', '1', '0', '1', '0', '1', NULL, 'Active', 'Exam', 0, 0, NULL, '2015-03-14 01:29:35', '2016-04-12 17:57:38'),
(5, 'JAIIB - Legal and Regulatory Aspects of Banking - Mock Test 1', '<p><em><span style="font-size: 12pt; font-family: arial,helvetica,sans-serif;"><strong>Candidate are advised to read exam instruction before start the exam</strong></span></em></p>\r\n<ul style="list-style-type: disc;">\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>You are going to appear a Mock test - 1 of "Legal and Regulatory Aspects of Banking" of JAIIB - Test Series. </strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>There are 100 multiple choice questions (MCQ) with no negative mark, each question will carry only 1 mark. Maximum marks is 100. No difficult category questions carrying 2 marks has been included in this mock test.</strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>Candidates are advice to select one correct answer. </strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>Duration of Mock Test will be 90 minutes.</strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong> On the right hand side of test page there will be remaining time and attempted &amp; non attempted question appear. </strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>At the end of the test candidate should select finish button on the right hand side. </strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>After submission of test, candidate are advised to check his/her result in result page which appears in candidate''s profile page. </strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>Candidate can check his section wise result in graphical representation. </strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>There is explanation for each question. </strong></span><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong><br /></strong></span></li>\r\n<li><span style="font-size: 10pt; font-family: arial,helvetica,sans-serif;"><strong>Test once submitted can''t be restored </strong> </span></li>\r\n</ul>', 90, '2015-04-19 16:49:25', '2015-05-10 16:49:32', 50, 'No', 2, 'Yes', '1', '1', '0', '1', '0', '1', NULL, 'Closed', 'Exam', 9, 0, '2015-05-21 21:56:36', '2015-04-19 16:49:57', '2015-05-21 21:56:36'),
