INSERT INTO `questions` (`id`, `qtype_id`, `subject_id`, `diff_id`, `question`, `option1`, `option2`, `option3`, `option4`, `option5`, `option6`, `marks`, `negative_marks`, `hint`, `explanation`, `answer`, `true_false`, `fill_blank`, `status`, `created`, `modified`) VALUES
(18, 2, 1, 1, 'Primary dealers mainly deal in shares, mutual fund units etc.', 'Nitish Kumar', 'Jitan Ram Manjhi', 'Laloo Yadav Ji', 'None of Above', '', '', '0.50', '0.00', '', 'Primary dealers also known as PDs, deal in government securities and deal in both the primary and secondary markets. Their basic responsibility is to provide markets for government securities and strengthen the government securities market.', '', 'False', '', 'Yes', NULL, NULL),
(19, 2, 1, 1, 'The decrease in Statutory Liquidity Ratio contracts the credit creation.', 'Ranchi', 'Gaya', 'Patna', 'None of Above', '', '', '1.00', '0.00', '', 'Statutory Liquidity Ratio (SLR) is the prescribed percentage of Demand and Time liabilities of a bank to be held in prescribed securities, mostly government securities. The increase or decrease in the CRR & SLR, contracts and enhances credit creation.', '', 'True', '', 'Yes', NULL, NULL),
(20, 2, 1, 1, 'Monetary control is exercised through Cash Reserve Ratio and Statutory Liquidity Ratio. ', '', '', '', '', '', '', '1.00', '0.00', '', 'Cash Reserve Ratio (CRR) is the mandatory deposit to be held by Banks with the requisite monetary authority. It is a percentage of their Demand and Time liabilities. The increase or decrease can be effected by the Central Bank to pump in or soak liquidity in the banking system.', '', 'True', '', 'Yes', NULL, NULL),
(21, 1, 1, 2, 'On recommendation from Lahiri Committee, in 2004, SEBI passed a regulation that derivative, instruments like Participatory Notes against underlying Indian securities can be issued.', 'Only to regulated entities and further transfers, if any, can also be to other regulated entities only.', 'Only to foreign banks', 'Only to FIIs registered with SEBI ', 'None.', '', '', '1.00', '0.00', '', 'On recommendation by the Lahiri Committee, in 2004, SEBI passed a regulation that derivative instruments like Participatory Notes against underlying Indian securities can be issued only to regulated entities and further transfers, if any, can also be to other regulated entities only.', '1', '', '', 'Yes', NULL, NULL),
(22, 1, 1, 2, 'Under domestic factoring, the payment of the bills that the seller gets from the factor is', '100 per cent of the value of the bills immediately on submission.', 'Nearly 80 per cent of the bill amount upon tendering the bill and the balance on due date. ', 'Nearly 80 per cent of the bill amount upon tendering the bill and the balance on due date after collecting it from the buyer.', '100 per cent of the value of the bill only after collection from the buyer.', '', '', '1.00', '0.00', '', 'Under domestic factoring, receivables arising only out of domestic trade shall be considered for factoring. The supplier/borrower shall draw bills of exchange for goods supplied and the purchaser shall accept that. After acceptance of bills of exchange, the factor shall make a prepayment of about 80 per cent of invoice value after deducting its discount charges at normal interest rates for the period of bill of exchange to the supplier. The balance payment (20% of the invoice value) shall be made after collecting the payment from the purchaser. If the purchaser fails to pay the due amount on due dates, the supplier shall make good the payment. The borrower/supplier shall submit the bill of exchange along with the invoice and LR/RR receipts.', '3', '', '', 'Yes', NULL, NULL),
(23, 1, 1, 2, 'A forward exchange contract is a firm contract for the purchase/sale of a specified quantity of a stated foreign currency at a pre-determined exchange rate between the bank and its:', 'Exporters', ' Importers', 'Both', 'None', '', '', '1.00', '0.00', '', 'A forward exchange contract is a firm contract between the bank and its customers for the purchase / sale of a specified quantity of a stated foreign currency at a pre-determined exchange rate.', '3', '', '', 'Yes', NULL, NULL),
(24, 1, 1, 2, 'As per Basel II Framework, the total of Tier 2 capital is permitted up to a maximum of', '100 per cent of Tier 1 capital', '250 per cent of Tier 1 capital', '80 per cent of Tier 1 capital ', '50 per cent of Tier 1 and Tier 3 capital', '', '', '1.00', '0.00', '', 'As per Basel ii Framework, The total of Tier 2 (supplementary) elements will be limited to a maximum of 100 percent of the total of Tier 1 elements.', '1', '', '', 'Yes', NULL, NULL),
(25, 1, 1, 2, 'Consumer Credit Bureau covers credit availed by', 'individuals', 'proprietary concerns', 'private and public limited companies', 'banks', '', '', '1.00', '0.00', '', 'CIBIL is a composite credit bureau, which caters to both commercial and consumer segments. The Consumer Credit Bureau covers credit availed by individuals while the Commercial Credit Bureau covers credit availed by non-individuals such as partnership firms, proprietary concerns, private and public limited companies, etc.', '1', '', '', 'Yes', NULL, NULL),
(26, 1, 1, 2, 'A cheque drawn for Rajkumar or order is stolen. The thief made endorsement as Rajkumar on the cheque in his favour. The cheque is presented in clearing and paid by bank. True owner later on sent legal notice to bank. What is the liability of the bank?', 'The paying bank will get protection under N.I. Act ', 'Forgery does not give any rights to bank, hence liable ', 'Under section 85, the paying bank is liable', 'Under section 131, the paying bank is liable.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(27, 1, 1, 2, 'A draft purchased is reported lost and the purchaser wants to stop the payment of the draft. Can the Bank do it?', 'Bank cannot stop payment since it is a promissory note.', 'Bank can stop payment since covered under negotiable instrument.', 'Bank can ask the purchaser to suffer for negligence and bank cannot help.', 'Bank would issue stop payment instructions only after two weeks from date of issue. 16. Objectives of KYC.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(28, 1, 2, 1, 'When was the National Consumer Disputes Redressal Commission (NCDRC) was set up by central government?', '1987', '1987', '1988', '1991', '', '', '1.00', '0.00', '', 'The National Consumer Disputes Redressal Commission (NCDRC), India is a quasi-judicial commission in India which was set up in 1988 under the Consumer Protection Act, 1986. Its head office is in New Delhi. The commission is headed by a sitting or retired judge of the Supreme Court of India. The present head is Justice D K Jain, former judge of the Supreme Court of India.', '3', '', '', 'Yes', NULL, NULL),
(29, 1, 2, 2, 'Whether moveable securities in possession of the bank can be sold by the Bank without intervention of\r\nthe Court ?', 'No. The Court order is required to sale the security.', 'Yes. Bank can sell as provided in the Contract ACt, 1872.', 'Yes. As the SARFAESI Act, 2002 has made provisions to that effect.', 'No. Till the account is not declared as NPA by the Bank.', '', '', '1.00', '0.00', '', 'The object of the SARFAESI Act is to give powers to the banks and financial institutions to enforce the securities given to the loans and advances by the borrowers without the intervention of the Court. It should be noted that the securities not in possession of the bank or financial institution are only covered by this Act. The securities in possession of the secured creditors are not covered by this Act and provisions of the Act are not applicable to them.', '2', '', '', 'Yes', NULL, NULL),
(30, 1, 2, 1, 'A bank has allowed a current A/c holder an ad hoc overdraft of Rs. 15 lakh. The amount is due. Whether this is recoverable under provisions of DRT Act?', 'No, as it is not a regular loan.', 'No, as only secured loans can be recovered under the DRT Act.', 'Yes, as it is a legally recoverable amount by the bank.', 'Yes, but if the tribunal grants special permission to lodge the case.', '', '', '1.00', '0.00', '', 'Debt Recovery Tribunal (DRT) Act is applicable for the debt due to any bank or financial institution or a consortium of them, when the debt is above Rupees ten lacs. ', '3', '', '', 'Yes', NULL, NULL),
(31, 1, 2, 2, 'In the Mardia case what did the Supreme Court declared as invalid?', 'Entire SARFAESI Act, 2002.', 'Creation of security interest.', 'Formation of Reconstruction Companies.', 'Condition to pay seventy-five per cent of the amounts as pre-condition while preferring appeal to the DRT.', '', '', '1.00', '0.00', '', '1. In Mardia Chemicals vs Union of India (2004) 21 ILD 521 SC, a three member bench of the Supreme Court has declared this Act as constitutionally valid, except a part of the Section 17(2). The Section 17(2) had laid down that when the lender intends to take action of taking possession of the security asset, the borrower can file an appeal to the DRT only after depositing seventy-five per cent of the amount claimed by the lender.The Supreme Court has declared this condition of the deposit of seventy five per cent of the claim amount as unreasonable, oppressive, arbitrary and violative of the Article 14 of the Constitution. After the Supreme Court decision in the Mardia case and its fall out on the very intention of the legislation giving importance for recovery and prevent long legal battles that borrowers create without any payment, the Government of India has issued a notification amending the Section 17(2) of the SARFAESI Act. The amendment now stipulates payment of fifty per cent amount instead of seventy five per cent as originally enacted.', '4', '', '', 'Yes', NULL, NULL),
(32, 1, 2, 2, 'When any bank or financial institution obtains a charge against property, with which authority will the transaction have to be registered under the SARFAESI Act, 2002?', 'With the Central Registry.', 'With the ROC.', 'With the Registrar of Assurances within whose jurisdiction the property lies.', 'With the Reserve Bank of India.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(33, 1, 2, 2, 'When can the provisions of SARFAESI Act, 2002 be invoked for proceeding against the charged property?', 'When the bank feels that it is necessary for the recovery at any time.', 'When the RBI directs to do so.', 'When there is default in repayment by the borrower.', 'When there is default in repayment and the bank declares the account as NPA.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(34, 1, 2, 3, 'Besides the SARFAESI Act, some other laws require some registration of charge created in the property. Is such double registration avoidable?', 'Yes, the creditor can choose under which law he needs registration.', 'No, registration under the SARFAESI Act as well as any other applicable law will have to be made as the SARFAESI Act is not substitution of any other law.', 'Yes, if one charge noting is by a registered document.', 'No, as the Civil Courts and DRT still have jurisdiction against the properties both registrations are required.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(35, 1, 2, 2, 'What is the object of introducing the banking ombudsman scheme, 2006?', 'For effective monitoring of the NPA accounts in the banks.', 'It is the RBI agency to regulate the disputes amongst the banks.', 'To enable resolution of complaints relating to banking services.', 'For executing the orders passed by the DRT.', '', '', '1.00', '0.00', '', 'The scheme aimed at resolution and settlement of complaints of the banking public against the commercial banks (excluding RRBs) and the scheduled primary co-operative banks without resorting to courts.', '3', '', '', 'Yes', NULL, NULL),
(36, 1, 2, 2, 'A bank has allowed a current A/c holder an ad hoc overdraft of Rs. 15 lakh. The amount is due. Whether this is recoverable under provisions of DRT Act?', 'No, as it is not a regular loan.', 'No, as only secured loans can be recovered under the DRT Act.', 'Yes, as it is a legally recoverable amount by the bank.', 'Yes, but if the tribunal grants special permission to lodge the case.', '', '', '1.00', '0.00', '', 'Debt Recovery Tribunal (DRT) Act is applicable for the debt due to any bank or financial institution or a consortium of them, when the debt is above Rupees 10 lacs. ', '3', '', '', 'Yes', NULL, NULL),
(37, 1, 2, 2, 'While filing appeal before the appellate tribunal if any amount is required to be deposited?', 'No, amount is required to be deposited until the appellate tribunal decides.', 'Yes, Court-fee on the appeal amount is required to be paid.', 'Yes, 75 per cent of the amount determined by the tribunal is required to be deposited at the timing of filing of the appeal.', 'Yes, after admission of the appeal 75 per cent of the amount determined by the tribunal is required to be deposited.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(38, 1, 2, 2, 'A company is under winding up process. Whether High Court permission is required to a bank to proceed against it before DRT?', 'No, as the DRT Act being a special Law having overriding effect over other laws.', 'Yes, as Companies Act specially provides to that effect', 'Depends on the stage of winding up process.', 'No permission but concurrence of High Court required.', '', '', '1.00', '0.00', '', 'Allahabad Bank vs Canra Bank 2000 AIR sew 1347 In this case one of the issues before the court was whether permission of Company Court is required for filing case before the Debt Recovery Tribunal when winding up proceedings are pending before the Company Court. \r\nThe Honourable Supreme Court after examining the Company Law and Recovery of Debts Due to banks and financial Institutions Act (DRT Act) held that: \r\n(A) Adjudication under DRT Act is exclusive and jurisdiction of Civil Court and Company Court is ousted.\r\n(B) DRT proceedings cannot be stayed by Company Court nor proceedings can be transferred to Company Court.\r\n(C) DRT Act overrides the Companies Act.', '1', '', '', 'Yes', NULL, NULL),
(39, 1, 2, 2, 'Doctrine of election will come into play', 'when there exixts two or more remedies;', 'when there are inconsistencies between the remedies;', 'when there is choice available to the party to opt for on e of them;', 'when all the aforesaid elements are to be present in a case.', '', '', '1.00', '0.00', '', 'Election means choosing between two alternative rights and inconsistent rights. If an instrument confers two rights on a person in such a manner that one right is in lieu of the other, that person can choose or elect any one of them. A person can not take under and against same instrument. Hence  all the aforesaid elements are to be present for expecting Doctrine of Election.\r\nThe Supreme Court observed that there are three elements of election, namely, existence of two or more remedies; inconsistencies between such remedies and a choice of one of them. If anyone of the three elements is not there, the doctrine will not apply. There is no repugnancy nor inconsistency between the two remedies and therefore, the Doctrine of Election does not apply.', '4', '', '', 'Yes', NULL, NULL),
(40, 1, 3, 3, 'A and B entered into a partnership investing Rs. 16000 and Rs. 12000 respectively. After 3 months, A withdrew Rs. 5000 while B invested Rs. 5000 more. After 3 more months C joins the business with a capital of Rs. 21000. The share of B exceeds that of C, out of a total profit of Rs. 26400 after one year by', 'Rs. 3200', 'Rs. 3400', 'Rs. 3600', 'Rs. 3800', '', '', '1.00', '0.00', '', 'A:B: C = 16000*3 + 11000*9:12000*3 + 17000*9:21000*6\r\n= 147:189:126 = 7:9:6\r\nDifference of B and Câ€™s shares =\r\nRs. [26400 * (9/22) â€” 26400 * (6/22))\r\n= Rs. 3600', '3', '', '', 'Yes', NULL, NULL),
(41, 1, 3, 1, 'Wages Paid for the erection of machine debited to wages Ac is', 'Error of Principle', 'Error of Commission', 'Error of Omission', 'Error of Mathematics', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(42, 1, 3, 1, 'True discount is equivalent to', 'Interest', 'Principal amount', 'Amount', 'All of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(43, 1, 3, 1, 'In retail business, widely followed method of inventory valuation is', 'FIFO', 'Weighted average', 'Adjusted selling price', 'LIFO', '', '', '1.00', '0.00', '', 'Adjusted selling price is used widely in retail businesses or businesses where the inventory comprises items, the individual costs of which are not readily ascertainable. The historical costs of inventory is estimated by calculating it, at the first instance at the selling price and then deducting an amount equal to the estimated gross margin of profit on such stocks.', '3', '', '', 'Yes', NULL, NULL),
(44, 1, 3, 1, 'The test of objectivity and verifiability is satisfied by valuing stock at', 'Historical price', 'Current replacement price', 'Net realizable value', 'Avg market price', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(45, 1, 3, 3, 'An asset cost Rs. 3,30,000/- has residual value of Rs. 30,000/-, and is expected to last 4 years. Calculate the depreciation for 4th year using sum of the digits Method.\r\n', ' Rs. 1,20,000/-', ' Rs. 60,000/-', ' Rs. 30,000/-', 'Rs. 15,000/-', '', '', '1.00', '0.00', '', 'D = (nth/E(sigma)n)(cost-Residual Value)\r\nE(sigma)n = 1+2+3+4 = 10\r\n1st year = 4/10(330000-30000) = 4/100*300000 = 120000\r\n2nd year = 3/10(330000-30000) = 3/100*300000 = 90000\r\n3rd year = 2/10(330000-30000) = 2/100*300000 = 60000\r\n4th year = 1/10(330000-30000) = 1/100*300000 = 30000\r\nAns :  Rs. 30000/-', '3', '', '', 'Yes', NULL, NULL),
(46, 1, 3, 1, 'Sacrificing ratio is calculated at the time of', ' Admission', 'Retirement', 'Death', 'None', '', '', '1.00', '0.00', '', '(At the time of Admission of a Partner) : When a new partner is admitted to partnership, adjustments of goodwill is necessary because goodwill has been built up by the old partners over a period of years for which they have worked hard and they would not like to just pass on a part of it to the new partner. The new partner also gets a share in profits of the firm from the date of his admission, which is sacrificed by the existing partners.', '1', '', '', 'Yes', NULL, NULL),
(47, 1, 3, 1, 'In perpetual bonds', 'Interest is paid even beyond maturity period', 'Only interest is paid and has no maturity value', 'Interest and maturity value is paid in advance', 'All the above', '', '', '1.00', '0.00', '', 'A bond with no maturity date. Perpetual Bonds are redeemable but pay a steady stream of interest forever.', '2', '', '', 'Yes', NULL, NULL),
(48, 2, 1, 1, 'Notes in the denomination from Rupee 1 to Rupees 1000 are issued by RBI. ', '', '', '', '', '', '', '0.50', '0.00', '', 'RBI has the sole authority for the issuance of currency notes and putting them into circulation, withdrawing them or exchanging them. RBI has issued and put in circulation notes in the denomination of Rs. 2, 5, 10, 20, 50, 100, 500 and 1000, except Rs. 1 notes and all coins, which are issued by the Government of India, but put into circulation by RBI.', '', 'False', '......................', 'Yes', NULL, NULL),
(49, 2, 1, 1, 'RBI appoints the CEOs of private sector banks.', '', '', '', '', '', '', '0.50', '0.00', '', 'RBI''s supervisory powers over commercial banks are quite wide as mentioned below and their objective is to develop a sound banking system in the country:\r\ni) To issue licences for new banks and new branches for the existing banks,\r\nii) To prescribe the minimum requirements for the paid-up capital and reserves, maintenance of cash reserves and other liquid assets,\r\niii) To inspect the working of the scheduled banks in India and abroad from all relevant angles to ensure their sound working.\r\niv) To conduct ad hoc investigations into complaints, irregularities and frauds pertaining to the banks.\r\nv) To control appointments, reappointments, termination of Chairmen and CEOs of private banks.\r\nvi) To approve or force amalgamation or merger of two banks. The recent example is the merger of Global Trust Bank with Oriental Bank of Commerce, after the RBI''s moratorium (freezing) of the former in early 2004.', '', 'True', '', 'Yes', NULL, NULL),
(50, 2, 1, 1, 'RBI has no power to amalgamate weaker banks with strong banks.', '', '', '', '', '', '', '0.50', '0.00', '', 'RBI''s supervisory powers over commercial banks are quite wide as mentioned below and their objective is to develop a sound banking system in the country:\r\ni) To issue licences for new banks and new branches for the existing banks,\r\nii) To prescribe the minimum requirements for the paid-up capital and reserves, maintenance of cash reserves and other liquid assets,\r\niii) To inspect the working of the scheduled banks in India and abroad from all relevant angles to ensure their sound working.\r\niv) To conduct ad hoc investigations into complaints, irregularities and frauds pertaining to the banks.\r\nv) To control appointments, reappointments, termination of Chairmen and CEOs of private banks.\r\nvi) To approve or force amalgamation or merger of two banks. The recent example is the merger of Global Trust Bank with Oriental Bank of Commerce, after the RBI''s moratorium (freezing) of the former in early 2004.', '', 'False', '', 'Yes', NULL, NULL),
(51, 2, 1, 2, 'Credit Authorisation and Consortium of Finance schemes of RBI are still mandatory for commercial banks in India.', '', '', '', '', '', '', '1.00', '0.00', '', 'Credit Authorisation Scheme (1960s) & Consortium Financing Scheme (1970s) schemes have been discontinued after the liberalisation since 1991. ', '', 'False', '', 'Yes', NULL, NULL),
(52, 2, 1, 1, 'All scheduled bank branches can handle foreign exchange transactions.', '', '', '', '', '', '', '0.50', '0.00', '', 'RBI administers foreign exchange control through its Exchange-Control Department. It authorizes the bank''s specified branches and other dealers, called Authorised Dealers (ADs) to deal in the prescribed kinds of foreign exchange transactions and issues the AD series of circulars for regulating such transactions.', '', 'False', '', 'Yes', NULL, NULL),
(53, 2, 1, 1, 'As there is no sub-target for the SSI sector, it does not comprise the Priority Sector.', '', '', '', '', '', '', '0.50', '0.00', '', 'In accordance with the government policy of poverty alleviation and improving the economic condition of the disadvantaged sections of the society, RBI has directed banks to lend to the specified Priority Sector with a minimum target of 40 per cent of their Net bank credit, with specified sub-targets for agriculture, weaker sections and the very poor sections of the society. Certain concessions in the lending terms and operations have also been prescribed by RBI for Priority Sector Advances.', '', 'False', '', 'Yes', NULL, NULL),
(54, 2, 1, 1, 'The Indian Banking System is regulated in terms of the provisions Banking Regulation of Act, 1934 & Reserve Bank of India Act, 1949.', '', '', '', '', '', '', '0.50', '0.00', '', 'Banking Regulation of Act, 1949 & Reserve Bank of India Act, 1935.', '', 'False', '', 'Yes', NULL, NULL),
(55, 2, 1, 1, 'The Central Board of Directors of RBI comprises one Governor, four deputy Governors, & Fifteen Directors.\r\n\r\n', '', '', '', '', '', '', '0.50', '0.00', '', 'The Governor and four Deputy Governors of RBI are appointed by the Union Government. The control of the RBI vests in the Central Board of Directors, that comprises the Governor, four Deputy Governors and 15 Directors nominated by the Union Government.', '', 'True', '', 'Yes', NULL, NULL),
(56, 1, 2, 1, 'In securitisation, who is the originator?', '<p>Borrower</p>', '<p>Lending Bank</p>', '<p>Securitisation Company</p>', '<p>None of the above</p>', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(57, 1, 2, 1, 'On sale of security asset, the sale proceeds are appropriated firstly.', 'Towards satisfaction of dues of secured creditor.', 'Towards payment of dues of labour.', 'Towards payment of cost, charges and expenses for preservation and protection of securities,\r\ninsurance premiums, etc\r\n', 'Towards payment of legal costs incurred by the creditor for taking possession and for effecting sale.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(58, 1, 2, 1, 'After Mardia Chemical Case, the amendment made in the SARFAESI Act stipulates deposit of _______ %', '25', '50', '60', '75', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(59, 1, 2, 1, 'The bank can seek review of award before', 'deputy governor of RBI', 'chief justice of supreme court', 'consumer protection act, 1986', 'none of the above', '', '', '0.50', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(60, 1, 2, 1, 'The banking ombudsman may ask the concerned bank to submit', 'information on the complaint', 'evidences and documents in support of the reply to the complaint', 'other related document', 'all the above', '', '', '0.50', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(61, 1, 2, 2, 'Under which provisions, the RBI has introduced the banking regulation act, 1949', 'section 33 of banking ombudsman scheme', 'RBI act, 134', 'consumer protection act, 1986', 'none of the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(62, 1, 2, 1, 'An award of banking ombudsman is', 'a judicial decision', 'an arbitrarily order', 'an order on the bank', 'an appeal to the bank', '', '', '0.50', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(63, 1, 2, 1, 'Under the banking ombudsman scheme a complaint can be lodged with the ombudsman', 'within in the specified jurisdiction', 'with the head office of the bank', 'with the consumer of the bank', 'any of the above', '', '', '0.50', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(64, 1, 2, 1, 'The secretariat staff in the baking ombudsman office will be', 'drawn from banks', 'drawn from reserve bank', 'directly appointed', '(a) and (b)', '', '', '0.50', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(65, 1, 2, 3, 'Which among the following is prohibited business for a banking company under Section 8 of Banking Regulation Act', 'Manage, sell and realise any property which may come into its possession in satisfaction of any of its claims\r\n', 'Undertake the administration of estates as executor, trustee or otherwise\r\n', 'Sell, improve, manage, develop, exchange, lease, mortgage, dispose of or turn into account or otherwise deal with all or any part of the business of any person or company\r\n', 'Buying or selling or bartering of goods directly or indirectly\r\n', '', '', '2.00', '0.00', '', 'Buying or selling or bartering of goods directly or indirectly in general is prohibited but can be done in connection with undertaking the administration of estates as executor, trustee, etc. Goods for the purpose of this Section means every kind of moveable property, other than actionable claims, stocks, shares, money, bullion and specie and all instruments referred to in Clause (a) of sub-Section (1) of Section 6', '4', '', '', 'Yes', NULL, NULL),
(66, 1, 2, 3, 'Section 9 of Banking Regulation Act prohibits a banking company from holding immoveable property, except as is required for its own use, for a initial period exceeding _______ years from the date of acquisition of the property.\r\n', '5\r\n', '7', '10', '3', '', '', '2.00', '0.00', '', 'As regards immoveable properties, Section 9 of the Banking Regulation Act prohibits a banking company from holding such property, howsoever acquired, except as is required for its own use, for a period exceeding seven years from the acquisition of the property. The Reserve Bank may extend this period by another five years, if it is satisfied that such extension would be in the interest of the depositors of the banking company.', '2', '', '', 'Yes', NULL, NULL),
(67, 1, 2, 3, 'The Reserve Bank derive the power as the sole authority for issue and management of currency in India under _____________?\r\n', 'Section 3 of the Reserve Bank of India Act\r\n', 'Section 56 of the Reserve Bank of India Act\r\n', 'Section 22 of the Reserve Bank of India Act\r\n', 'None of the above\r\n', '', '', '2.00', '0.00', '', 'The Reserve Bank is the sole authority for issue and management of currency in India under Section 22 of the RBI Act.', '3', '', '', 'Yes', NULL, NULL),
(68, 1, 2, 3, 'Payment of dividend in banking company is governed by?', 'Section 15 of Banking Regulation Act\r\n', 'Section 13 of Banking Regulation Act\r\n', 'Section 10 of Banking Regulation Act\r\n', 'None of the above\r\n', '', '', '2.00', '0.00', '', 'under Section 15 of the Banking Regulation Act, no dividend is payable until all capitalised expenses are completely written off. Such expenses include preliminary expenses, organisation expenses, share-selling commission, brokerage, loss incurred and any other item, of expenditure not represented by tangible assets. However, dividends are payable without writing off depreciation, bad debt etc.', '1', '', '', 'Yes', NULL, NULL),
(69, 1, 2, 3, '"The eligibility criteria require for payment of dividend by a banking company is  minimum 9 % of CAR and Net NPAs not exceeding 1%."', 'False. Only 9% of CAR is mandatory criteria.', 'False. Only Net NPA not exceeding 1% is mandatory criteria.\r\n', 'True. Both criteria should be met.\r\n', 'None of the above\r\n', '', '', '2.00', '0.00', '', 'RBI has given detailed eligibility criteria for declaration of dividend by banks and also guidelines on the quantum of dividend that can be declared by banks. The eligibility criteria require a minimum 9 % of CAR and Net NPAs not exceeding 1%. Also the quantum of dividend that can be declared is based on the levels of net NPAs and in a graded level (Maximum 40% pay out ratio) and can be paid out of only current year''s profits.', '3', '', '', 'Yes', NULL, NULL),
(70, 1, 2, 3, 'Meaning of substantial interest as per Section 2 of the Banking Regulation Act.', 'Holding of beneficial interest by any individual or his spouse or minor child, whether singly or taken together in the shares of a company exceeding Rs. 10 lacs or 10 per cent of the paid-up capital of the company amounts to substantial interest.', 'Holding of beneficial interest by any individual or his spouse or minor child, whether singly or taken together in the shares of a company exceeding Rs. 5 lacs or 10 per cent of the paid-up capital of the company amounts to substantial interest.', 'Holding of beneficial interest by any individual or his spouse or minor child, whether singly or taken together in the shares of a company exceeding Rs. 5 lacs or 20 per cent of the paid-up capital of the company amounts to substantial interest.', 'None of the above', '', '', '2.00', '0.00', '', '"Substantial interest'' is defined in Section 2 of the Banking Regulation Act. Accordingly, holding of beneficial interest by\r\nany individual or his spouse or minor child, whether singly or taken together in the shares of a company exceeding Rs. 5 lacs or ten per cent of the paid-up capital of the company amounts to substantial interest. In the case of firms, such holding of beneficial interest exceeding ten per cent of the total capital of the firm amounts to substantial interest."', '2', '', '', 'Yes', NULL, NULL),
(71, 1, 2, 3, 'The Information Technology Act, 2000 has amended the Reserve Bank of India Act, inserting the Clause (pp) in Section 58 (2) empowering the Reserve Bank', 'To constitute clearing house', 'To constitute Board for regulation and supervision of Payment and Settlement Systems\r\n', 'To regulate physical cheque clearing system\r\n', 'To frame regulations for electronic payment systems of banks and financial institutions\r\n', '', '', '2.00', '0.00', '', '"The regulation of payment systems has become important in the context of electronic payment systems becoming popular and the probability of complications in the absence of a suitable regulatory framework with statutory backing. In the absence of specific powers under the RBI Act, the Bank has not been able to frame any regulations relating to payment systems. Hence, the Information Technology Act, 2000 has amended the Reserve Bank of India Act, inserting the Clause (pp) in Section 58 (2) empowering the Reserve Bank to frame regulations for payment systems of banks and financial institutions\r\n\r\nSection 58 empowers the Bank to make regulations for giving effect to the provisions of the Act and Clause (g) of the sub-Section (2) thereof, provides for making provisions for regulation of clearing houses for the banks including post office saving banks."', '4', '', '', 'Yes', NULL, NULL),
(72, 1, 2, 3, '<p>Which one of the following is not an ground of compliant under Banking Ombudsman Scheme, 2006.</p>', '<p>"Deficiency in banking or other services in respect of non-acceptance, without sufficient cause, of small denomination notes tendered for any purpose, and for charging of commission in respect thereof;"</p>', '<p>Deficiency in banking service in respect of loans and advances pertaining to not providing loan and advance.</p>', '<p>Deficiency in banking or other services in respect of non-adherence by the bank or its subsidiaries to the instructions of Reserve Bank on ATM/ Debit card operations or credit card operations</p>', '<p>Deficiency in banking service in respect of loans and advances pertaining to non-observance of Reserve Bank Directives on interest rates</p>', '', '', '2.00', '0.00', '', '<p>"One of the grounds on which complaints may be made to the banking ombudsman is "Deficiency in banking service in respect of loans and advances pertaining to non-acceptance of application for loans <span style="text-decoration: underline;">without furnishing valid reasons to the applicant</span>."</p>', '2', '', '', 'Yes', NULL, NULL),
(73, 1, 2, 3, 'The cash reserve required to be maintained by a scheduled bank with the Reserve Bank under Section 42(1) of the Reserve Bank of India Act (as amended in 2006) is an __________________, being ''such per cent of the total of the demand and time liabilities in India of that bank as shown in the return referred to in the sub-Section (2), as the Reserve Bank may from time to time, having regard to the needs of securing the monetary stability in the country, notify in the Gazette of India''.\r\n', 'average monthly balance\r\n', 'average fortnightly balance\r\n', 'average weekly balance\r\n', 'average daily balance\r\n', '', '', '2.00', '0.00', '', 'The cash reserve required to be maintained by a scheduled bank with the Reserve Bank under Section 42(1) of the Reserve Bank of India Act (as amended in 2006) is an average daily balance, being ''such per cent of the total of the demand and time liabilities in India of that bank as shown in the return referred to in the sub-Section (2), as the Reserve Bank may from time to time, having regard to the needs of securing the monetary stability in the country, notify in the Gazette of India''.', '4', '', '', 'Yes', NULL, NULL),
(74, 1, 2, 3, 'The undertaking of a banking company may be acquired by the Central Government if it is satisfied on a report from the Reserve Bank that the banking company has failed on more than one occasion to comply with the __________ ?', 'Directions of the Government\r\n', 'Directions under Sections 21 and 35A of BR Act\r\n', 'Provisions of the Companies Act\r\n', 'None of the above\r\n', '', '', '2.00', '0.00', '', 'The undertaking of a banking company may be acquired by the Central Government if it is satisfied on a report from the Reserve Bank that the banking company has failed on more than one occasion to comply with the directions under Sections 21 and 35A of BR Act.', '2', '', '', 'Yes', NULL, NULL),
(75, 1, 2, 3, 'In the winding up proceedings, the liquidator of a banking company will make payment first to _________  among the following?', 'Depositors in savings bank account up to Rs. 250\r\n', 'Depositors other than  savings bank account depositors up to Rs. 250', 'Claims have been made within one month of service of notice\r\n', 'Depositors covered by the DICGC Act', '', '', '2.00', '0.00', '', 'In the winding up proceedings, the liquidator of a banking company has to make certain preferential payments under Section 43 A of the Banking Regulation Act. Accordingly, the preferential payments referred to in Section 530 of the Companies Act, in respect of which, claims have been made within one month of service of notice, get the first preference. After that, depositors in savings bank account up to Rs. 250 and then other depositors up to Rs. 250 get priority over all other creditors. After making these payments, the balance available will be utilised for payment to general creditors and then for payment of further amounts due to the depositors. The provisionfor preferential payment by liquidator will not apply to depositors covered by the DICGC Act.', '3', '', '', 'Yes', NULL, NULL),
(76, 1, 2, 3, 'The Reserve Bank can apply for winding up of a banking company in certain cases except', 'The banking company is unable to pay its debts', 'bank being not entitled to carry on banking business in India under Section 22 of the BR Act by reason of rejection or cancellation of licence\r\n', 'prohibition to accept fresh deposits under Section 35(4) of the BR Act or Section 42 (3A)(b) of the Reserve Bank of India Act\r\n', 'failure to comply with the requirements of Section 11 regarding minimum paid-up capital and reserves\r\n', '', '', '2.00', '0.00', '', '"The High Court shall order the winding up of a banking company in the circumstances mentioned in Section 38 of the Banking Regulation Act\r\n(i) The banking company is unable to pay its debts;\r\n(ii) An application for winding up has been made by the Reserve Bank under Section 37 or Section 38 of the Act."', '1', '', '', 'Yes', NULL, NULL),
(77, 1, 2, 2, 'Banking is defined in _____________________ as the acceptance of deposits of money from the public for the purpose of lending or investment.', 'Lord Denning MR in United Dominions Trust Ltd. vs Kirkwood', 'Section 5(b) of the Banking Regulation Act \r\n', '"Section 49A of the Banking Regulation Act"\r\n', 'Section 2 of Reserve Bank of India Act', '', '', '1.00', '0.00', '', 'Banking is defined in Section 5 (b) of the Banking Regulation Act', '2', '', '', 'Yes', NULL, NULL),
(78, 1, 2, 2, 'Acceptance of Deposits by Non-banking Companies is regulated by', 'Companies (Acceptance of Deposit) Rules, 1975 issued under Section 58A of the Companies Act, 1956', 'Non-Banking Financial Companies Acceptance of Public Deposits (Reserve Bank) Directions, 1998 and other directions issued by it under Chapter IIIB of the Reserve Bank of India Act.\r\n', 'Section 49A of the Banking Regulation Act\r\n', 'Section 45S of the RBI Act (as amended in 1997)\r\n', '', '', '1.00', '0.00', '', 'Non-banking Companies does not include Non-Banking Financial Company and Banking Companies. Deposit made under these types of company is regulated by Companies Act 1956 which is superceded by Companies Act, 2013.', '1', '', '', 'Yes', NULL, NULL),
(79, 1, 2, 2, 'Multi-state co-operative societies can be licensed as co-operative banks by?\r\n', 'Reserve Bank of India Act\r\n', 'Bank Regulation Act \r\n', '"Banking Regulation (Amendment) and Miscellaneous Provisions Act, 2004"\r\n', 'Banking Laws (Application to Co-operative Societies) Act, 1965\r\n', '', '', '1.00', '0.00', '', '"After the Supreme Court held in Apex CoÂ¬operative Bank''s case (AI R 2004 SC 141) that multi-state co-operative societies cannot be licensed as cooperative\r\nbanks, the Banking Regulation (Amendment) and Miscellaneous Provisions Act, 2004 was enacted to permit licensing of multi-state co-operative banks"', '3', '', '', 'Yes', NULL, NULL),
(80, 1, 2, 2, 'What is maximum ceiling limit on the commission, brokerage, discount or remuneration on the sale of shares of banking companies\r\n', '2% of the paid up value of the shares\r\n', '2.5% of the paid up value of the shares\r\n', '5% of the paid up value of the shares\r\n', '2.25% of the paid up value of the shares\r\n', '', '', '1.00', '0.00', '', 'Section 13 of the Banking Regulation Act imposes a ceiling on the commission, brokerage, discount or remuneration on the sale of shares of banking companies. Accordingly, the payments on this account in any form should not exceed two-and-a-half per cent of the paid-up value of the shares.', '2', '', '', 'Yes', NULL, NULL),
(81, 1, 2, 2, 'The upper limit for holding the office of directors other than whole time director or chairman, of a banking company shall not be more than ____ years.', '5\r\n', '3', '10', '8', '', '', '1.00', '0.00', '', 'The directors of a banking company shall not hold office for more than eight years continuously. However, this provision is not applicable to the chairman or a whole-time director. When the chairman or a whole-time director of a bank is removed from office, he/she ceases to be a director of the bank and shall not be eligible for further appointment as director of that banking company for a period of four years.', '4', '', '', 'Yes', NULL, NULL),
(82, 1, 2, 2, 'A shareholder of a banking company can exercise voting rights up to of the ____ total voting rights of all shareholders,', '1%', '10%', '20%', 'None of the above', '', '', '1.00', '0.00', '', 'There is no specified ceiling on a person''s holding of shares in a banking company under the Banking Regulation Act or any other law. However, Section 12(2) of the Act puts certain restrictions on voting rights of shareholders. Accordingly, no shareholder can exercise voting rights in respect of the shares held by him/her in excess of 10% of the total voting rights of all the shareholders of the banking company.', '2', '', '', 'Yes', NULL, NULL),
(83, 1, 2, 2, 'Within how much days return on unclaimed deposit need to be filed from the end of the calender year?', '30', '60', '90', '45', '', '', '1.00', '0.00', '', 'Banks have to file a return every year on their unclaimed deposits under Section 26 of the Banking Regulation Act. The return has to be filed within thirty days of the end of each calendar year in the form and manner prescribed and should cover all deposits not operated for ten years. In the case of fixed deposits the period of ten years starts from the expiry of the period of the deposit.', '1', '', '', 'Yes', NULL, NULL),
(84, 1, 2, 2, 'Which section of the Banking regulation Act provides that a depositor or depositors of a banking company (including co-operative banks) may nominate one person in the prescribed manner as nominee to whom the deposit may be returned in the event of death of the sole depositor or depositors?', 'Section 45ZE', 'Section 45ZC\r\n', 'Section 45ZA\r\n', 'None of the above\r\n', '', '', '1.00', '0.00', '', '"Section 45ZA of the Banking Regulation Act provides that a depositor or depositors of a banking company (including co-operative banks) may nominate one person in the prescribed manner as nominee to whom the deposit may be returned in the event of death of the sole depositor or depositors. \r\n\r\nSections 45ZC and 45ZE provide that any person who leaves any article in safe custody and in safety lockers respectively with a banking company, may nominate one person as nominee to receive the article in the event of death of that person."\r\n', '3', '', '', 'Yes', NULL, NULL),
(85, 1, 2, 2, 'Section 20 of the Banking Regulation Act imposes certain restrictions on loans and advances which includes', 'Negotiating of loans and advances\r\n', 'Purchasing and selling of bonds, scrips and other forms of securities on behalf of constituents or others\r\n', 'Receiving of all kinds of bonds, scrips or valuables on deposit or for safe custody or otherwise\r\n', 'No banking company shall grant loans or advances on the security of its own shares\r\n', '', '', '1.00', '0.00', '', '"Section 20 of the Banking Regulation Act imposes certain restrictions on loans and advances. Accordingly, no banking company shall grant loans or advances on the security of its own shares. Further, a banking company, is prohibited from entering into any commitment for granting any loans or advances to or on behalf of any of its directors\r\nThe forms of business permissible under Section 6(1) of the Banking Regulation Act, apart from banking business includes\r\ni) Negotiating of loans and advances\r\nii) Purchasing and selling of bonds, scrips and other forms of securities on behalf of constituents or others \r\niii) Receiving of all kinds of bonds, scrips or valuables on deposit or for safe custody or otherwise."\r\n', '4', '', '', 'Yes', NULL, NULL),
(86, 1, 2, 2, 'A banking company has to prepare profit and loss accounts and balance sheet as at the _____________ or at the expiration of twelve months ending with such date as notified by the Central Government.', 'end of calender year\r\n', 'end of March\r\n', 'end of June\r\n', 'end of financial year\r\n', '', '', '1.00', '0.00', '', 'The balance sheet and profit and loss account, has to be prepared at the end of each calendar year or on expiry of the twelve months period, ending with any other date which the Central Government may notify in the official gazette in this behalf, as on the last working day of the year or the period, as the case may be.', '1', '', '', 'Yes', NULL, NULL),
(87, 1, 2, 2, 'Within how many days banking company has to submit a return of its liquid assets under Section 24(3) of the Banking Regulation Act?', '20 days from the end of the month to which it relates\r\n', '15 days from the end of the month to which it relates\r\n', '14 days from the end of the month to which it relates\r\n', '30 days from the end of the month to which it relates\r\n', '', '', '1.00', '0.00', '', 'Banking company has to submit a return of its liquid assets under Section 24(3) of the Banking Regulation Act. The return has to be submitted within twenty days from the end of the month to which it relates. The return has to be in the form prescribed under Rule 13A of the Banking Regulation (Companies) Rules, 1949.', '1', '', '', 'Yes', NULL, NULL),
(88, 1, 2, 2, 'Within how many days banking company has to submit annual accounts and balance sheet to Reserve Bank of India without considering extension of time?\r\n', '3 months\r\n', '4 Months\r\n', '5 Months\r\n', '6 Months', '', '', '1.00', '0.00', '', 'The annual accounts and balance sheet have to be submitted to the Reserve Bank within three months from the end of the period to which they relate. The Reserve Bank may extend the time by a further period of three months.', '1', '', '', 'Yes', NULL, NULL),
(89, 1, 2, 1, 'A Regional Rural Bank is ', 'a body corporate created under a special statute', 'a coÂ¬operative society', 'a company', 'None of the above', '', '', '0.50', '0.00', '', 'A Regional Rural Bank is a body corporate created under a special statute', '1', '', '', 'Yes', NULL, NULL),
(90, 2, 1, 1, 'Issue and servicing of government debt is managed by commercial banks.', '', '', '', '', '', '', '0.50', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(91, 1, 2, 1, 'Company matters of a banking company are regulated by', 'SEBI\r\n', 'Reserve Bank of India\r\n', '"Controller Authorities under the Companies Act"\r\n', 'None of the above\r\n', '', '', '0.50', '0.00', '', 'Company matters of a banking company are regulated by "Controller Authorities under the Companies Act"\r\n\r\n', '3', '', '', 'Yes', NULL, NULL),
(92, 1, 2, 1, 'The private sector banks are constituted under ______________ ?', 'Reserve Bank of India Act', 'Companies Act\r\n', 'Banking Regulation Act\r\n', 'None of the above\r\n', '', '', '0.50', '0.00', '', 'All the private sector banks are banking companies. These banks are governed by the Companies Act, 1956 in respect of their constitution and by the Banking Regulation Act and the RBI Act with regard to their business of banking.', '2', '', '', 'Yes', NULL, NULL),
(93, 1, 2, 1, '"The Reserve Bank is the sole authority for issue and management of currency in India under "', 'Section 22 of the Reserve Bank of India Act', 'Section 23 of the Reserve Bank of India Act', 'Section 23 of Banking Regulation Act', 'Section 22 of Banking Regulation Act\r\n', '', '', '0.50', '0.00', '', 'To commence or carry on, the banking business in India, a company requires a licence from the Reserve Bank under Section 22 of the Banking Regulation Act, 1949. Commencing or carrying on a banking business without a licence is prohibited.', '4', '', '', 'Yes', NULL, NULL),
(94, 1, 2, 1, 'Permission for opening new branches of a RRB is required from _____ .', 'RBI', 'Central Government\r\n', 'NABARD\r\n', 'None of the above\r\n', '', '', '0.50', '0.00', '', 'In the case of regional rural banks, the applications for permission have to be routed through the National Bank (NABARD), and the national bank has to offer its comments on merits to the Reserve Bank', '3', '', '', 'Yes', NULL, NULL),
(95, 1, 2, 1, 'A company has to obtain a ______________ from the Reserve Bank to commence banking business in terms of Section 22 of the BR Act', 'Commencement Certificate\r\n', 'License\r\n', 'Registration\r\n', 'None of the above\r\n', '', '', '0.50', '0.00', '', 'To commence or carry on, the banking business in India, a company requires a licence from the Reserve Bank under Section 22 of the Banking Regulation Act, 1949. Commencing or carrying on a banking business without a licence is prohibited.', '2', '', '', 'Yes', NULL, NULL);
INSERT INTO `questions` (`id`, `qtype_id`, `subject_id`, `diff_id`, `question`, `option1`, `option2`, `option3`, `option4`, `option5`, `option6`, `marks`, `negative_marks`, `hint`, `explanation`, `answer`, `true_false`, `fill_blank`, `status`, `created`, `modified`) VALUES
(96, 1, 2, 1, 'Reserve Bank may issue directions to banking companies under Section 21 of BR Act on', 'Audit\r\n', 'Loan and Advances\r\n', 'Capital Structure\r\n', 'Directorship\r\n', '', '', '0.50', '0.00', '', 'The Reserve Bank is empowered under Section 21 of the Banking Regulation Act to issue directions to control advances by banking companies. Such directions may be issued to banking companies generally or to any particular banking company.', '2', '', '', 'Yes', NULL, NULL),
(97, 1, 2, 1, 'Liquid assets are required to be maintained in India under Section 24 of the BR Act, may be held in the form of', 'cash only;', 'cash and gold only\r\n', 'cash, gold or encumbered approved securities\r\n', 'cash, gold or unencumbered approved securities\r\n', '', '', '0.50', '0.00', '', 'The assets may be in cash, gold or unencumbered approved securities.', '4', '', '', 'Yes', NULL, NULL),
(98, 2, 1, 1, 'The decrease in Statutory Liquidity Ratio contracts the credit creation.', '', '', '', '', '', '', '0.50', '0.00', '', 'Statutory Liquidity Ratio (SLR) is the prescribed percentage of Demand and Time liabilities of a bank to be held in prescribed securities, mostly government securities. The increase in the SLR, contracts and enhances credit creation.', '', 'False', '', 'Yes', NULL, NULL),
(99, 1, 2, 1, 'The penal interest chargeable on a banking company under Section 24(4) of the BR Act for not maintaining liquid assets as specified under Section 24(2A) of the Act.', 'May be waived by the Reserve Bank if it is satisfied that the bank had sufficient cause for the failure', '"Has to be charged in all cases and the Reserve Bank has no option but to waive penal interest"\r\n', 'can be reduced by the Reserve Bank, but, not completely waived\r\n', 'All of these\r\n', '', '', '0.50', '0.00', '', 'The Reserve Bank is also empowered to impose a similar penal interest for shortfall in the assets on any day and if shortfall continues on the succeeding working day, the higher penal interest is payable as above. If the Reserve Bank is satisfied on the application of a banking company that it had sufficient cause not to comply with the provisions as to maintenance of assets, penal interest may be waived.', '1', '', '', 'Yes', NULL, NULL),
(100, 2, 1, 1, 'Depositories hold securities in physical form.', '', '', '', '', '', '', '0.50', '0.00', '', 'Depositories hold securities in demat form (as opposed to physical form), maintain accountsof depository participants who, in turn, maintain sub-accounts of their customers. On instructions of the stock exchange clearing house, supported by documentation, a depository transfers securities from the buyers to sellers accounts in electronic form.', '', 'False', 'Demat', 'Yes', NULL, NULL),
(101, 1, 2, 1, 'The balance sheet and profit and loss account shall be audited by a person duly qualified to be?', 'a certified financial analyst', '"auditor of cooperative societies"\r\n', 'Auditor of companies\r\n', 'Any of these\r\n', '', '', '0.50', '0.00', '', 'The accounts have to be audited by auditors duly qualified to be auditors of companies.', '3', '', '', 'Yes', NULL, NULL),
(102, 1, 2, 1, 'Reserve Bank is empowered to conduct __________ of a banking company under Section 35(1) of the BR Act', 'inspection\r\n', 'special audit\r\n', 'Statutory audit\r\n', 'All of these\r\n', '', '', '0.50', '0.00', '', 'Reserve Bank is empowered to conduct inspection of a banking company under Section 35(1) of the BR Act', '1', '', '', 'Yes', NULL, NULL),
(103, 1, 1, 1, 'Urban Cooperative Banks are controlled by ', 'NABARD,', 'State Governments,', 'RBI', 'SEBI', 'Both 2 & 3', '', '0.50', '0.00', '', 'Urban Cooperative Banks are controlled by State governments and RBI, while other cooperative banks are controlled by National Bank for Agriculture and Rural Development (NABARD) and State Governments.', '5', '', 'State Governments, RBI', 'Yes', NULL, NULL),
(104, 1, 2, 1, 'In a winding up proceeding the depositors shall ___________  for the amounts shown in the books of the bank standing to their credit', 'be deemed to have filed claim', '"have to file claim"\r\n', 'have no claim\r\n', 'have proportionate claim', '', '', '0.50', '0.00', '', 'Section 43 of the Act, the depositors need not make claims. The claims of every depositor of a banking company is deemed to have filed for the amount as shown in the books of the banking company standing to his credit.', '1', '', '', 'Yes', NULL, NULL),
(105, 2, 1, 1, 'RBI is the regulator of banks and the securities market in India. ', '', '', '', '', '', '', '0.50', '0.00', '', 'RBI is the regulator of banks while SEBI is the regulator of securities market in India', '', 'False', '', 'Yes', NULL, NULL),
(106, 2, 1, 1, 'Notes in the denomination from Rupee 1 to Rupees 1000 are issued by RBI. ', '', '', '', '', '', '', '0.50', '0.00', '', 'RBI has the sole authority for the issuance of currency notes and putting them into circulation, withdrawing them or exchanging them. RBI has issued and put in circulation notes in the denomination of Rs. 2, 5, 10, 20, 50, 100, 500 and 1000, except Rs. 1 notes and all coins, which are issued by the Government of India, but put into circulation by RBI.', '', 'False', '', 'Yes', NULL, NULL),
(110, 2, 1, 1, 'RBI currently draws its powers of regulating exchange control from FERA, 1973. ', '', '', '', '', '', '', '0.50', '0.00', '', 'RBI is entrusted with the duty of maintaining the stability of the external value of the national Currency - Indian Rupee. It used to regulate the foreign exchange market in the country in terms of the Foreign Exchange Regulation Act (FERA), 1947 (amended and enlarged in (1973). The FERA, 1973 has been replaced by the Foreign Exchange Management Act, 1999 (FEMA) and RBI is now guided by the provisions of the new Act.', '', 'False', '', 'Yes', NULL, NULL),
(113, 2, 1, 1, 'As there is no sub-target for the SSI sector, it does not comprise the Priority Sector.', '', '', '', '', '', '', '0.50', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(114, 1, 1, 1, 'The Central Board of Directors of RBI comprises____\r\n', 'One Governor, Four Deputy governor & Fifteen Directors', 'One Governor, SIX Deputy governor & Fourteen Directors', 'One Governor, Five Deputy governors & Twelve Directors', 'One Governor, Eight Deputy governors & Seven Directors', '', '', '0.50', '0.00', '', 'The Governor and four Deputy Governors of RBI are appointed by the Union Government. The control of the RBI vests in the Central Board of Directors, that comprises the Governor, four Deputy Governors and 15 Directors nominated by the Union Government.', '1', '', '', 'Yes', NULL, NULL),
(115, 2, 1, 1, 'RBI acts as the Banker to the Central and State Governments.', 'Banker & State ', '', '', '', '', '', '0.50', '0.00', '', 'RBI acts as the banker to the Central and State Governments. As such, it provides them banking services of deposits, withdrawal of funds, making payments and receipts, collection and transfer of funds and management of public debt.', '', 'True', '', 'Yes', NULL, NULL),
(116, 1, 1, 1, 'The loan values (amount of loan) under retail lending normally range between,  \r\n\r\n', 'Rs. 20,000 to Rs.1001akh.', 'Rs.1001akh to Rs.10 crore ', 'More than Rs.10 crore	', 'None', '', '', '0.50', '0.00', '', 'The typical products offered in the Indian retail banking segment are housing loans, consumption loans for purchase of durables, auto loans, credit cards and educational loans. The loans are marketed under attractive brand names to differentiate the products offered by different banks. As the Report on Trend and Progress of India, 2003-04 has shown that the loan values of these retail lending typically range between Rs.20,000 to Rs.100 lakh. ', '1', '', '', 'Yes', NULL, NULL),
(117, 1, 1, 2, 'The Retail loans given by commercial banks are generally for duration of', '5 to 7 years with housing loans granted for a longer duration of 15-20 years ', 'less than 5 years only ', 'less than 1 year only ', 'none', '', '', '1.00', '0.00', '', 'Indian retail banking segment are housing loans, consumption loans for purchase of durables, auto loans, credit cards and educational loans. The loans are marketed under attractive brand names to differentiate the products offered by different banks. The loans are generally for duration of five to seven years with housing loans granted for a longer duration of 15-20 years.', '1', '', '', 'Yes', NULL, NULL),
(118, 1, 1, 2, 'The experience of banks in India in recent years under retail lending has shown that the following loans had the least level of impairment (defaults)', 'home loans portfolio', 'consumer loans portfolio', 'vehicle loans portfolio', 'none', '', '', '1.00', '0.00', '', 'In recent past retail lending has turned out to be a key profit driver for banks with retail portfolio constituting 21.5 per cent of total outstanding advances as on March 2004. The overall impairment of the retail loan portfolio worked out much less then the Gross NPA ratio for the entire loan portfolio. Within the retail segment, the housing loans had the least gross asset impairment. In fact, retailing make ample business sense in the banking sector. ', '1', '', '', 'Yes', NULL, NULL),
(119, 1, 1, 2, 'Wholesale banking refers to doing banking business with ', 'individuals, ', 'industrial and business entities - including government and public sector companies ', ' only companies registered under the Companies Act', 'large borrowers irrespective of their category', '', '', '1.00', '0.00', '', 'Wholesale Banking refers to doing banking business with industrial and business entities - mostly corporates and trading houses, including multinationals, domestic business houses and prime public sector companies.', '2', '', '', 'Yes', NULL, NULL),
(120, 1, 1, 2, 'A Depository Receipt (DR) is a type of', 'negotiable (transferable) financial instrument that is traded on a local stock exchange of a country but represents a security, usually in the form of equity that is issued by a foreign publicly listed company.', 'negotiable (transferable) financial instrument that is traded on a stock exchange of a foreign country but represents a security, usually in the form of equity that is issued by a foreign publicly listed company.', 'negotiable (transferable) financial instrument that is traded on a local stock exchange of a country but represents a security, usually in the form of equity that is issued by a local publicly listed company.', 'Receipt given by a depository participant of a depository.', '', '', '1.00', '0.00', '', 'A depositary receipt (DR) is a type of negotiable (transferable) financial security that is traded on a local stock exchange but represents a security, usually in the form of equity, that is issued by a foreign publicly listed company. The DR, which is a physical certificate, allows investors to hold shares in equity of other countries. One of the most common types of DRs is the American depositary receipt (ADR), which has been offering companies, investors and traders global investment opportunities since the 1920s.\r\n', '1', '', '', 'Yes', NULL, NULL),
(121, 1, 1, 2, 'Overseas Depository Bank'' means', ' A bank authorised by the issuing company to issue Global Depository receipts against issue of Foreign Currency Convertible Bonds or ordinary shares of the issuing company', 'A bank authorised by the government t6-issue Global Depository receipts against issue of Foreign Currency Convertible Bonds or ordinary shares of the issuing company', 'A bank authorised by the issuing company to issue Global Depository Receipts against receipt of foreign currency', 'A bank where deposits in foreign currencies can be made.', '', '', '1.00', '0.00', '', 'Overseas Depository Bankâ€ has been defined in the "Scheme", means "a. bank authorized by the issuing company to issue global depository receipts. against issue of Foreign Currency Convertible Bonds or ordinary shares of the. issuing companyâ€.', '1', '', '', 'Yes', NULL, NULL),
(122, 1, 1, 2, 'Participatory notes are like contract notes issued by', 'Foreign Institutional Investors (FIIs) to entities that want to invest in the Indian stock market but do not want to register themselves with the SEBI.', 'Commercial banks to their investors. ', 'Government of India to banks', '', '', '', '1.00', '0.00', '', 'Foreigners or non-residents (i.e. people living outside India other than Non-Resident Indians and Persons of Indian Origin) are not allowed to invest directly in the Indian stock market.Their involvement in the Indian capital market has to be carried out through a foreign institution, which in turn is required to register itself with Securities and Exchange Board of India (SEBI) as a foreign institutional investor (FII). Participatory notes are like contract notes. These are issued by Foreign Institutional Investors (FIIs) to entities that want to invest in the Indian stock market but do not want to register themselves with the SEBI. FIIs registered with the SEBI and their sub-accounts can issue, deal or hold Participatory Notes.', '1', '', '', 'Yes', NULL, NULL),
(123, 1, 1, 2, 'On recommendation from Lahiri Committee, in 2004, SEBI passed a regulation that derivative, instruments like Participatory Notes against underlying Indian securities can be issued.', 'Only to foreign banks', 'Only to FIIs registered with SEBI ', 'Only to regulated entities and further transfers, if any, can also be to other regulated entities only.', 'None.', '', '', '1.00', '0.00', '', 'On recommendation by the Lahiri Committee, in 2004, SEBI passed a regulation that derivative instruments like Participatory Notes against underlying Indian securities can be issued only to regulated entities and further transfers, if any, can also be to other regulated entities only.', '3', '', '', 'Yes', NULL, NULL),
(124, 1, 1, 1, 'The main function of SEBI is', 'to protect the interests of investors in securities', 'to promote the development of the securities market', 'to regulate securities market', 'all the above.', '', '', '0.50', '0.00', '', 'The Government of India enacted the SEBI Act, 1992, on 4 April 1992 to provide for the establishment of aboard, called the Securities and Exchange Board of India (SEBI) to protect the interests of investors in securities and to promote the development of and to regulate, the securities market and for matters connected therewith or incidental thereto (Prior to the formation of SEBI, some of the control functions were carried on by the controller of Capital Issues and the Company Law Board.).', '4', '', '', 'Yes', NULL, NULL),
(125, 1, 1, 1, 'SEBI in respect of certain matters, has the same powers:', 'as are vested in a civil court under the Code of Civil Procedure, 1908 (5 of 1908), while trying a suit,', 'as are vested in a criminal court under the Criminal Procedure Code while trying a suit ', 'as the Company Law Board', 'none.', '', '', '0.50', '0.00', '', ' Notwithstanding anything contained in any other law for the time being in force while exercising the powers under 23 [clause (i) or clause (ia) of sub-section (2) or sub- section (2A)], the Board shall have the same powers as are vested in a civil court under the Code of Civil Procedure, 1908 (5 of 1908), while trying a suit, in respect of the following matters, namely :â€” \r\n(i)  the discovery and production of books of account and other documents, at such place and such time as may be specified by the Board; (ii)  summoning and enforcing the attendance of persons and examining them on oath; \r\n(iii)  inspection of any books, registers and other documents of any person referred to in section 12, at any place;', '1', '', '', 'Yes', NULL, NULL),
(126, 1, 1, 1, 'One of the following categories of investors need not obtain a certificate of registration from SEBI in order to buy, sell or deal in securities:', 'stock broker', 'portfolio manager', 'investment adviser', 'retail investor', '', '', '0.50', '0.00', '', 'SEBI has made it mandatory for any entity/person engaged in marketing and selling of mutual fund products to pass the Association of Mutual Funds in India (AMFI) certification test (Advisors Module) and obtain a registration number from AMFI. Firms and corporates will have to obtain certificate of registration from AMFI and all employees of corporate distributors engaged in selling and marketing of mutual fund products have to pass the AMFI certification test (Advisors Module) and obtain registration with AMFI before canvassing the business of mutual funds.', '4', '', '', 'Yes', NULL, NULL),
(127, 1, 1, 1, 'The ownership, management and trading functions of a stock exchange are clearly segregated in respect of a____', 'Demutualised exchange', 'Corporatised exchange', 'Any stock exchange', 'None.', '', '', '0.50', '0.00', '', 'Demutualisation refers to the transition process of an exchange from a ''mutually owned'' association to a ''shareholders-owned'' company. In other words, transforming the legal structure of an exchange from a mutual form to a business corporation form is referred to as demutualisation. The above in effect means that after demutualisation the ownership, the management, and the trading rights at the exchange are segregated from one another. In a mutual exchange, the three functions of ownership, management and trading are intertwined into a single group. Here, the broker members of the exchange are both the owners and the traders on the exchange and they further manage the exchange as well. A demutualised exchange, on the other hand, has all these three functions clearly segregated,i.e. the ownership, management and trading are in separate hands.The BSE, NSE and OTCEI are not only corporatised but also demutualised with the\r\nsegregation of ownership and trading rights of members.', '1', '', '', 'Yes', NULL, NULL),
(128, 1, 1, 1, 'The issue of new securities to existing shareholders at a ratio to those already held is known as', 'Rights Issue/Rights Shares', 'Bonus Issue', 'Preference Issue', 'None', '', '', '0.50', '0.00', '', 'Rights Issue/Rights Shares: This refers to the issue of new securities to the existing shareholders, at a ratio to those shares already held.Bonus Shares: These shares are issued by the companies to their shareholders free of cost by capitalisation of accumulated reserves from the profits earned in the earlier years or out of the share premium account.', '1', '', '', 'Yes', NULL, NULL),
(129, 1, 1, 1, 'Initial Public Offering (IPO) means for the first time\r\n', 'a fresh issue of securities', 'offers its existing securities for sale', 'both the above', 'none.', '', '', '0.50', '0.00', '', 'An IPO is the offering that is made when an unlisted company makes either a fresh issue of securities or an offer for sale of its existing securities or both for the first time to the public. This paves way for listing and trading of the issuer''s securities.', '3', '', '', 'Yes', NULL, NULL),
(130, 1, 1, 1, 'As per SEBI guidelines, in a Book Building process the cap in the price band ', 'should be at least 10 per cent of the floor price', 'should not be more than 20 per cent of the floor price ', 'no limits', 'None.', '', '', '0.50', '0.00', '', 'Book Building means a process undertaken, by which a demand for the securities proposed to be issued by a corporate body is elicited and built-up and the price for the securities is assessed on the basis of the bids obtained for the quantum of securities offered for subscription by the issuer. The issuer company can mention a price band of 20 per cent (cap in the price band should not be more than 20 per cent of the floor price) in the draft offer documents filed with SEBI and actual price can be determined at a later date before filing of the final offer document with SEBI/ROCs', '2', '', '', 'Yes', NULL, NULL),
(131, 1, 1, 1, 'Retail individual investorâ€™ means an investor who applies or bids ', 'for securities of or for a value of not more than Rs. 1,00,00', 'for securities of face value of not more than Rs.1,00,000.', 'for securities of 1000 units', 'none.', '', '', '0.50', '0.00', '', 'Retail Individual Investor means an investor who apples or bids for securities of or for a value not more than Rs. 1,00,000.', '1', '', '', 'Yes', NULL, NULL),
(132, 1, 1, 1, 'As per SEBI guidelines, safety net arrangements can be made available only to', 'all original resident individual allottees limited up to a maximum of 1000 shares per allottee', 'all original allottees limited up to a maximum of 1000 shares per allottee', 'all shareholders limited up to a maximum of 1000 shares per shareholder', 'none.', '', '', '0.50', '0.00', '', 'Safety Net: Any safety net scheme or buy-back arrangements of the shares proposed in any public issue shall be finalized by an issuer company with the lead merchant banker in advance and disclosed in the prospectus. Such a buy-back or safety net arrangement shall be made available only to original resident individual allottees limited to a maximum of 1000 shares per allottee and the offer is kept open for a period of six months from the last date of dispatch of securities.', '1', '', '', 'Yes', NULL, NULL),
(133, 1, 1, 2, 'Red Herring Prospectus is a prospectus ', 'which is issued in red colour', 'which contains some clauses in red colour', 'which does not have details of either price or number of shares being offered or the amount of that an unlisted company makes to the public issue ', 'none.', '', '', '1.00', '0.00', '', 'Red Herring Prospectus (RHP) is a prospectus which does not have details of either price of number of shares being offered or the amount of issue. This means that in case the price is not disclosed, the number of shares and the upper and lower price bands are disclosed', '3', '', '', 'Yes', NULL, NULL),
(134, 1, 1, 1, 'A mutual fund is set up in the form of ', 'a trust', 'a Company incorporated under the Indian Companies Act ', 'by an Act of Parliament', 'none.', '', '', '0.50', '0.00', '', 'A mutual fund is set up in the form of a trust, which has sponsors, trustees, Asset Management Companies (AMCs) and custodians.', '1', '', '', 'Yes', NULL, NULL),
(135, 1, 1, 1, 'A mutual fund has, apart from its sponsors', 'Trustees', 'Asset Management Company ', 'Custodian', 'All of the above.', '', '', '0.50', '0.00', '', 'A mutual fund is set up in the form of a trust, which has sponsors, trustees, Asset Management Companies (AMCs) and custodians.', '4', '', '', 'Yes', NULL, NULL),
(136, 1, 1, 1, 'The main function of an Asset Management Company is to', 'hold the securities of various schemes', 'manage the funds by making investments in various types of securities', 'hold its property for the benefit of the unit holders', 'all the above', '', '', '0.50', '0.00', '', 'An AMC approved by SEBI manages the funds by making investments in various types of securities', '2', '', '', 'Yes', NULL, NULL),
(137, 1, 1, 1, 'NAV is required to be disclosed by the mutual funds on a ______basis', 'daily', 'weekly', 'depending on the type of scheme ', 'All of the above.', '', '', '0.50', '0.00', '', 'The NAV per unit is the market value of securities of a scheme, less the expenses incurred on the scheme, divided by the total number of units of the scheme on any particular date. NAV is required to be disÂ¬closed by the mutual funds on a regular basis - daily or weekly - depending upon the type of scheme.', '4', '', '', 'Yes', NULL, NULL),
(138, 1, 1, 1, 'A Fund of Funds is a scheme that invests primarily', 'in money market instruments', 'in other schemes of the same mutual fund or other mutual funds', 'in the bullion market', 'only in primary market.', '', '', '0.50', '0.00', '', 'Fund of Funds (FoF): A scheme that invests primarily in other schemes of the same mutual fund or other mutual funds is known as a Fund of Funds (FoF) scheme. An FoF scheme enables the investors to achieve greater diversification through one scheme. It spreads risks across a greater universe.', '2', '', '', 'Yes', NULL, NULL),
(139, 1, 1, 1, 'The first insurance company was started in India in 1818 at', 'Kolkata', 'Chennai', 'Mumbai', 'New Delhi', '', '', '0.50', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(140, 1, 1, 1, 'The entry level capital requirement for a new Insurance Company in India is', 'Rs.100 crore', 'Rs. 50 crore', 'Rs. 500 crore', 'None.', '', '', '0.50', '0.00', '', 'In the life insurance sector, capital requirements grow steeply as business expands. Starting with an initially-mandated capital of Rs 100 crore', '1', '', '', 'Yes', NULL, NULL),
(141, 1, 1, 1, 'The primary legislation that deals with insurance business in India is', 'Insurance Act, 1938', 'Insurance Regulatory and Development Authority Act, 1999 ', 'Both Insurance Act, 1938 and IRDA Act, 1999', 'LIC of India Act.', '', '', '0.50', '0.00', '', 'The primary legislation that deal with the insurance business in India are  Insurance Act, 1938, &  Insurance Regulatory & Development Authority Act, 1999.', '3', '', '', 'Yes', NULL, NULL),
(142, 1, 1, 1, 'Factoring service means', 'Collection of bills', 'Discounting of bills', 'Maintenance of account books', 'All of the above', '', '', '0.50', '0.00', '', 'Factoring is a service that is concerned with the financing and collection of account receivables in domestic and international trade. It is an ongoing arrangement between the client and factor (usually a bank or a financial institution), where invoices raised on open account sales of goods and services are regularly assigned to ''the factor'' for financing, collection and sales ledger administration. The buyer and the seller usually have long-term relationships. The client sells invoiced receivables at a discount to the factor to raise finance for working capital requirement. The factor may or may not accept the incumbent credit risk.', '4', '', '', 'Yes', NULL, NULL),
(143, 1, 1, 1, 'The type of arrangement under which a bank pays the seller the value of the bill and later collects it from the buyer on the due date is called', 'Bill discounting', 'Factoring', 'Forfaiting', 'None.', '', '', '0.50', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(144, 1, 1, 1, 'The type of factoring under which the factor collects back from the seller the amount paid by him in case of non-payment of the bills on the due date is called', 'Recourse factoring', 'Non-recourse factoring', 'Bills discounting', 'Bills purchased.', '', '', '0.50', '0.00', '', 'There are two types of factoring services, recourse factoring (with recourse) and non-recourse factoring (without recourse). In recourse factoring, in the case of non-payment of invoices by customers, the factor will recover the amount advanced from the client. In non-recourse factoring, the factor provides both finance and credit protection. In case of non-payment of invoices by customers, the factor will bear the risk of bad debts.', '1', '', '', 'Yes', NULL, NULL),
(145, 1, 1, 1, 'Under domestic factoring, the payment of the bills that the seller gets from the factor is', '100 per cent of the value of the bills immediately on submission', 'nearly 80 per cent of the bill amount upon tendering the bill and the balance on due date', 'nearly 80 per cent of the bill amount upon tendering the bill and the balance on due date after collecting it from the buyer', '100 per cent of the value of the bill only after collection from the buyer', '', '', '0.50', '0.00', '', 'Under domestic factoring, receivables arising only out of domestic trade shall be considered for factoring. The supplier/borrower shall draw bills of exchange for goods supplied and the purchaser shall accept that. After acceptance of bills of exchange, the factor shall make a prepayment of about 80 per cent of invoice value after deducting its discount charges at normal interest rates for the period of bill of exchange to the supplier. The balance payment (20 per cent of the invoice value) shall be made after collecting the payment from the purchaser. If the purchaser fails to pay the due amount on due dates, the supplier shall make good the payment. The borrower/supplier shall submit the bill of exchange along with the invoice and LR/RR receipts.', '3', '', '', 'Yes', NULL, NULL),
(146, 1, 1, 1, 'Forfaiting provides finance against the export receivables to an exporter: ', 'with recourse to the exporter', 'without recourse to the exporter', 'both', 'either one', '', '', '0.50', '0.00', '', 'Forfeiting is a means of finance (credit) an exporter of goods avails from an intermediary called the forfaiter against the export receivables but without the obligation to repay the credit. Forfeiting is used for international trade transactions. In fact, it is the discounting of trade receivables such as drafts drawn under letters of credit, bills of exchange, promissory notes, or other freely negotiable instruments on a ''no recourse'' basis, (i.e. without recourse to the exporter in case the importer fails to pay on the due date).', '2', '', '', 'Yes', NULL, NULL),
(147, 1, 1, 1, 'Forfaiter is', 'an intermediary between an exporter and importer', 'an exporter', 'an importer ', 'a bank.', '', '', '0.50', '0.00', '', 'Forfeiting is a means of finance (credit) an exporter of goods avails from an intermediary called the forfaiter against the export receivables but without the obligation to repay the credit.', '1', '', '', 'Yes', NULL, NULL),
(148, 1, 1, 1, 'Forfaiting provides to the exporter against receivables', '100 per cent financing', '80 per cent financing', 'depending on the contract with the forfaiter ', 'none', '', '', '0.50', '0.00', '', 'Forfeiting provides a flexible, creative alternative to traditional international trade financing methods and is particularly useful for transactions with buyers in developing nations. The following are the advantages of forfaiting to the exporters: Forfaiting provides 100 per cent financing - without recourse and not occupying exporter''s credit line. That is to say once the exporter obtains the financed fund, he will be exempted from the responsibility to repay the debt.', '1', '', '', 'Yes', NULL, NULL),
(149, 1, 1, 1, 'Forfaiting enables the exporter to avoid the following risks', 'interest-rate risk', 'currency risk', 'credit risk and political risk', 'all.', '', '', '0.50', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(150, 1, 1, 1, 'In a bank guarantee, the number of parties involved in the agreement are', 'three', 'two', 'many', 'none', '', '', '0.50', '0.00', '', 'There are three persons in a contract of guarantee; the person giving the guarantee is called the Guarantor or Surety, the person on whose behalf the guarantee is given is called the Principal Debtor and the person in favour of whom the guarantee is given is called the Creditor or Beneficiary.', '1', '', '', 'Yes', NULL, NULL),
(151, 1, 1, 2, 'A forward exchange contract is a firm contract for the purchase/sale of a specified quantity of a stated foreign currency at a pre-determined exchange rate between the bank and its', 'exporters', 'importers', 'both', 'none', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(152, 1, 1, 1, 'A revolving Letter of Credit is one which provides that the amount of drawing stipulated in it will be available to the beneficiary', 'again and again as may be agreed between the buyer and the seller within a stipulated period', ' Any number of times', 'Only one once ', 'None', '', '', '0.50', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(153, 1, 1, 2, 'Operational risk is the risk of loss arising from various types of', 'human error', 'failed systems and procedures in the bank ', 'breakdown in internal controls', 'all of the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(154, 1, 1, 1, 'The Basel Committee on Banking Supervision is a committee of banking supervisory authorities that was established by:', 'the central bank governors of the Group of ten countries ', 'European countries', 'India', 'USA', '', '', '1.00', '0.00', '', 'The Basel Committee on Banking Supervision (BCBS) is a committee of banking supervisory authorities that was established by the central bank governors of a group of ten countries in 1985. It consists of senior representatives of bank supervisory authorities and central banks from Belgium, Canada, France, Germany, Italy, Japan, Luxembourg, the Netherlands, Spain, Sweden, Switzerland, the United Kingdom, and the United States of America. It usually meets at the Bank for International Settlements in Basel, where its permanent secretariat is located.', '1', '', '', 'Yes', NULL, NULL),
(155, 1, 1, 2, '. Under the Basel I Accord, BCBS fixed the minimum requirement of capital funds for banks at', '8 per cent of the total risk weighted assets', '9 per cent of the total risk weighted assets ', '10 per cent of the total risk weighted assets ', '1000 crore.', '', '', '1.00', '0.00', '', 'Under the Basel I Accord, only the credit risk element was considered and the minimum requirement of capital funds was fixed at 8 per cent of the total risk weighted\r\nassets.', '1', '', '', 'Yes', NULL, NULL),
(156, 1, 1, 1, 'how many pillars is the Basel I Framework based''', '4', '3', '2', '1', '', '', '0.50', '0.00', '', 'In 1988, the Basel Committee on Banking Supervision (BCBS) in Basel, Switzerland, published a set of minimum capital requirements for banks.These were known as Basel I. It focused almost entirely on credit risk (default risk) - the risk of counter party failure. It defined  capital requirement and structure of risk weights for banks.', '4', '', '', 'Yes', NULL, NULL),
(157, 1, 1, 2, 'The risks considered for capital requirements under Basel II are__', 'credit risk, market risk and operational risk', 'credit risk, interest rate risk and foreign exchange risk', 'credit risk, political risk and country risk', 'None', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(158, 1, 1, 1, 'The first pillar under Basel II talks about', 'minimum capital requirements..', 'supervisory review', 'market discipline', 'disclosure norms', '', '', '0.50', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(159, 1, 1, 2, 'As per Basel II Framework, the total of Tier 2 capital is permitted up to a maximum of', '100 per cent of Tier 1 capital', '250 per cent of Tier 1 capital ', '80 per cent of Tier 1 capital ', '50 per cent of Tier 1 and Tier 3 capital', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(160, 1, 1, 2, 'Tier I capital of a bank consists of its', ' paid-up equity capital\r\n', 'issued and fully paid ordinary shares/common stock and perpetual non-cumulative preference shares and disclosed-reserves\r\n\r\n', ' authorised capital	', 'none.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(161, 1, 1, 2, 'Subordinated term debt will be limited to a maximum of', '50 per cent of Tier 1 elements', '100 per cent of Tier 1 elements ', '85 per cent of Tier 1 elements', 'none.', '', '', '1.00', '0.00', '', 'Subordinated term debt: Includes conventional, unsecured, subordinated debt capital instruments, with a minimum original fixed term to maturity of over five years and limited life redeemable preference shares. During the last five years to maturity, a cumulative discount (or amortisation) factor of 20 per cent per year will be applied to reflect the diminishing value of these instruments as a continuing source of strength. Unlike the hybrid debt instruments, these instruments are not normally available to participate in the losses of a bank that continues trading. For this reason, these instruments will be limited to a maximum of 50 per cent of Tier 1.', '1', '', '', 'Yes', NULL, NULL),
(162, 1, 1, 2, 'In case of Strategic Alliances', 'the partners will remain as separate entities', 'the partners will lose their individual identities', 'one partner will get merged with the other', ' none', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(163, 1, 1, 2, 'Three mid-sized public sector banks have entered into a `strategic alliance'' in October 2006. They are', 'Indian Bank, Corporation Bank and Oriental Bank of Commerce ', 'Indian Bank, Punjab National Bank and Canara Bank', 'Union Bank of India, Syndicate Bank and Corporation Bank ', 'Canara Bank, Syndicate Bank and Corporation Bank.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(164, 1, 1, 1, 'Combining of two or more companies into a single company where one survives with its name and the others lose their corporate existence is called', 'Merger', 'Alliance', 'Consolidation', 'Acquisition.', '', '', '0.50', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(165, 1, 1, 1, 'In 1921, the three presidency banks - the Bank of Bengal, the Bank of Bombay and the Bank of Madras were amalgamated into one Bank which is now called the', 'State Bank of India', 'Reserve Bank of India', 'Indian Bank', 'none.', '', '', '0.50', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(166, 1, 1, 2, 'One of the following does not own 10 per cent equity stake in the capital of CIBIL', 'HDFC', 'SBI', 'ICICI Bank', 'Standard Chartered Bank ', '', '', '1.00', '0.00', '', 'The Reserve Bank of India (RBI), in its ''Annual Monetary and Credit Policy'' for the year 2004-05, had stated that in respect of credit bureaus, ''it is desirable that the objective should be to move towards a sufficiently diversified ownership with no single entity owning more than 10 per cent of the paid-up capital in the first stage and 5 per cent later.'' Accordingly, SBI and HDFC have divested their equity stake in favour of significant data providers with representation from all the categories of credit grantors. As on 31 December, 2006, HDFC, SBI, ICICI Bank, D&B and TU, hold 10 per cent stake each in CIBIL, whereas Citicorp Finance (India) Ltd., Standard Chartered Bank, HSBC, Punjab National Bank, Bank of India, Central Bank of India, Union Bank of India, Bank of Baroda and Indian Overseas Bank hold 5 per cent stake each, while the remaining 5 per cent is equally held by GE Strategic', '4', '', '', 'Yes', NULL, NULL),
(167, 1, 1, 1, 'The Consumer Credit Bureau covers credit availed by', 'individuals', 'proprietary concerns', 'private and public limited companies', 'banks.', '', '', '0.50', '0.00', '', 'The Consumer Credit Bureau covers credit availed by individuals while the Commercial Credit Bureau covers credit availed by non-individuals such as partnership\r\nfirms, proprietary concerns, private and public limited companies, etc.', '1', '', '', 'Yes', NULL, NULL),
(168, 1, 1, 2, 'In case of receipt of request for transfer of borrowal account, the consent or objection of the lender, if any, should be conveyed within', 'twenty-one days from the date of receipt of request', 'fifteen days from the date of receipt of request', 'immediately on receipt of request\r\n', '', '', '', '1.00', '0.00', '', 'In case of receipt of request for transfer of borrowal account, either from the borrower or from a bank/financial institution, which proposes to takeover the account, the consent or otherwise, i.e. objection of the lender, if any, should be conveyed within twenty-one days from the date of receipt of request.', '1', '', '', 'Yes', NULL, NULL),
(169, 1, 1, 1, 'Credit information reports can be accessed by', 'only those members who have provided all their data to CIBIL', 'by any bank', 'by any Indian citizen ', 'none.', '', '', '0.50', '0.00', '', 'CIBIL is a repository of information,which contains the credit history of commercial and consumer borrowers. CIBIL provides this information to its members in the form of credit information reports (CIRs).', '1', '', '', 'Yes', NULL, NULL),
(170, 1, 1, 3, 'The Banking Codes and Standards Board of India was registered on 18 February, 2006 under:', 'RBI Act', 'Banking Regulation Act', 'the Societies Registration Act, 1860', 'none.', '', '', '2.00', '0.00', '', 'The Banking Codes and Standards Board of India (BCSBI) was set up on 18 February, 2006. On the guidance of Reserve Bank of India, BCSBI had brought out the ''Code of Bank''s Commitment to Customers'' to be followed by member banks. The code sets minimum standards of banking practices for banks to follow when they deal with individual customers. This code deals with, inter alia, fair practices code for collection of debts.', '3', '', '', 'Yes', NULL, NULL),
(171, 1, 1, 2, 'The `Bankers'' Fair Practice'' code was brought out in June 2004 by', 'IBA', 'RBI', 'Government of India', 'None', '', '', '1.00', '0.00', '', 'The IBA had brought out its ''Bankers'' Fair Practice'' code in June 2004 and all member banks had adopted it voluntarily.', '1', '', '', 'Yes', NULL, NULL),
(172, 1, 2, 3, 'A subsidiary bank has to act as agent of the State Bank under __________ of the (SBI Subsidiary Banks) Act, at any place as required by the State Bank to receive, collect and remit money, bullion and Government securities on behalf of the Government of India, and undertake other business which the Reserve Bank may entrust the State Bank from time to time, with the approval of the Reserve Bank.', 'Section 3', 'Section 10', 'Section 18\r\n', 'Section 36 \r\n', '', '', '2.00', '0.00', '', '"A subsidiary bank has to act as agent of the State Bank under Section 36 of the (SBI Subsidiary Banks) Act, at any place as required by the State Bank to receive, collect and remit money, bullion and Government securities on behalf of the Government of India, and undertake other business which the Reserve Bank may entrust the State Bank from time to time, with the approval of the Reserve Bank.\r\n\r\nUnder Section 36A, a subsidiary bank has also act as an agent of the Reserve Bank if required by it, to undertake Government work or other work entrusted by the Reserve Bank."', '4', '', '', 'Yes', NULL, NULL),
(173, 1, 2, 3, 'Co-operative banks other than scheduled Co-operative Banks and scheduled state co-operative banks have to maintain in India by way of cash reserve with itself or by way of balance in current account with the Reserve Bank or the state cooperative bank of the state concerned or district Co-operative Bank or by way of net balance in current accounts or any one or more of these ways a sum equivalent to at least _________ of its total demand and time liabilities in India.', '3%\r\n', '5%\r\n', '7.50%\r\n', '4%\r\n', '', '', '2.00', '0.00', '', 'Co-operative banks other than scheduled Co-operative Banks and scheduled state co-operative banks have to maintain in India by way of cash reserve with itself or by way of balance in current account with the Reserve Bank or the state cooperative bank of the state concerned or district Co-operative Bank or by way of net balance in current accounts or any one or more of these ways a sum equivalent to at least 3% of its total demand and time liabilities in India. In the case of a primary cooperative bank the balance in current accounts with the central co-operative bank of the district concerned may also be taken into account. The balance has to be reckoned as on the last Friday of the second preceding fortnight', '1', '', '', 'Yes', NULL, NULL),
(174, 1, 2, 3, 'Which among the following is not covered under Section 20 of the Banking Regulation Act (as applicable to co-operative societies) regaring restrictions on loans and advances by co-operative banks', 'loans and advances on the security of its own shares\r\n', 'unsecured loans or advances to any of its directors\r\n', '"unsecured loans or advances to any company in which the chairman of the cooperative\r\nbank is interested as managing agent or chairman or managing director"\r\n', '"unsecured loans or advances made by a coÂ¬operative bank against bills for supplies or services made to Government or bills of exchange arising out of bona fide, commercial or trade transactions"', '', '', '2.00', '0.00', '', 'Restrictions on furnishing loan and advance do not apply to unsecured loans or advances made by a coÂ¬operative bank against bills for supplies or services made to Government or bills of exchange arising out of bona fide, commercial or trade transactions. Further, unsecured loans or advances in respect of which trust receipts are furnished to the co-operative bank and loans to directors or any other persons within the limits and on terms and conditions approved by the Reserve Bank are also exempted.', '4', '', '', 'Yes', NULL, NULL),
(175, 1, 2, 3, 'Which of these checking need not to be done before debiting the account of drawer of cheque in light of decision made by Supreme Court in Bank of Maharashtra vs M/s Automotive Engineering Co. ', 'Cross checking cheque serial number', 'Verifying tenor of the cheque presented\r\n', 'Matching signature of the account holder', 'Scrutinizing cheque under UV Ray lamp', '', '', '2.00', '0.00', '', '"Section 89 of the Negotiable Instruments Act gives protection to the paying banker of a cheque which has been materially altered but does not appear to have been so altered, if payment was made according to the apparent tenor thereof at the time of payment and otherwise in due course.\r\nSection 10 of the said Act defines payment in due course to mean payment in accordance with the apparent tenor of the instrument in good faith and without negligence to any person in possession\r\nSection 31 of the said Act obliges the drawee bank having sufficient funds of the drawer in its hands properly.\r\n\r\nSimply, because the ultraviolet ray lamp was not kept in the branch and the said cheque was not subjected to such lamp would not be sufficient to hold the appellant bank guilty of negligence."', '4', '', '', 'Yes', NULL, NULL),
(176, 1, 2, 2, 'A general meeting of shareholders shall be held annually as required under Section 44 of SBI Subsidiary Banks Act within _____ weeks of sending the accounts, etc., to the State Bank and others', '7 weeks\r\n', '4 weeks\r\n', '8 weeks\r\n', '6 weeks\r\n', '', '', '1.00', '0.00', '', 'A general meeting of shareholders shall be held annually as required under Section 44 of SBI Subsidiary Banks Act within 6 weeks of sending the accounts, etc., to the State Bank, Reserve Bank and the Central Government.', '4', '', '', 'Yes', NULL, NULL),
(177, 1, 2, 2, 'What minimum percentage of shares of Nationalized bank should be held by Central Government at all the time?', 'Not less than 75%\r\n', 'Not less than 90%\r\n', 'Not less than 51%\r\n', 'Not less than 50%\r\n', '', '', '1.00', '0.00', '', 'The Banking Companies (Acquisition and Transfer of Undertakings) and Financial Institutions Laws (Amendment) Act, 2006 enables these banks to raise capital by way of public issue or preferential allotment or private placement of equity shares or preference shares. The Central Government shall, however, at all times hold not less than fifty one per cent of the equity of these banks.', '3', '', '', 'Yes', NULL, NULL),
(178, 1, 2, 2, 'The minimum paid-up capital and reserves required to commence or carry on banking business by a co-operative bank is not less than _________ .', 'Rs. 10 Lakhs', 'Rs. 1 Lakh', 'Rs. 2 Lakhs\r\n', 'Rs. 5 Lakhs\r\n', '', '', '1.00', '0.00', '', 'The minimum paid-up capital and reserves required to commence or carry on banking business by a co-operative bank is not less than Rs. 1 lakh under Section 11 of BR Act (as applicable to co-operative banks)', '2', '', '', 'Yes', NULL, NULL),
(179, 1, 2, 2, '"Whether bank can seek remedy from account holder under section 85 of the negotiable instrument act, 1881, in case payment made to ____________, to be handed over to the account holder, absconded before making payment to the account holder."', 'One of the employee of the bank', 'Account holder''s servant\r\n', 'Account holder''s agent', 'Account holder''s relative', '', '', '1.00', '0.00', '', '"The Supreme Court in Bank of Bihar vs Mahabir Lai (AIR 1964 Supreme Court 397) held that a banker can seek protection under Section 85 only where payment has been made to the holder, his servant or agent.\r\nPayment to a person who had nothing to do with the firm or a payment to an agent of the bank would not be a payment to the firm.\r\nHence bank cannot seek remedy under section 85 of the negotiable instrument act, 1881 for payment made to one of the employee of the bank."', '1', '', '', 'Yes', NULL, NULL),
(180, 1, 2, 1, 'Regional rural banks operate in____________ ?', 'A notified area\r\n', 'The whole of a state', 'Only a district\r\n', 'Whole country\r\n', '', '', '0.50', '0.00', '', 'Section 3 of the Act authorises the Central Government to establish regional rural banks by notification in the official gazette at the request of a sponsor bank to operate within specified local limits. ''Sponsor Bank'' is a bank by which a regional rural bank is sponsored and it holds 35 per cent of the issued capital of the RRB, while the Central Government holds 50 per cent and the State Government holds the remaining fifteen per cent of the issued capital.', '1', '', '', 'Yes', NULL, NULL),
(181, 1, 2, 1, 'The management of the affairs of a regional rural bank vests in ________ ?', 'The Sponsor Bank\r\n', 'Its board of directors\r\n', 'Chairman\r\n', 'The National bank\r\n', '', '', '0.50', '0.00', '', 'The management of RRB vests in the board of directors. The board has to function on business principles with due regard to public interest.', '2', '', '', 'Yes', NULL, NULL);
INSERT INTO `questions` (`id`, `qtype_id`, `subject_id`, `diff_id`, `question`, `option1`, `option2`, `option3`, `option4`, `option5`, `option6`, `marks`, `negative_marks`, `hint`, `explanation`, `answer`, `true_false`, `fill_blank`, `status`, `created`, `modified`) VALUES
(182, 1, 2, 1, 'The Chairman of the State Bank is appointed by ?', 'Central Board\r\n', 'Banking Service Recruitment Board', 'Governor of RBI', 'Central Government', '', '', '0.50', '0.00', '', 'The Board shall consist of Chairman, Vice-Chairman, not more than two Managing Directors appointed by the Central  Government, presidents of local boards and other directors. There are directors falling in different categories.', '4', '', '', 'Yes', NULL, NULL),
(183, 1, 2, 1, 'Payment in due course under second 10 of the negotiable instrument act, 1881 includes', 'apparent tenor of the instrument', 'good faith and without negligence to any person in possession', 'does not afford a reasonable ground for believing that he is not entitled to receive payment of the amount therein mentioned', 'All of these', '', '', '0.50', '0.00', '', 'Payment in due course has been stated in Section 10 of Negotiable instrument act, 1881. ''Payment in due course'' means payment in accordance with the apparent tenor of the instrument in good faith and without negligence to any person in possession thereof under circumstances which does not afford a reasonable ground for believing that he is not entitled to receive payment of the amount therein mentioned', '4', '', '', 'Yes', NULL, NULL),
(184, 1, 1, 2, 'In the cal/notice money market the following participant are allowed to trade______\r\n', 'all corporates\r\n', 'all banks, Primary Dealers and Mutual funds ', 'Only banks\r\n', 'none.', '', '', '1.00', '0.00', '', 'This market is governed by the Reserve Bank of India which issues guidelines for the various participants in the call/notice money market. The entities permitted to participate both as lender and borrower in the call/notice money market are Scheduled Commercial Banks (excluding RRBs), Co-operative Banks other than Land Development Banks and Primary Dealers. ', '3', '', '', 'Yes', NULL, NULL),
(185, 1, 1, 2, 'The minimum maturity period of certificates of deposit (CDs) with effect from 29 April 2005 is______', '8 days', '15 days', '21 days', 'None', '', '', '1.00', '0.00', '', 'With a view to further widening the range of money market instruments and giving investors greater flexibility in deployment of their short-term surplus funds, Certificates of Deposit (CDs) were introduced in India in 1989. CD is a negotiable money market instrument and issued in dematerialised form or as a Usance Promissory Note, for funds deposited at a bank or other eligible financial institution for a specified time period. The minimum maturity period of CDs was reduced from 15 days to 8 days with effect from 29 April 2005,', '1', '', '', 'Yes', NULL, NULL),
(186, 1, 1, 2, 'Scheduled commercial banks (SCBs) and primary dealers (PDs) have been allowed with effect from November 2006, to cover their short positions within an extended period of:', '5 trading days ', '2 trading days ', 'short sales not permitted ', 'None', '', '', '1.00', '0.00', '', 'On the basis of the recommendations of the technical group on the central government securities market, intra-day short-selling in central government securities was permitted from February 2006. On an assessment of the market feedback, eligible participants, viz., scheduled commercial banks (SCBs) and PDs have been allowed with effect from November 2006, to cover their short positions within an extended period of five trading days. As this arrangement may result in carrying short positions across settlement cycles, the participants would be allowed to deliver a shorted security by borrowing it through the repo market.', '1', '', '', 'Yes', NULL, NULL),
(187, 1, 1, 3, 'Resident individuals are free to remit in a financial year for any current or capital account transaction or a combination of both up to_____', 'US$ 25,000', 'US$ 50,000', 'US$ 10,000', 'none.', '', '', '2.00', '0.00', '', 'Enhancement of limit under liberalised remittance scheme: Resident individuals would henceforth be free to remit up to US$ 50,000 per financial year for any current or\r\ncapital account transaction or a combination of both.', '2', '', '', 'Yes', NULL, NULL),
(188, 1, 1, 1, 'Principle functions of banks are:', 'accepting deposits', 'lending and investing', 'non-fund business and remittance services ', 'all of above.', '', '', '0.50', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(189, 1, 1, 2, 'deposit accounts, the main relationship between bank and customer is', 'creditor-bank, debtor-customer ', 'debtor-bank, creditor-customer ', 'agent-principal', 'servant-owner', 'only (a) and (b).', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(190, 1, 1, 2, 'When a bank lends money to the corporate person the relationship is_____', 'borrower and lender', 'creditor-debtor ', 'debtor-creditor', 'customer and client', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(191, 1, 1, 1, 'Bailor-bailee relationship is applicable in', 'cash deposited with cashier by customer ', 'safe deposit locker', 'demand draft issued by bank', 'keeping articles in safe custody with bank ', '', '', '0.50', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(192, 1, 1, 2, 'What relationship is created when the bank collects a cheque in clearing?', 'holder for value', 'clearing member and principal ', 'agent and principal', 'collecting bank and holder ', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(193, 1, 1, 2, 'When any FDR is lost by a customer of a bank, what document is executed:', 'guarantee bond', 'government bond', 'promissory bond, ', 'indemnity bond.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(194, 1, 7, 3, 'Credit voucher for Ks. 44,444 favouring Nilu was wrongly posted to Riza by the bank. the relationship established with Riza is', 'trustee and beneficiary', 'debtor and guarantor', 'creditor and indemnifier', 'creditor and debtor ', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(195, 1, 7, 2, 'Mr. Prabhat Sinha has a bank account and credited Rs. 20 lakh in it. Subsequently he was arrested on charge of fraud. The police informed the bank not to allow withdrawals from his account. Two, days later, bank receives a cheque of Rs. 15,000 favouring  Prabhat Sinha''s creditor. What should the bank do?', 'not to pay cheque ', 'return cheque with memo stating A/c holder in jail.', 'honour the cheque', ' get police orders for payment ', 'get court orders for payment', '', '1.00', '0.00', '', 'Yes, Since police has asked the bank not to withdraw any amount from his account only, hence account has been marked debit freeze only. Bank received a cheque in favouring of Prabhat Sinha that is part of credit to customer account. Hence no issue.', '3', '', '', 'Yes', NULL, NULL),
(196, 1, 7, 3, 'Account holder X draws a cheque for Rs. 5,000 favouring Rajesh (a minor aged 13 years) or bearer. Rajesh presents the cheque on counter duly signed on the back. What should the banker do with the cheque of a minor?', 'refuse, since no contractual capacity ', 'pay the cheque after inquiring with X ', 'pay to Rajesh without any responsibility of bank ', 'ask Rajesh to bring his parents', ' Section 26 N.I. Act, 1881, does not allow minor to receive payment', '', '2.00', '0.00', '', 'It is a bearer cheque and the holder in due course, hence the cheque can be passed without any liabilities from back side.', '3', '', '', 'Yes', NULL, NULL),
(197, 1, 7, 3, 'A cheque drawn for Rajkumar or order is stolen. The thief made endorsement as Rajkumar on the cheque in his favour. The cheque is presented in clearing and paid by bank. True owner later on sent legal notice to bank. What is the liability of the bank?', 'the paying bank will get protection under N.I. Act ', 'forgery does not give any rights to bank, hence liable ', 'under section 85, the paying bank is liable', 'under section 131, the paying bank is liable', '', '', '2.00', '0.00', '', 'An order cheque can be transferred only by endorsement followed by delivery. According to Section 16 of N.I. Act, an endorsement may be ''in blank'' or ''in full''. If the endorser signs his name only, it is endorsement in blank. If the endorser signs and adds a direction to pay the amount to or to the order of specified person, it is then called as an endorsement in full. A paying banker should look into the regularity of the endorsement before making payment so that he could avail the protection under Section 85(1) of the N.I. Act,', '1', '', '', 'Yes', NULL, NULL),
(198, 1, 7, 3, 'After close of business hours by 1.30 hrs. the account holder himself availed payment. At 4.15 p.m. (after close of 1.45 hrs) income tax attachment order is received by bank. What would be the liability of paying bank?', 'is made in due course and as payment is debitable next day, bank is protected.', 'payment is not in due course since paid after reasonable time (i.e. 1.30 hrs. late for today)', 'attachment order will be effective after bank''s right of lien over the late payment bank should approach the customer to get the order changed to next day.', 'Payment after business hours is a payment in due course hence bank is not liable, Section 10 N.I. Act.', '', '', '2.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(199, 1, 7, 3, 'Ritesh issued a cheque at 3:30 p.m. (one hour after close of business hours of the bank) to Shubha Shubha approached to the bank and on request paid the money at 4:00 p.m. as late payment: Ritesh arrived to the bank and stopped payment of cheque issued to Shubha at 4:30 p.m. on the same day. Who is liable for loss?', 'Payment after business hours is not a payment in due course hence bank is liable, Section 10 N.I. Act.', 'Payment even though after business hours but within banking hours is protected under Section 31.', 'Payment late for today is protected under Section 85', 'Refused to accept stop payment instructions since late for today', '', '', '2.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(200, 1, 7, 2, 'Mr. Tanweer wants a demand draft striking the word `Order'' and writing the word `Bearer''. Can bank help him`?', 'Bearer Draft is unlawful under Section 31 of RBI', 'Bearer Draft can be issued like a cheque', 'Signature of the payee should be attested on the back of draft by the issuing branch', 'Attestation of the signature of the payee on a separate slip of paper by bank (without striking out the word `Order'' on draft', '', '', '1.00', '0.00', '', 'An order cheque may be presented for payment either by the original payee or by the endorsee. In such cases, proper identification of the presenter should be asked for. Further if the cheque contains endorsements, it must be ensured that they are regular. A bearer cheque can be paid to any person who presents it. In such cases, the paying banker need not verify the endorsement. However, the signature of the presenter should be obtained on the reverse of the cheque for having received the payment. Whether amount stated in words and figure are the same: Before making payment, it should be ensured that the amount stated in words and figure tallies.', '4', '', '', 'Yes', NULL, NULL),
(201, 1, 7, 2, 'A draft purchased is reported lost and the purchaser wants to stop the payment of the draft. Can the Bank do it?', 'Bank cannot stop payment since it is a promissory note', 'Bank can stop payment since covered under negotiable instrument.', 'Bank can ask the purchaser to suffer for negligence and bank cannot help.', 'Bank would issue stop payment instructions only after two weeks from date of issue.', '', '', '1.00', '0.00', '', 'The Supreme Court, In Shri Jagadish Mills case AIR 1959 held that when a draft is received in the hand of the payee, the purchaser of that draft has no authority to issue "Stop Payment Instructions" Such instruction can stop a cheque-payment, but not a draft payment. When the draft is delivered to the payee, the purchaser is not entitled to ask the bank to stop payment and the bank  is not bound by the direction of purchaser.', '1', '', '', 'Yes', NULL, NULL),
(202, 1, 7, 1, 'Objectives of KYC______', 'to ensure appropriate customer identification ', 'to monitor transactions of suspicious nature ', 'to ensure that he/she would not deceive the bank. ', 'if loan given it would not be a NPA', 'Only (a) and (b)', '', '1.00', '0.00', '', '', '5', '', '', 'Yes', NULL, NULL),
(203, 1, 7, 1, 'Sources of credit information', 'Information''s on visit to business premises', 'On interview with borrower and from documents submitted ', 'Information''s from loan proposal', 'All of above', 'Only (b) and (c)', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(204, 1, 7, 1, 'Current accounts deposits are not entitled to', 'Cheque book above 100 leaves', 'Monthly Statements', 'Cash Payments', 'Interest ', 'All of the above.', '', '1.00', '0.00', '', 'Current deposit accounts are opened to meet the transactions of business and trade and hence are not entitled to any interest from the bank.', '4', '', '', 'Yes', NULL, NULL),
(205, 1, 7, 1, 'Merchant bankers'' activity relate to', 'Financial Brokers', 'Financial Intermediaries', 'Credit Appraisers', 'Underwriters', 'All of the above. ', '', '1.00', '0.00', '', 'Merchant bankers are financial intermediaries. They act as intermediaries of transfer of capital from those who own it (Investor or Bond Subscriber) to those who use it (Corporates or Governments).', '2', '', '', 'Yes', NULL, NULL),
