(209, 1, 7, 1, 'Bankerâ€™s lien is an / a_____', 'bailment of goods', 'implied pledge', 'agreement', 'an stoppage', '', '', '1.00', '0.00', '', 'Lien is the right of the banker to retain possession of the goods and securities owned by the debtor until the debt due from the latter is paid. The banker''s lien is an implied pledge.', '2', '', '', 'Yes', NULL, NULL),
