(234, 1, 1, 2, 'In a limited Co. certificate of incorporation was obtained though the memorandum was signed by two persons for all the seven signatories where the signatures were forged. Will the bank accept memo as genuine for opening bank a/c?', 'Yes', 'N0', 'Yes because incorporation certificate is valid', 'No because forged documents cannot be accepted', 'Bank will ask its H.G.', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(235, 1, 1, 2, 'There should be two persons to open a partnership account in a bank. Which of the\r\nfollowing is correct?', 'X aged 25 years Y aged 17 years', 'X aged 25 years Y aged 21 years', 'X aged 17 years and Y aged 16 years', 'Ku. Shubha aged 30 years and Ku. Rachna aged 16 years (daughter of Ku. Shubha)', 'X aged 71 years Y aged 57 years but lunatic.', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(236, 1, 1, 2, 'HUF account is to be opened in a bank where there are three major persons Shivkumar - Father; Mrs. Ramawati - Shivkumar''s Mother, Sharat Kumar - Son; Who can become Karta of HUF?', 'Shivkumar', 'Sharat Kumar', 'Mrs. Ramawati', 'Both Shivkumar and Ramawati', 'Both Shivkumar and Sharat Kumar.', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
