(238, 1, 1, 2, 'X a partner in the firm xyz Co. wants to open a bank account in the firm''s name. Does it require signatures of', 'All partners', 'Anyone', 'Managing partner only', 'Sleeping partner not required.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(239, 1, 2, 1, 'Which section of the Negotiable Instrument Act, 1881 provides for protection of Collecting Bank \r\n', 'Section 131 of the Negotiable instrument Act, 1881\r\n', 'Section 10 of the Negotiable instrument Act, 1881\r\n', 'Section 31 of the Negotiable instrument Act, 1881\r\n', 'Section 89 of the Negotiable instrument Act, 1881\r\n', '', '', '0.50', '0.00', '', '"Section 131 of the Negotiable Instruments Act grants protection to a collecting banker.\r\nSection 10, 31 and 89 give protection to paying bank."\r\n', '1', '', '', 'Yes', NULL, NULL),
(240, 1, 2, 1, 'Section _______ of the Indian Contract Act defines an indemnity', 'Section 125\r\n', 'Section 120\r\n', 'Section 124\r\n', 'None of the above\r\n', '', '', '0.50', '0.00', '', 'Section 124 of the Indian Contract Act, 1872 defines contract of indemnity as follows: A contract by which one party promises to save the other from loss caused to him by the conduct of the promiser himself or by the conduct of any other person, is called a ''Contract of Indemnity.', '3', '', '', 'Yes', NULL, NULL),
(241, 1, 2, 1, 'There are ________ parties to a contract of indemnity\r\n', '5\r\n', '4\r\n', '3\r\n', '2\r\n', '', '', '0.50', '0.00', '', 'The indemnifier and indemnity holder are the two parties to a contract of indemnity.', '4', '', '', 'Yes', NULL, NULL),
(242, 1, 2, 1, 'There are ________ parties to a contract of guarantee\r\n', '5\r\n', '4\r\n', '3\r\n', '2\r\n', '', '', '0.50', '0.00', '', 'In a contract of guarantee there are three parties, viz., the debtor (the person on whose behalf the guarantee is given), the creditor (the beneficiary, the person to whom the guarantee is given) and the surety (the person who gives the guarantee).', '3', '', '', 'Yes', NULL, NULL),
(243, 1, 2, 1, 'Rights of the indemnity holder includes', 'All damages which he may be compelled to pay in any suit in respect of any matter to which the promise to indemnify applies\r\n', 'All costs which he may be compelled to pay in any such suit if, in bringing or defending it, he did not contravene the orders of the promisor, and acted as it would have been prudent for him to act in the absence of any contract of indemnity, or, if the promisor authorised him to compromise the suit\r\n', 'All sums which he may have paid under the terms of any compromise of any such suit, if the compromise was not contrary to the orders of the promisor, and was one, which it would have been prudent for the promisee to make in the absence of any contract of indemnity, or, if the promisor authorised him to compromise the suit.\r\n', 'All of these\r\n', '', '', '0.50', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(244, 1, 2, 1, '"In case the indemnity holder does not violate the two mandatory conditions, he is then entitled to be indemnified by the indemnifier to the extent of:"', 'the damages paid by him\r\n', 'the costs required either to file the suit or defend it\r\n', 'any amounts paid by him pursuant to a compromise in the suit provided that the compromise was not contrary to any of the order or directions of the indemnifier and the compromise was such that it was an act of prudence in the absence of a contract of indemnity.\r\n', 'All of these\r\n', '', '', '0.50', '0.00', '', '"The rights of an indemnity holder are subject to:\r\n(a) his acting within the scope of his authority;\r\n(b) he does not contravene the specific directions of the promisor.\r\nIn case the indemnity holder does not violate the above two conditions, he is then entitled to be indemnified by the indemnifier for mentioned amount."\r\n', '4', '', '', 'Yes', NULL, NULL),
(245, 1, 2, 1, 'In bank guarantees the bank makes payment on', 'being convinced that the beneficiary has incurred loss\r\n', 'on being sued by the beneficiary\r\n', 'on the guarantee being invoked and after seeking concurrence of the debtor\r\n', 'merely on demand by the beneficiary\r\n', '', '', '0.50', '0.00', '', '"Bank under a contract of guarantee is bound to honour its  guarantee and its obligations to pay is primary and independent of the underlying contract between the customer on whose behalf the guarantee is given and the beneficiary.\r\nThe only exception for a bank not to make payment under a guarantee is when a fraud exists, which must be proved beyond doubt or special equity is in favour of the debtor."', '4', '', '', 'Yes', NULL, NULL),
(246, 1, 2, 1, 'If a beneficiary were to invoke the guarantee within the claim period, for a default committed by the debtor during the validity period then in case the bank did not make payment, the beneficiary can sue the bank within the normal period as provided in the Limitation Act, 1963. This period under the Limitation Act is ____ for Government department or municipal body.\r\n', '3\r\n', '30\r\n', '15\r\n', '10\r\n', '', '', '0.50', '0.00', '', 'This period under the Limitation Act is thirty years in case the beneficiary is Government department or municipal body and three years in all other cases.\r\n', '2', '', '', 'Yes', NULL, NULL),
(247, 1, 2, 1, 'In which of the following cases the bank need to pay in case bank guarantee has been invoked\r\n', 'Bank customer who has taken the bank guarantee has prohibited the bank by furnishing injunction of court\r\n', 'Guarantee has been invoked improperly\r\n', 'Bank guarantee has been invoked within the claim period after the validity of the bank guarantee.\r\n', 'Fraud has been detected by the bank and the same is well established.\r\n', '', '', '0.50', '0.00', '', 'Claim period is the duration in which beneficiary can claim for the amount of bank guarantee while validity period is the period under which their guarantee subsists.\r\n', '3', '', '', 'Yes', NULL, NULL),
(248, 1, 2, 2, 'Which one of following is not one of the conditions for which protection is available to banker under section 131 of the Negotiable Instrument Act, 1881\r\n', 'Banker should have acted in good faith\r\n', 'Banker should have acted without negligence\r\n', 'Banker should receive payment from a customer\r\n', 'The cheque should be crossed generally or specially to himself\r\n', '', '', '1.00', '0.00', '', '"Section 131 grants protection to a collecting banker, the protection is conditional. For the collecting banker to claim the protection under Section 131 he has to comply with certain conditions and they are:\r\n1. The collecting banker should have acted in good faith.\r\n2. He should have acted without negligence.\r\n3. He should receive payment for a customer.\r\n4. The cheque should be crossed generally or specially to himself\r\nThe collecting bank should have account of the customer for which payment need to be received.\r\nThe provisions of the above section has been applied to drafts as per Section 131A of the Negotiable Instruments Act."', '3', '', '', 'Yes', NULL, NULL),
(249, 1, 2, 2, 'Which of the following is duty of the collecting bank as established practise in the banking industries for claiming protection under section 131 of the Negotiable Instrument Act, 1881\r\n', 'Duty to take into Account the State of Customer''s Account\r\n', 'Duty to Verify the Instruments or any Apparent Defect in the Instruments\r\n', 'Duty to Ensure Crossing and Special Crossing\r\n', 'All of these\r\n', '', '', '1.00', '0.00', '', '"Following is duty of the collecting bank as established practise in the banking industries.\r\n1) Duty to Open the Account with References and Sufficient Documentary Proof\r\n2) Duty to Confirm the Reference where the Referee is not known or has given Reference in Absentia\r\n3) Duty to Ensure Crossing and Special Crossing\r\n4) Duty to Verify the Instruments or any Apparent Defect in the Instruments\r\n5) Duty to take into Account the State of Customer''s Account\r\n6) Due emphasis of Collecting Bank in Collecting Cheques Payable to Third Parties"', '4', '', '', 'Yes', NULL, NULL),
(250, 1, 2, 2, 'Section 124 of the Indian Contract Act on Indemnity covers following types of indemnity\r\n', 'Insurance contract and contract of indemnity\r\n', 'Only contract of indemnity\r\n', 'Contract of indemnity and cases of indemnity where no written contract has been entered into\r\n', 'Insurance contract, Contract of indemnity and cases of indemnification where no written contract has been entered into\r\n', '', '', '1.00', '0.00', '', '"Insurance contract is not covered under Section 124 of the Indian Contract Act.\r\nCases of indemnification where no written contract has been entered into has been dealt with principles of general law."\r\n', '2', '', '', 'Yes', NULL, NULL),
(251, 1, 2, 2, 'The risk is contingent in ________\r\n', 'Indemnity\r\n', 'Guarantee\r\n', 'Both Indemnity and Guarantee\r\n', 'None of the above\r\n', '', '', '1.00', '0.00', '', 'In an indemnity, the risk is contingent whereas in a  Guarantee the liability is subsisting.\r\n', '1', '', '', 'Yes', NULL, NULL),
(252, 1, 2, 2, 'The number of minimum contract that need to be entered into in a contract of Guarantee is\r\n', '1\r\n', '4\r\n', '3\r\n', '2\r\n', '', '', '1.00', '0.00', '', 'In a contract of guarantee there are at least three contracts: one between the debtor and creditor, the other between the creditor and the surety and the third between the surety and the debtor.\r\n', '3', '', '', 'Yes', NULL, NULL),
(253, 1, 2, 2, 'The indemnifier had authorised the indemnity holder to compromise the suit.\r\n', 'Yes in all cases\r\n', 'No\r\n', 'Only when specific instruction is given in this regard from indemnifier\r\n', 'Cases other than in which indemnifier has given specific instruction not to compromise.\r\n', '', '', '1.00', '0.00', '', 'The Madras High Court in Venkataramana vs Mangamma, has held that even in the absence of a notice to the indemnifier (promisor), the compromise would bind him, if not contrary to the orders of the promisor, and is entered bona fide and without any collusion and is not imprudent.\r\n', '4', '', '', 'Yes', NULL, NULL),
(254, 1, 2, 2, 'In case of bank guarantees on behalf of company that is in liquidation the bank on invocation of the guarantee by the beneficiary\r\n', 'must pay the amount to the Liquidator and not the beneficiary\r\n', 'must deposit the amount in the court to avoid any controversy\r\n', 'must pay the beneficiary\r\n', 'need not pay, since the bank guarantee lapses on the company being liquidated\r\n', '', '', '1.00', '0.00', '', '"Bank under a contract of guarantee is bound to honour its  guarantee and its obligations to pay is primary and independent of the underlying contract between the customer on whose behalf the guarantee is given and the beneficiary.\r\nThe only exception for a bank not to make payment under a guarantee is when a fraud exists, which must be proved beyond doubt or special equity is in favour of the debtor."', '3', '', '', 'Yes', NULL, NULL),
(255, 1, 2, 2, 'Bank guarantee is\r\n', 'Independent contract from underlying contract between the parties\r\n', 'dependent on underlying contract between the parties\r\n', 'it depends on the terms on which it has been taken\r\n', 'None of the above\r\n', '', '', '1.00', '0.00', '', 'bank guarantees are independent commitments taken by bank on the behalf of their customers.\r\n', '1', '', '', 'Yes', NULL, NULL),
(256, 1, 2, 2, 'Whether bank can honour the bank guarantee in case where a previous invoke of the bank guarantee has been stopped by the customer by presenting injunction from the court and it is still to be proved that the beneficiary has committed fraud.\r\n', 'bank has to honour the bank guarantee\r\n', 'bank can plea for non-payment on the fact that a previous attempt of fraud has been made.\r\n', 'Bank can stop payment in consultation with the its client on the basis of verbal communication\r\n', 'None of the above\r\n', '', '', '1.00', '0.00', '', 'M/s Escorts Limited vs Messrs Modern insulators and Another, Court held that averments of fraud have to be pleaded and proved, which was not done in the earlier attampt. Of importance in this judgement is the Court''s remark as regards the conduct of the bank. The Court remarked that the bank should have approached the Court for appropriate directions if it had any doubts. Merely because an application for injunction was made, would not be a ground for the bank not to honour its commitment under the bank guarantee.\r\n', '1', '', '', 'Yes', NULL, NULL),
(257, 1, 2, 3, 'Judgement "The relationship between the customer and the bank is that of a creditor and debtor, the bank had no authority to make payment of a cheque containing a forged signature" has been pronounced in\r\n', 'Canara Bank vs Canara Sales Corporation and Others\r\n', 'Bihta Cooperative Development and Cane Marketing Union Ltd. vs Bank of Bihar\r\n', 'Bank of Bihar vs Mahabir Lai\r\n', 'Bhutoria Trading Company (BTC) vs Allahabad Bank\r\n', '', '', '2.00', '0.00', '', '"In Bihta Cooperative Development and Cane Marketing Union Ltd. vs Bank of Bihar ""one of the signatures was forged so that there never was any mandate by the customer at all to the banker and the question of negligence of the customer in between the signature and the presentation of the cheque never arose""\r\nThe Supreme Court in Bank of Bihar vs Mahabir Lai held that a banker can seek protection under Section 85 only where payment has been made to the holder, his servant or agent, i.e. payment must be made in due course.\r\nIn Bhutoria Trading Company (BTC) vs Allahabad Bank, Calcutta high court emphasis on ""The Expression payment in due course has been defined in Section 10 of the Negotiable Instruments Act to mean payment in accordance with the apparent tenor of the instrument in good faith and without negligence to any person in possession thereof"', '1', '', '', 'Yes', NULL, NULL),
(258, 1, 2, 3, 'The Court held ''liable to pay'' appearing in the third paragraph of Section 89 included a liability to pay under an overdraft agreement as much as it applied to an ordinary deposit account" in\r\n', 'Bareilly Bank Ltd. vs Naval Kishore\r\n', 'Tanjore Permanent Bank vs S.R. Rangachari\r\n', 'Brahma Shumshere Jung Bahadur vs Chartered Bank of India, Australia and China\r\n', 'United Bank of India vs AT Ali Hussain & Co.\r\n', '', '', '2.00', '0.00', '', '"In Bareilly Bank Ltd. vs Naval Kishore, court favoured the customer against bank for not taking reasonable precaution in passing the cheque as regard to cross-verifing cheque number issued to the customer.\r\nIn Tanjore Permanent Bank vs S.R. Rangachari, the Court held that since the material alteration on both the cheques were visible and since they were not authenticated by the drawer''s initials, the payment made by the bank was not according to the apparent tenor of the instrument and as such the bank cannot claim protection under Section 89 of the Negotiable Instruments Act\r\nThe Calcutta High Court in United Bank of India vs AT Ali Hussain & Co. dismissed the appeal and held that both from the point of view of equitable principles and the doctrine of estoppel, the paying bank was disentitled to recover the money either from the collecting bank or the payee."', '3', '', '', 'Yes', NULL, NULL),
(259, 1, 2, 3, 'As per Harding vs London Joint Stock Bank, Collecting Bank is required to do which of the necessary verification before opening bank account of the customer.\r\n', 'Verifying documents of the prospecting customer and obtaining reference\r\n', 'Verifying constitution of the propective customer\r\n', 'Verifying introducer and its genuiness\r\n', 'Verifying power to operative the account from third person\r\n', '', '', '2.00', '0.00', '', 'In Harding vs London Joint Stock Bank the bank was held negligent for failure to make necessary enquiries from the employer as to whether the customer who was an employee had, in fact, the necessary power to deal with the cheque.', '4', '', '', 'Yes', NULL, NULL),
(260, 1, 2, 3, 'As per English Decision Ladbroke vs Todd, Collecting Bank is required to do which of the necessary verification before opening bank account of the customer.\r\n', 'Verifying documents of the prospecting customer and obtaining reference\r\n', 'Verifying constitution of the prospective customer\r\n', 'Verifying introducer and its genuineness\r\n', 'Verifying power to operative the account from third person\r\n', '', '', '2.00', '0.00', '', '"In English Decision Ladbroke vs Todd, the bank was held liable to make good the amount since it acted\r\nnegligently while opening the account inasmuch as it had not obtained any reference"', '1', '', '', 'Yes', NULL, NULL),
(261, 1, 2, 3, 'In Syndicate Bank vs Jaishree Industries and Others, Collecting Bank is required to do which of the necessary verification before opening bank account of the customer.\r\n', 'Verifying documents of the prospecting customer and obtaining reference\r\n', 'Verifying constitution of the prospective customer\r\n', 'Verifying introducer and its genuineness\r\n', 'Verifying power to operative the account from third person\r\n', '', '', '2.00', '0.00', '', 'In Syndicate Bank vs Jaishree Industries and Others, No information was sought or inquiry neither held as to the incorporation of the account holder nor was the memorandum of association, resolution, etc., scrutinized', '2', '', '', 'Yes', NULL, NULL),
(262, 1, 2, 3, 'In Indian Bank vs Catholic Syrian Bank, Collecting Bank is required to do which of the necessary verification before opening bank account of the customer.\r\n', 'Verifying documents of the prospecting customer and obtaining reference\r\n', 'Verifying constitution of the prospective customer\r\n', 'Verifying introducer and its genuineness\r\n', 'Verifying power to operative the account from third person\r\n', '', '', '2.00', '0.00', '', 'In Indian Bank vs Catholic Syrian Bank, account of the prospecting customer should be opened after verification and stablising genuiness of the situation under which account has been introduced.', '3', '', '', 'Yes', NULL, NULL),
(263, 1, 2, 3, 'In which case following judgement was pronounced "Non-negotiable crossing is only one of the factors amongst others to be considered to decide about the bankers, negligence and that the mere taking of a non- negotiable cheque cannot be held to be evidence of negligence on the part of the bankers."', 'Crumpling vs London Joint Stock Bank Ltd\r\n', 'Underwood Ltd. vs Bank of Liverpool Martin Ltd\r\n', 'Savory Company vs Llyods Bank\r\n', 'New Zealand Bank vs Ateliers de Constructions Electriques de Cherleroi\r\n', '', '', '2.00', '0.00', '', '"In Underwood Ltd. vs Bank of Liverpool Martin Ltd, the bank was held negligent for not making enquiries as to whether the managing director was, in fact, entitled to the amounts represented by furnished cheques.\r\nIn Savory Company vs Llyods Bank, the cheques which were payable to the employer was collected by the employee in a private account opened by him and the bank was held liable for negligence.\r\nNew Zealand Bank vs Ateliers de Constructions Electriques de Cherleroi, an agent paid his principal''s cheque into his personal account and the bank was charged with conversion"', '1', '', '', 'Yes', NULL, NULL),
(264, 1, 2, 3, 'In which case following judgement was pronounced  "Where under a letter of guarantee the bank has undertaken to pay a fixed amount to creditor and the payment of the amount guaranteed by the bank was not made dependent on the proof of any default on the part of the company in liquidation, the bank was bound to make payment to the creditor even if the company has gone for the liquidation."\r\n', 'Maharashtra Electricity Board, Bombay vs Official Liquidator, High Court of Ernakulam and Another\r\n', 'Messrs SCII (India) Limited vs Official Liquidator\r\n', 'R.D. Harbottle Ltd. vs Official Liquidator\r\n', 'R.D. Harbottle Ltd. vs Official Liquidator\r\n', '', '', '2.00', '0.00', '', 'In Maharashtra Electricity Board, Bombay vs Official Liquidator, High Court of Ernakulam and Another, Supreme Court held that bank liability to pay under bank guarantee is not based upon any future event or verification by the bank for failure of the customer.\r\n', '1', '', '', 'Yes', NULL, NULL),
(265, 1, 2, 3, 'In which case following judgement was pronounced "Except possibly in clear case of fraud of which the banks have notice, the Courts will leave the merchants to settle their disputes under the contracts by utilisation or arbitration as available to them or as stipulated in the contracts"\r\n', 'State Bank of India vs Messrs Saksaria Sugar Mills Limited\r\n', 'Texmaco Ltd. vs State Bank of India\r\n', 'United Commercial Bank vs Bank of India\r\n', 'US Court in Itek Corp. vs First National Bank of Boston\r\n', '', '', '2.00', '0.00', '', 'In United Commercial Bank vs Bank of India, judgement was pronounced "Except possibly in clear case of fraud of which the banks have notice, the Courts will leave the merchants to settle their disputes under the contracts by utilisation or arbitration as available to them or as stipulated in the contracts"\r\n', '3', '', '', 'Yes', NULL, NULL),
(266, 1, 2, 1, 'Under SARFAESI Act, 2002, the word Board is used to mean\r\n', 'Reserve Bank of India Act\r\n', 'SEBI\r\n', 'Debt recovery Tribunal\r\n', 'Securitization Company\r\n', '', '', '0.50', '0.00', '', 'The word ''Board'' is used in the Act to mean the Securities and Exchange Board of India (SEBI). It is established under the Securities and Exchange Board of India Act, 1992.\r\n\\', '2', '', '', 'Yes', NULL, NULL),
(267, 1, 2, 1, 'Which pair in not correct\r\n', 'Obligor - Borrower\r\n', 'Lender - Originator\r\n', 'Sponsor - Reserve Bank of India\r\n', 'Secured Creditor - Financial Institution\r\n', '', '', '0.50', '0.00', '', '"Originator is the owner of a financial asset that is acquired by a securitisation company or reconstruction company for the purpose of securitisation or asset reconstruction. In plain meaning, when the bank or financial institution lends money against security they are the originator.\r\nObligor means a person liable,\r\n(i) To pay to the originator, whether under a contract or otherwise, or\r\n(ii) To discharge any obligation in respect of a financial asset, whether existing, future, conditional or contingent, or\r\n(iii) and includes a borrower\r\nSponsor is an entity holding not less than ten per cent of the paid-up equity capital of securitisation or reconstruction company\r\nSecured creditor means any bank or financial institution or any consortium or group of banks or financial institutions in whose favour the security interest is created by the borrower for due repayment."\r\n', '3', '', '', 'Yes', NULL, NULL),
(268, 1, 2, 1, 'This evidences the purchaser''s undivided right, title and interest in the security\r\n', 'Ownership\r\n', 'Transfer right\r\n', 'Right to possess and enjoy\r\n', 'None of the above\r\n', '', '', '0.50', '0.00', '', 'The security receipt evidences the purchaser''s undivided right, title and interest in the security. These receipts are transferable in the market.\r\n', '4', '', '', 'Yes', NULL, NULL),
(269, 1, 2, 1, 'Which one cannot be a Qualified Institutional buyer\r\n', 'Insurance Company\r\n', 'Bank\r\n', 'A partnership firm with financial experience\r\n', 'A foreign Institutional investor\r\n', '', '', '0.50', '0.00', '', 'Such buyer means a financial institution or an insurance company or a bank or a state financial corporation or state industrial development corporation or trustee or any asset management company, making an investment on behalf of a mutual fund or provident fund or gratuity fund or pension fund or a foreign institutional investor, registered under the SEBI Act, 1992 or any other body corporate as may be specified by SEBI. This definition covers several categories of institutional investors but does not include a company registered under the Companies Act, 1956. If any company wants to become a qualified institutional buyer then it will have to get such a registration from SEBI.', '3', '', '', 'Yes', NULL, NULL),
(270, 1, 2, 1, 'Which statement is correct\r\n', 'An asset reconstruction company need not be registered under Companies Act\r\n', 'A foreign institutional investor to be registered with RBI\r\n', 'SARFAESI Act not applicable to RRBs\r\n', 'Securitization Company has also to be registered with SEBI\r\n', '', '', '0.50', '0.00', '', 'The securitisation company can set up separate trusts scheme wise and act as trustee for such schemes, as provided in the Securitisation Companies and Reconstruction Companies (Reserve Bank) Guidelines and Directions, 2003. The investors in the securitisation company are the beneficiaries of such trusts\r\n', '3', '', '', 'Yes', NULL, NULL),
(271, 1, 2, 1, 'Securitisation companies can set up separate trusts scheme wise and act as trustee for such schemes. The beneficiaries of such trusts are\r\n', 'Trustees\r\n', 'Borrowers\r\n', 'Creditors\r\n', 'None of the above\r\n', '', '', '0.50', '0.00', '', 'The securitisation company can set up separate trusts scheme wise and act as trustee for such schemes, as provided in the Securitisation Companies and Reconstruction Companies (Reserve Bank) Guidelines and Directions, 2003. The investors in the securitisation company are the beneficiaries of such trusts.\r\n', '4', '', '', 'Yes', NULL, NULL),
(272, 1, 2, 1, 'The securitization company or reconstruction company can acquire financial asset of any bank or financial institution by issuing\r\n', 'Debenture\r\n', 'Bond\r\n', 'Any other security\r\n', 'Any one of the above\r\n', '', '', '0.50', '0.00', '', '"The securitisation company or the reconstruction company can acquire the financial asset of any bank or financial institution by any of the following ways:\r\n(i) By issuing a debenture or bond or any other security in the nature of debenture for the agreed consideration and agreed terms and conditions between the bank/financial institution and the securitisation company/reconstruction company as the case may be,\r\n(ii) By entering into an agreement with such bank or financial institution for the transfer of financial asset to such company on terms and conditions as may be agreed between them."\r\n', '4', '', '', 'Yes', NULL, NULL),
(273, 1, 2, 1, 'Indentify the odd one (Debenture)\r\n', 'A debenture for payment of consideration to be paid to the bank for acquisition of financial asset from it\r\n', 'The rate of interest on debenture cannot be more than 1.5% above Bank rate\r\n', 'Redemption period not beyond 6 years\r\n', 'Reconstruction company to issue debenture\r\n', '', '', '0.50', '0.00', '', 'A debenture, for the payment of consideration, is to be paid to the bank or the financial institution for the acquisition of financial asset from it. As per the extant guidelines from RBI, the rate of interest offered in the debenture cannot be less than one and half per cent above the Bank Rate as on the date of issue of the debentures and the period of redemption of debenture cannot exceed six years.\r\n', '2', '', '', 'Yes', NULL, NULL),
(274, 1, 2, 1, 'Indentify the odd one (Debenture)\r\n', 'A debenture for payment of consideration to be paid to the bank for acquisition of financial asset from it\r\n', 'The rate of interest on debenture cannot be more than 1.5% above Bank rate\r\n', 'Redemption period not beyond 6 years\r\n', 'Reconstruction company to issue debenture\r\n', '', '', '0.50', '0.00', '', 'A debenture, for the payment of consideration, is to be paid to the bank or the financial institution for the acquisition of financial asset from it. As per the extant guidelines from RBI, the rate of interest offered in the debenture cannot be less than one and half per cent above the Bank Rate as on the date of issue of the debentures and the period of redemption of debenture cannot exceed six years.\r\n', '2', '', '', 'Yes', NULL, NULL);
INSERT INTO `questions` (`id`, `qtype_id`, `subject_id`, `diff_id`, `question`, `option1`, `option2`, `option3`, `option4`, `option5`, `option6`, `marks`, `negative_marks`, `hint`, `explanation`, `answer`, `true_false`, `fill_blank`, `status`, `created`, `modified`) VALUES
(275, 1, 2, 1, 'A securitisation company or reconstruction company can raise funds by way of deposits\r\n', 'Not False\r\n', 'Not true\r\n', 'Not applicable to securitization company but to reconstruction company\r\n', 'Not applicable to reconstruction company but to securitisation company\r\n', '', '', '0.50', '0.00', '', 'Acquisition may be by raising of funds by such a securitisation or reconstruction company from the qualified institutional buyers by issue of security receipts representing undivided interest in the financial assets or otherwise.\r\n', '2', '', '', 'Yes', NULL, NULL),
(276, 1, 2, 1, 'Identify the incorrect one (securitization)\r\n', 'Non-performing asset is linked to overdue period which is 90 days now\r\n', 'If the asset is taken for reconstruction limit is 7 years for reconstruction\r\n', 'Capital adequacy of 15% to be there\r\n', 'While issuing security receipts necessary disclosures to be made without fail\r\n', '', '', '0.50', '0.00', '', '"Important points from the guidelines issued until October 2004 by the RBI are as under:\r\n(i) On the acquisition of a financial asset that has been classified by the bank or financial institution as a non-performing asset, the securitisation company or the reconstruction company has to formulate a plan for realisation of such an asset within twelve months. During such a planning period, the asset can be classified as a Standard Asset, \r\n(ii) Definition of a non-performing asset, has been linked to an overdue period, which is now ninety days, \r\n(iii) Any entity not registered with the Reserve Bank of India under the SARFAESI Act, may conduct the business of securitisation or asset reconstruction outside the purview of SARFAESI Act. \r\n(i v) The securitisation company or reconstruction company can undertake activities and functions as given in the SARFAESI Act and no other business.\r\n(v) A securitisation company or reconstruction company cannot raise money by way of deposits, \r\n(vi) At the time of enforcing securities as per provisions of the SARFAESI Act, the securitisation company or reconstruction company may itself acquire secured assets for use or resale if such resale is through a public auction, \r\n(vii) When the asset is acquired for reconstruction there is a limit of five years for such reconstruction, \r\n(viii) The securitisation company or reconstruction company is permitted to set up trusts that can issue security receipts. Trusteeship of such trusts vests in the concerned securitisation or reconstruction company, \r\n(ix) While issuing security receipts, detailed disclosures are required to be made by the concerned securitisation or reconstruction company, \r\n(x) The balance sheet of the asset acquiring company should disclose names and addresses of the banks/financial institutions from whom the assets are acquired with values thereof, industry-wise and sponsor-wise dispersion of assets and related party disclosures, \r\n(xi) Maintaining of the capital adequacy of fifteen per cent of total assets acquired or the capital of Rs. 100 crore, whichever is less."\r\n', '2', '', '', 'Yes', NULL, NULL),
(277, 1, 2, 1, 'The date agreed upon by the secured creditors representing not less than three-forth in value of the amount outstanding on such date\r\n', 'Agreement Date\r\n', 'Agreed date\r\n', 'Record date\r\n', 'Due date\r\n', '', '', '0.50', '0.00', '', '"If the borrower pays the entire dues, costs charges and expenses incurred by the creditor at any time before the date fixed for sale or transfer, the secured creditor shall not sell or transfer the secured asset and no further steps shall be taken for sale or transfer. In cases of joint finance or consortium finance by two or more secured creditors no secured creditor can take any action of taking possession of secured asset, unless exercise of such right is agreed upon by the secured creditors representing not less than three-fourths in value of the outstanding dues on the record date.\r\nThe ''record date'' means the date agreed upon by the secured creditors representing not less than three-fourths in value, of the amount outstanding on such date."', '3', '', '', 'Yes', NULL, NULL),
(278, 1, 2, 1, 'In case of sale of immovable property the borrower should be given notice about the sale before\r\n', '60 days\r\n', '2 months\r\n', '90 days\r\n', 'None of these\r\n', '', '', '0.50', '0.00', '', 'The authorised officer is required to publish the possession notice in two leading newspapers, one of which should be in the local vernacular language thirty days before sale of the immoveable property, the borrower should be given a notice about the sale.', '4', '', '', 'Yes', NULL, NULL),
(279, 1, 2, 1, 'An authorized officer has finanlised the sale of property for Rs. 10 lacs. Then the purchaser has to remit\r\n', 'The amount immediately\r\n', 'Within 15 days\r\n', '25% of the offer price\r\n', 'Nothing at once\r\n', '', '', '0.50', '0.00', '', 'When the offer of sale of property is accepted by the purchaser and the secured creditor accepting the offer confirms the sale, the purchaser has to deposit twenty-five per cent of the offer price.\r\n', '3', '', '', 'Yes', NULL, NULL),
(280, 1, 2, 1, 'The authorized officer can\r\n', 'Accept the offer\r\n', 'confirm the sale\r\n', 'issue sale certificate\r\n', 'perform all the above\r\n', '', '', '0.50', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(281, 1, 2, 1, 'Securitisation ( identify the odd one)\r\n', 'For taking possession and then sell the immovable property (under mortgage) court permission required\r\n', 'Court permission not required\r\n', 'The authorization officer to publish the possession notice\r\n', 'In two leading newspaper\r\n', '', '', '0.50', '0.00', '', 'When immovable property is obtained as security by way of mortgage for its sale and realisation of money, Court intervention is required\r\n', '2', '', '', 'Yes', NULL, NULL),
(282, 1, 2, 1, 'An appeal to the Appellate Tribunal is to be preferred within\r\n', '30 days from the date of receipt of the order of Debts Recovery Tribunal\r\n', '30 days\r\n', '60 days\r\n', 'None of these\r\n', '', '', '0.50', '0.00', '', 'Any person aggrieved by any order made by the debts recovery tribunal can prefer an appeal along with the prescribed fees to the Appellate Tribunal within thirty days from the date of receipt of the order of debts recovery tribunal.\r\n', '1', '', '', 'Yes', NULL, NULL),
(283, 1, 2, 1, 'A record to be maintained at the central registered at their head office to record transactions relating to\r\n', 'Securitization of financial assets\r\n', 'reconstruction of financial assets\r\n', 'Creation of security interests\r\n', 'All the above\r\n', '', '', '0.50', '0.00', '', 'Under this Act, ''Central Registry'' means the registering office, set up or caused to be set up by the Central Government. With this proposed set up, all the transactions of asset securitisation, reconstruction as well as transactions of creation of security interests, will have to be registered with this authority.', '4', '', '', 'Yes', NULL, NULL),
(284, 1, 2, 1, 'When any security interest is registered with the Central Registrar is modified, the same is required to be filed before Central Registrar within\r\n', '30 days\r\n', 'One month\r\n', '45 days\r\n', '60 days\r\n', '', '', '0.50', '0.00', '', 'Whenever any security interest is registered with the central registrar is modified, the modification is required to be filed before central registrar. It is the duty of the securitisation or the reconstruction company or the secured creditor to file the modification. For filing the modification same provisions as are made for registration of charge apply. This means, modification will have to be filed within thirty days in the prescribed forms with prescribed fees. Delay condonation will be for a period of next thirty days on payment of fees not more than ten times of the prescribed fees.\r\n', '1', '', '', 'Yes', NULL, NULL),
(285, 1, 2, 1, 'If a reconstruction company fails to comply with any of the directions of RBI then the company is punishable with fine not exceeding\r\n', 'Rs. 1 lac for the default\r\n', 'Rs. 5000/- per day\r\n', 'Rs. 10000/- per day\r\n', 'Rs. 5 lacs\r\n', '', '', '0.50', '0.00', '', 'Under the Section 12 of the SARFAESI Act, the Reserve Bank of India is statutorily empowered to issue directions to the securitisation or reconstruction company. If any such company fails to comply with any of the directions issued by the Reserve Bank of India, then such company is punishable with a fine not exceeding Rs. 5 lakh for the default. In case of further continuation of the offence, an additional fine up to Rs. 10,000 per day of the default can be imposed.\r\n', '4', '', '', 'Yes', NULL, NULL),
(286, 1, 2, 1, 'Provisions of SARFAESI Act not applicable for\r\n', 'A pledge of movable assets\r\n', 'Hire purchase or lease in which no security interest has been created\r\n', 'Any security interest created in agricultural land\r\n', 'All the above\r\n', '', '', '0.50', '0.00', '', '"Section 31 gives the exclusions for securities that can be taken possession of and to some other specific securities to which the Act is not applicable. These exclusions, to which the provisions of the Act are not applicable, are\r\n(i) A lien, on any goods, money or security given by or under the Indian Contract Act, 1872 or the Sale of Goods Act, 1930 or any other law for the time being in force.\r\n(ii) A pledge of movable, within the meaning of Section 172 of the Indian Contract Act, 1872. \r\n(iii) Creation of security interest in any vessel as defined within the meaning of Section 3(55) of the Merchant Shipping Act, 1958.\r\n(iv) Creation of security in any aircraft as defined in Section 2 of Aircraft Act 1934. \r\n(v) Any conditional sale, hire-purchase or lease or any other contract in which no security interest has been created.\r\n(vi) Any rights of unpaid seller under Section 47 of the Sale of Goods Act, 1930. \r\n(vii) Any properties not liable for attachment or sale under the first proviso to Section 60(1) of the Civil Procedure Code, 1908.\r\n(viii) Any security interest for securing repayment of any financial asset not exceeding one lakh rupees, \r\n(ix) Any security interest created in agricultural land, \r\n(x) Any case, in which the amount due is less than twenty per cent of the principal amount and interest thereunder."\r\n', '4', '', '', 'Yes', NULL, NULL),
(287, 1, 2, 1, 'A bank has realized part of the liability by using securitization procedure. The balance outstanding is Rs. 12 lacs without any tangible security\r\n', 'Bank will have to forego\r\n', 'Bank can approach DRT\r\n', 'Bank cannot approach any court\r\n', 'Bank will have to write off\r\n', '', '', '0.50', '0.00', '', 'If after sale of securities the claim is not fully satisfied and still there are any dues to be recovered from the borrower, the creditor is required to file civil suit before the Civil Court or a claim before the debt recovery tribunal within the limitation period.', '2', '', '', 'Yes', NULL, NULL),
(288, 1, 2, 1, 'After recovery through securitization process for balance outstanding to recover the bank can approach competent court provided\r\n', 'Limitation period is not over\r\n', 'Debt is time barred\r\n', 'Limitation period has not been extended\r\n', 'Borrower agrees\r\n', '', '', '0.50', '0.00', '', 'If after sale of securities the claim is not fully satisfied and still there are any dues to be recovered from the borrower, the creditor is required to file civil suit before the Civil Court or a claim before the debt recovery tribunal within the limitation period.\r\n', '1', '', '', 'Yes', NULL, NULL),
(289, 1, 2, 1, 'Banking Ombudsman review authority is\r\n', 'Ombudsman himself\r\n', 'Awarding official\r\n', 'RBI Executive Director\r\n', 'None of them\r\n', '', '', '0.50', '0.00', '', 'Any person aggrieved by the award has the right to prefer an appeal against the award before the appellate authority within forty-five days form the date of receipt of the award. So appellate authority is the review authority.\r\n', '4', '', '', 'Yes', NULL, NULL),
(290, 1, 2, 1, 'Which one is incorrect in case of Banking Ombudsman ', 'Provided with a secretariat\r\n', 'Cost of secretariat to be borne by RBI\r\n', 'Remuneration to be decided by RBI\r\n', 'He can not act as an arbitrator\r\n', '', '', '0.50', '0.00', '', '"The scheme was introduced with the following objectives:\r\n(i) To resolve complaints relating to banking services and to facilitate the satisfaction or settlement of such complaints, \r\n(ii) Resolve disputes between a bank and its constituents as well as amongst banks, through the process of conciliation, meditation and arbitration"\r\n', '4', '', '', 'Yes', NULL, NULL),
(291, 1, 2, 1, 'Banking ombudsman - identify odd one\r\n', 'Non-adherenace of prescribed working hours by branch\r\n', 'Observance of RBI directives on interest rates\r\n', 'Failure to pay guarantee amount\r\n', 'Non-issue of drafts to non-customers\r\n', '', '', '0.50', '0.00', '', 'Complaint can be filed are exhaustive and cover all of the services the bank offers to its customers. The grounds include some  matters related to loans and advances also. Though there cannot be a complaint for not sanctioning a loan, it can be for non-observance of RBI directives, delay in decision, interest rate directives and non-acceptance of a loan application.', '1', '', '', 'Yes', NULL, NULL),
(292, 1, 2, 1, 'DRT Act not applicable to\r\n\r\n', 'Nationalized Banks\r\n', 'Regional Rural Banks\r\n', 'State Bank of India\r\n', 'None of these\r\n', '', '', '0.50', '0.00', '', '"The Act is applicable for the debt due to any bank or financial institution or a consortium of them, when the debt is above Rupees ten lakh.\r\n''Bank'' means, a banking company, a corresponding new bank, i.e., bank commonly known as Nationalised Bank established with the Act that Nationalised them, State Bank of India and its subsidiary bank or a Regional Rural Bank."\r\n', '4', '', '', 'Yes', NULL, NULL),
(293, 1, 2, 1, 'Under DRT Act, a recovery officer is one who is\r\n', 'Appointed by the respective Banks\r\n', 'Also known as authorized officer\r\n', 'Appointed by the central government\r\n', 'Also called presiding officer\r\n', '', '', '0.50', '0.00', '', 'Recovery Officer'' means a recovery officer appointed by the Central Government for each tribunal under the sub-Section (1) of Section 7.', '3', '', '', 'Yes', NULL, NULL),
(294, 1, 2, 1, 'Which one is incorrect (DRT)\r\n', 'An application for execution of decree of foreign court cannot be entertained by Debt Recovery Tribunal\r\n', 'The limitation Act applies for DRT cases\r\n', 'Other Bank can join the application\r\n', 'Tribunal to deal with cases above Rs. 10 lacs\r\n', '', '', '0.50', '0.00', '', '"In Bank of India vs Harshadrai Odhavji Mody, Bombay High Court has held that an application for execution of the decree of foreign court can be entertained by the Debt Recovery Tribunal.\r\n\r\nFor application to be filed before the Tribunal the Limitation Act, 1963 apply. This means that the application must be filed by the bank or the financial institution within three years from cause of action.\r\n\r\nWhere a bank or a financial institution has filed application under Section 19(1) before the Tribunal for recovery of its debt and if from the same person another bank or financial institution has also to recover any debt, then such later bank or financial institution may join the applicant bank or financial institution in already filed application at any stage of the proceedings before the final order is passed [Section 19(2)] by making an application.\r\n\r\nThe Act is applicable for the debt due to any bank or financial institution or a consortium of them, when the debt is above Rupees ten lakh."', '1', '', '', 'Yes', NULL, NULL),
(295, 1, 2, 1, 'Identify the correct mode of recovery of debts (DRT)\r\n', 'Attachment and sale of movable property\r\n', 'Sale of immovable property of the defendant\r\n', 'Arrest of the defendant and his detention in prison\r\n', 'Any one of the above\r\n', '', '', '0.50', '0.00', '', '"On receipt of the copy of the recovery certificate issued under Section 19(22), the Recovery Officer has to proceed to recover the amount specified in the certificate by one or more of the following modes:\r\n(i) attachment and sale of movable and immovable property of the defendants; \r\n(ii) arrest of the defendant and his detention in prison; (iii) appointment of a receiver for the management of the movable and immovable properties of the defendant. \r\nThe Recovery Officer can sell any of the property owned by the defendant"', '4', '', '', 'Yes', NULL, NULL),
(296, 1, 2, 1, 'The recovery certificate which has been issued required rectification of arithmetical mistake. It can be done by\r\n', 'The banker himself\r\n', 'The competent court\r\n', 'The officer of the DRT\r\n', 'None of these persons\r\n', '', '', '0.50', '0.00', '', 'The Presiding Officer of the Tribunal who had issued the recovery certificate is authorised to withdraw the certificate or correct any clerical or arithmetical mistake in the certificate.\r\n', '4', '', '', 'Yes', NULL, NULL),
(297, 1, 2, 1, 'Any person aggrieved by the order of  recovery officer may appeal to the tribunal within \r\n', '15 days\r\n', '30 days\r\n', '30 days from the date of the order\r\n', '30 days from the date of receipt of the copy of the order\r\n', '', '', '0.50', '0.00', '', 'Section 30 provides that any person aggrieved by the order of Recovery Officer may appeal within thirty days to the Tribunal. The period of thirty days is to be counted from the receipt of the copy of the order by such person.', '4', '', '', 'Yes', NULL, NULL),
(298, 1, 2, 1, 'According to Bankers'' Book evidence Act identify the correct one\r\n', 'The Act extends to the whole of India including the state of Jammu and Kashmir\r\n', 'For a computer print out certificate by the principal accountant is not acceptable\r\n', 'The certified copy need not have any declaration\r\n', 'The Act is not applicable to the State of Jammu & Kashmir\r\n', '', '', '0.50', '0.00', '', 'The Act extends to the whole of India except the State of Jammu & Kashmir\r\n', '4', '', '', 'Yes', NULL, NULL),
(299, 1, 2, 1, 'For inspection of books by order of court the same has to be served in the bank\r\n', 'Any time before banking business hours\r\n', 'Any of its branches\r\n', 'At least a week before the same is to be obeyed\r\n', 'None of these\r\n', '', '', '0.50', '0.00', '', 'The order so passed shall be served on the bank at least three clear working days before the same is to be obeyed.\r\n', '4', '', '', 'Yes', NULL, NULL),
(300, 1, 2, 1, 'A dispute where the person against whom compliant has been made, denies or disputes the allegations contained in the complaint refers to\r\n', 'Consumer Dispute\r\n', 'Customer Dissatisfaction\r\n', 'Consumer Compliant\r\n', 'Deficiency in Customer Service\r\n', '', '', '0.50', '0.00', '', 'Consumer dispute'' means a dispute where the person against whom complaint has been made, denies or disputes the allegations contained in the complaint.\r\n', '1', '', '', 'Yes', NULL, NULL),
(301, 1, 2, 1, 'Under the consumer Protection Act, who is not treated as a "Person"\r\n', 'An unregistered firm\r\n', 'a registration firm\r\n', 'a co-operative society\r\n', 'None of the above\r\n', '', '', '0.50', '0.00', '', '"Person'' includes\r\n(i) a firm whether registered or not; \r\n(ii) a Hindu undivided family; \r\n(iii) a co-operative society;\r\n(iv) every other association of persons whether registered under the Societies Registration Act, 1860 or not"\r\n', '4', '', '', 'Yes', NULL, NULL),
(302, 1, 2, 1, 'J applied for a loan which the bank considered. However J went to the consumer forum claiming that the loan was inadequate. Then the consumer forum\r\n', 'Can direct the bank to give balance loan\r\n', 'Cannot direct bank\r\n', 'Can ascertain the consumer''s request\r\n', 'None of these\r\n', '', '', '0.50', '0.00', '', 'In Jagannath Meher vs Branch Manager, State Bank of India ,it was held that where a loan was sanctioned by the bank but the complaint that the loan was inadequate to start the industry is not tenable. It was held that the Consumer Forum cannot override the decision taken by the bank as that was a power of discretion of the bank and there was no reason that the bank acted otherwise than in good faith.', '2', '', '', 'Yes', NULL, NULL),
(303, 1, 2, 1, 'Which one is incorrect\r\n', 'The state consumer protection council to meet at least two times every year\r\n', 'The district consumer protection council to meet at least two times every year\r\n', 'The central consumer protection council to meet at least two times every year\r\n', 'The highest council is the National Council\r\n', '', '', '0.50', '0.00', '', '"The Central Council shall meet as and when necessary but at least once in a year.\r\nThe State Council shall meet as and when necessary. There has to be at least two meeting every year.\r\nThe District Council shall meet as and when necessary. There has to be at least two meeting every year."\r\n', '3', '', '', 'Yes', NULL, NULL),
(304, 1, 2, 1, 'Identify the odd one (Consumer Disputes Redressal Agencies)\r\n', 'National Commission\r\n', 'District Forum\r\n', 'Central Council\r\n', 'State Commission\r\n', '', '', '0.50', '0.00', '', '"District Forum'' means a Consumer Dispute Redressal Forum established under Clause (a) of Section 9 under this Act.\r\n''National Commission'' means the National Consumer Disputes Redressal Commission established under Clause (c) of Section 9.\r\n''State Commission'' means a Consumer Disputes Redressal Commission established in a state under Clause (b) of Section 9 of the Act.\r\nThe Central Government has established a consumer council known as the Central Consumer Protection Council, called as Central Council.\r\nThe Central Council shall consist of the following:\r\n(i) The Minister-in-Charge of the Consumer Affairs in the Central Government, who shall be the Chairman of the Council, and \r\n(ii) Such number of other official or non-official members representing such interests as may be prescribed."\r\n', '3', '', '', 'Yes', NULL, NULL),
(305, 1, 2, 1, 'Every member of the District Forum to hold office for a term of three years or up to the age of sixty-five years, whichever is earlier\r\n', 'TRUE\r\n', 'FALSE\r\n', 'Partially True\r\n', 'It is not 3 years but 5 years\r\n', '', '', '0.50', '0.00', '', 'Every member of the District Forum shall hold office for a term of five years or up to the age of sixty-five years, which ever is earlier\r\n', '4', '', '', 'Yes', NULL, NULL),
(306, 1, 2, 1, 'An appeal against the district Forum''s order has to be filed before State Commission within 30 days. In case of monetary involvement the person filing appeal\r\n', 'Need not remit any amount\r\n', 'Has to remit 50% of the amount ordered\r\n', 'Rs. 25,000\r\n', 'B & C whichever is less\r\n', '', '', '0.50', '0.00', '', 'Any person aggrieved by the order passed by the District Forum may prefer as appeal to the State Commission within a period of thirty days from the date of order, in the form and manner as may be prescribed. The appeal cannot be filed without payment of 50 per cent or the amount ordered to be paid or Rs. 25,000, whichever is less.', '4', '', '', 'Yes', NULL, NULL),
(307, 1, 2, 1, 'For filing any compliant before a District Forum, State Commission or the National Commission the limitation period from the date of cause of action is\r\n', '1 year\r\n', '2 years\r\n', '3 years\r\n', 'No limitation period\r\n', '', '', '0.50', '0.00', '', 'For filing any complaint before a District Forum, State Commission or the National Commission the limitation period is two years from the date of cause of action.', '2', '', '', 'Yes', NULL, NULL),
(308, 1, 2, 1, 'An agreement involving 3 persons is called\r\n', 'Unilateral Agreement\r\n', 'Bilateral Agreement\r\n', 'Multi person agreement\r\n', '', '', '', '0.50', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(309, 1, 2, 1, 'It is the delivery of goods by one person to another for some purpose. When the purpose is accomplished, the goods are to be returned or otherwise disposed of according to the direction of the person delivering them\r\n', 'Hypothecation\r\n', 'Bailment\r\n', 'Assignment\r\n', 'Mortgage\r\n', '', '', '0.50', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(310, 1, 2, 1, 'Under pledge the pledgee is the\r\n', 'Debtor\r\n', 'Creditor\r\n', 'Borrower\r\n', 'None of them\r\n', '', '', '0.50', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(311, 1, 2, 1, 'Termination of agency is possible\r\n', 'Principal revoking his authority\r\n', 'Agent dies during the agency period\r\n', 'Principal is adjudicated as insolvent\r\n', 'All the above\r\n', '', '', '0.50', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(312, 1, 2, 1, 'Which one does not pertain to sale\r\n', 'The risk in goods is with the buyer\r\n', 'The Seller can only sue for damages\r\n', 'It is a contract in which the parties have already performed their part\r\n', 'The ownership of goods have already passed irrespective of whether the goods are delivered or not\r\n', '', '', '0.50', '0.00', '', '"Sale\r\n1. A sale is a contract in which the parties have already performed their part.\r\n2. In a sale the ownership of goods have already passed, irrespective of whether the goods are delivered or not.\r\n3. The risk in goods is with the buyer.\r\n4. In a sale, if the seller does not deliver the goods, the buyer can file a suit and demand specific performance and delivery of the goods.\r\n5. If the buyer does not pay for the goods the seller can claim file a suit and demand the price."\r\n', '2', '', '', 'Yes', NULL, NULL),
(313, 1, 2, 1, 'It is a stipulation collateral to the main purpose of the contract. The breach of such a stipulation gives rise to a claim for damages only\r\n', 'Condition\r\n', 'Warranty\r\n', 'Guarantee\r\n', 'Stipulation\r\n', '', '', '0.50', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(314, 1, 2, 1, 'The unpaid seller (which one is not correct)\r\n', 'Right not to withhold delivery of goods\r\n', 'Right to re-sale\r\n', 'A lien on the goods for the price while he is in possession of them\r\n', 'Right to stop goods in transit\r\n', '', '', '0.50', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(315, 1, 2, 1, 'This type of partnership can be dissolved by any partner by giving notice in writing to all the other partners of his intention to dissolve the firm\r\n', 'Ordinary Partnership\r\n', 'Partnership at Will\r\n', 'Special Partnership\r\n', 'Particular partnership\r\n', '', '', '0.50', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(316, 1, 2, 1, 'The implied authority of a partner does not empower him to\r\n', 'Open a banking account on behalf of the firm in his own name\r\n', 'Withdraw a suit filed on behalf of the firm\r\n', 'Admit any liability in a suit against him\r\n', 'Enter into partneship on behalf of the firm\r\n', '', '', '0.50', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(317, 1, 2, 1, 'A minor who was admitted to receive the benefits of a firm, on attaining majority and becoming a partner\r\n', 'His rights and liabilities as a minor continue upto the date on which he becomes a partner\r\n', 'He is personally liable to 3rd parties for all the acts of the firm done\r\n', 'Since has was admitted to the benefirs of the firm\r\n', 'All the above are applicable\r\n', '', '', '0.50', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(318, 1, 2, 1, 'Which one is correct\r\n', 'Registration of a firm is optional\r\n', 'Registration of a company is not compulsory\r\n', 'A firm does not have a perpetual existence\r\n', 'Common seal is not applicable to a firm\r\n', '', '', '0.50', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(319, 1, 5, 1, 'In the formula, Interest = Principal Ã— Rate Ã— Time, Rate is________and Time is_____', 'Bank rate of interest, One year period of time', 'Rate of interest percent per annual, period expressed in years for which some amount is borrowed or lent', 'Average rate per annual, Periodicity of applying interest', 'Market rate of interest, Initial period fixed for repayment', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
