(321, 1, 5, 1, ' An annuity is ordinary annuity:', 'If payments are required to be made at the beginning of each period.', 'If payments are required to be made at the middle of each period.', 'If payments are required to be made at the end of each period.', 'If payments are required to be made at ordinary installments.', '', '', '1.00', '0.00', '', 'Ordinary Annuity: Payments are required at the end of each period. For an illustration, straight bonds usually make coupon payments at the end of every six months until the bond''s maturity date.', '3', '', '', 'Yes', NULL, NULL),
(322, 1, 5, 1, 'Which of the following are calculations involved in calculation of annuity:', 'Calculating the future value of an ordinary annuity', 'Calculating the present value of an ordinary annuity', 'Calculating the future value of an annuity due', 'All the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(323, 1, 5, 1, 'The present value of an ordinary annuity is ', 'Less than the present value of an annuity due', 'More than the present value of an annuity due', 'Same as the present value of an annuity due', 'Nothing can be said conclusively', '', '', '1.00', '0.00', '', '', '1', 'True', '', 'Yes', NULL, NULL),
(324, 2, 5, 1, 'An annuity is annuity due, If payments are required to be made at the beginning of each period.', 'jhj', '', '', '', '', '', '1.00', '0.00', '', 'Annuity Due: Payments are required at the beginning of each period. Rent is an illustration of annuity due. You are usually required to pay rent when you first move in at the beginning of the month, and then on the first of each month thereafter.', '', 'True', '', 'Yes', NULL, NULL),
(325, 1, 5, 1, 'Annuities are:', 'Series of payments (Many number of cash flows) made at a specified frequeny over the course of a fixed period of time.', 'Lump sum payments made anytime during the course of a fixed period of time.', 'The annual interest payable or receivable in a debt or an investment', 'The total amount payable annually in respect of a debt or investment.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(326, 1, 5, 1, 'An annuity is ordinary annuity', 'If payments are required to be made at the beginning of each period.', 'If payments are required to be made at the middle of each period.', 'If payments are required to be made at the end of each period.', 'If payments are required to be made at ordinary installments.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(327, 1, 5, 1, 'Sinking fund is characterized by ', 'When some specified amount is needed in future, accumulation of the fund by means of equal periodic deposits is known as sinking fund', 'Sinking funds may be used to redeem bond issues', 'funds may be sued to replace worn out equipments or to buy new equipments', 'All of the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(328, 1, 5, 1, 'In relation to paying of long term loans the sum of the interest payments and the sinking fund payment is called:', 'Book value', 'Periodic expense', 'Cost of the debt', 'II & III', '', '', '1.00', '0.00', '', 'The book value of the borrower''s debt at any time as the original principal, minus the amount in the sinking fund. The book value of the debt, may be considered as the outstanding balance of the loan. Hence answer is II&III', '4', '', '', 'Yes', NULL, NULL),
(329, 1, 5, 1, 'Which of the following are true about Debentures', 'Debenture holders are entitled to received a guarantee amount during the period of the debenture.', 'Debenture holders are entitled to be paid the guaranteed amount irrespective of the fact that the debenture issuing company runs into loss or not.', 'Debenture holders do not normally get any voting right in the company', 'All of the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(330, 1, 5, 1, 'The rate of return required by investors in the market for owning a bond is called the:', 'Coupon', 'Face value', 'Maturity', 'Yield to maturity', 'Coupon rate', '', '1.00', '0.00', '', 'It is the rate of return earned by an investor, who purchases a bond and holds it until the maturity. The YTM is the discount rate, which equals the present value of promised cash flows to the current market price/purchase price.', '4', '', '', 'Yes', NULL, NULL),
(331, 1, 1, 1, 'Which bond would most likely possess the least degree of interest rate risk?', '8% coupon rate, 10 years to maturity', '10% coupon rate, 10 years to maturity', '12% coupon rate, 10 years to maturity', '8% coupon rate, 20 years to maturity', '12% coupon rate, 20 years to maturity', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(332, 1, 5, 1, 'Which of the following statements regarding bond pricing is true?', 'The lower the discount rate, the more valuable the coupon payments are today.', 'Bonds with high coupon payments are generally (all else being the same) more sensitive to changes in interest rates than bonds with lower coupon payments.', 'When market interest rates rise, bond prices will also rise, all else being the same.', 'Bonds with short maturities are generally (all else being the same) more sensitive to changes in interest rates than bonds with longer maturities.', 'All else being the same, bonds with larger coupon payments will have a lower price today.', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(333, 1, 5, 1, 'The stock valuation model that determines the current stock price as the next dividend divided by the (discount rate less the dividend growth rate) is called the:\r\n', 'Zero growth model', 'Dividend growth model', 'Capital asset pricing model', 'Earnings capitalization model', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(334, 1, 5, 1, 'A stock''s next expected dividend divided by the current stock price is the:', 'Current yield', 'Total yield', 'Dividend yield', 'Capital gains yield', 'Earnings yield', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(335, 1, 5, 1, 'The net present value (NPV) rule can be., best stated as:', 'An investment should be accepted if, and only if, the NPV is exactly equal to zero.', 'An investment should be rejected if the NPV is positive and accepted if it is negative.', 'An investment should be accepted if the NPV is positive and rejected if it is negative.', 'An investment with greater cash inflows than cash outflows, regardless of when the cash flows occur, will always have a positive NPV and therefore should always be accepted.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
