(344, 1, 5, 1, 'Which one is not based on passage of time?', 'Straight line', 'Sum-of-the years', 'Declining balance', 'Units of production', '', '', '1.00', '0.00', '', 'To calculate depreciation charges using the sum of the years'' digits method, take the expected life of an asset (in years) count back to one and add the figures together. This is a method of calculating depreciation of an asset that assumes a higher depreciation charge and a greater tax benefit in the early years of an asset''s life.', '2', '', '', 'Yes', NULL, NULL),
(345, 1, 5, 1, 'Depreciation expense in the declining balance method is calculated by the depreciation rate:', 'Time book value at the beginning of the year', 'Also book value at the end of the year', 'Divided by book value at the beginning of year', 'Times accumulated depreciation at year-end', '', '', '1.00', '0.00', '', 'Depreciation each year is calculated on the book value at the beginning of each year times the rate.', '1', '', '', 'Yes', NULL, NULL),
(346, 1, 5, 1, 'If a car is depreciated in four years, the rate of depreciation using twice the straight-line rate is', '-25%', '50%', '100%', '75%', '', '', '1.00', '0.00', '', 'Four years under straight line would be Â¼ each year or 25 percent, which is multiplied times 2.', '2', '', '', 'Yes', NULL, NULL),
