(351, 2, 5, 1, 'Accountancy and bookkeeping are the same.', '', '', '', '', '', '', '1.00', '0.00', '', 'Bookkeeping is the process of recording, in chronological order, the daily transactions of a business entity. It forms part of the accounting information system. On the other hand, accounting is an information system â€“ includes the process of recording, classifying, summarizing, reporting, analyzing and interpreting the financial condition and performance of a business â€“ in order to communicate it to stakeholders for business decision making.', '', 'False', '', 'Yes', NULL, NULL),
(352, 2, 5, 1, 'Accounting records all types of transactions including quarrels between the management and workers, etc.', '', '', '', '', '', '', '1.00', '0.00', '', 'accounting records only  cash and cash equivalent  transactions of business.', '', 'False', '', 'Yes', NULL, NULL),
(353, 2, 5, 1, 'Accounting Standard 1, deals with depreciation.', '', '', '', '', '', '', '1.00', '0.00', '', 'Disclosure of Accounting Policies', '', 'False', '', 'Yes', NULL, NULL),
