(357, 2, 5, 1, 'In Mercantile system of accounting, incomes and expenses are recognised as and when', '', '', '', '', '', '', '1.00', '0.00', '', ' The mercantile system is a system of managing the economy of a country through the regulation of its foreign trade. The goal of this system is to establish a permanent positive balance of trade', '', 'True', '', 'Yes', NULL, NULL),
(358, 2, 5, 1, 'In cash method of accounting, profit represents excess of receipts over expenditure.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(359, 2, 5, 1, 'Accounting Standard 6 relates to Depreciation Accounting ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(360, 2, 5, 2, 'Consistency Concept envisages that the accounting information should be prepared on a consistent basis from period to period, and within the periods, there should be a consistent treatment of similar items.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(361, 2, 5, 2, 'Conservatism Concept forbids the inclusion of unrealised gains but advocates the provision for possible losses.', '', '', '', '', '', '', '1.00', '0.00', '', 'Convention of conservatism: While recording transactions, all possible losses must be taken into consideration, while all anticipated profits should be ignored. This is also called the principle of prudence.', '', 'True', '', 'Yes', NULL, NULL),
(362, 2, 5, 2, 'Dual Aspect Concept: means that each transaction in accounts has two aspects which are expressed as ''Debit'' and ''Credit'' and are recorded in books of account accordingly. Money Measurement Concept: It records only those transactions that can be recorded in monetary terms.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(363, 2, 5, 1, 'Cost Concept  means that the transactions are recorded at the amounts involved while the assets are always recorded at cost.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
