(372, 2, 5, 1, 'In accordance with the going concern concept in accounting, a business is considered as having an indefinite life.', '', '', '', '', '', '', '1.00', '0.00', '', 'Going Concern Concept  refers to the expectation that the organisation will have indefinite life.This assumption has an important bearing on how the assets are to be valued', '', 'True', '', 'Yes', NULL, NULL),
(373, 1, 5, 1, 'What is a Nominal Account?', 'An account of each person or firm with whom the trader deals', 'An account of each head of expense or source of income', 'An account of each property or possession dealt in by the trader in his business', 'None of these', '', '', '1.00', '0.00', '', 'Nominal accounts are the accounts that report revenues, expenses, gains, and losses. (The owner''s drawing account is also a temporary account, even though it is not an income statement account.) Nominal or temporary accounts are closed at the end of each accounting year.', '2', '', '', 'Yes', NULL, NULL),
(374, 1, 5, 1, 'What is the fundamental rule of debit and credit with regard to assets or real accounts?', 'Debit the receiver and credit the giver', 'Debit what comes in and credit what goes out', 'Debit expenses and losses and credit gains', 'All the above', '', '', '1.00', '0.00', '', 'real account relates to tangible or intangible assets like land,goodwill.', '2', '', '', 'Yes', NULL, NULL),
