(376, 1, 5, 1, 'Where does the net profit appear in the balance sheet?', 'Liabilities side', 'Assets side', 'Either (a) or (b)', 'None of these', '', '', '1.00', '0.00', '', 'The profit or net income belongs to the owner of a sole proprietorship or to the stockholders of a corporation. The owner''s or stockholders'' equity is reported on the credit side of the balance sheet.', '4', '', '', 'Yes', NULL, NULL),
(377, 2, 5, 1, 'A consignment account is in the nature of ''Nominal Account''.', '', '', '', '', '', '', '1.00', '0.00', '', 'A consignment account is a combined form of trading and profit and loss account solely to the concerned consignment. It can be treated as nominal account.', '', 'True', '', 'Yes', NULL, NULL),
(378, 2, 5, 1, 'Del Credere commission is paid to the consignee in order to avoid bad debts. ', '', '', '', '', '', '', '1.00', '0.00', '', 'Sometimes the principal gives extra commission to the agent for the recovery of credit sales made by him. Thus cash realization becomes his duty. There are chances of bad-debts out of credit sales. In order to compensate him for bad-debts loss, some extra commission is given which is known as Del Credere Commission.', '', 'True', '', 'Yes', NULL, NULL),
(379, 2, 5, 1, 'In a lease agreement there are  two parties.', '', '', '', '', '', '', '1.00', '0.00', '', 'A lease is a contractual arrangement calling for the lessee (user) to pay the lessor (owner) for use of an asset. Broadly put, a lease agreement is a contract between two parties, the lessor and the lessee. The lessor is the legal owner of the asset, the lessee obtains the right to use the asset in return for rental payments.', '', 'True', '', 'Yes', NULL, NULL),
(380, 2, 5, 1, 'The user the asset is known as Lessee. ', '', '', '', '', '', '', '1.00', '0.00', '', 'A lease is a contractual arrangement calling for the lessee (user) to pay the lessor (owner) for use of an asset. Broadly put, a lease agreement is a contract between two parties, the lessor and the lessee. The lessor is the legal owner of the asset, the lessee obtains the right to use the asset in return for rental payments.', '', 'True', '', 'Yes', NULL, NULL),
(381, 2, 5, 1, 'The owner of the asset is known as Lessor.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(382, 2, 5, 2, 'The ownership of the asset remains with the lessor.', '', '', '', '', '', '', '1.00', '0.00', '', 'A lease is a contractual arrangement calling for the lessee (user) to pay the lessor (owner) for use of an asset. Broadly put, a lease agreement is a contract between two parties, the lessor and the lessee. The lessor is the legal owner of the asset, the lessee obtains the right to use the asset in return for rental payments.', '', 'True', '', 'Yes', NULL, NULL),
(383, 2, 5, 1, 'Leasing agreement is usually for a specific period.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL);
INSERT INTO `questions` (`id`, `qtype_id`, `subject_id`, `diff_id`, `question`, `option1`, `option2`, `option3`, `option4`, `option5`, `option6`, `marks`, `negative_marks`, `hint`, `explanation`, `answer`, `true_false`, `fill_blank`, `status`, `created`, `modified`) VALUES
(384, 2, 5, 2, 'Leasing is a tool of tax planning.', '', '', '', '', '', '', '1.00', '0.00', '', 'Rental income is income from property if the taxpayer rents space and provides basic services only, such as heat, light, parking and laundry facilities. However, if the taxpayer provides additional services to tenants such as cleaning, security and meals, the taxpayer may be considered to be carrying on a business.', '', 'True', '', 'Yes', NULL, NULL),
(385, 2, 5, 2, 'Under leasing arrangement, risk of obsolescence is to be borne by the lessee..', '', '', '', '', '', '', '1.00', '0.00', '', 'One of the advantages to leasing from a lesseeâ€™s standpoint is that the risk of obsolescence is borne by the lessor, not the lessee. \r\n', '', 'False', '', 'Yes', NULL, NULL),
(386, 2, 5, 2, 'Lease rent paid by lessee is not an expense. ', '', '', '', '', '', '', '1.00', '0.00', '', 'Rent is any amount you pay for the use of property you do not own. In general, you can deduct rent as an expense only if the rent is for property you use in your trade or business. If you have or will receive equity in or title to the property, the rent is not deductible.', '', 'False', '', 'Yes', NULL, NULL),
(387, 2, 5, 2, 'Lessor can claim depreciation on leased assets', '', '', '', '', '', '', '1.00', '0.00', '', 'Indian Accounting Standard 19 on ''Leases'' provide that in case of an operating lease, the lessor shall be eligible to claim depreciation in respect of leased asset', '', 'True', '', 'Yes', NULL, NULL),
(388, 2, 5, 2, 'Lessor can claim depreciation on leased assets. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(389, 2, 5, 2, 'In an operative lease, period of lease is much less compared to the economic life of the asset.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(390, 2, 5, 2, 'In hire purchase transactions, the buyer pays the price in instalment.', '', '', '', '', '', '', '1.00', '0.00', '', 'Hire-purchase system is a special system of purchase and sale of goods. Under this system purchaser pays the price of the goods in installments. The installments may be annual, six monthly, quarterly, monthly fortnightly etc. Under this system the goods are delivered to the purchaser at the time of agreement before the payment of installments but the title on the goods is transferred after the payment of all installments as per the hire-purchase agreement.', '', 'True', '', 'Yes', NULL, NULL),
(391, 2, 5, 2, 'In hire purchase, ownership of goods passes to the buyer on payment of  Last installment.', '', '', '', '', '', '', '1.00', '0.00', '', 'The special feature of a hire-purchase transaction is that the payment of every installment is treated as the payment of hire charges by the purchaser to the hire vendor till the payment of the last installment.. After the payment of the last installment, the amount of various installments paid is appropriated towards the payment of the price of the goods sold and the ownership or the goods is transferred to the purchaser.', '', 'True', '', 'Yes', NULL, NULL),
(392, 2, 5, 2, 'The ownership of goods passes to the buyer immediately in instalment system. ', '', '', '', '', '', '', '1.00', '0.00', '', 'The special feature of a hire-purchase transaction is that the payment of every instalment is treated as the payment of hire charges by the purchaser to the hire vendor till the payment of the last instalment.. After the payment of the last instalment, the amount of various instalments paid is appropriated towards the payment of the price of the goods sold and the ownership or the goods is transferred to the purchaser.', '', 'True', '', 'Yes', NULL, NULL),
(393, 2, 5, 2, 'The person who purchases goods on hire purchase basis is called Hire Purchaser.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(394, 1, 5, 3, 'The Income and Expenditure account is prepared on the basis of-', 'Mercantile system of accounting ', 'cash system of accounting', 'hybrid system of accounting.', '', '', '', '1.00', '0.00', '', 'Under accrual or mercantile basis accounting, revenues are recognized and earned when they are realized or realizable irrespective of when the cash is received.\r\nTo put it in different terms, the accrual basis of accounting asks you to take into consideration all those incomes/gains and expenses/losses pertaining to the accounting period for which you are trying to ascertain the profits and losses irrespective of whether the incomes are received in cash or not and the expenses are paid out in cash or not.', '1', '', '', 'Yes', NULL, NULL),
(395, 1, 5, 2, 'Amount received towards Endowment Fund is - ', 'revenue receipt ', 'Capital receipt', 'deferred \r\nrevenue receipt ', '', '', '', '1.00', '0.00', '', 'An investment fund set up by an institution in which regular withdrawals from the invested capital are used for ongoing operations or other specified purposes. Endowment funds are often used by nonprofits, universities, hospitals and churches. They are funded by donations, which are tax deductible for donors.', '2', '', '', 'Yes', NULL, NULL),
(396, 1, 5, 3, 'The debit balance in the Income and Expenditure Account indicates - ', 'the excess of income over expenditure ', 'The excess of expenditure over income', 'the \r\nexcess of cash receipts over cash payments. ', 'non of the above.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(397, 1, 5, 3, 'which of the following item should not be entered in the receipts and payments account of a club - ', 'Subscriptions received ', 'Sale of machinery', 'Loss on sale of old furniture ', '(ii) and (iii)', 'None of the above.', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(398, 1, 5, 3, 'Subscriptions receivable at the beginning and end of the year are Rs. 2000 and Rs. 3000 \r\nrespectively. Income and Expenditure accounts show subscriptions at Rs. 20000. The amount \r\nshown in receipt and payment account under subscriptions account', ' Rs. 19,000', ' Rs. 23,000', ' Rs. 22,000', ' Rs. 17,000', ' Rs. 27,000', ' Rs. 31,000', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(399, 2, 5, 2, 'Depreciation is the reduction in the value of asset.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(400, 2, 5, 2, 'Depreciation is recorded in debet side of profit and loss account. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(401, 2, 5, 2, 'Depreciation is a fall in the value of an asset. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(402, 2, 5, 2, 'Fall in market price is the main cause of depreciation. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(403, 2, 5, 2, 'Depreciation is a part of the operating cost. ', '', '', '', '', '', '', '1.00', '0.00', '', 'An operating expense is any expense incurred as part of normal business operations. Depreciation represents the periodic, scheduled conversion of a fixed asset into an expense as the asset is used during normal business operations. Since the asset is part of normal business operations, depreciation is considered an operating expense.', '', 'True', '', 'Yes', NULL, NULL),
(404, 2, 5, 2, 'Depreciation is to know the correct profit.', '', '', '', '', '', '', '1.00', '0.00', '', 'A depreciation expense has a direct effect on the profit that appears on a company''s income statement. The larger the depreciation expense in a given year, the lower the company''s reported net income', '', 'True', '', 'Yes', NULL, NULL),
(405, 2, 5, 2, 'Depreciation is provided to arrive at the profit earned by the business. ', '', '', '', '', '', '', '1.00', '0.00', '', 'A depreciation expense has a direct effect on the profit that appears on a company''s income statement. The larger the depreciation expense in a given year, the lower the company''s reported net income', '', 'True', '', 'Yes', NULL, NULL),
(406, 2, 5, 2, 'The value of asset will be reduced to zero under the written down value method of depreciation. ', '', '', '', '', '', '', '1.00', '0.00', '', 'The Straight-line Method reduces the Net-Book value of an asset by the same amount each period. The value of asset will be reduced to zero or the scrap value, which will be realised on sale of scrap.', '', 'False', '', 'Yes', NULL, NULL),
(407, 2, 5, 2, 'The asset being completely written off under the written down value method. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(408, 2, 5, 2, 'The expenditure on repairs and renewal and depreciation on assets are equal in every year \r\nunder the straight line method of depreciation. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(409, 2, 5, 3, 'The form of balance sheet and profit and loss account of a banking company is prescribed in Forms A and B of third schedule of the Banking Regulation Act, 1949. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(410, 2, 5, 2, 'The various items of assets in the balance sheet are arranged according to Liquidity order', '', '', '', '', '', '', '1.00', '0.00', '', '<table class="bs" cellspacing="0" cellpadding="4" align="center">\r\n<tbody>\r\n<tr><th class="bs_title" colspan="4">Balance Sheet of M/s Free Flow Fluids as on 30th June 2007</th></tr>\r\n<tr><th class="bs_head">Liabilities</th><th class="bs_amt_mid">Amount</th><th class="bs_head">Assets</th><th class="bs_amt_mid">Amount</th></tr>\r\n<tr>\r\n<td class="bs_part">Bank Overdraft&nbsp;<br />Bills Payable&nbsp;<br />Sundry Creditors&nbsp;<br />...&nbsp;<br />...&nbsp;<br />...&nbsp;<br />...&nbsp;<br />Pr. Share Capital&nbsp;<br />Eq. Share Capital</td>\r\n<td class="bs_amt_mid">5,00,000&nbsp;<br />12,00,000&nbsp;<br />13,00,000&nbsp;<br />...&nbsp;<br />...&nbsp;<br />...&nbsp;<br />...&nbsp;<br />12,00,000&nbsp;<br />35,00,000</td>\r\n<td class="bs_part">Cash&nbsp;<br />Bank Balance&nbsp;<br />Bills Receivable&nbsp;<br />Sundry Debtors&nbsp;<br />...&nbsp;<br />...&nbsp;<br />Buildings&nbsp;<br />Land&nbsp;<br />Goodwill</td>\r\n<td class="bs_amt">11,60,000&nbsp;<br />...&nbsp;<br />15,00,000&nbsp;<br />26,00,000&nbsp;<br />...&nbsp;<br />...&nbsp;<br />27,00,000&nbsp;<br />35,00,000&nbsp;<br />8,00,000</td>\r\n</tr>\r\n<tr>\r\n<td class="bs_part">&nbsp;</td>\r\n<td class="bs_amt_lt">2,54,20,000</td>\r\n<td class="bs_part">&nbsp;</td>\r\n<td class="bs_amt_rt">2,54,20,000</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<div class="box_p10_hint">\r\n<h3>Liquidity</h3>\r\nLiquidity is the characteristic of an asset to get converted to cash. The faster an asset can be converted to cash, the more liquid it is.</div>\r\n<h3>Arrangement of Assets</h3>\r\n<div class="box_p10_2 lm25 bm20">The highest liquid asset is placed first (at the top) and the least liquid asset is placed last.\r\n<ul>\r\n<li>Cash is considered to be the highest liquid asset. We do not need any time to convert cash to cash.</li>\r\n<li>Goodwill is considered to be the least liquid asset. It is attached to the organisation and can be realised only when the organisation is dissolved.</li>\r\n</ul>\r\n</div>', '', 'True', '', 'Yes', NULL, NULL),
(411, 2, 5, 2, 'Slip System of posting is peculiar of banking company accounts. ', '', '', '', '', '', '', '1.00', '0.00', '', 'In a banking company, the main slips are pay-in-slips, withdrawal slips and cheques and all these slips are filled in by clients of the bank. These slips serve the basis of entry in the ledgers and control accounts in the General Ledger are prepared on the basis of analysis of these slips', '', 'True', '', 'Yes', NULL, NULL),
(412, 1, 5, 3, ' Name the major institutions carrying on banking business in India. ', 'Reserve Bank of India; State Bank of India; Central Bank of India; ', 'Punjab National Bank; Dena Bank; Bank of India. ', 'All of the above.', 'None of the above.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(413, 1, 5, 3, 'State the main functions of a modern commercial bank. ', '(a)    Accepting money on deposits \r\n(b)   Extending facilities of loans and advances to trade and industries ', '(a) Providing facilities to depositors for payment by cheques \r\n(b)  Opening letters of credit ', '(a)  Issuing letters or guarantee \r\n(b)  Dealing in foreign exchange', '(a) Acting as a trustees and executors \r\n(b) Merchant banking ', 'All of above.', 'None of the above.', '1.00', '0.00', '', '', '5', '', '', 'Yes', NULL, NULL),
(414, 1, 5, 3, 'Name the items which appear on both the sides of the balance sheet. ', 'Constituents'' liabilities for acceptance, endorsement and other obligations.', ' Bills receivable being bills for collection.', 'All the above.', 'None of the above.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
