(418, 2, 5, 2, 'A company has a perpetual succession . ', '', '', '', '', '', '', '1.00', '0.00', '', 'perpetual succession is the continuation of a corporation''s or other organization''s existence despite the death, bankruptcy, insanity, change in membership or an exit from the business of any owner or member, or any transfer of stock,etc.', '', 'True', '', 'Yes', NULL, NULL),
