(424, 1, 5, 2, 'A company incorporated by a special act', 'Public limited company ', 'Private limited company', 'Statutory company', 'Chartered company', 'Foreign company ', 'None of the above.', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(425, 1, 5, 2, 'A company incorporated by a special charter', 'Public limited company', 'Private limited company ', 'Statutory company ', 'Chartered company ', 'Foreign company', 'None of the above.', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(426, 1, 5, 2, 'Minimum number of member is two', 'Public limited company \r\n\r\n \r\n\r\n', 'Private limited company ', 'Statutory company', 'Chartered company ', 'Foreign company ', 'None of the above.', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(427, 1, 5, 2, 'A company incorporated outside India ', 'Public limited company\r\n\r\n \r\n\r\n', 'Private limited company', 'Statutory company', 'Chartered company ', 'Foreign company ', 'None of the above.', '1.00', '0.00', '', '', '5', '', '', 'Yes', NULL, NULL),
(428, 2, 5, 2, 'Share premium amount can be distributed as dividend amongst the shareholders. ', '', '', '', '', '', '', '1.00', '0.00', '', 'When a company issues shares at a premium, share premium account is credited with the amount of premium. It is recorded on liabilities side of balance sheet under the head ''Reserves and Surplus''.Share premium amount is a capital profit and hence not available for distribution as dividend.', '', 'False', '', 'Yes', NULL, NULL),
(429, 2, 5, 2, 'In the very first year of working of the company, shares can be issued at discount. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(430, 2, 6, 1, 'If calls on shares are not received, company can forfeit these shares.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(431, 2, 6, 2, 'The Company Law Board''s permission is required for issue of shares at a discount.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(432, 2, 6, 2, 'Capital redemption reserve can be utilised for payment of dividend', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(433, 2, 6, 2, 'Shares of a limited company can be classified into equity and preference.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(434, 2, 6, 2, 'Authorised capital is the amount with which company is formed.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(435, 2, 6, 2, 'Capital subscribed by the public is called Subscribed capital. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(436, 2, 6, 2, 'Paid-up capital means amount of capital actually paid by Shareholders. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(437, 2, 6, 2, 'The balance sheet represents an expansion of the equations as: Assets = Liabilities + Capital. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(438, 2, 6, 2, 'Assets - Original Capital = Liabilities. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(439, 2, 6, 2, 'Rehman has assets of Rs. 10,000 and liabilities of Rs. 5,000. His capital therefore would be \r\nRs. 15,000.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(440, 2, 6, 2, 'Assets will be equal to capital if there are no liabilities of the business.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(441, 2, 6, 2, 'If a firm borrows a sum of money, its capital would be reduced. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(442, 2, 6, 2, 'Partnership is a separate legal entity.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(443, 2, 6, 2, 'There should be at least two persons to form a partnership. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(444, 2, 6, 2, 'In partnership, profits of the partnership have to be shared by all, though loss may be borne \r\nby only one or few partners only.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(445, 2, 6, 2, 'According to the Indian Partnership Act, there is no maximum limit of partners in the \r\npartnership ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(446, 2, 6, 1, 'If the partnership deed is silent on certain points, then in such a case, the relevant provisions \r\nof the Partnership Act will apply. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
