(448, 2, 6, 1, 'If the partnership firm is following the fixed capital account method salary payable to a \r\npartner is credited to the partners'' current account. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
