(456, 1, 7, 1, 'A Demand Draft is issued by the banks to be valid for', '12 months', '6 months', '3 months', 'None of the above', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(457, 1, 7, 3, 'A customer is entitled to issuance of a duplicate DD in place of the lost one, provided', 'he gives due intimation to the issuing branch', 'payment of DD not already made by the drawee branch', 'execution of an indemnity signed by both the payee and the purchaser of the DD', 'payment of a fee as applicable for issue of such duplicate DD ', 'all the above ', '', '1.00', '0.00', '', 'A contract by which one party promises to save the other from loss caused to him by the conduct of the promisor himself or the conduct of any other person is called a contract of indemnity - Section 124 (Indian Contract Act, 1872).', '3', '', '', 'Yes', NULL, NULL),
(458, 1, 7, 2, 'One of the following statements is not true with regard to a locker facility in the bank.', 'In the case of a sole hirer of a safety locker, nomination can be made in favour of only one individual.', 'A locker cannot be hired by limited companies, specified associations and societies  etc. ', 'In the case of death of a sole locker-hirer (where there is nomination) access to locker may be given to the nominee', 'Where there are joint locker-hirers having a contract of locker hire with a ''either or  survivor'' clause and where there is no nomination, access to the locker may be given to the survivor in case of death of one of the hirers without death certificate of first applicant.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(459, 1, 7, 1, 'One of the following statements is not true with respect to RTGS: ', 'Funds are transferable from the branch of one bank to the branch of another bank. ', 'Only the corporate and Government departments can avail of the facility', 'The RTGS system is maintained and operated by the RBI', 'Each participant bank here of the RTGS will be required to open a dedicated \r\nsettlement account for putting through its RTGS transactions.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(460, 1, 7, 1, 'One of the following statements is not true with respect to NEFT.', 'Funds are transferable electronically from one customer account of a participant bank  branch to another customer account of any other participant bank branch.', 'The individual branches participating in NEFT can be located only in the urban/metro centres. ', 'The remitting branch prepares a structured financial messaging solution (SFMS) message and sends it to its service centre for NEFT. ', 'The RBI at the clearing centre sorts the transactions bank-wise and prepares the \r\naccounting entries of net debit or credit for passing on to the banks participating in the \r\nsystem.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(461, 2, 7, 1, 'Portfolio management relies on the combination of securities to get most efficient portfolio ', '', '', '', '', '', '', '1.00', '0.00', '', 'Portfolio means a basket of investments or securities in a combined form. Debt securities will yield interest income and equity investments will yield dividend income apart from capital appreciation over a period of time.', '', 'True', '', 'Yes', NULL, NULL),
(462, 2, 7, 1, 'Risk and return have the same meaning in selection of a portfolio ', '', '', '', '', '', '', '1.00', '0.00', '', 'It is the portfolio that matters: Individual securities are important only to the extent that they affect the aggregate portfolio. The risk of a security should preferably not be based on the uncertainty of a single security''s return but on the contribution to the uncertainty of the total portfolio''s return.', '', 'False', '', 'Yes', NULL, NULL),
(463, 2, 7, 1, 'The role of a portfolio manager lies in study of investor, investment strategy etc. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(464, 2, 7, 1, 'A portfolio manager is any person who, pursuant to a contract or arrangement with a client, advises, directs or undertakes on behalf of the client the management or administration of a portfolio of securities or the funds of the client. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(465, 2, 7, 1, 'A purchaser of a Demand Draft can countermand its payment by the drawee bank. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(466, 1, 7, 1, 'Cardinal principles of lending are ', ' Safety and liquidity', 'profitability and diversification of risks ', 'purpose and security ', 'Only (i) and (iii) ', 'All of (i) to (iii) ', '', '1.00', '0.00', '', '', '5', '', '', 'Yes', NULL, NULL),
(467, 1, 7, 2, 'Liquidity with a banker means ', 'Cash on Hand', 'Cash and Bank balances ', 'Short-term current assets to convert into cash ', 'All of above ', 'None ', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(468, 1, 7, 2, 'Customer profitability analysis means', 'Exercise done by bank before lending to a customer', 'Exercise before opening a new branch ', 'Assess the profitability of customer''s business ', 'Only (i) and (iii) ', 'None', '', '1.00', '0.00', '', 'Customer Profitability Analysis (CPA) done when the banker is engaged in more than one service or business for a customer, this is all the more necessary not only to assess the profitability of the operation/business vis-a-vis a customer but also to enable a banker to decide on as to what length he can go in parting with a portion of profit and offer a competitive rate for the customers.', '3', '', '', 'Yes', NULL, NULL),
(469, 1, 7, 1, 'Banker can reduce risk in lending to a borrower', 'By obtaining adequate security', 'By ensuring that there will be no problem of liquidity with borrower ', 'By ensuring that there will be no default on account of lack of liquidity and lack of willingness to pay on the part of the borrower', 'None of the above.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(470, 1, 7, 1, 'In banker''s parlance, credit risk in lending refers to ', 'Default of repayment by a borrower ', 'Default of bankers in maintaining SLR', 'Default of a banker to release credit to a borrower ', 'None of above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(471, 1, 7, 1, 'Net working capital means ', 'Current assets - Current Liabilities ', 'Owned funds â€“ Goodwill ', 'Use of assets + Sources of funds', 'None of above.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(472, 1, 7, 1, 'Major Current assets are', 'Marketable investments and Cash/receivables/inventories', 'Inventories + Cash + Receivables ', 'Shares in sister concern + Unquoted shares + Cash', 'All of above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(473, 1, 7, 1, 'What are the sources of working capital? ', 'Trade credits + Unsecured loans + Deposits ', 'Bank borrowings + Advance payments', 'Net working capital ', 'All of above ', 'None', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(474, 1, 7, 1, 'Working capital means ', 'Requirements for the day-to-day transactions ', 'Excess of current assets over current liabilities ', 'Fixed assets - Current assets ', 'None of above. ', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(475, 1, 7, 1, 'Term loans mean Loans ', 'Payable after one year to ten years ', 'Repayments are done in instalments ', 'Term loans are utilised for acquisition of fixed assets', 'All of above ', 'Only (i) and (ii) ', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(476, 1, 7, 1, 'Working capital needs are estimated by', 'Operating cycle method ', 'Projected turnover method', 'Cash budget method', 'Any of above', 'None of above.', '', '1.00', '0.00', '', 'The conditions of commercial banks for lending on a short-term basis are rigorous. A customer has to satisfy his bank about his character, capacity, capital and collateral, in brief he has to establish his creditworthiness. If the overall appraisal is satisfactory, the bank will finance only the residual gap in the customers resources, after taking into consideration the expected availability from all other sources of funds. Generally, there are four methods of estimating the working capital requirements of a borrower:\r\n(a) The operating cycle method \r\n(b) The projected net working capital method\r\n(c) The projected turnover method \r\n(d) The cash budget', '4', '', '', 'Yes', NULL, NULL),
(477, 1, 7, 1, 'Difference between cash budget and cash flow', 'Cash flow deals with cash and non-cash funds. ', 'Cash budget deals with cash transactions only. ', 'Cash flow statements are generally for quarterly or half-yearly while cash budgets are for shorter periods. ', 'Cash budget is a projection into the future while a cash flow statement is historical.', 'All of above.', '', '1.00', '0.00', '', '', '5', '', '', 'Yes', NULL, NULL),
(478, 1, 7, 3, 'Advantages of cash budget could be', 'Borrower should plan in advance the cash requirements.', 'Banker is able to spot a danger signal quickly and corrective measures are taken.', 'Banker can plan his resources to meet credit demands.', 'All of above. ', 'None of the above.', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(479, 1, 7, 1, 'Is there any exposure ceiling for banks in providing advances/loans to borrowers? ', '15 per cent of capital funds for single borrower and 40 per cent in a borrower''s group. ', '10 per cent of capital funds for single borrower and 20 per cent in a borrower''s group.', '25 per cent of capital funds for single borrower and 50 per cent in a borrower''s group \r\nfor infrastructural projects.', 'no such ceiling. ', '', '', '1.00', '0.00', '', 'From 1 April 2002, the exposure ceiling is 15 per cent of the capital funds in the case of a single borrower and 40 per cent in the case of group borrowings.', '1', '', '', 'Yes', NULL, NULL),
(480, 1, 7, 1, 'Credit decisions are affected by risks like: ', 'Credit risk/market risk/operational risk', 'Liquidity/ interest rate/ foreign exchange rate ', 'Commodity price/equity price risks ', 'None of the above', '', '', '1.00', '0.00', '', 'The main risks are credit risk, market risk (mainly liquidity risk and interest rate risk) and operational risk. Credit risk is defined as the possibility of losses associated with a diminution in the credit quality of borrowers or counter parties.', '1', '', '', 'Yes', NULL, NULL),
(481, 1, 7, 1, ' Housing Loans granted to individuals up to Rs.----- for construction of houses (excluding loans granted by banks to their employees) are treated as priority sector advances.', '5 lakh', '10 lakh ', '20 lakh  ', '15 lakh ', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(482, 1, 7, 1, 'Educational loans granted to individuals for educational purposes up to Rs __________ for studies in India, will be classified as priority sector. ', '7.5 lakh ', '10 lakh', '15 lakh', '20 lakh', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(483, 1, 7, 1, 'The scheduled commercial banks are expected to enlarge credit to the priority sector and ensure that priority sector advances constitute  ____________ .', '18 per cent of net bank credit', '40 per cent of net bank credit ', '12 per cent of net bank credit', '25 per cent of net bank credit ', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(484, 1, 7, 2, 'A micro enterprise in manufacturing sector is one where the investment in plant and machinery does not exceed______', 'Rs. 10 lakh', 'Rs.20 lakh  ', 'Rs. 25 lakh', 'Rs. 50 lakh ', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(485, 1, 7, 2, 'The Government of India also provides subsidy to the SSI units for getting rated to the extent of 75 per cent of the charges/fees paid to the rating agency by the SSI units subject to a maximum of Rs.', 'Rs. 40,000 ', 'Rs. 60,000', 'Rs. 75,000 ', 'Rs. 1 lakh', '', '', '1.00', '0.00', '', 'the Government of India and launched in April, 2005 for performance and credit rating of manufacturing MSEs, the National Small Industries Corporation (NSIC) empanels credit rating agencies for rating of small enterprises engaged in manufacturing activities. The rating scheme aims at helping them in accessing credit from banks faster and at competitive terms. The Government of India also provides a subsidy to these enterprises for getting rated to the extent of 75 per cent of the charges/fees paid to the rating agency subject to a maximum of Rs. 40,000.', '1', '', '', 'Yes', NULL, NULL),
(486, 1, 7, 2, 'A medium enterprise in service sector is one,', 'Where the investment in equipment is more than Rs. 3 crore but does not exceed Rs. 10 crore.', 'Where the investment in equipment is more than Rs. 2 crore but does not exceed Rs. 10 crore. ', 'Where the investment in equipment is more than Rs. 5 crore but does not exceed Rs. 10 crore.', 'Where the investment in equipment is more than Rs. 2 crore but does not exceed Rs. 5 crore.', '', '', '1.00', '0.00', '', 'A medium enterprise in service sector is one : Where the investment in equipment does not exceed Rs. 10 lakh. (Currently called asSSSBEs). Where the investment in equipment is more than Rs. 10 lakh but does not exceed Rs. 2 crore. Where the investment in equipment is more than Rs. 2 crore but does not exceed Rs. 5 crore.', '4', '', '', 'Yes', NULL, NULL),
(487, 1, 7, 1, 'Swarnajayanti Gram Swarozgar Yojana'' (SGSY) did not replace one of the following schemes:', 'Integrated Rural Development Programme (IRDP)', 'Training of Rural Youth for Self-Employment (TRYSEM)', 'Development of Women and Children in Rural Areas (DWCRA)', 'PMRY', '', '', '1.00', '0.00', '', 'The SGYS scheme has come into operation from 1 April, 1999 replacing all other scheme like the IRDP, TRYSEM, DWCRA, SITRA, GKJ, MWS, etc.', '4', '', '', 'Yes', NULL, NULL),
(488, 1, 7, 2, 'Under SGSY, the group is entitled for a subsidy of', 'Fifty per cent of the project cost subject to per capita subsidy of Rs. 10,000/subject to maximum of Rs. 1.50 lakh.', 'Twenty-five per cent of the project cost subject to per capita subsidy of Rs. 10,000 subject to maximum of Rs. 1.25 lakh.', 'Thirty-three per cent of the project cost subject to per capita subsidy of Rs. 10,000 subject to maximum of Rs. 1.50 lakh.', 'Fifty per cent of the project cost subject to per capita subsidy of Rs. 10,000 subject to maximum ofRs. 1.25 lakh.', '', '', '1.00', '0.00', '', 'Subsidy under SGSY will be uniform at 30 per cent of the project cost, subject to a maximum of Rs 7,500. In respect of SC/STs it will be 50 per cent of the project cost, subject to a maximum of Rs. 10,000. The group is entitled to subsidy of 50 per cent of the project cost subject to a per capita subsidy', '4', '', '', 'Yes', NULL, NULL),
(489, 1, 7, 2, 'Under SJSRY, the percentage of women beneficiaries should not be less than', '30%', '33%', '50%', '22.5%', '', '', '1.00', '0.00', '', 'Sub-targets: The percentage of women beneficiaries under the SJSRY Scheme shall not be less than 30 per cent. SCs/STs must be benefited to the extent of the proportion of their strength in the local population. A special provision of 3 per cent shall be made for the disabled under the scheme.', '1', '', '', 'Yes', NULL, NULL),
(490, 1, 7, 2, 'Maintenance of the following books, registers is not compulsory for SHG', 'Minutes book,', 'Savings and Loan register', 'Visitors book ', 'Members'' passbook', '', '', '1.00', '0.00', '', 'SHG should maintain simple basic records such as minutes book, attendance register, loan ledger, general ledger, cash book, bank passbook and individual passbooks.', '3', '', '', 'Yes', NULL, NULL),
(491, 1, 7, 2, 'SHGs, for assistance under PMRY may consist of', '5-20 educated unemployed youth', '3-15 educated unemployed youth', '10-25 educated unemployed youth', '2-10 educated unemployed youth', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(492, 1, 7, 2, 'If the guidelines of the RBI in the matter of credit are violated, it can levy penalty on the violating bank under', 'Reserve Bank of India Act', 'Negotiable Instrument Act', 'Indian Penal Code', 'Banking Regulation Act', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(493, 1, 7, 1, 'When banks give home loans, the nature of charge created is', 'Hypothecation', ' Mortgage', 'Assignment', 'Pledge', '', '', '1.00', '0.00', '', 'The nature of charge created on this type of security is mortgage. Mortgage of immovable property is either primary or collateral security. If any advance is granted', '2', '', '', 'Yes', NULL, NULL),
(494, 1, 7, 2, 'As per the Stamp Act, a document executed in India shall be stamped', 'only before execution', 'at any time, but before filing suit', 'within 30 days after execution', 'before or at the time of execution ', '', '', '1.00', '0.00', '', 'A document shall be stamped in accordance with the Indian Stamp Act as amended by the concerned State Governments. Indian Stamp Act contains provisions regarding time of stamping for instruments executed in India and out of India. A document executed in India shall be stamped before or at the time of execution.\r\nSection 12 of Indian Stamp Act provides for cancellation of adhesive stamp so that the same cannot be used again. Any instrument bearing an adhesive stamp which has not been cancelled, so that it cannot be used again, shall be deemed to be unstamped.', '4', '', '', 'Yes', NULL, NULL),
(495, 1, 7, 1, 'One of the following statements is not true', 'The Court cannot condone delay in filing suit as per Section 5 of the Limitation Act', 'If a demand promissory note is not stamped before or at the time of execution in India, the defect can be cured by paying penalty', 'When the borrower acknowledges the debt before the expiry of limitation period, the period of limitation is extended by one more period.', 'If the borrower makes part payment in to the loan account before the expiry of limitation period, the period of limitation is extended by one more period.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(496, 1, 7, 2, 'One of the following statements is not true in the right of set-off.', 'Set-off means partial or total merging of a claim of one person against another in a counter claim of the latter against the former. ', 'Both debts must be for certain sum', 'A debt accruing due cannot be set-off', 'A banker can set-off the credit balance in the guarantor''s account before the liability of the guarantor to the bank is determined.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(497, 2, 7, 1, 'In the case of assignment of LIP as a security to an advance, the ass''gnment is not complete unless a notice of assignment is given to the Insurance Company.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(498, 2, 7, 1, 'In the case of assignment of LIP as a security to an advance, the assignment is not complete unless a notice of assignment is given to the Insurance Company, the notice of assignment may be given either by the assignor or by the assignee.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(499, 2, 7, 1, 'The banker''s lien is an implied pledge.', '', '', '', '', '', '', '1.00', '0.00', '', 'Lien is the right of the banker to retain possession of the goods and securities owned by the debtor until the debt due from the latter is paid. The banker''s lien is an implied pledge. A banker acquires the right to sell the goods which came into its possession in the ordinary course of banking business, in case the debt is not paid. Section 171 of the Indian Contract Act, 1872 gives to the banker an absolute right of general lien on all goods and securities received by the banker.', '', 'True', '', 'Yes', NULL, NULL),
(500, 2, 7, 2, 'When a customer inadvertently leaves a packet containing certain share certificates while leaving the bank premises, the banker can take these securities under lien against certain liability incurred by the customer to the bank.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(501, 2, 7, 1, 'Right of lien and right of set-off can be exercised simultaneously at the same time.', '', '', '', '', '', '', '1.00', '0.00', '', 'When the right set-off is available to the bank, lien right cannot apply. These two different rights cannot be exercised simultaneously at the same time.', '', 'False', '', 'Yes', NULL, NULL),
(502, 2, 7, 1, 'There is less risk for a bank when hypothecation facility is granted to a Company, because of the registration of the bank''s charge with the ROC.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(503, 2, 7, 1, 'One of the essential requirements of a pledge is the actual or constructive delivery of the goods pledged by the pawner to the pawnee,', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(504, 2, 7, 2, 'Limitation period for filing a suit for sale of mortgaged property is thirty years from the date mortgage debt becomes due.', '', '', '', '', '', '', '1.00', '0.00', '', 'Limitation period for filing a suit for foreclosure is thirty years from the date mortgage debt becomes due.', '', 'False', '', 'Yes', NULL, NULL),
(505, 1, 7, 2, 'When will a loan be NPA?', 'Interest and/or loan instalments overdue for more than 90 days.', 'A/c is out of order for more than 90 days in case of overdraft/cash credit ', 'Bill remains overdue for more than 90 days in BP/BD', 'Only (a) and (c)', 'All of the above', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(506, 1, 7, 1, 'Charging of interest at monthly rests would/would not change overdues under NPA. ', 'Would make overdue of 90 days from monthly interest debiting', 'Would make overdue 90 days from previous quarter ending', 'Both of above', 'Both of above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(507, 1, 7, 1, 'Charging of interest at monthly rests would/would not change overdues under NPA. ', 'Would make overdue of 90 days from monthly interest debiting', 'Would make overdue 90 days from previous quarter ending', 'Both of above', 'Both of above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(508, 1, 7, 1, 'Charging of interest at monthly rests would/would not change overdues under NPA. ', 'Would make overdue of 90 days from monthly interest debiting', 'Would make overdue 90 days from previous quarter ending', 'Both of above', 'Both of above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(509, 1, 7, 2, 'Direct advances to agriculture and SME under standard assets category requires provision at the rate of', '0.40 percent ', '1.00 percent', '0.10 percent ', '0.25 percent ', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(510, 1, 7, 2, 'A substandard asset is one which has remained NPA for a period less than or equal to', '12 months', '6 months', '90 days', '180 days', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(511, 1, 7, 2, 'The scope of activities undertaken by the business correspondents will not include:', 'disbursal of small value credit', 'recovery of principal/collection of interest', 'collection of small value deposits', 'payment of money on demand drafts not exceeding Rs. 1,000', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(512, 1, 7, 2, 'Bank cannot use the services of one of the following person/association/organisation as intermediaries in providing financial and banking services through the use of business facilitator and correspondent models', 'non-governmental organizations', 'self-help groups (NGOs/SHGs)', 'village sarpanch', 'Micro Finance Institutions (MFIs)', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(513, 1, 7, 2, 'Bank cannot use the services of one of the following person/association/organisation as intermediaries in providing financial and banking services through the use of business facilitator and correspondent models', 'non-governmental organizations', 'self-help groups (NGOs/SHGs)', 'village sarpanch', 'Micro Finance Institutions (MFIs)', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(514, 1, 7, 1, 'A computer network mainly used to share', 'Data', 'Software', 'Hardware', 'All of the above ', 'None of these', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(515, 1, 7, 1, 'Terminals connected to a server is known as', 'Clients', 'Nodes', '(a) & (b)	', 'CPU', 'None of these', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(516, 1, 7, 1, 'For uninterrupted power supply in branch computerisation, the following device is used ', 'Online UPS', 'Offline UPS', 'Convertor', 'Generator ', 'None of these', '', '1.00', '0.00', '', 'Online UPS: In an online UPS, the main 230 V input current is converted into 48 V DC and from the battery charger-cum-rectifier is then converted to a 230 VAC, even in the case of main supply available and the power is supplied to the computer systems. In case of power failure, the 48 V DC is supplied by the batteries. It comes back automatically to the normal status when the main supply recovers. In bank computerisation, online UPS is used.', '1', '', '', 'Yes', NULL, NULL),
(517, 1, 7, 1, 'Proper functioning of a computerised system is ensured by', 'Generation of audit trails', 'Exceptional transaction report', 'Tallying of cash book', 'All of the above', 'None of these', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(518, 1, 7, 2, 'In muiti-user computer networking', 'Computers are based on a centralised processing concept', 'Various terminals are attached to the main computer', 'All data and information is kept on the main computer', 'Large number of users can be connected to a central computer', 'All of above', '', '1.00', '0.00', '', '', '5', '', '', 'Yes', NULL, NULL),
(519, 1, 7, 2, 'In star topology', 'Each node is joined to the central node by a separate link', 'Devices are connected in a closed loop', 'Information is passed from one node to the another in series', 'Devices on the network are connected to a single continuous cable', 'All of above', '', '1.00', '0.00', '', 'In a star topology, the central node is often the master. Each of the other nodes is joined to the master by separate links. While this topology gives the advantage of giving maximum ability to change, it cannot handle large traffic as every transaction has to pass through the central node.', '1', '', '', 'Yes', NULL, NULL),
(520, 1, 7, 2, 'In bus topology', 'Each node is joined to the central node by a separate link', 'Devices are connected in a closed loop', 'Information is passed from one node to another in series', 'Devices on the network are connected to a single continuous cable', 'All of above', '', '1.00', '0.00', '', 'With the bus topology, all devices on the network are connected to a single continuous cable. Transmission from any station travels the length of the bus in both directions and is received by all other stations.', '4', '', '', 'Yes', NULL, NULL),
(521, 1, 7, 2, 'In ring topology', 'Each node is joined to the central node by a separate link', 'Devices are connected in a closed loop', 'Information is passed from one node to the other in series (d) (b) & (c)', 'All of above', '', '', '1.00', '0.00', '', 'In a ring topology, the devices are connected in a closed loop and information is passed from one node to the other in series. Data transmission is possible in one direction only. As the packet circulates, the destination recognizes its address and copies the packet contents onto it.', '3', '', '', 'Yes', NULL, NULL),
(522, 1, 7, 2, 'In Core banking system', 'Branches are connected to a central host', 'Branch automation modules and delivery channels are incorporated', 'Transactions are done centrally and online', 'All of above', 'None of these', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL);
INSERT INTO `questions` (`id`, `qtype_id`, `subject_id`, `diff_id`, `question`, `option1`, `option2`, `option3`, `option4`, `option5`, `option6`, `marks`, `negative_marks`, `hint`, `explanation`, `answer`, `true_false`, `fill_blank`, `status`, `created`, `modified`) VALUES
(523, 1, 7, 2, 'Benefits in Core Banking is', 'Reliable centralised data recovery', 'Data warehousing and data mining technologies', 'Integrated customer centric services', 'Core infrastructure can be used for future expansion', 'All of above', '', '1.00', '0.00', '', 'Core banking has a centralised branch computerisation model where the branches are connected to a central host,  incorporates branch automation modules and online multiple delivery channels like ATM, ABB, Debit Card, Tele-banking/mobile banking, internet banking, etc., under one roof. In core banking, there is a central database for the bank and transactions are done centrally, online. It offers integrated products and services tocustomers round the clock. There is scope for induction of modern banking services.', '5', '', '', 'Yes', NULL, NULL),
(524, 1, 7, 1, 'MODEM does the following:', 'modulates digital signals into analogue', 'demodulates analogue signals into digital', 'converts data into image   ', 'both (a) and (b)', 'none of these', '', '1.00', '0.00', '', 'This is a conversion device installed in pairs at each end of an analogue communications line (i.e. telephone line). The modem at the transmitting end modulates the\r\ndigital signals received locally from a computer or a terminal into analogue signals. It sends the digital Js and 0s over standard phone lines as modulated tones.', '4', '', '', 'Yes', NULL, NULL),
(525, 1, 7, 2, 'A twisted pair cable consists of', 'two insulated copper wire', 'an inner copper conductor held in position by circular spacers ', 'single copper wire', 'all of these ', 'none of these', '', '1.00', '0.00', '', ' it is a  type of cable that consists of two independently insulated wires twisted around one another. The use of two wires twisted together helps to reduce crosstalk and electromagnetic induction. While twisted-pair cable is used by older telephone networks and is the least expensive type of local-area network (LAN) cable', '1', '', '', 'Yes', NULL, NULL),
(526, 1, 7, 2, 'A coaxial cable consists of ', 'two insulated copper wire ', 'an inner copper conductor held in position by circular spacers ', 'single copper wire', 'all of these ', ') none of these', '', '1.00', '0.00', '', 'Coaxial cable: The coaxial cables consist of an inner copper conductor held in position by circular spacers. The inner wire is surrounded by insulation and covered by a protective sheath. The covering protects the conductor and prevents interference of signals. The cable can carry digital signals at very high rates of 500 mega bits per second.', '2', '', '', 'Yes', NULL, NULL),
(527, 1, 7, 2, 'In an optical fibre data is transmitted through', 'a very thin glass or plastic fibres with a beam of light ', 'satellite', 'laser beam driven by a high speed high current ', 'both (a) and (c)', 'none of these', '', '1.00', '0.00', '', 'Optical fibre: Optical fibre has been a technological breakthrough in communications. It supports data rate of 2 giga bits/sec. Fibre optics provide high quality (low error rate) transmission of signals at very high speeds.', '4', '', '', 'Yes', NULL, NULL),
(528, 1, 7, 2, 'In a microwave system', 'radio waves are modulated to carry information ', 'wave beams are sent from one antenna to another', 'along the route, the received data is amplified and retransmitted ', 'microwave signals may be passed on to the satellite', 'all of above', '', '1.00', '0.00', '', 'Microwave systems: These use very high frequency radio signals used in telephone systems and television transmissions. The radio waves are modulated to carry information. Antennae are mounted on towers to send wave beams from one antenna to another. Along the route, the received data is amplified and retransmitted. The microwave signals may also be passed on to the communication satellites.', '5', '', '', 'Yes', NULL, NULL),
(529, 1, 7, 2, 'A message switcher is used to', 'store and forward data to large number of terminals over a single communication channel ', 'send more than one signal simultaneously over a single communication channel', 'intercept and handle communication activities for the host computer ', 'all of above', 'none of these', '', '1.00', '0.00', '', 'Message switches. It is used for storing and forwarding data to a large number of terminals over a single communication channel. A message switches receives data from all the terminals, stores them in a queue and routes them, one at a time, to the CPU during transmission. It also distributes messages coming from the CPU to appropriate terminals during reception.', '1', '', '', 'Yes', NULL, NULL),
(530, 1, 7, 2, 'Multiplexer is used to', 'store and forward data to a large number of terminals over a single communication channel', 'send more than one signal simultaneously over a single communication channel', 'intercept and handle communication activities for the host computer ', 'all of above', 'none of these', '', '1.00', '0.00', '', 'Multiplexer. It is a device that enables more than one signal to be sent simultaneously over one physical channel. It combines inputs from two or more terminals, computer ports or other multiplexers, and transmits the combined data stream over a single high-speed channel. At the receiving end, the highÂ¬speed channel is demultiplexed, either by another multiplexer or by software.', '2', '', '', 'Yes', NULL, NULL),
(531, 1, 7, 2, 'Front End Processor (FEP) is used to', 'store and forward data to large number of terminals over a single communication channel.', 'send more than one signal simultaneously over a single communication channel', 'intercept and handle communication activities for the host computer ', 'all of above', 'none of these', '', '1.00', '0.00', '', 'Front end processor. It is a dedicated communications system that intercepts and handles communication activities for the host computer. It is used to off-load communication tasks from the host computer, thus freeing it to devote its CPU to processing application programs.', '3', '', '', 'Yes', NULL, NULL),
(532, 1, 7, 2, 'A simplex transmission is capable of', 'transmitting data only in one direction', 'data movement m both the direction but only in one direction at a time ', 'providing a simultaneous two way communication', 'data communication only', 'none of these', '', '1.00', '0.00', '', 'Simplex: A simplex transmission is capable of transmitting data in only one direction. The sender cannot receive and the receiver cannot send. Commercial radio broadcast is a simplex type of transmission. This type of transmission is useful in analogue sampling.', '1', '', '', 'Yes', NULL, NULL),
(533, 1, 7, 3, 'A Full-duplex transmission is capable of ', 'data in one direction only ', 'data movement in both the direction but only in one direction at a time', 'providing a simultaneous two way communication', 'data communication only ', 'none of these', '', '1.00', '0.00', '', 'Full duplex: A full duplex commonly called ''Duplex'' provides for simultaneous two-way transmission. The transmission is faster because it avoids the delay that occurs in a half-duplex circuit each time direction of transmission is changed. Examples are the four wire full duplex modems used on telephone lines.', '3', '', '', 'Yes', NULL, NULL),
(534, 1, 7, 2, 'The upper value limit of an individual national electronic funds transfer (NEFT) transaction is ', '20000', '50000', '100000', 'None of the above', '', '', '1.00', '0.00', '', 'There is no upper value limit for putting through an individual NEFT transaction.', '4', '', '', 'Yes', NULL, NULL),
(535, 1, 7, 3, 'committee which has recommended for establishment of data warehouse is known as ', 'Vasudevan Committee', 'Rangarajan Committee', 'Saraf Committee', 'Shere Committee', 'None of these', '', '2.00', '0.00', '', 'The Vasudevan Committee has also recommended that the Reserve Bank of India should establish a data warehouse on banking and finance for the data collected under the regulatory provisions. Data Mining', '1', '', '', 'Yes', NULL, NULL),
(536, 1, 7, 2, 'Data mining techniques can be applied in', 'Predicting future trends based on information available', 'Credit risk analysis', 'Analysing demographic information about customers', 'All of the above', 'None of these', '', '1.00', '0.00', '', 'Data mining is a technique to reveal the strategic information hidden in the data warehouse(s). It is the process of automatically finding patterns and relations in large\r\ndatabases.', '4', '', '', 'Yes', NULL, NULL),
(537, 1, 7, 2, 'Communication technology', 'facilitates the processing of data', 'helps in transmission of data', 'enables decision support system', 'is a tool for data mining', 'All of the above', '', '1.00', '0.00', '', 'the communication technology helps in transmission of the data. With the combined application of the two, embodied as information technology,', '2', '', '', 'Yes', NULL, NULL),
(538, 1, 7, 2, 'Which of the following is the gateway in India for EDI services worldwide?', 'Satyam online', 'BSNL', 'MTNL', 'VSNL', '', '', '1.00', '0.00', '', 'Videsh Sanchar Nigam Ltd. (VSNL) provides Gateway for Electronic Data Interchange Services (GEDIS) worldwide.EDI is usually referred to as electronic funds transfer (EFT).', '4', '', '', 'Yes', NULL, NULL),
(539, 1, 7, 2, 'The universal set of standards for EDI is known as', 'EDI', 'BIS', 'EDIFACT', 'ISO', '', '', '1.00', '0.00', '', 'EDI is usually referred to as electronic funds transfer (EFT). Electronic data interchange for administration of commerce and transport (EDIFACT) is the universal set of\r\nstandards and guidelines for communication by EDI.', '3', '', '', 'Yes', NULL, NULL),
(540, 1, 7, 2, 'Decision support system (DSS) uses ', 'query language', 'adhoc report generator ', 'statistical analyser ', ' graphics', 'All of the above', '', '1.00', '0.00', '', 'The decision support systems provide the management use of query languages, ad hoc report generators, statistical analysers, graphics, etc. They also provide the\r\nmanagement with tools that can test the what-if situations to pre-test the potential outcome of different decisions.the DSS make use of complex mathematical models to aid decision making.\r\n', '5', '', '', 'Yes', NULL, NULL),
(541, 1, 7, 2, 'A typical computerised environment constitutes three interdependent but separate components. ', 'Software, hardware and data', 'Hardware, software and UPS', 'Software, modem and networking', 'Software, people ware and data ', 'None of these', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(542, 1, 7, 2, 'The risks broadly lead to:', 'Incorrect decision making leading to setback to business', ') Interruption in activities due to loss of data, hardware, software, people ware ', 'Violation of privacy', 'Direct financial loss due to computer frauds', 'All of these', '', '1.00', '0.00', '', '', '5', '', '', 'Yes', NULL, NULL),
