(544, 1, 7, 2, 'The consequences of errors in computerised systems are more serious than in manual systems because:', 'Computer systems process more data', 'Errors in computer systems are generated at high speed, and the cost to correct may be high ', 'Users of computer systems perceive the computer outputs to be always correct', 'All of above ', '(a) and (c)', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
