(546, 1, 7, 2, ' Audit for the software used is carried out by CAATT. This type is known as: ', 'The audit around the computer ', 'The audit through the computer', 'The audit with the computer ', 'All of above ', '', '', '1.00', '0.00', '', '''Computer Aided Audit Tools and Techniques'' (CAATTs) have evolved as one of the more efficient and effective ways to audit  with computer-generated files, records and documents and to evaluate internal controls over processing in a computerised environment.\r\n', '3', '', '', 'Yes', NULL, NULL),
(547, 1, 7, 3, 'Risk prone component(s) in computerised systems are: ', 'Errors and omissions in data and software ', 'Unauthorised disclosure of confidential information ', 'Computer abuse and mis-utilisation of banks assets ', 'Frauds ', 'All of above', '', '1.00', '0.00', '', '', '5', '', '', 'Yes', NULL, NULL),
(548, 1, 7, 1, 'Effective control mechanism(s) in computerised environment are:', 'Preventive', 'Detective', 'Corrective ', 'All of above', '(a)and(c) ', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(549, 1, 7, 1, ' Objective of IS security is to ensure; ', 'Confidentiality', 'Integrity', 'Availability', 'All of above ', 'None of these', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(550, 1, 6, 2, 'If a Bond is purchased at its current market price and if the coupon interest is received, the rate of return on it is measured by:', 'Yield- to-maturity of Bond', 'Current yield of Bond', '(c)	Current present value of Bond', 'Future yield of Bond', '', '', '1.00', '0.00', '', 'Measuring Yield\r\nWhile the stated (nominal) interest rate on a bond might appear to be the only measure of a bond yield, it is only accurate if you buy a bond at par (or its face value) and hold it until the bond matures. However, many investors buy bonds at prices above or below par, and many sell prior to maturity. \r\n\r\nThe following measures are used to reflect these circumstances:\r\nYield to Maturity - YTM\r\nThe return based on the actual purchase price of the bond\r\nTakes any premium or discount over par into account and uses the actual time to maturity for the number of compounding periods\r\nIf an investor buys a bond at a price below its par value (at a discount), then its YTM will be greater than its stated interest rate (also known as its coupon rate).\r\nIf an investor buys a bond above its par value (at a premium), then its YTM will be lower than its coupon rate.\r\nIf the bond was purchased at par, the yield to maturity will equal the stated coupon rate.\r\n', '2', '', '', 'Yes', NULL, NULL),
(551, 1, 6, 2, 'The formula for calculating current yield is :', 'Current yield = Current Market Price/Coupon Interest', 'Current yield = Present value/Coupon Interest', 'Current yield = Coupon Interest/ Market Price', 'Current yield = Coupon Interest/ Present value', '', '', '1.00', '0.00', '', 'Current Yield\r\nSimply, the annual income divided by the market value of the bond\r\nIf the bond is trading at a premium, the current yield will be less than the nominal yield.\r\nIf the bond is trading at a discount, the current yield will be greater than the nominal yield.\r\n\r\n', '3', '', '', 'Yes', NULL, NULL),
(552, 1, 6, 3, 'A bond of face value Rs.5000 carries a coupon interest rate of 12%. It is quoted in the market at Rs.4500. what is the current yield of the bond?', '12%', '10%', '13.3%', '14.2%', '', '', '1.00', '0.00', '', 'The formula for calculating current yield is :\r\nCurrent yield = Current Market Price/Coupon Interest\r\n\r\nA client buys a DEF 10% bond at 105. The bond matures in 10 years. What is the current yield?\r\n10.17%\r\n9.52%\r\n9.69%\r\n9.13%\r\nThe correct answer is "b", since current yield is found by dividing the annual interest payment (in this case 10% or $100) by the current market price (in this case 105% or $1,050). Note that bond par values are most often $1,000. Whether or not you know this value, it will not affect the answer, since you can merely divide the coupon in % terms by the price in % terms.\r\n', '3', '', '', 'Yes', NULL, NULL),
(553, 1, 6, 3, 'Which of the following are true about yield-to-maturity of Bonds:', 'By Yield-to-maturity (YTM), a Bondâ€™s rate of return that takes into a account interest income as well as capital gain or loss can be measured', 'YTM is Bondâ€™s internal rate of return.', 'It calculates Bondâ€™s yield or rate of return, when its current price and cash flows are known.', 'All of the above', '', '', '1.00', '0.00', '', 'Yield to Maturity - YTM\r\nThe return based on the actual purchase price of the bond\r\nTakes any premium or discount over par into account and uses the actual time to maturity for the number of compounding periods\r\nIf an investor buys a bond at a price below its par value (at a discount), then its YTM will be greater than its stated interest rate (also known as its coupon rate).\r\nIf an investor buys a bond above its par value (at a premium), then its YTM will be lower than its coupon rate.\r\nIf the bond was purchased at par, the yield to maturity will equal the stated coupon rate.\r\n', '4', '', '', 'Yes', NULL, NULL),
(554, 1, 6, 1, 'There is a Rs.5000 par value bond. Its current price is Rs.4000 and coupon rate is 10%. It maturity of 6 years. What would be the rate of return that an investor will earn if he purchases the bond and holds till maturity.', '12.1%', '14.3%', '15.34%', '11.32%', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(555, 1, 6, 3, 'Which of the following are true:', 'When the required rate of return is equal to the coupon rate, the value of the bond is equal to its par value', 'When the required rate of return is greater than the coupon rate, the value of the bond is less than its par value', 'When the required rate of return is less than the coupon rate, the value of the bond is greater than its par value', 'All of the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(556, 1, 6, 2, 'Which of the following are true:', 'A Bond price is inversely proportional to its yield to maturity.', 'For a given difference between YTM and coupon rate of Bonds, the longer the term of maturity, the greater will be the change in price with change in YTM.', 'Given the maturity the change in Bond price will be greater with a decrease in the Bondâ€™s YTM than the change in Bond price with an equal increase in the Bondâ€™s YTM.', 'All of the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(557, 1, 6, 1, 'The holding period for which interest are risk disappears is known as:', 'Safety of Bond', 'Duration of the Bond', 'Maturity of the Bond', 'Due holding period', '', '', '1.00', '0.00', '', 'Investors are subject to interest rate risk on two counts - the reinvestment of annual interest and the capital gain/loss on sale of the bond at the end of the holding  period. When the interest rates rise, there is a gain in reinvestment and a loss on liquidation', '4', '', '', 'Yes', NULL, NULL),
(558, 1, 6, 1, 'Duration of  a Bond can be calculated by the formula:', 'âˆ‘(PVÃ—T)\r\nâˆ‘PV', 'âˆ‘PV\r\nâˆ‘(PVÃ—T)', 'âˆ‘PV\r\n   T', 'âˆ‘PVÃ—âˆ‘T\r\nâˆ‘PV\r\n', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(559, 1, 6, 1, 'Consider a Bond which matures after 3 years with face value of Rs.100, carrying a coupon of 8% payable annually. What is the duration of the Bond?', '3 years', '3.2 years', '2.5 years', '2.8 years', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(560, 1, 6, 3, 'The concept of duration is also known as:', 'Mcgregor Duration', 'Macaulay Duration', 'Mozart Duration', 'Moler Duration', '', '', '1.00', '0.00', '', 'The concept was first introduced by F Macaulay and thus, is called by his name as the Macaulay Duration. It is also possible to compute the duration of an entire portfolio of bonds. It is the weighted average of the duration of the individual bonds. For an Investor a bond will be risky if the holding period of the\r\nbond is different from its duration.', '2', '', '', 'Yes', NULL, NULL),
(561, 1, 6, 1, 'The sensitivity of Bond price to changes in interest rates is called:', 'Bond sensitivity', 'Price Volatility', 'Bond Volatility', 'Bond-Price bondage', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(562, 1, 6, 1, 'Bond price and YTM are:', 'Directly proportional to each other', 'Absolutely the same', 'Inversely related', 'Not related to each other', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(563, 2, 6, 1, 'The extent of change in Bond prices for a change in YTM measures the interest rate risk of a bond.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
