(566, 1, 6, 3, 'Interest rate elasticity is defined as:', '	IE = Percentage change is yield to maturity for a Bond I\r\n         Percentage change in price for Bond in period t', '	IE = Percentage change in price for Bond in period t\r\n        Percentage change in yield to maturity for a Bond I', 'IE = Present value of Bond\r\n        -------------------------------------------------------\r\n	Percentage change in yield to maturity for a Bond', 'IE =  Percentage change in yield to maturity for a Bond\r\n   Present value of Bond', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(567, 1, 6, 1, 'Bond price elasticity can be calculated as ', 'IE = DÃ—YTM\r\n        1+YTM', 'IE = 1+YTM\r\n        DÃ—YTM', 'IE =    YTM\r\n          D+YTM', 'IE =         D\r\n        1+YTM', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(568, 1, 6, 1, 'Duration and interest rate elasticity of a Bond are:', 'Inversely related', 'Directly related', 'Not related to each other', 'Absolutely the same', '', '', '1.00', '0.00', '', 'Duration and interest rate elasticity of a Bond are Directly related.', '2', '', '', 'Yes', NULL, NULL),
(569, 1, 6, 3, 'A Bond has a face value of Rs.5000.  Its coupon rate is 8% and period of maturity is 10 years. If the current market rate 8% is changes to 10%, the price of the Bond will change to:', '25% increase in YTM would bring -12.29% change in the price', '25 increase in YTM would bring -12.29%change in the price', '25% increase in TYTM would bring 12.29% change in the price', '25 increase in YTM would bring 12.29% change in the price', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(570, 2, 6, 2, 'An irredeemable bond is one, which will be paid back by the company at the end of the specified period', '', '', '', '', '', '', '1.00', '0.00', '', 'Bonds with a fixed maturity but not subject to prior redemption; bonds that cannot be called for redemption by the issuer (payer or obligor) before maturity. They should not be confused with perpetual bonds or intermediate bonds .There is no repayment of principal', '', 'False', '', 'Yes', NULL, NULL),
