(579, 1, 6, 2, 'The concept of time value of money means:', 'A sum of money received to-day has more value than the same amount of money to be received in future, because the money received to-day can be invested to-day to get some more earning.', 'Since there is risk involved in future, an individual would always like to receive money to-day than to wait for future and be under risk.', 'The money received to-day can be used for any consumption which one may not be able to do because of future inflation and price rise.', 'All of these.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(580, 1, 6, 1, 'If one investor  wants to take decision about going in for an investment out of many he has to calculate:', 'What the value of money to be received now will be at any point in future.', 'What will be the present value of the sum of money to be received in future', 'The time value of money and to discount the future sums to be received to their present value before making a decision whether a particular investment opportunity is worth.', 'All of these', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(581, 1, 6, 1, 'Capital Budgeting involves:', 'Searching new investment ideas.', 'Estimating the cost-benefit relationships of an investment.', 'Selecting the most profitable investment for implementation.', 'All of these.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(582, 1, 6, 1, 'Time value of money is relevant in :', 'Accounting rate of return method', 'Pay back period method', 'Internal rate of return method', 'All of these', '', '', '1.00', '0.00', '', 'The internal rate of return is the rate at which an investment project promises to generate a return during its useful life.Under this method, If the internal rate of return promised by the investment project is greater than or equal to the minimum required rate of return, the project is considered acceptable otherwise the project is rejected. Internal rate of return method is also known as time-adjusted rate of return method.', '3', '', '', 'Yes', NULL, NULL),
(583, 1, 6, 1, 'The formula for calculating the present value of a sum of money to be received in future is :', 'P= F/(1+r)n', 'P=FnÃ—(1+r)', 'P=Fn/(1+r)', 'P = Fx (1+r)n', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
