(597, 1, 6, 3, 'Accounting Standard 28 deals with:', 'Impaired Assets', 'Intangible Assets', 'Contingent Assets', 'Non- Performing Assets', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(598, 1, 6, 1, 'Which of the following Indian companies are required to prepare their accounts under USGAAP.', 'All Public Limited Companies', 'Companies borrowing from US banks', 'Companies listed in US Stock Markets', 'None of the above', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(599, 1, 6, 1, 'Transfer Pricing relates to :', 'Pricing of goods and services within the divisions of a company or from parent company to a subsidiary', 'Transfer of funds from one bank to another', 'Transfer of funds from one branch to another branch of the same bank', 'Both (a) and (c) above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(600, 1, 6, 1, 'What is a nominal account:', 'An account of each person or firm with whom the trader deals', 'An account of each head of expense or source of income', 'An account of each property or possession dealt in by the trader in his business', 'None of these', '', '', '1.00', '0.00', '', 'nominal account relates to expenses,losses,income and gain.', '2', '', '', 'Yes', NULL, NULL),
(601, 1, 6, 1, ' What is the fundamental rule of debit and credit with regards to Assets or Real accounts:', 'Debit the receiver and credit the giver', 'Debit what comes in and credit what goes out', 'Debit expenses and losses and credit gains', 'All of the above.', '', '', '1.00', '0.00', '', 'real accounts relate to the tangible or intangible real assets.', '2', '', '', 'Yes', NULL, NULL),
(602, 1, 6, 1, 'How does profit made from normal business operations retained in business appear in the Balance Sheet.', 'Under Capital', 'Under Capital, Reserve and Surplus', 'Under Cash in hand and at bank', 'None of the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(603, 1, 6, 2, 'Where does the Net Profit appear in the Balance Sheet?', 'Liabilities Side', 'Assets side', 'Either a or b', 'None of these', '', '', '1.00', '0.00', '', 'net profit appears on the liabilities side of the balance sheet becoz net Profit is the amount earned by the Owner and it is always added to the Capital. As Capital is liabilty of the firm/Co. therefore it is shown on the liability side of the balance sheet. ', '1', '', '', 'Yes', NULL, NULL),
(604, 1, 6, 2, 'In double entry,  the entry is balanced with a corresponding entry, which is called: ', 'Reverse entry', 'Adjusting entry', 'Contra entry', 'Double entry', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(605, 1, 6, 2, 'For nominal accounts the fundamental rule of Debit and Credit is, Debit expenses and losses and Credit:', 'The giver', 'What goes out', 'Income &  gain', 'None of the above', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(606, 1, 6, 2, ' In book keeping Capital account is a â€¦â€¦â€¦ account?', 'Nominal', 'Real', 'Personal', 'Intangible', '', '', '1.00', '0.00', '', 'Capital account is the example of tangible or intangible asset and is the part of real account.', '2', '', '', 'Yes', NULL, NULL),
(607, 1, 6, 2, ' Where should a withdrawal of cash from business by the proprietor be credited to:', 'Drawings', 'Proprietorsâ€™ account', 'Capital account', 'Cash account', '', '', '1.00', '0.00', '', 'cash accounts are made in business only for cash transactions.so all deposit and withdrawal of cash are credited/ debited to cash account.', '4', '', '', 'Yes', NULL, NULL),
(608, 1, 6, 2, 'For nominal accounts, the fundamental rule of Debit and Credit is, Debit expenses and losses and Credit', '(a)	The giver\r\n\r\n\r\n', '(b)	What goes out', '(c)	Incomes & gains', '(d)	None of the above\r\n', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(609, 1, 6, 1, 'A person who owes money to the firm is called:', '(a)	Creditor\r\n\r\n\r\n', '(b)	Debtor', '(c)	Shareholders', '(d)	Owner\r\n', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(610, 1, 6, 2, 'In Double entry system of Book keeping every business transaction affects:', '(a)	Two accounts\r\n\r\n\r\n\r\n', '(b)	Two sides of the same account', '(c)	The same account on two different dates', '(d)	One personal and one real account', '', '', '1.00', '0.00', '', 'Double entry system means the recording of both the aspects, i.e. receiving of values and giving of values of each transaction. The two aspects are distinguished in terms of debit and credit. An account is capable of receiving and giving of values. When an account receives a value or benefit it is debited and when it gives a value or benefit, it is credited. As every transaction affects at least two accounts, one account receives a benefit of certain value; another account would give the benefit of the same value.', '1', '', '', 'Yes', NULL, NULL),
(611, 1, 6, 1, 'Following is known as the book of prime entry:', '(a)	Journal\r\n\r\n\r\n\r\n', '(b)	Cash book', '(c)	Subsidiary books', '(d)	All of the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(612, 1, 6, 1, 'Double entry book keeping refers to a system where:', '(a)	Each transaction is entered in the books by two persons to avoid frauds and mistakes\r\n\r\n\r\n\r\n', '(b)	At least two aspects of each transaction is recognized and recorded in accounts books', '(c)	Two sides of each account always tally', '(d)	Only transactions that are entered twice are recognized                                   ', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(613, 1, 6, 2, 'For a Real account, the rule for journalizing is:', '(a)	Debit the receiver credit the giver\r\n\r\n\r\n\r\n', '(b)	Debit what goes out credit what comes in', '(c)	Debit what comes in credit what goes out', '(d)	Debit Assets credit Liabilities', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(614, 1, 6, 1, 'In a transaction, the two accounts indentified:', '(a)	Should belong to only one type of account\r\n\r\n\r\n\r\n', '(b)	One of the accounts must belong to personal account', '(c)	Must be necessarily of two types-real, nominal or personal', '(d)	 May belong to any one or two or more types of accounts', '', '', '1.00', '0.00', '', 'for any transactions two accounts either real,nominal,personal may belongs to any one or two or more types of account.', '4', '', '', 'Yes', NULL, NULL),
(615, 1, 6, 1, 'Commission received in advance is of the nature of:', '(a)	Real account\r\n\r\n\r\n', '(b)	Nominal account', '(c)	Personal account', '(d)	Intangible account\r\n', '', '', '1.00', '0.00', '', 'personal account relates to natural persons,artificial person and representative persons\r\ncommission received in advance is a representative persons.', '3', '', '', 'Yes', NULL, NULL),
(616, 1, 6, 1, 'Rebate on bills discounted account is of the nature of:', '(a)	Personal account \r\n\r\n\r\n\r\n', '(b)	Real account', '(c)	Nominal account', '(d)	Intangible account', '', '', '1.00', '0.00', '', 'Rebate on bills discounted account is the example of discount received account and is the nature of nominal account.', '3', '', '', 'Yes', NULL, NULL),
(617, 1, 6, 2, 'Patents right account is of the nature of:', '(a)	Nominal account\r\n\r\n\r\n', '(b)	Personal account ', '(c)	Real account', '(d)	Intangible account\r\n', '', '', '1.00', '0.00', '', 'Patents right account is intangible real asset and is the nature of real account', '3', '', '', 'Yes', NULL, NULL),
(618, 1, 6, 1, 'Rent prepaid account is of the nature of', '(a)	Real account\r\n\r\n\r\n', '(b)	 Personal account', '(c)	Nominal account', '(d)	Intangible account\r\n', '', '', '1.00', '0.00', '', 'Rent prepaid account is a representative person and is the  category of personal account.', '2', '', '', 'Yes', NULL, NULL),
(619, 1, 6, 1, ' Salaries outstanding account belongs to the category of:', '(a)	Real account \r\n\r\n\r\n', '(b)	Personal account', '(c)	Nominal account', '(d)	Intangible account\r\n', '', '', '1.00', '0.00', '', ' Salaries outstanding account is a representative person and is the  category of personal account.', '2', '', '', 'Yes', NULL, NULL),
(620, 1, 6, 1, 'All losses and expenses are â€¦â€¦â€¦â€¦..', '(a)	Debited\r\n\r\n\r\n\r\n', '(b)	Credited', '(c)	Either debited or credited', '(d)	Recorded in cash book', '', '', '1.00', '0.00', '', 'losses and expenses is the golden rule of nominal account in which all expenses and losses are debited in  any account.', '1', '', '', 'Yes', NULL, NULL),
(621, 1, 6, 1, 'The purchase of Machinery for the business is recorded in â€¦â€¦â€¦..', '(a)	Purchase Register\r\n\r\n\r\n\r\n', '(b)	Journal', '(c)	Cash book', '(d)	Creditorsâ€™ Register', '', '', '1.00', '0.00', '', 'journal is a book of prime entry because all the transactions are entered first in this book.\r\nrecording of purchase of machinery is the prime entry in the business.so it will entered in journal.', '2', '', '', 'Yes', NULL, NULL),
(622, 1, 6, 1, 'Where should a withdrawal of cash from business by the proprietor be credited to Drawings:', '(a)	Proprietorâ€™s a/ c\r\n\r\n\r\n\r\n', '(b)	Capital a/ c', '(c)	Cash a / c', '(d)	None of the above', '', '', '1.00', '0.00', '', 'all cash deposits and cash withdrawal are recorded in debit or credit side cash account.', '3', '', '', 'Yes', NULL, NULL),
(623, 1, 6, 1, 'Goods worth Rs. 500 taken by the proprietor for personal use should be credited to:', '(a)	Sales a / c\r\n\r\n\r\n\r\n', '(b)	Proprietorâ€™s personal account', '(c)	Purchases a / c ', '(d)	Expenses account', '', '', '1.00', '0.00', '', 'drawings a/c........................dr\r\n                    to purchases a/c\r\n(this entry is in the category of special journal entry)', '3', '', '', 'Yes', NULL, NULL),
(624, 1, 6, 1, 'The amount brought in the proprietor in the business should be credited to:\r\n\r\n\r\n', '(a)	Proprietorâ€™s account\r\n\r\n\r\n', '(b)	Drawings account', '(c)	Capital Account', '(d)	Cash account', '', '', '1.00', '0.00', '', 'cash a/c.....................dr\r\n            to capital a/c', '3', '', '', 'Yes', NULL, NULL),
(625, 1, 6, 1, 'The amount of Rs. 1,000 paid to Sindh Transport Co. to send Machine to us should be debited to:\r\n', '(a)	Sindh Transport Co.\r\n\r\n\r\n\r\n', '(b)	Freight A / c', '(c)	Machine A / c', '(d)	Cash A / c', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(626, 1, 6, 1, 'Mr. X starts business with stock. The journal entry for this transaction will be:\r\n\r\n', '(a)	Debit Cash a/c credit Stock a/c\r\n\r\n\r\n', '(b)	Debit Capital a/c Stock a/c', '(c)	Debit Stock a/c credit Cash a/c', '(d)	Debit Stock a/c Credit Capital a/c', '', '', '1.00', '0.00', '', 'stock is an asset which comes in category of real account is debited(what comes in) and capital account is a representative person in personal account is credited (giver).', '4', '', '', 'Yes', NULL, NULL),
(627, 1, 6, 1, 'Sold goods worth Rs. 50,000 to Mohan, on 45 days credit. The entry for this will be:\r\n', '(a)	Debit Mohanâ€™s a/c credit Sales a/c\r\n\r\n\r\n\r\n\r\n', '(b)	Debit 45 days credit a/c credit Sales a/c', '(c)	Debit goods a/c credit Sales a/c', '(d)	Debit Cash Receivable a/c credit Sales a/c', '(e)	Debit Cash Receivable a/c credit Sales a/c', '', '1.00', '0.00', '', 'mohan is the receiver(personal account) is debited and sales is an income(nominal account) is credited to the account.', '1', '', '', 'Yes', NULL, NULL),
(628, 1, 6, 1, 'Sold to Shyam goods worth Rs. 10,000 against cheque issued by him. The entry for this will be:\r\n', '(a)	Debit Bank a/c credit Shyamâ€™s a/c\r\n\r\n\r\n\r\n', '(b)	Debit Shyamâ€™s a/c credit Sales a/c', '(c)	Debit Bank a/c credit Sales a/c', '(d)	Debit Cheque received a/c credit Sales a/c', '', '', '1.00', '0.00', '', 'bank is the receiver of cheque(personal account) is debited and sales is an income(nominal account) is credited to the account.', '3', '', '', 'Yes', NULL, NULL),
(629, 1, 6, 2, 'Rs. 1,000 paid on carriage on purchases will be recorded in journal as:\r\n', '(a)	Debit Purchases Credit Carriage a/c\r\n\r\n\r\n\r\n', '(b)	Debit Carriage Credit Purchase a/c', '(c)	Debit Carriage Inward Credit Purchase a/c', '(d)	Debit Purchases Credit Cash', '', '', '1.00', '0.00', '', 'this entries is comes under the category of special journal entries.', '3', '', '', 'Yes', NULL, NULL),
(630, 1, 6, 1, 'A Computer having a price tag of Rs. 30,000 was purchased at a discounted price of Rs. 28,000. This will be recorded as:\r\n\r\n', '(a)	Debit office Equipment a/c Rs. 30,000, Credit Cash a/c Rs. 28,000, Credit discount Received Rs. 2,000\r\n\r\n\r\n', '(b)	Debit Office Equipment a/c Rs. 28,000.', '(c)	Debit Purchases a/c Rs. 30,000, Credit Cash a/c Rs. 28,000, Credit discount Received Rs. 2,000', '(d)	Debit Purchases a/c Rs. 28,000,Credit Cash a/c Rs. 28,000', '', '', '1.00', '0.00', '', 'purchases a/c Rs. 28000\r\ndiscount received a/c Rs. 2000    \r\n                         To computer a/c Rs. 30000\r\n                   ', '2', '', '', 'Yes', NULL, NULL),
(631, 1, 6, 1, 'Paid on account Rs. 10,000 to Mahesh to whom we owe Rs. 12,000. The payment will be recorded as:\r\n\r\n', '(a)	Debit Mahesh a/c Rs. 10,000 Credit Cash a/c Rs. 10,000\r\n\r\n\r\n', '(b)	Debit Mahesh a/c Rs. 12,000 Credit Cash a/c Rs. 10,000 Credit Discount a/c Rs. 2,000', '(c)	Debit Mahesh a/c Rs. 12,000 Credit Cash a/c Rs. 10,000 Credit Commission a/c Rs. 2,000.', '(d)	Debit Mahesh a/c Rs. 10,000 Debit Discount 2,000 Credit Cash a/c Rs. 12,000.', '', '', '1.00', '0.00', '', 'mahesh is the receiver(personal account) is debited and cash paid(real account) is credited.', '1', '', '', 'Yes', NULL, NULL),
(632, 1, 6, 1, 'Of the goods purchased on Credit from Babu Lal, goods worth Rd. 5,000 were found unsuitable and returned to him. This will be accounted for as:\r\n', '(a)	Debit Babu Lal Credit Sales a/c\r\n\r\n\r\n\r\n', '(b)	Debit Sales Credit Purchases a/c', '(c)	Debit Babu Lal Credit Sales Return a/c', '(d)	Debit Babu Lal Cradit Purchases Return a/c', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(633, 1, 6, 1, 'What is a Journal?\r\n\r\n', '(a)	Original entry\r\n\r\n\r\n', '(b)	Double entry', '(c)	Duplicate entry', '(d)	None of the above', '', '', '1.00', '0.00', '', 'journal is a book of prime entry and also called a book of original entry.', '1', '', '', 'Yes', NULL, NULL),
(634, 1, 8, 1, 'INFINET is set up at ......\r\n\r\n\r\n\r\n', 'a. Mumbai', 'b. New Delhi', 'c. Hyderabad', 'd. Chennai', '', '', '1.00', '0.00', '', 'As per the recommendations of the Saraf Committee, the Reserve Bank of India decided to set up a countrywide data communication network for banks linking major centres of the country. This network christened as the INFINET (Indian Financial Network) has been set up at Hyderabad.', '3', '', '', 'Yes', NULL, NULL),
(635, 1, 8, 1, 'Limitation period for filing a suit for sale of mortgaged property is ...... years from due date.\r\n\r\n\r\n\r\n', 'a. 10 years', 'b. 12 years', 'c. 20 years', 'd. 30 years', '', '', '1.00', '0.00', '', 'Limitation period for filing a suit for sale of mortgaged property is twelve years from the date mortgage debt becomes due.', '2', '', '', 'Yes', NULL, NULL),
(636, 1, 8, 1, 'Which is not a communication processor?\r\n\r\n\r\n\r\n', 'Message switches', 'Multiplxers', 'Transponders', 'Front End Processors', '', '', '1.00', '0.00', '', 'The purpose of communication processors is to enhance data communication between two points. Communication processors can be broadly categorised as:\r\n(i) Message Switches \r\n(ii) Multiplexers \r\n(iii) Front end processors', '3', '', '', 'Yes', NULL, NULL),
(637, 1, 8, 1, 'A minor account can be opened jointly with ...\r\n\r\n\r\n\r\n', 'Natural Guardian', 'Grand Parents', 'Adult member of the family', 'Any one of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(638, 1, 8, 1, 'While raising a loan for the company, who will sign the documents on behalf of the company?\r\n\r\n\r\n\r\n', 'Managing Director', 'Authorised official as mentioned in resolution from Board of Directors', 'Executive Director', 'None of the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(639, 1, 8, 1, 'In which topology, breakdown of one station can disable the entire LAN?\r\n\r\n\r\n\r\n', 'Star', 'Bus', 'Ring', 'None of these', '', '', '1.00', '0.00', '', 'Ring Topology: A network that is connected on both ends to one source, with client machines hanging off of the ring. If you break the ring, all computers in the ring lose connectivity.', '3', '', '', 'Yes', NULL, NULL),
(640, 1, 8, 1, 'Various techniques like brainstorming sessions, surveys for need/idea identification, suggestion scheme for staff are used during ......\r\n', 'Idea screening\r\n', 'Commercial launch\r\n', 'Product Development\r\n', 'Concept testing', '', '', '1.00', '0.00', '', 'Ideas are necessary for a firm to develop a new product. These can come from various sources: customers, technical experts, employees, competitors, channel members, and top management. There are also other specialised sources like inventors, research institutions, advertising agencies and consultants.', '1', '', '', 'Yes', NULL, NULL),
(641, 1, 8, 1, '...... is a complex function requiring use of both qualitative and quantitative techniques including budgetary control, control of marketing mix, and even marketing audit.\r\n', 'Analysis\r\n', 'Planning\r\n', 'Implementation\r\n', 'Control', '', '', '1.00', '0.00', '', 'Control: Measurement and evaluation of progress against the goals and targets spelt out in the plans is an important function for determining the future course of action. This may prove to be problematic due to difficulties in measuring the performance criteria and ascertaining the cause and effect. It is a complex function requiring use of both qualitative and quantitative techniques including budgetary control, control of marketing mix, and even marketing audit.', '4', '', '', 'Yes', NULL, NULL);
INSERT INTO `questions` (`id`, `qtype_id`, `subject_id`, `diff_id`, `question`, `option1`, `option2`, `option3`, `option4`, `option5`, `option6`, `marks`, `negative_marks`, `hint`, `explanation`, `answer`, `true_false`, `fill_blank`, `status`, `created`, `modified`) VALUES
(642, 1, 8, 1, 'Which is not an objective of Test Marketing?\r\n', 'To know how the consumers and dealers react to handling, using and repurchasing the actual product\r\n', 'To learn the size of the market\r\n', 'To test the product in authentic consumer settings\r\n', 'All the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(643, 1, 8, 1, 'Mode of communication capable of receiving and transmitting at all time (i.e. Two-way communication simultaneously possible) is ......\r\n', 'Simplex\r\n', 'Semi duplex or half duplex\r\n', 'Duplex\r\n', 'None of the above', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(644, 1, 8, 1, 'Mode of communication capable of receiving and transmitting both but only one at a time is ......\r\n', 'Simplex\r\n', 'Semi duplex or half duplex\r\n', 'Duplex\r\n', '.None of the above', '', '', '1.00', '0.00', '', 'Semi duplex or half duplex transmission allows data movement in both the directions but in only one direction at a time. Modems, on a line, are a good example of a Semi duplex or half duplex. The transmitting end waits for the response from the receiving end before sending another message.', '2', '', '', 'Yes', NULL, NULL),
(645, 1, 8, 1, 'Optical fibre can carry signals at ......\r\n', '100 mega bits/sec\r\n', '500 mega bits/sec\r\n', '2 giga bits/sec\r\n', '5 giga bits/sec', '', '', '1.00', '0.00', '', 'Optical fibre: Optical fibre has been a technological breakthrough in communications. It supports data rate of 2 giga bits/sec. Fibre optics provide high quality (low error rate) transmission of signals at very high speeds.', '3', '', '', 'Yes', NULL, NULL),
(646, 1, 8, 1, 'Which is not one of the aspects which need careful scrutiny for launching a product?\r\n', 'Geographical reach\r\n', 'Timing of launch\r\n', 'Place of launch\r\n', 'Prospect consumer groups', '', '', '1.00', '0.00', '', 'Launching : The final stage is that of full-scale launch in the market. This is a stage which requires committing resources to the largest extent. The two functions which involve substantial costs are manufacturing and marketing. Decisions on the following aspects need careful scrutiny for launching a product:\r\nâ€¢ Timing of launch \r\nâ€¢ Geographical reach\r\nâ€¢ Prospect consumer groups \r\nâ€¢ Market strategy', '3', '', '', 'Yes', NULL, NULL),
(647, 1, 8, 2, 'When a firm faces a situation that the expected sales and profit do not reach the desired levels, it can adopt_______possible approaches.\r\n', '2', '3', '4', '5', '', '', '1.00', '0.00', '', 'Growth Strategies : One of the objectives of the firms is to continuously increase their sales and profit. At some point of time, a firm faces a situation that the expected sales and profit from its existing businesses do not reach the desired levels. The firms need to adopt suitable strategies to fill this strategic gap. The firms can adopt three possible approaches:\r\nâ€¢ Identify opportunities for further growth within the existing businesses (Intensive Growth)\r\nâ€¢ Identify opportunities to build or acquire businesses related to the existing businesses (Integrative Growth)\r\nâ€¢ Identify opportunities to add attractive businesses, unrelated to the existing businesses {Diversification Growth)', '2', '', '', 'Yes', NULL, NULL),
(648, 1, 8, 1, 'Example of Simplex mode of communication is ......\r\n', 'Radio broadcast\r\n', 'Walkie talkie\r\n', 'Four-wire modems\r\n', 'All of the above', '', '', '1.00', '0.00', '', 'Simplex: A simplex transmission is capable of transmitting data in only one direction. The sender cannot receive and the receiver cannot send. Commercial radio broadcast is a simplex type of transmission. This type of transmission is useful in analogue sampling.', '1', '', '', 'Yes', NULL, NULL),
(649, 1, 8, 1, 'Under PMRY, the eligible subsidy is ...... % of the project cost.\r\n', '10', '15', '20', '25', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(650, 1, 8, 1, 'If loan is sanctioned against pledge of stocks, within how many days creation of charge should be filed with Registrar of companies?\r\n', '30 Days\r\n', '45 Days\r\n', '60 Days\r\n', 'Registration not required', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(651, 1, 8, 1, 'Which is a possible approaches which can be adopted by a firm, when it faces a situation that the expected sales and profit do not reach the desired levels?\r\n', 'Intensive Growth\r\n', 'Integrative Growth\r\n', ' Diversification Growth\r\n', 'All the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(652, 1, 8, 1, 'Intensive Growth is defined as......\r\n', 'Identify opportunities for further growth within the existing businesses\r\n', 'Identify opportunities to build or acquire businesses related to the existing businesses\r\n', 'Identify opportunities to add attractive businesses, unrelated to the existing businesses\r\n', 'None of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(653, 1, 8, 2, 'During Mortgage, normally parent documents for_________years is asked for.\r\n', '10 years\r\n', '13 years\r\n', '20 years\r\n', '30 years', '', '', '1.00', '0.00', '', 'Parent documents for the prescribed period to ascertain the flow of title. Some banks call for parent documents for thirty years.', '4', '', '', 'Yes', NULL, NULL),
(654, 1, 8, 1, 'Product strategies are based on ......\r\n', 'Product Mix\r\n', 'Product Life Cycle\r\n', 'Both a & b\r\n', 'None of these', '', '', '1.00', '0.00', '', 'PRODUCT STRATEGIES : Marketing strategies which are based on the product element are called product strategies. Product strategies are of two types:\r\n1. Strategies based on "Product Mix"\r\n2. Strategies based on "Product Life Cycle"', '3', '', '', 'Yes', NULL, NULL),
(655, 1, 8, 2, 'Borrowing powers of the Board of Directors of the company can be veried by examing ...\r\n', 'a. Memorandum of Association\r\n', 'b. Articles of Association\r\n', 'c. Certificate of incorporation\r\n', 'd.None of the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(656, 1, 8, 1, 'Banknet was set up in ......\r\n', '1971\r\n', '1981\r\n', '1991\r\n', 'd.2001', '', '', '1.00', '0.00', '', 'On the communication front, Banknet and SWIFT for transmission of messages were commissioned in India in the year 1991.', '3', '', '', 'Yes', NULL, NULL),
(657, 1, 8, 1, 'The Master Earth Station of NICNET is installed in ......\r\n', 'a.Mumbai\r\n', 'b.New Delhi\r\n', 'c.Hyderabad\r\n', 'd.Chennai', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(658, 1, 8, 1, 'Diversification in which the new products have technological and/or marketing synergies with existing product lines, though the target groups of customers are entirely different is called as_______\r\n', 'Concentric diversification\r\n', 'Horizontal diversification\r\n', 'Conglomerate diversification\r\n', 'None of the above', '', '', '1.00', '0.00', '', 'Concentric diversification: The new products have technological and/or marketing synergies with existing product lines, though the target groups of customers are entirely different, e.g. an audiocassette manufacturer introduces computer tape manufacture.', '1', '', '', 'Yes', NULL, NULL),
(659, 1, 8, 2, 'Using an existing brand name to launch new or modified products in a new category is called as ......\r\n', 'Line extension\r\n', 'Brand extension\r\n', 'Multi brands\r\n', 'New brands', '', '', '1.00', '0.00', '', 'Brand extension: It is use of an existing brand name to launch new or modified products in a new category. It provides immediate recognition and quick acceptance to new products. Enfield brand was used for motorcycles. It later was used for television and gensets. Vehicle loans were available to transport operators, now they are made available with modifications to retail and agri-customers also.', '2', '', '', 'Yes', NULL, NULL),
(660, 1, 8, 1, 'Normally coaxial cables can carry signals at ......\r\n', '100 mega bits/sec\r\n', '500 mega bits/sec\r\n', '2 giga bits/sec\r\n', '5 giga bits/sec', '', '', '1.00', '0.00', '', 'Coaxial cable: The coaxial cables consist of an inner copper conductor held in position by circular spacers. The inner wire is surrounded by insulation and covered by a protective sheath. The covering protects the conductor and prevents interference of signals. The cable can carry digital signals at very high rates of 500 mega bits per second.', '2', '', '', 'Yes', NULL, NULL),
(661, 1, 8, 1, 'In Housing Loan, if EMI is not paid on due date, penal interest at ...... % will be charged normally.\r\n', '2\r\n', '3\r\n', '4\r\n', '5', '', '', '1.00', '0.00', '', 'Some banks give an option to those who have opted for the fixed rate of interest optees, to switch in to a floating rate after a certain period, either with or without penalty. If the EMI is not paid on the due date, penal interest, normally at two per cent, will be charged.', '1', '', '', 'Yes', NULL, NULL),
(662, 1, 8, 1, 'Book debts can be financed by ......\r\n', 'a. Factoring\r\n', 'b. Forfeiting\r\n', 'c. Both a and b\r\n', 'd. None of these', '', '', '1.00', '0.00', '', 'Book debts can be financed by:\r\n(a) Factoring\r\n(b) forfeiting (outright purchase of book debts)\r\n(c) Overdraft, cash credit against hypothecation of book debts', '3', '', '', 'Yes', NULL, NULL),
(663, 1, 8, 1, 'Within how many days particulars of charge should be filed with Registrar of companies from the date of creation of charge?\r\n', 'a. 30 Days\r\n', 'b. 45 Days\r\n', 'c. 60 Days\r\n', 'd.90 Days', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(664, 1, 8, 1, 'Your bank receives a cheque in inward clearing which has not been signed by the account holder. Which one of the following reasons you will select to return the cheque?\r\n', 'a. Cheque is not signed by the payee\r\n', 'b. Refer to the drawer\r\n', 'c. Cheque is not signed by the drawee\r\n', 'd.Cheque is not signed by the endorsee', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(665, 1, 8, 1, 'Banknet was set up by ......\r\n', 'a.IBA\r\n', 'b.RBI\r\n', 'c.Central Govt\r\n', 'd.None of the above', '', '', '1.00', '0.00', '', 'Banknet was set up in the year 1991 by the RBI to facilitate inter-bank transfer of messages within India. It is primarily meant for the exclusive use of the banking industry and other financial institutions and links seven cities, viz., Mumbai, New Delhi, Kolkata, Chennai, Bangalore, Hyderabad and Nagpur through leased lines.', '2', '', '', 'Yes', NULL, NULL),
(666, 1, 8, 1, 'A collaborative network that uses Internet Technology to link business with their suppliers is ......\r\n', 'a.Internet\r\n', 'b.Intranet\r\n', 'c.Extranet\r\n', 'd.WAN', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(667, 1, 8, 1, 'Banknet was set up by ......\r\n', 'a.IBA\r\n', 'b.RBI\r\n', 'c.Central Govt\r\n', 'd.None of the above', '', '', '1.00', '0.00', '', 'Banknet was set up in the year 1991 by the RBI to facilitate inter-bank transfer of messages within India. It is primarily meant for the exclusive use of the banking industry and other financial institutions and links seven cities, viz., Mumbai, New Delhi, Kolkata, Chennai, Bangalore, Hyderabad and Nagpur through leased lines.', '2', '', '', 'Yes', NULL, NULL),
(668, 1, 8, 1, 'Banknet link ...... cities\r\n', '5', '6', '7', '8', '', '', '1.00', '0.00', '', '''Banknet'' was set up in the year 1991 by the RBI to facilitate inter-bank transfer of messages within India. Itis primarily meant for the exclusive use of the banking industry and other financial institutions and links seven cities, viz., Mumbai, New Delhi, Kolkata, Chennai, Bangalore, Hyderabad and Nagpur through leased lines.', '3', '', '', 'Yes', NULL, NULL),
(669, 1, 8, 1, 'INDONET was set up by ......\r\n', 'a.RBI\r\n', 'b.CMC Ltd\r\n', 'c.TCS\r\n', 'd.None of the above', '', '', '1.00', '0.00', '', 'INDONET was set up by CMC Ltd., in the 1980s and was among the first countrywide networks in India. It has host computers at Hyderabad, Mumbai, Delhi, Kolkata and Chennai and access points at Pune, Vizag, Bangalore and Ahmedabad. It is built around X.25 protocol which allows flexibility in heterogeneous hardware connectivity. It can be accessed via dialup/ dedicated VHF radio links. It also provides a gateway to INET for a wider geographical spread in India and connectivity to other international networks like, Telenet, Tymnet of USA, Telepack of Singapore, Datex of Germany. It has recently added fault tolerant mainframes which offer high uptime and greater processing facilities.', '2', '', '', 'Yes', NULL, NULL),
(670, 1, 8, 1, 'Communication software which allows free format messaging and file transfer on Banknet infrastructure\r\nis ......\r\n', 'a.NICNET\r\n', 'b.Banknet\r\n', 'c.RBI Net\r\n', 'd.Indonet', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(671, 1, 8, 1, 'Cash budget is a payment of ......\r\n', 'a. cash Receipts\r\n', 'b. cash payments\r\n', 'c. either a or b\r\n', 'd.both a and b', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(672, 1, 8, 1, 'cash flow statements deals with ......\r\n', 'a. cash funds\r\n', 'b. non-cash funds\r\n', 'c. both a and b\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(673, 1, 8, 1, 'Coins are issued by\r\n', 'a. RBI\r\n', 'b. Govt of India\r\n', 'c. both a and b\r\n', 'd. None of these', '', '', '1.00', '0.00', '', 'RBI has the sole authority for the issuance of currency notes and putting them into circulation, withdrawing them or exchanging them. RBI has issued and put in circulation notes in the denomination of Rs. 2, 5, 10, 20, 50, 100, 500 and 1000, except Rs. 1 notes and all coins, which are issued by the Government of India, but put into circulation by RBI.', '2', '', '', 'Yes', NULL, NULL),
(674, 1, 8, 1, 'Universal Banking means...\r\n', 'a. International Banking\r\n', 'b. Wholesale Banking\r\n', 'c. Offering multiple Financial Products\r\n', 'd. All of the above', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(675, 1, 8, 2, 'Banknet doesn''t link ......\r\n', 'a. Nagpur\r\n', 'b. Bangalore\r\n', 'c. Hyderabad\r\n', 'd. Ahmedabad', '', '', '1.00', '0.00', '', 'a communication network, ''Banknet'' was set up in the year 1991 by the RBI to facilitate inter-bank transfer of messages within India. It is primarily meant for the\r\nexclusive use of the banking industry and other financial institutions and links seven cities, viz., Mumbai, New Delhi, Kolkata, Chennai, Bangalore, Hyderabad and Nagpur through leased lines', '4', '', '', 'Yes', NULL, NULL),
(676, 1, 8, 1, 'One of the objective of Style improvement is ......\r\n', 'a. Products'' versatility\r\n', 'b. Aesthetic appeal\r\n', 'c. Durability\r\n', 'd. Convenience', '', '', '1.00', '0.00', '', 'Style improvement: This is aimed at increasing the aesthetic appeal of the product. The purpose of making such modifications is to get more consumers interested in using the product and to retain the customers likely to switch to competing products.', '2', '', '', 'Yes', NULL, NULL),
(677, 1, 8, 2, 'Introducing additional brands in an existing product category is called as ......\r\n', 'a. Line extension\r\n', 'b. Brand extension\r\n', 'c. Multi brands\r\n', 'd.New brands', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(678, 1, 8, 1, 'Banks access Banknet with ......\r\n', 'a. RBI Net\r\n', 'b. INET\r\n', 'c. COMET\r\n', 'd. INDONET', '', '', '1.00', '0.00', '', 'User banks access BANKNET through leased lines at the respective local centres with COMET (Computerised Message Transfer and File Transfer) software. The message transfer utility enables 400 users to login at a time at each node.', '3', '', '', 'Yes', NULL, NULL),
(679, 1, 8, 1, 'The message transfer utility of COMET enables ...... users to login at a time at each node.\r\n', 'a.200\r\n', 'b.2000\r\n', 'c.400\r\n', 'd.4000', '', '', '1.00', '0.00', '', 'User banks access BANKNET through leased lines at the respective local centres withCOMET (Computerised Message Transfer and File Transfer) software. The message transfer utility enables 400 users to login at a time at each node.', '3', '', '', 'Yes', NULL, NULL),
(680, 1, 8, 2, 'Total amount of transactions are accumulated and debited to the customerâ€™s account in ......\r\n', 'a.Debit Card\r\n', 'b.Credit Card\r\n', 'c.Charge Card\r\n', 'd.Smart Card', '', '', '1.00', '0.00', '', 'Charge Card: In this, transactions by the cardholder are accumulated over a period of time, generally a month and the total amount is charged, i.e. debited to the account of the cardholder. The cardholder is given time of about 25 to 50 days to credit his account, in case there are insufficient funds in his account at the time of debit.', '3', '', '', 'Yes', NULL, NULL),
(681, 1, 8, 1, 'As per Basel 2 Recommendations, the subordinate Term Debt are restricted to...\r\n\r\n', 'a. 25% of Tier I Capital\r\n', 'b. 50% of Tier I Capital\r\n', 'c. 25% of Tier II Capital\r\n', 'd. 50% of Tier II Capital', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
