(684, 1, 8, 2, 'In respect of which one of the following co-operative institutions the percentage share of deposits in\r\ntheir total financial resources is the lowest among all the institutions given in the list?\r\n', 'a. PACS\r\n', 'b. DCCB\r\n', 'c. SCB\r\n', 'd. PLDB', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(685, 1, 8, 2, 'Under PMRY scheme, which is not levied?\r\n', 'a. Penal Interest\r\n', 'b. Processing charges\r\n', 'c. both a and b\r\n', 'd. None of these', '', '', '1.00', '0.00', '', 'The Prime Minister''s Rozgar Yojana (PMRY) has been designed to provide employment to the educated unemployed youth by setting up of micro enterprises by the educated unemployed poor. It relates to the setting up of the self-employment ventures for industries, services and business. The scheme covers the whole of the country.', '3', '', '', 'Yes', NULL, NULL),
(686, 1, 8, 2, 'The service provided by HSBC which allows the customer to access their accounts from a PC installed at his office or at their home is called ......\r\n', 'a. Corporate Banking\r\n', 'b. Hexagon\r\n', 'c. Personal Banking\r\n', 'd. Both a & c', '', '', '1.00', '0.00', '', 'HSBC Ltd.has taken the concept of remote banking further by providing a service called Hexagon, which allows the customer to access his accounts from a PC that is\r\ninstalled at his office or at his home - that is desktop banking - for the customer. This access is also available for worldwide locations, giving the customer fingertip access to his accounts worldwide.', '2', '', '', 'Yes', NULL, NULL),
(687, 1, 8, 1, 'Which one comes under Terrestrial cables?\r\n', 'a. Copper wire-pair\r\n', 'b. Coaxial pair\r\n', 'c. Optical fibre\r\n', 'd. All of them', '', '', '1.00', '0.00', '', 'Terrestrial cables: Three of the most commonly used wiring techniques are the twisted pair, coaxial cables and the fibre optics.', '4', '', '', 'Yes', NULL, NULL),
(688, 1, 8, 1, 'How many types of diversification are generally observed?\r\n', 'a. 2\r\n', 'b. 3\r\n', 'c. 4\r\n', 'd. 5', '', '', '1.00', '0.00', '', 'Diversification refers to entering attractive opportunities which are outside the existing businesses of the firm. When a firm identifies a highly attractive industry and when the requisite business mix strengths are already present in it, it has an attractive business opportunity for diversification. Three types of diversification are generally observed:\r\n(a) Concentric diversification: \r\n(b) Horizontal diversification: \r\n(c) Conglomerate diversification:', '2', '', '', 'Yes', NULL, NULL),
(689, 1, 8, 1, 'There are ...... stages of branding in banking services.\r\n', 'a. 2\r\n', 'b. 3\r\n', 'c. 4\r\n', 'd. 5', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(690, 1, 8, 2, 'The customer has the option to pay the entire amount once in a month or pay in installments in ......\r\n', 'a. Debit Card\r\n', 'b. Credit Card\r\n', 'c. Charge Card\r\n', 'd. Smart Card', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(691, 1, 8, 1, 'SGYS scheme came into operation from ......\r\n', 'a. 01.03.1998\r\n', 'b. 01.04.1998\r\n', 'c. 01.03.1999\r\n', 'd. 01.04.1999', '', '', '1.00', '0.00', '', 'SELF-HELP GROUPS AND SGSY SCHEME The SGYS scheme has come into operation from 1 April, 1999 replacing all other schemes like the IRDP, TRYSEM, DWCRA, SITRA, GKJ, MWS, etc. The objective of the scheme is to bring the poor people above the poverty line within three years.', '4', '', '', 'Yes', NULL, NULL),
(692, 1, 8, 1, 'Cash budget deals with ......\r\n', 'a. cash transactions\r\n', 'b. non-cash transactions\r\n', 'c. both a and b\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(693, 1, 8, 1, 'Who are eligible for subsidy under SHG?\r\n', 'a. All the members\r\n', 'b. only BPL members\r\n', 'c. only APL members\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '''Self-Help Group(SHG) is a voluntary association of poor formed with the common goal of social and economic empowerment.only below poverty line(BPL) member are eligible for subsidy under SHG.', '2', '', '', 'Yes', NULL, NULL),
