(697, 1, 8, 1, 'An audiocassette manufacturer introduces computer tape manufacture is an example of ......\r\n', 'a. Concentric diversification\r\n', 'b. Horizontal diversification\r\n', 'c. Conglomerate diversification\r\n', 'd.None of the above', '', '', '1.00', '0.00', '', 'Concentric diversification: The new products have technological and/or marketing synergies with existing product lines, though the target groups of customers are entirely different, e.g. an audiocassette manufacturer introduces computer tape manufacture.', '1', '', '', 'Yes', NULL, NULL),
(698, 1, 8, 2, 'Using a new brand name for a new product, either when entering a new product category or when it is felt that the existing brand power is waning is called as ......\r\n', 'a. Line extension\r\n', 'b. Brand extension\r\n', 'c. Multi brands\r\n', 'd. New brands', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
