(701, 1, 8, 1, 'Integrative Growth is defined as......\r\n', 'a. Identify opportunities for further growth within the existing businesses\r\n', 'b. Identify opportunities to build or acquire businesses related to the existing businesses\r\n', 'c. Identify opportunities to add attractive businesses, unrelated to the existing businesses\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(702, 1, 8, 1, 'The benefits of test marketing are ......\r\n', 'a. An opportunity to decide about launching or dropping the product\r\n', 'b. Determining the suitable consumers\r\n', 'c. More reliable forecast of future sales\r\n', 'd. Determining the better promotional strategies', '', '', '1.00', '0.00', '', 'objectives of test marketing are:\r\nâ€¢ To test the product in authentic consumer settings\r\nâ€¢ To learn the size of the market\r\nâ€¢ To know how the consumers and dealers react to handling, using and repurchasing the actual product', '2', '', '', 'Yes', NULL, NULL),
(703, 1, 8, 1, 'Mode of communication capable of only transmitting data but not receiving is ......\r\n', 'a. Simplex\r\n', 'b. Semi duplex or half duplex\r\n', 'c. Duplex\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(704, 1, 8, 1, 'Example of Duplex mode of communication is ......\r\n', 'a. Radio broadcast\r\n', 'b. walkie talkie\r\n', 'c. Four-wire modems\r\n', 'd. All of the above', '', '', '1.00', '0.00', '', 'A duplex communication system is a point-to-point system composed of two connected parties or devices that can communicate with one another in both directions. "Duplex" comes from "duo" that means "double", and "plex" that means "structure" or "parts of"; thus, a duplex system has two clearly defined data transmissions, with each path carrying information in only one direction: A to B over one path, and B to A over the other.', '3', '', '', 'Yes', NULL, NULL),
(705, 1, 8, 1, 'Which one doesn''t come under plastic money?\r\n', 'a. Credit Card\r\n', 'b. Charge Card\r\n', 'c. Debit Card\r\n', 'd. None of these', '', '', '1.00', '0.00', '', 'plastic money is the generic term for all types of bank cards, credit cards, debit cards, smart cards, etc.\r\n\r\n', '4', '', '', 'Yes', NULL, NULL),
(706, 1, 8, 2, 'Which is not a criteria generally adopted for short listing the ideas generated?\r\n', 'a. Should build on the resources and the skills of the firm\r\n', 'b. Should be suggested by the staffs\r\n', 'c. Should have sufficient market potential\r\n', 'd. Should fit into the overall strategy of the firm', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(707, 1, 8, 2, 'No-frills savings bank account, multi-city cheque book facility of savings bank account are example for\r\n', 'a. Line extension\r\n', 'b. Brand extension\r\n', 'c. Multi brands\r\n', 'd. New brands', '', '', '1.00', '0.00', '', 'Line extension  is introduction of additional items in an existing product category underthe same brand name, say with new ingredients, form, flavours or package size. It is a lowcost low-risk way of introduction of new products to meet desires for variety. HLL launched Surf Ultra, Surf Excel, Surf Excelmatic and International Surf Excel as line extensions of Surf. No-frills savings bank account, multi-city chequebook facility, sweep facility are variants of savings bank account.', '1', '', '', 'Yes', NULL, NULL),
(708, 1, 8, 2, 'Which one doesn''t belong to Money Market?\r\n', 'a. T. Bills\r\n', 'b. Commercial Papers\r\n', 'c. PSU Bonds\r\n', 'd. Certificate of Deposits', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(709, 1, 8, 1, 'Normally, the amount of advance payment made to the seller by the buyer before issue of guarantee is___\r\n', 'a. 5-10%\r\n', 'b. 10-15%\r\n', 'c. 15-20%\r\n', 'd. 20-25%', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(710, 1, 8, 2, 'Which one ensures high speed with laser beam light source?\r\n', 'a. Copper wire-pair\r\n', 'b. Coaxial pair\r\n', 'c. Optical fibre\r\n', 'd. All of them', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(711, 1, 8, 1, 'In the maturity stage of its life cycle, the sales of a product______\r\n', 'a. Increases\r\n', 'b. Declines\r\n', 'c. Stands Still\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', 'Products have a life cycle with four phases of introduction, growth, maturity and decline. The product life cycle operates on three levels - product, product sub-category and brand. Product modification is a widely used strategy for marketing especially in maturity stage. Product elimination is an appropriate strategy for dealing with products in their decline stage.', '2', '', '', 'Yes', NULL, NULL),
(712, 1, 8, 1, 'One of the objective of Quality improvement is ......\r\n', 'a. Products'' versatility\r\n', 'b. Aesthetic appeal\r\n', 'c. Durability\r\n', 'd. Convenience', '', '', '1.00', '0.00', '', 'Quality improvement : This is done with the objective of improving the functional performance (durability, reliability, speed) of the product.', '3', '', '', 'Yes', NULL, NULL),
(713, 1, 8, 1, 'Commonly used medium of communication in banking\r\n', 'a. Coaxial Cables\r\n', 'b. Fibre Optic Cable\r\n', 'c. Telephone Lines\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(714, 1, 8, 1, 'â€˜DOSâ€™ floppy disk does not have ......\r\n', 'a. A Boot Record\r\n', 'b. A File Allocation Table\r\n', 'c. A Root Directory\r\n', 'd. Virtual Memory', '', '', '1.00', '0.00', '', 'Disk Operating System refer to an operating system software used in most computers that provides the abstraction and management of secondary storage devices and the information on them (e.g., file systems for organizing files of all sorts). ', '4', '', '', 'Yes', NULL, NULL),
(715, 1, 8, 3, 'Which is not a major reason for product elimination?\r\n', 'a. Excessive administration expenditure and time\r\n', 'b. Sales keep declining continuously and there is no possibility of increasing sales\r\n', 'c. Profits keep declining continuously and there is no possibility of improving profits\r\n', 'd. All the above', '', '', '1.00', '0.00', '', 'In the decline stage, the sales of a product are low but the costs are high. Weak products demand more resources in terms of the time management and marketing personnel. These also require greater marketing efforts and higher expenses. Some products may reach a stage that their demand reduces to almost nil level, in spite of marketing strategies and programmes.\r\n                            The major reasons for product elimination are:\r\nâ€¢ Sales keep declining continuously and there is no possibility of increasing sales.\r\nâ€¢ Profits keep declining continuously and there is no possibility of improving profits.\r\nâ€¢ Product prices are declining continuously and it may be difficult for the firm to supply at the prevailing market price.\r\nâ€¢ Product is no more effective in achieving the desired objective, and there is no possibility of this happening in future.\r\nâ€¢ Emergence and growth of substitute products may drive the product out of market\r\nâ€¢ Excessive administration expenditure and time.', '4', '', '', 'Yes', NULL, NULL),
(716, 1, 8, 2, 'An audiocassette manufacturer starts manufacturing cassette holding trays is an example of ......\r\n', 'a. Concentric diversification\r\n', 'b. Horizontal diversification\r\n', 'c. Conglomerate diversification\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(717, 1, 8, 2, 'â€˜MICRâ€™ technology used for clearance of cheques by banks refers to ......\r\n', 'a. Magnetic Ink Character Recognition\r\n', 'b. Magnetic Intelligence Character Recognition\r\n', 'c. Magnetic Information Cable Recognition\r\n', 'd. Magnetic Insurance Cases Recognition', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(718, 1, 8, 2, 'The regulator for Mutual Funds in India is......\r\n', 'a. FIMMDA\r\n', 'b. AMFI\r\n', 'c. RBI\r\n', 'd.SEBI', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(719, 1, 8, 2, 'Individual customers are covered by ...... of CIBIL.\r\n', 'a. Personal Credit Bureau\r\n', 'b. Consumer Credit Bureau\r\n', 'c. Retail Credit Bureau\r\n', 'd.Commercial Credit Bureau', '', '', '1.00', '0.00', '', 'CIBIL is a composite credit bureau, which caters to both commercial and consumer segments. The Consumer Credit Bureau covers credit availed by individuals while the Commercial Credit Bureau covers credit availed by non-individuals such as partnership firms, proprietary concerns, private and public limited companies, etc.', '2', '', '', 'Yes', NULL, NULL),
(720, 1, 8, 2, 'A company which pools money from investors and invests in stocks, bonds, shares is called\r\n', 'a. A bank\r\n', 'b. An insurance company\r\n', 'c. Bancassurance\r\n', 'd.Mutual Fund', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(721, 1, 8, 1, 'Which is not a type of Power of Attorney (P/A) generally granted?\r\n', 'a. General\r\n', 'b. Limited\r\n', 'c. Universal\r\n', 'd. None of these', '', '', '1.00', '0.00', '', 'Two types of P/A are generally granted:\r\n1. General or universal\r\n2. Special or limited.', '4', '', '', 'Yes', NULL, NULL),
(722, 1, 8, 1, 'â€œBuy Now â€“ Pay Nowâ€ is commonly used for ......\r\n', 'a. Debit Cards\r\n', 'b. Vault Cards\r\n', 'c. Credit Cards\r\n', 'd. E-purse', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(723, 1, 8, 2, 'Open Systems Interconnection (OSI) Model consists of ......\r\n', 'a. 5-layers\r\n', 'b. 6-layers\r\n', 'c. 7-layers\r\n', 'd. 8-layers', '', '', '1.00', '0.00', '', 'The Open Systems Interconnection (OSI) Model is a conceptual and logical layout that defines network communication used by systems open to interconnection and communication with other systems.  The model is broken into seven subcomponents, or layers, each of which represents a conceptual collection of services provided to the layers above and below it.', '3', '', '', 'Yes', NULL, NULL),
(724, 1, 8, 1, 'Internet is ......\r\n', 'a. Network of LAN\r\n', 'b. Network of ATMs\r\n', 'c. Network of ALPMs\r\n', 'd. Network of Networks', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(725, 1, 8, 2, 'A passive threat to computer security is ......\r\n', 'a. Malicious Intent\r\n', 'b. Sabotage\r\n', 'c. Accidental Errors\r\n', 'd. Espionage Agents', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(726, 1, 8, 2, 'Which is not a function of a bank?\r\n', 'a. Remittances\r\n', 'b. Discounting of bills\r\n', 'c. Conducting foreign exchange/Govt transactions\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(727, 1, 8, 3, 'In Garnishee Order, the personal account of a partner ...... for the debts of the firm.\r\n', 'a. can be attached\r\n', 'b. can''t be attached\r\n', 'c. can be attached if ordered so by the court\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(728, 1, 8, 2, 'Mandate is a ...... agreement\r\n', 'a. stamped\r\n', 'b. unstamped\r\n', 'c. memorandum\r\n', 'd. letter', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(729, 1, 8, 2, 'Customer keeps certain valuables with the bank for safe-keeping. Here the bank is a ......\r\n', 'a. Debtor\r\n', 'b. Creditor\r\n', 'c. Trustee\r\n', 'd. Lessee', '', '', '1.00', '0.00', '', 'If a customer keeps certain valuables or securities with the bank for safe-keeping or deposits a certain amount of money for a specific purpose, the banker, besides becoming a bailee, is also a trustee. In the case of Subramanyan Pillai and Others vs. Palai Central Bank Ltd. (AIR 1962 Ker. 210), certain persons deposited Rs. 2,000 each in the bank as guarantee money to purchase cars. The bank failed before they could get the vehicle. The court was of the view that the bank should act as a trustee and that the money should be refunded from the bank''s asset on the basis of preferential debts. A trustee holds money or assets and performs certain\r\nfunctions for the benefit of other person called beneficiary.', '3', '', '', 'Yes', NULL, NULL),
(730, 1, 8, 3, 'If Garnishee Order is in a single name, and the account is in joint names with Operating clause "Either or\r\nSurvivor", the money in the account ......\r\n', 'a. can be attached\r\n', 'b. can''t be attached\r\n', 'c. can be attached if ordered so by the court\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
