(732, 1, 8, 2, 'The network interface card of LAN is related to following layer of OSI Model Transport\r\n', 'a. Network\r\n', 'b. Data Link\r\n', 'c. Physical\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
