(734, 1, 8, 3, 'If in a cheque, amount stated in words and figure are not same, then ......\r\n', 'a. amount stated in words shall be paid\r\n', 'b. amount stated in figure shall be paid\r\n', 'c. cheque should be returned with reason "amount in words and figure differs"\r\n', 'd. any one of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
