(749, 2, 9, 1, '	A cash book also serves the purpose of cash account', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(750, 2, 9, 2, '	Cheques received from the customers are recorded on the credit side of the columnar cash book.', '', '', '', '', '', '', '1.00', '0.00', '', 'Cheques received from the customer and deposited into the bank are recorded on the debit side in the Cash book in the bank deposits column', '', 'False', '', 'Yes', NULL, NULL),
(751, 2, 9, 2, '	Interest allowed by the bank will be entered on the debit side of the cash book in the cash column.', '', '', '', '', '', '', '1.00', '0.00', '', ' Interest allowed by the bank is entered on the debit side in the bank deposits column.', '', 'False', '', 'Yes', NULL, NULL),
(752, 2, 9, 2, 'A bearer cheque received from a customer or paid to a supplier will always be entered in the cash column of the cash book.', '', '', '', '', '', '', '1.00', '0.00', '', 'Cheques received and issued are recorded only in the bank columns of the cash book.', '', 'False', '', 'Yes', NULL, NULL),
(753, 2, 9, 2, 'Credit sales are recorded on the credit side of the cash book.', '', '', '', '', '', '', '1.00', '0.00', '', 'Only cash transactions are recorded in Cash book. Credit sales are entered in the Sales book or in the Journal.', '', 'False', '', 'Yes', NULL, NULL),
