(755, 3, 9, 1, 'Cash column of cash book can never have a â€¦â€¦â€¦ balance.', '', '', '', '', '', '', '1.00', '0.00', '', 'When the rule of "debit what comes in and credit what goes out " is followed in cash book,it cannot show credit balance since you cannot spend more than the receipt ie.,what goes out can not be more than what comes in. Therefore cash book show debit balance. ', '', '', 'Credit', 'Yes', NULL, NULL),
