(782, 1, 9, 3, 'Whenever there is difference between the balance/overdraft shown by pass Book and shown by Cash book, it may be due to\r\n', 'a.	Debits in bank column of cash book but no credits in pass book e.g. Cheques deposited but no credited', 'b.	Credits in the bank column of cash book but no debits in Pass book e.g Cheques issued by but no presented for payment\r\n', 'c.	Debits in  pass book but no credits in the bank column cash book e.g. bank charges, interest on overdrafts, payments for standing instructions, dishonour of cheque deposited by the customer, errors by bank, etc.\r\n(Internal transfer of the bank affecting customerâ€™s A/c like credits in pas book  but no debits in the bank column of the cash book e.g. Internest on savings balance, amount collected by towards interest or dividend, direct deposits into the customerâ€™s account by bank, etc.)\r\n\r\n', 'd.	All the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
