(786, 1, 9, 1, 'Bank reconciliation statement is prepared to ascertain the causes of the difference between\r\n\r\n', 'a.	The balance as per the bank column of the cash book and the balance as per pass book\r\n', 'b.	The balance as per the cash column of the cash book and the balance as per pass book\r\n', 'c.	Neither of the two\r\n', 'd.	Both of the two', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(787, 1, 9, 3, 'A Bank Reconciliation is prepared, so that the difference in the under noted balances is recoiled\r\n', 'a.	The difference in the balance in the cash column and bank column of the Cash book\r\n', 'b.	The difference in the balance in the pass book at the beginning and at the end\r\n\r\n', 'c.	The difference in the cash book and pass book balances as on a date\r\n', 'd.	The difference in bank ledger and pass book', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
