(789, 1, 9, 1, 'Entries for issuance of cheques are made immediately by the customer to the credit of Cash Book, but the bank debits the customer account\r\n\r\n', 'a.	Immediately\r\n', 'b.	On presentation over counter\r\n', 'c.	On presentation in clearing\r\n', 'd.	On presentation on counter or in clearing\r\n', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(790, 1, 9, 1, 'Functions of a Trial Balance\r\n', 'a.	To act as a device to check the arithmetical accuracy of the accounting process\r\n', 'b.	To provide summary position of each account and accounts in general\r\n', 'c.	To act as a starting point for preparation of Final accounts\r\n\r\n', 'd.	All of the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(791, 1, 9, 2, 'Errors arising from not observing the accounting principles correctly are called\r\n', 'a.	Errors of Commission\r\n\r\n', 'b.	Errors of Principle\r\n', 'c.	Errors of Omission\r\n', 'd.	Mathematical errors', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(792, 1, 9, 1, 'Wages paid for the erection of machine debited to wages a/c is\r\n', 'a.	Error of Principle\r\n\r\n', 'b.	Error of Commission\r\n', 'c.	Error of Omission\r\n', 'd.	Error of Mathematics', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(793, 1, 9, 1, 'An amount of Rs.5,000 paid to Anand against an acceptance was debited to Sanjayâ€™s account. The rectification of this error will\r\n', 'a.	Increase the net profit\r\n\r\n', 'b.	Reduce no effect on the net profit\r\n', 'c.	Have not effect on the net profit\r\n', 'd.	Affect any purchase account', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(794, 1, 9, 2, 'The preparation of Trial balance helps in \r\n', 'a.	Locating clerical errors\r\n', 'b.	Locating errors of omission\r\n', 'c.	Locating errors of principle\r\n', 'd.	None of the above\r\n', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(795, 1, 9, 2, 'Errors which affect one account can be\r\n', 'a.	Errors of full omission\r\n\r\n', 'b.	Errors of principle\r\n', 'c.	Errors of posting\r\n', 'd.	None of the above', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(796, 1, 9, 2, 'Errors of commission arise when\r\n', 'a.	Any transaction is incorrectly recorded, either wholly or partially\r\n\r\n', 'b.	Any transaction is left wholly or partially\r\n', 'c.	Any transaction is recorded in a fundamentally incorrect manner\r\n', 'd.	All of the above', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(797, 1, 9, 1, 'The error in the casting of Sales Book is\r\n', 'a.	error of Principle\r\n\r\n', 'b.	error of commission\r\n', 'c.	error of omission\r\n', 'd.	none of the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(798, 1, 9, 1, 'An error may be located anytime\r\n', 'a.	Immediately, after located anytime\r\n', 'b.	After the entry is passed, but before preparing the Trial Balance\r\n', 'c.	After the preparation of Trial balance\r\n', 'd.	After the preparation of final accounts\r\n', 'e.  All of the above.', '', '1.00', '0.00', '', '', '5', '', '', 'Yes', NULL, NULL),
(799, 1, 9, 1, 'Which  of the following is a capital expenditure:\r\n\r\n', 'a.	Expenses incurred to move the stock from one place to another\r\n', 'b.	Renovation of the Cinema hall to convert it into PVR\r\n', 'c.	Providing a new Tube fitting in the office \r\n', 'd.	Repair of machinery\r\n', '', '', '1.00', '0.00', '', ' capital expenditure:- Payments made in cash or cash equivalents over a period of more than one year. Capital expenditures are used to acquire assets or improve the useful life of existing assets. An example of a capital expenditure is the funding to construct a factory. ', '2', '', '', 'Yes', NULL, NULL),
(800, 1, 9, 1, 'Expenditure for training employees for better running of the machinery\r\n', 'a.	Revenue charge \r\n\r\n', 'b.	Deferred revenue charge \r\n', 'c.	Capital charge \r\n', 'd.	Deferred capital charge ', '', '', '1.00', '0.00', '', 'Revenue expenditure is expenditure concerned with the costs of doing business on a day to day basis. When companies make a revenue expenditure, the expense provides immediate benefits, rather than long term ones. ', '1', '', '', 'Yes', NULL, NULL),
(801, 1, 9, 1, 'Which of the following is a Capital Expenditure\r\n', 'a.	Rs. 12000 spent on repairs of Machine\r\n\r\n', 'b.	Rs. 12000 Spent on overhaul of machine purchased second hand\r\n', 'c.	Rs. 12,000 Spent on overhaul of machine already installed\r\ns', 'd.	Rs. 12,000 Spent on purchase of good', '', '', '1.00', '0.00', '', ' capital expenditure:- Payments made in cash or cash equivalents over a period of more than one year. Capital expenditures are used to acquire assets or improve the useful life of existing assets. An example of a capital expenditure is the funding to construct a factory. ', '3', '', '', 'Yes', NULL, NULL),
(802, 1, 9, 2, 'Deferred expenditure is one which is basically a â€¦â€¦â€¦ expenditure, but charging of the expenditure to Profit & Loss account is deferred as the benefit of such expenditure is to remain with the organization for more than one year:\r\n\r\n', 'a.	Revenue\r\n', 'b.	Capital\r\n', 'c.	Small\r\n', 'd.	Big', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(803, 1, 9, 1, 'Cost of Rs. 30,000 for dismantling, removing and reinstalling plant by a sugar mill incurred in connection with the removal of works to a more suitable locality\r\n', 'a.	Capital expenditure\r\n\r\n', 'b.	Deferred revenue expenditure\r\n', 'c.	Revenue expenditure\r\n', 'd.	Deferred capital expenditure', '', '', '1.00', '0.00', '', '( This expenditure has not resulted into acquiring of an asset, nor improved the earning capacity and the benefits for change of premises will be enjoyed over a long period.)\r\n', '2', '', '', 'Yes', NULL, NULL),
(804, 2, 9, 1, 'A revenue expenditure of one party of one party may be capital receipt of the other party.', '', '', '', '', '', '', '1.00', '0.00', '', 'if a dealer in old cars purchases an old car, it is a revenue expenditure for the dealer, but capital receipt for the seller of the car.', '', 'True', '', 'Yes', NULL, NULL),
(805, 2, 9, 2, '	Receipts from sale of machinery is revenue receipt.', '', '', '', '', '', '', '1.00', '0.00', '', 'It is False in normal circumstances. It is a capital receipt because of sale of asset. However, if the machine is sold by a dealer of machines, it is a revenue receipt for him.', '', 'False', '', 'Yes', NULL, NULL),
(806, 2, 9, 2, 'Debentures receipts are revenue receipts.', '', '', '', '', '', '', '1.00', '0.00', '', 'Sale of Debentures is a capital receipt-these are non-recurring and do not arise in normal activities of the business. However for a stock broker, it will be a revenue receipt.', '', 'False', '', 'Yes', NULL, NULL),
(807, 1, 9, 2, 'When an alteration is made to an exiting asset like pulling down walls to make a room big or to put up partition walls, the expenditure is treated as:\r\n', 'a.	Capital Expenditure\r\n\r\n', 'b.	Revenue Expenditure\r\n', 'c.	Deferred Revenue Expenditure\r\n', 'd.	None of the above', '', '', '1.00', '0.00', '', 'because there will be some benefit for some time.\r\n', '2', '', '', 'Yes', NULL, NULL),
(808, 1, 9, 2, ': Expenditure for making a few more exits in a Cinema Hall to comply with Government orders:\r\n\r\n', 'a.	Capital Expenditure \r\n', 'b.	Revenue Expenditure \r\n', 'c.	Deferred Revenue Expenditure\r\n', 'd.	None of the above', '', '', '1.00', '0.00', '', 'This expenditure do not add to profit earning capacity.', '3', '', '', 'Yes', NULL, NULL),
(809, 1, 9, 1, 'The objectives of accounting can be achieved by preparing the final accounts, which comprise of:\r\n\r\n', 'a.	Bank reconciliation statement \r\n', 'b.	Cash book and ledger accounts\r\n', 'c.	Profits & Loss Accounts & Balance Sheet\r\n', 'd.	None of the above', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(810, 1, 9, 1, 'The income statement has normally:\r\n\r\n', 'a.	One part \r\n', 'b.	Two parts', '', '', '', '', '1.00', '0.00', '', 'Income statement comprises of Trading and Profit & Loss Account. They have two parts-the first  part is called Trading account which reveals gross profit or gross loss, and the second part is called Profit & Loss account to show net profit or net loss.', '2', '', '', 'Yes', NULL, NULL),
(811, 1, 9, 1, ' In a manufacturing concern direct expenses include:\r\n\r\n', 'a.	All expenses incurred for production of goods (like wages, power and fuel, Factory lighting, factory rent and rent and rates) and all expenses incurred in bringing the goods to the firm and in making them ready for sale, like freight paid on purchases, cartage, octroi, custom duty, carriage inward, etc.\r\n', 'b.	All expenses for sale and distribution of goods.\r\n', 'c.	All operational and no-operational expenses on the business.\r\n', 'd.	None of the above.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(812, 1, 9, 1, 'Profit & Loss account starts with the gross profit or loss from trading account and then all the indirect expenses are debited in this account which are:\r\n\r\n', 'a.	Administrative expenses\r\n', 'b.	Selling & distribution expenses\r\n', 'c.	Factory and manufacturing expenses\r\n', 'd.	 (a) and (b) above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(813, 2, 9, 1, 'The debts written off as bad, if recovered subsequently, are credited to debtorsâ€™ account', '', '', '', '', '', '', '1.00', '0.00', '', 'Bad debts already written off, but recovered afterwards are credited as income in the â€˜Bad debts Recovered accountâ€™', '', 'False', '', 'Yes', NULL, NULL),
(814, 2, 9, 2, 'Depreciation account appearing in the Trial Balance is shown in the Profit & Loss account', '', '', '', '', '', '', '1.00', '0.00', '', 'It means that the amount of depreciation has been adjusted from their respective assets. Therefore , the amount will be shown in the P & L account only to arrive at the correct profit.', '', 'True', '', 'Yes', NULL, NULL),
(815, 1, 9, 1, 'Goodwill is:\r\n\r\n', 'a.	Current Asset\r\n', 'b.	Fixed Asset\r\n', 'c.	Intangible asset\r\n', 'd.	Tangible asset', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(816, 1, 9, 1, 'Select the correct statement \r\n', 'a.	The balance sheet represents an expansion of the equation as:\r\n Assets= Liabilities + Capital\r\n', 'b.	 A has assets of Rs.1,00,000 and Liabilities of Rs.20,000. His capital would be Rs.1,20,000.\r\n', 'c.	If a firm borrows a sum of money, its capital is reduced\r\n\r\n', 'd.	Assets â€“ Original Capital introduced = Liabilities', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(817, 2, 9, 1, 'Gains from the sale or exchange of assets are not considered as revenue of the business.', '', '', '', '', '', '', '1.00', '0.00', '', 'These are non- operational incomes. But will be considered as income of the business', '', 'False', '', 'Yes', NULL, NULL),
(818, 2, 9, 2, ' Salary paid in advance is not an expense because it neither reduces assets nor increases liabilities', '', '', '', '', '', '', '1.00', '0.00', '', 'Salary prepaid is deducted from the total amount paid for Salary during the year, and increases assets of the concern to that extent.', '', 'True', '', 'Yes', NULL, NULL),
(819, 2, 9, 2, ' All liabilities which become due for payment in one year are classified as long term liabilities', '', '', '', '', '', '', '1.00', '0.00', '', 'Liabilities payable in one year are classified as current liabilities.', '', 'False', '', 'Yes', NULL, NULL),
(820, 2, 9, 1, 'The provision for bad debts is debited to Sundry Debtors account', '', '', '', '', '', '', '1.00', '0.00', '', 'This provision is credited to Sundry debtors account', '', 'False', '', 'Yes', NULL, NULL),
(821, 1, 9, 3, 'The liabilities which are not shown in the balance sheet but are shown as a footnote are called:\r\n\r\n', 'a.	Intangible liabilities \r\n', 'b.	Fictitious liabilities\r\n', 'c.	Contingent liabilities\r\n', 'd.	All the above ', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(822, 1, 9, 2, 'Once the trading and Profit & Loss account is prepared, there is no need for the following balances to remain in the ledger\r\n\r\n', 'a.	Assets & Liabilities account \r\n', 'b.	Debtors & creditors account\r\n', 'c.	Expenses and incomes \r\n', 'd.	All of the above ', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(823, 1, 9, 2, 'The items of expenses which show debit balance, appear as ______ item in the Trading or Profit 7 Loss account\r\n\r\n', 'a.	Debit \r\n', 'b.	Credit ', '', '', '', '', '1.00', '0.00', '', 'effect is the closure of the expenditure accounts', '1', '', '', 'Yes', NULL, NULL),
(824, 1, 9, 1, 'The closing stock becomes opening stock for next period and the entry passed is:\r\n', 'a.	Debiting Trading a/c and Crediting Opening Stock A/c \r\n\r\n', 'b.	Crediting Trading a/c and Debiting Opening Stocks A/c\r\n', 'c.	Debiting P & L a/c and Crediting Opening Stocks A/c\r\n', 'd.	Crediting P & L a/c and Debiting Opening Stock', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(825, 1, 9, 2, 'According to Accounting Standard 2 inventory means tangible property held\r\n', 'a.	for sale in the ordinary course of business (finished goods)\r\n', 'b.	in the process of production for such sale (work-in-process)\r\n', 'c.	for production in the production of goods or services for sale (Raw materials)\r\n', 'd.	all of above\r\n', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(826, 1, 9, 1, 'Historical cost means:\r\n\r\n', 'a.	Cost of purchase \r\n', 'b.	Cost of conversion\r\n', 'c.	Other costs incurred in normal course of business in bringing the inventories upto their present location and condition.\r\n', 'd.	(a), (b) and (c) above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(827, 1, 9, 1, ' Valuation of stock be done by:\r\n\r\n', 'a.	FIFO (First in First out) method\r\n', 'b.	LIFO (Last in First out) method\r\n', 'c.	Average cost method\r\n', 'd.	Base Stock method\r\n', 'e.	Adjusting selling selling price method', 'f. All of the above.', '1.00', '0.00', '', '', '6', '', '', 'Yes', NULL, NULL),
(828, 1, 9, 2, 'Ascertaining value of stock from accounting record is known as\r\n\r\n', 'a.	Continuous stock taking\r\n', 'b.	Periodic inventory\r\n', 'c.	Perpetual inventory\r\n', 'd.	Stock audit', '', '', '1.00', '0.00', '', 'Stock register is maintained which gives the stock figure at any point of time. It is possible for the management to provide for continuous stock taking. This method helps in finding out discrepancies in the stock, by comparing the actual quantity of individual items with the book balance', '3', '', '', 'Yes', NULL, NULL),
(829, 1, 9, 2, 'Ascertaining of value of stock at the end of the year by physically counting the stock is known as\r\n\r\n', 'a.	Continuous stock taking\r\n', 'b.	Periodic inventory\r\n', 'c.	Perpetual inventory\r\n', 'd.	Stock audit', '', '', '1.00', '0.00', '', 'Annual stock taking is taken and in order to finalize stock figures, the purchases and sales are normally suspended during the period of stock taking', '2', '', '', 'Yes', NULL, NULL),
(830, 1, 9, 3, 'The closing stock is treated in the final accounts:\r\n', 'a.	Credit side of Trading a/c and as an asset in the Balance Sheet as current asset\r\n\r\n', 'b.	Debit side of Trading a/c and as an asset in the Balance Sheet as current asset\r\n', 'c.	Credit side of P & L a/c and as an asset in the Balance Sheet as current asset\r\n', 'd.	Debit side of P & L a/c and as a liability in the Balance Sheet as current asset', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(831, 1, 9, 2, 'The benefit of the amount already spent is sometimes available in the next accounting period also. Such a portion of the expense concerned is called \r\n', 'a.	prepaid expenses \r\n', 'b.	expense paid in advance \r\n', 'c.	expense not due but paid \r\n', 'd.	by any one of the above names\r\n', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(832, 2, 9, 1, 'Interest outstanding A/c is debited and Interest a/c is credited for interest on lone', '', '', '', '', '', '', '1.00', '0.00', '', 'The correct entry should be to debit Interest a/c and credit Interest outstanding A/c', '', 'False', '', 'Yes', NULL, NULL),
(833, 1, 9, 3, 'The adjustment entry for provision for discount on creditors is:\r\n\r\n', 'a.	Profit & Loss a/c â€¦â€¦â€¦â€¦Dr.\r\nTo Provision for Discount on Creditors\r\n', 'b.	Provision for Discount on Creditors â€¦â€¦ Dr.\r\nTo Profit & Loss a/c\r\n', 'c.	Sundry Creditors â€¦â€¦â€¦. Dr.\r\nTo Provision for Sundry creditors\r\n', 'd.	(c) & (b) together\r\n', '', '', '1.00', '0.00', 'The reserve for discount on creditors will be deducted from Sundry creditors in the balance sheet and is carried forward to the next year', 'The creation of this provision is against the concept of conservatism which takes into account the expected losses only and not expected gains. Therefore, It is usually avoided in practice.', '2', '', '', 'Yes', NULL, NULL),
(834, 1, 9, 2, 'Wages already paid for erection of a machinery will be recorded as:\r\n\r\n', 'a.	Debit wages, credit Machinery\r\n', 'b.	Debit Machinery, credit Wages\r\n', 'c.	No adjustment required\r\n', 'd.	Dr. Erection charges and credit P & L a/c', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(835, 1, 9, 2, 'Depreciation is :\r\n\r\n', 'a.	A part of operating cost\r\n', 'b.	A reduction in the value of asset\r\n', 'c.	Gradual and continuous\r\n', 'd.	On account of all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(836, 2, 9, 1, 'Fall in market price is the main cause of depreciation', '', '', '', '', '', '', '1.00', '0.00', '', 'Only current assets are affected by this fact. We talk of depreciation only on fixed assets', '', 'False', '', 'Yes', NULL, NULL),
(837, 1, 9, 2, 'When Depreciation A/c is debited and the Provision for Depreciation A/c is credited,\r\n\r\n', 'a.	Depreciation is shown on the debit side of P & L A/c\r\n', 'b.	Asset appears at its original value in the details column of the Balance Sheet\r\n', 'c.	Accumulated Provision for depreciation is deducted from the value of the Asset.\r\n', 'd.	The net value of the Asset is shown in the amount column of the Balance Sheet.', '', '', '1.00', '0.00', '', 'When Depreciation A/c is debited and the Provision for Depreciation A/c is credited,The net value of the Asset is shown in the amount column of the Balance Sheet.', '4', '', '', 'Yes', NULL, NULL),
(838, 2, 9, 2, 'The expenditure on repairs and renewals and depreciation on assets are equal in every year under the straight line method of depreciation', '', '', '', '', '', '', '1.00', '0.00', '', 'By the passage of time, work efficiency of assets decrease and repair expenses increase. In the initial years the depreciation will be more and repairs are less, and in later years the expenditure on repairs is high and less depreciation', '', 'False', '', 'Yes', NULL, NULL),
(839, 2, 9, 3, 'The value of the asset is reduced to zero under the WDV method of depreciation', '', '', '', '', '', '', '1.00', '0.00', '', 'In this method the value of asset can never be zero', '', 'False', '', 'Yes', NULL, NULL),
(840, 1, 9, 2, 'On an equipment purchased for Rs.50,000, it is decided to charge depreciation @ 30%, the difference in the book value of the assets at the end of three years, assuming that the company is adopting (i) Straight line method, and (ii) Written down value method will be\r\n\r\n', 'a.	Book value will be higher Rs.12,150 under WDV method\r\n', 'b.	Book value will be higher Rs12,150 under SLM method\r\n', 'c.	Book value will be higher Rs15,000 under WDV method\r\n', 'd.	Book value will be higher Rs.15,000 under SLM method', '', '', '1.00', '0.00', '', 'Under SLM it will be Rs.5,000, but under WDV it will be Rs.17,150', '1', '', '', 'Yes', NULL, NULL),
(841, 1, 9, 2, 'Which of the following is true\r\n\r\n', '(a)	Both EPS and PE ratio vary with the stock market price of companyâ€™s share\r\n', '(b)	While calculating Debt/ Equity ratio, fixed deposits from shareholders are taken as part of Debt\r\n', '(c)	While calculating Quick ratio, all current liabilities are not taken into account\r\n', '(d)	Debtorâ€™s Turnover ratio is higher if the company sells more goods on credit basis than on cash basis', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(842, 2, 4, 1, 'A public sector bank is a body corporate created under a special statute. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(843, 2, 4, 2, 'A banking company is registered under the Banking Regulation Act.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(844, 2, 4, 2, 'Co-operative banks are registered under the Multi-State Co-operative Societies Act \r\nor a State Co-operative Societies Act.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(845, 1, 4, 2, 'A company has to obtain a........................  from the Reserve Bank to commence banking \r\nbusiness in terms of Section 22 of the BR Act.', 'registration;', ' licence; ', 'commencement certificate', '', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(846, 1, 4, 2, 'Foreign banks are required under Section 11 of the BR Act to deposit...................................... \r\nof their business in India with the Reserve Bank', 'twenty per cent of profit for each year; \r\n', 'thirty per cent of profit for each year; ', 'twenty per cent of the deposits collected each year', '', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(847, 1, 4, 2, 'Banks may float subsidiaries for carrying on the business specified in.................................  . ', 'their Memorandum of Association; ', 'Section 6(1 )(a) to (o) of the BR Act; ', 'their Articles of Association', '', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(848, 1, 4, 2, 'A shareholder of a banking company can exercise voting rights up to............................  of the \r\ntotal voting rights of all shareholders.', 'one per cent; ', ' ten per cent;', 'hundred per cent', '', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(849, 1, 4, 2, 'Banking companies are not permitted to give dividend until all ......................... are written off. \r\n', 'bad debts,  ', 'expenses, ', 'capitalised expenses', '', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(850, 2, 4, 2, 'A temporary branch for less than thirty days in a town where a bank has an existing branch does not require permission from Reserve Bank.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(851, 1, 4, 3, 'At least .....................................of the directors should have the qualifications prescribed under Section 10A(2) of the BR Act. ', '50 per cent, ', '75 per cent, ', '51 per cent', '', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(852, 1, 4, 2, 'When the board of a banking company is ordered to be reconstituted under Section 10A of the BR Act, directors will be removed..........................  for the purpose of reconstitution.', 'by rotation, \r\n', 'by lots, ', 'by majority decision', '', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(853, 1, 4, 2, 'The provisions of Section 36AA of the BR Act regarding removal of managerial personnel have .........................  over other laws. ', 'no effect, ', 'overriding effect, ', 'persuasive effect', '', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(854, 1, 4, 2, 'Reserve Bank is authorised to appoint .............................................. under Section 36AB of the BR Act. \r\n', 'directors,', 'additional directors, ', 'managing director', '', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(855, 2, 4, 2, 'Reserve Bank has the power to remove any officer or other staff of a banking company under Section 36M of the BR Act.''', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(856, 1, 4, 2, ' A banking company has to prepare profit and loss accounts and balance sheet as at the...............................  or at the expiration of twelve months ending with such date as notified by the Central Government. ', 'end of calendar year,', ' end of March, ', 'end of June', '', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(857, 1, 4, 2, 'The balance Sheet and profit and loss account shall be audited by a person duly qualified to be.............................  . ', 'a certified financial analyst, ', 'auditor of companies, ', 'auditor of cooperative societies', '', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(858, 1, 4, 2, 'Three copies of the balance sheet and accounts along with the auditor''s report of a banking company sent to the Reserve Bank under Section 31 of the BR Act, have also to be sent to ............................................... . ', 'the Central Government, ', 'Registrar of Companies, ', 'Company Law Board', '', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(859, 2, 4, 2, 'Foreign banks have to prepare accounts and balance sheet in respect of all business transacted by them in India', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(860, 2, 4, 2, 'Reserve Bank requires the permission of the Central Government for ordering special audit of a banking company', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(861, 2, 4, 2, 'Three copies of the balance sheet, profit and loss account, \r\nand auditor''s report of a banking \r\ncompany have to be submitted to the Reserve Bank as returns', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(862, 1, 4, 2, 'The undertaking of a banking company may be acquired by the Central Government if it is satisfied on a report from the Reserve Bank that the banking company has failed on more than one occasion to comply with the..............................................  . ', 'directions of the Government,', ' directions under Sections 21 and 35A of BR Act, ', 'provisions of the Companies Act', '', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(863, 1, 4, 2, '.....................................may apply to the High Court for winding up of a banking company under Section 38 of the BR Act.', ' Registrar of Companies, ', 'Reserve Bank, ', 'Central Government', '', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(864, 2, 4, 2, 'Central Government can acquire the undertaking of a banking company under Section \r\n36AE of the Banking Regulation Act in the interest of banking policy without any report \r\nfrom the Reserve Bank on the affairs of the banking company, ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(865, 2, 4, 2, ' The Reserve Bank or State Bank or another person as specified by the Reserve Bank in its \r\napplication before the High Court may be appointed as liquidator of a banking company, ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(866, 2, 4, 2, 'The Reserve Bank may prepare a scheme for reconstruction or \r\namalgamation of a banking \r\ncompany under moratorium under Section 45 of the BR Act.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(867, 2, 4, 2, 'Making any false \r\nstatement in a return or other document submitted under the provisions of \r\nthe BR Act is punishable with imprisonment and fine also.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(868, 1, 4, 1, 'State Bank has to act as  and carry out Central Government business and other \r\nbusiness entrusted by the Reserve Bank, ', 'agent of Reserve Bank, ', 'agent of Central \r\nGovernment, \r\n', 'advisor to the Central Government', '', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(869, 2, 4, 2, 'The State Bank can make statutory regulations for carrying out the purposes of the State Bank of India Act, in consultation with Reserve Bank and with previous approval of the Central Government', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(870, 2, 4, 2, 'The management of Nationalised Banks is governed by the Nationalised Banks (Management and Miscellaneous Provisions) Schemes of 1970 and 1980. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(871, 2, 4, 3, 'Regional rural banks may transact the business of banking as defined in Section 5(b) of the BR Act and also other business specified in Section 6(1) of that Act. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(872, 1, 4, 3, '.....................................in relation to a co-operative society, for the purpose of BR Act, includes a member of any committee or body for the time being vested with the management of the affairs of that society. ', 'Director, ', 'Member, ', 'Manager', '', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(873, 1, 4, 3, 'The requirement of minimum \r\npaid-up capital and reserves for a co-operative bank to commence or carry on banking business is........................................  . ', 'Rs. 1 crore,', ' Rs. 1 lakh, ', 'Rs. 10 lakh', '', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(874, 1, 4, 3, 'Under Section 23 of the BR Act, without the permission of Reserve Bank, a   \r\ncan open a new place of business within the area of its operation, ', 'central co-operative bank, ', 'state co-operative bank, ', 'primary co-operative bank', '', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(875, 1, 4, 3, 'Co-operative banks have to prepare their balance sheet and profit and loss account in the forms set out in the Third Schedule to................................................  . ', 'Banking Regulation Act, ', 'Reserve Bank of India Act, ', 'State Co-operative Societies Act', '', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(876, 2, 4, 2, 'The provisions of the Banking Regulation Act as provided in Section 56 of the Act apply to co-operative banks, ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(877, 2, 4, 3, 'A scheduled co-operative bank has to maintain cash reserve as stipulated in Section 42 of the Reserve Bank of India Act (as applicable to co-operative societies)', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(878, 2, 4, 1, 'The law relating to the payment of cheques and protection to a banker is contained in the Indian Contract Act. .', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(879, 2, 4, 1, 'Section 31 of the Negotiable Instruments Act applies only to the banker', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(880, 2, 4, 3, ' If a bank makes payment without checking the instrument under an ultraviolet lamp, it can be held liable on the grounds of negligence.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(881, 2, 4, 3, 'Section 131A of the Negotiable Instruments Act extends the protection granted to a banker while receiving payment of a cheque, and drafts', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(882, 2, 4, 1, 'There are three parties to a contract of indemnity, the indemnifier, the indemnity holder and the person on whose behalf the indemnity is given', '', '', '', '', '', '', '1.00', '0.00', '', ': "A Contract whereby one party promises to save the other from loss caused to him by the conduct of the promisor himself or by the conduct of any other person, is called a contract of indemnity\r\nthere are two parties,The person who promises to save the other is called the Indemnitor or Indemnifier and the person who is compensated is the Indemnitee, Indemnified or the indemnity-holder.\r\n\r\n\r\n', '', 'False', '', 'Yes', NULL, NULL),
(883, 2, 4, 1, 'An indemnity holder is entitled to compromise a suit as thought fit by him though contrary to the orders of the indemnifier', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(884, 1, 4, 1, 'In bank guarantees the bank makes payment on: \r\n', '(a)  being convinced that the beneficiary has incurred loss; \r\n', '(b)  on being sued by the beneficiary; ', '(c)  on the guarantee being invoked and after seeking concurrence of the debtor; \r\n', '(d)  merely on demand by the beneficiary.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(885, 1, 4, 1, 'In case of bank guarantees on behalf of company that is in liquidation the bank on \r\ninvocation of the guarantee by the beneficiary: \r\n', '(a)  must pay the amount to the Liquidator and not the beneficiary; \r\n', '(b)  must deposit the amount in the court to avoid any controversy; \r\n', '(c)  must pay the beneficiary; \r\n', '(d)  need not pay, since the bank guarantee lapses on the company being liquidated. ', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(886, 1, 4, 1, 'The letter of credit is opened on the request of \r\n', '(i) Issuing bank ', '(ii) Applicant', '(iii) Beneficiary ', ' (iv) Confirming bank ', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(887, 1, 4, 1, 'The LC issuing bank is also called \r\n', '(i) the importers bank or the opening bank \r\n', '(ii) the advising bank or the confirming bank ', '(iii) the negotiating bank or the nominated bank ', '(iv) the reimbursement bank ', '', '', '1.00', '0.00', '', 'A letter of credit is a document, typically from a bank (Issuing Bank), assuring that a seller (Beneficiary) will receive payment up to the amount of the letter of credit, as long as certain documentary delivery conditions have been met.', '1', '', '', 'Yes', NULL, NULL),
(888, 1, 4, 1, 'The right to receive payment under a letter of credit or the right to draw bills on a letter of credit is vested in \r\n', '(i) the opener of the LC  ', '(ii) the issuing bank only \r\n', '(iii) the seller only  ', '(iv) all the three parties', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(889, 1, 4, 1, 'The advising bank''s responsibility is \r\n', '(i) to inform the issuing bank as to whom to issue the letter of credit ', '(ii) to advise the buyer the despatch of documents by the seller ', '(iii) to inform the beneficiary/seller about the letter of credit ', '', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(890, 1, 4, 1, 'Reimbursing bank is the bank \r\n', '(i)  that reimburses the seller \r\n', '(ii)  that reimburses the negotiating/paying or confirmingbank \r\n', '(iii)  that reimburse the buyer on the goods being found defective \r\n', '(iv)  none of the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(891, 2, 4, 2, 'A bill of exchange is also called a ''bill'' or a ''draft''.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(892, 2, 4, 3, 'An airway bill is also a document evidencing title to goods. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(893, 2, 4, 3, 'A deferred payment guarantee differs from other kinds of guarantee issued by banks as regards payment liability of the bank on invocation', '', '', '', '', '', '', '1.00', '0.00', '', 'Deferred Payment Guarantee:- the banker guarantees payment of instalments spread over a period. This type of guarantee is required, when goods or machinery are purchased by a customer on long-term credit and the payment is to be made in instalments on specified dates spread over more than a year', '', 'False', '', 'Yes', NULL, NULL),
(894, 2, 4, 3, 'In a deferred payment guarantee the banks liability comes into existence only if all the instalments are not paid and not on the non-payment of any one instalment by the \r\ncustomer. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(895, 3, 4, 3, '.....................................of the bill is bound in case of dishonour of bill.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', '', 'Drawer', 'Yes', NULL, NULL),
(896, 3, 4, 3, 'Ownership of goods can be transferred by endorsement and delivery of.......................................', '', '', '', '', '', '', '1.00', '0.00', '', '', '', '', 'Document of title to  goods', 'Yes', NULL, NULL),
(897, 2, 4, 1, 'A mortgage deed need not be witnessed. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(898, 2, 4, 3, 'Permission from Income Tax Authorities under the Section 230 to create mortgage is required only if the land belongs to a company. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(899, 2, 4, 3, 'There are three types of shares - ordinary, equity and preference. ', '', '', '', '', '', '', '1.00', '0.00', '', 'there are only two types of shares:-equity and preference. ', '', 'False', '', 'Yes', NULL, NULL),
(900, 2, 4, 1, 'Supply bills are bills of exchange. ', '', '', '', '', '', '', '1.00', '0.00', '', 'when the government department is supplied goods or raw materials a bill is drawn on them for the price of goods supplied  are called supply bills.these bills are not bills of exchange.', '', 'False', '', 'Yes', NULL, NULL),
(901, 2, 4, 1, ' In mortgage by way of conditional sale the property is sold with a condition for re-conveyance. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(902, 3, 4, 3, 'To decide as to which mortgage will have priority over the other in the case of two or more mortgages on the same immoveable property, the date of  ..........................................mortgage is pertinent. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', '', 'execution of', 'Yes', NULL, NULL),
(903, 3, 4, 3, 'Limitation period for filing a suit for sale of mortgaged properties is ,....................................... years from the date the mortgage debt becomes due.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', '', 'twelve', 'Yes', NULL, NULL),
(904, 3, 4, 3, 'Pledge means ............................ of goods for purpose of securing a payment of debt or performance of promise', '', '', '', '', '', '', '1.00', '0.00', '', '', '', '', 'bailment', 'Yes', NULL, NULL),
(905, 2, 4, 1, 'Hypothecation letter gives a banker right to possession of goods in the event of default.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(906, 3, 4, 3, 'Trusts of Muslims are governed by the ..............................', '', '', '', '', '', '', '1.00', '0.00', '', '', '', '', 'Wakf', 'Yes', NULL, NULL),
(907, 1, 4, 2, 'Limitation period for filing a suit in term loans is  ....................years from the date of default of .instalment.', '1', '2', '3', '4', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(908, 1, 4, 3, 'Period of repayment in the case of medium-term loan is ........................', '3-6 YRS', '2-5 YRS', '5-7 YRS', '1-3 YRS', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(909, 1, 4, 1, 'Cash Credit facility is a   ......................................', 'Fund based facility ', ' Non-Fund based facility', '', '', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(910, 2, 4, 3, 'Certificate of commencement of business is required for private limited company to \r\nstart business.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(911, 2, 4, 2, 'A partner on behalf of firm cannot institute a suit on contract, if the firm is \r\nregistered. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(912, 3, 4, 3, 'Section 58 of Partnership Act, 1932 provides for ...............................', '', '', '', '', '', '', '1.00', '0.00', '', '', '', '', 'registration of partnership', 'Yes', NULL, NULL),
(913, 3, 4, 3, 'Pledge is ..................................... of goods as a security for debt.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', '', 'bailment', 'Yes', NULL, NULL),
(914, 1, 4, 3, 'Charge shall be registered within  .................days from the date of creation of charge.', '30', '15', '7', '45', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(915, 1, 4, 3, 'After Mardia Chemical Case, the amendment made in the SARFAESI Act stipulates deposit of .......................  amount before preferring the appeal to DRT (Appellate Tribunal). ', '10 per cent.', '30 per cent.', '50 per cent.', '70 per cent.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(916, 1, 4, 2, 'Whether moveable securities in possession of the bank can be sold by the bank without the intervention of the Court? \r\n', '(a)  Now, a Court order is required to sale the security. \r\n', '(b)  Yes, bank can sell as provided in the Contract Act, 1872. \r\n', '(c)  Yes, as the SARFAESI Act, 2002 has made provisions to that effect. \r\n', '(d)  No, until the account is not declared as NPA by the bank. ', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(917, 1, 4, 2, 'As per the laws existing today, the mortgaged security cannot be sold without a Court intervention. Is this correct? \r\n', '(a)  Yes, Court intervention is required as per the provisions of the Transfer of Properties Act. \r\n\r\n', '(b)  No, SARFAESI Act, 2002 has now made enabling provisions. \r\n', '(c)  Yes, since the Contract Act has made no provisions about any Court intervention. \r\n', '(d)  No, due to the recent amendments in the Transfer of Property Act no Court intervention is required.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(918, 2, 4, 1, 'For the enforcement of a mortgage security, court intervention is required even for actions under the SARFAESI Act.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(919, 1, 4, 2, 'When any bank or financial institution obtains a charge against property, with \r\nwhich authority will the transaction have to be registered under the SARFAESI Act, 2002? \r\n', '(a)  With the Central Registry. \r\n', '(b)  With the ROC. \r\n', '(c)  With the Registrar of Assurances within whose jurisdiction the property lies. \r\n', '(d)  With the Reserve Bank of India. ', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(920, 1, 4, 2, 'When can the provisions of SARFAESI Act, 2002 be invoked for proceeding against the charged property? \r\n', '(a)  When the bank feels that it is necessary for the recovery at any time. \r\n', '(b)  When the RBI directs to do so. \r\n', '(c)  When there is default in repayment by the borrower. \r\n', '(d)  When there is default in repayment and the bank declares the account as NPA', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(921, 1, 4, 3, 'Whether existing or future receivables are property? \r\n', '(a)  Yes. \r\n', '(b)  No. \r\n', '(c)  Yes, but if and when charged to the lender. \r\n', '(d)  No, if hypothecated to the lender. ', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(922, 1, 4, 2, 'After application of the SARFAESI Act what have the existing companies to do about registration with RBI? \r\n', '(a)  They are automatically deemed to be registered. \r\n', '(b)  They are required to stop functioning. \r\n', '(c)  Existing companies do not require registration \r\n', '(d)  They have to get registered within six months from the commencement of the Act.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(923, 1, 4, 2, 'Which, from amongst the following, is a reason for the cancellation of registration of the securitisation company and reconstruction company without giving a hearing \r\nopportunity? \r\n', '(a)  The company does not keep accounts as per the RBI norms. \r\n ', '(b)  The company ceases to carry on the business of securitisation or reconstruction. \r\n', '(c)  The company fails to hold investment from the qualified investor. \r\n', '(d)  The company does not fulfil any of the conditions imposed at the time of registration.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(924, 1, 4, 3, 'When the securitisation company or reconstruction company issues security receipts, the holder thereof, is entitled to a .................................. in the financial asset. ', 'undivided interest', 'divided interest', 'equal interest', 'unequal interest', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(925, 2, 4, 2, 'SARFAESI Act is applicable to the Regional Rural Banks.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(926, 1, 4, 2, 'On sale of the security asset, the sale proceeds are appropriated firstly. \r\n', '(a)  Towards the satisfaction of dues of secured creditor. \r\n', '(b)  Towards the payment of dues of labour. \r\n', '(c)  Towards payment of cost, charges and expenses for the preservation and protection of securities, insurance premiums, etc. \r\n', '(d)  Towards payment of legal costs incurred by the creditor for taking possession and for effecting sale. ', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(927, 1, 4, 2, 'The period stipulated in the Act for filing details of security interest is .............. days. ', '15', '30', '45', '90', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL);
INSERT INTO `questions` (`id`, `qtype_id`, `subject_id`, `diff_id`, `question`, `option1`, `option2`, `option3`, `option4`, `option5`, `option6`, `marks`, `negative_marks`, `hint`, `explanation`, `answer`, `true_false`, `fill_blank`, `status`, `created`, `modified`) VALUES
(928, 1, 4, 2, 'Besides the SARFAESI Act, some other laws require some registration of charge created in the property. Is such double registration avoidable? \r\n', '(a)  Yes, the creditor can choose under which law he needs registration. \r\n', '(b)  No, registration under the SARFAESI Act as well as any other applicable law will have to be made as the SARFAESI Act is not substitution of any other law. \r\n', '(c)  Yes, if one charge noting is by a registered document. \r\n', '(d)  No, as the Civil Courts and DRT still have jurisdiction against the properties both registrations are required.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(929, 2, 4, 1, 'Is there any punishment provided in the Act for not following RBI directions? ', '', '', '', '', '', '', '1.00', '0.00', 'yes', '', '', 'True', '', 'Yes', NULL, NULL),
(930, 1, 4, 2, 'Whether breach of RBI directives is punishable offence and to what extent? \r\n', '(a)  Yes, a fine up to Rs. 5 lakh and for continuation of offence a fine of up to Rs. 10,000 per day. \r\n', '(b)  Yes, by cancellation of licences of the company. \r\n', '(c)  No, these are the administrative directions. \r\n', '(d)  No, the Act has not provided for any punishment in specific.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(931, 1, 4, 1, ' If on some point the provisions of the Transfer of Property Act and the  SARFAESI Act are different, which Act will prevail? ', 'Transfer of Property Act', 'SARFAESI Act', 'non of the above.', '', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(932, 1, 4, 2, 'Provisions of the SARFAESI Act are applicable to which of the following? \r\n', '(a)  Pledged goods. \r\n', '(b)  Only mortgaged properties. \r\n', '(c)  Securities that are not otherwise charged to the creditors. \r\n', '(d)  Securities charged to creditors and not in possession of the creditor. ', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(933, 1, 4, 2, 'When the rules, framed by the Central Government, under the Act get validity? \r\n', '(a)  After the appellate tribunal of DRT approves them. \r\n', '(b)  On Supreme Court approving the same. \r\n', '(c)  Immediately on framing of the rules by the Government and notifying the same. \r\n', '(d)  When both the Houses of Parliament approve the Rule so framed. ', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(934, 1, 4, 1, 'What is the object of introducing the banking ombudsman scheme, 2006? \r\n', '(a)  For effective monitoring of the NPA accounts in the banks. \r\n', '(b)  It is the RBI agency to regulate the disputes amongst the banks. \r\n', '(c)  To enable resolution of complaints relating to banking services. \r\n', '(d)  For executing the orders passed by the DRT. ', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(935, 1, 4, 1, 'Complaints can be made against promises made by sales agents but not fulfilled by the bank represented by them under the banking ombudsman Scheme 2006? \r\n', '(a)  No complaint is admissible as he is not the employee of the bank. \r\n', '(b)  The sales agent has no authority to make any promise and hence the bank is not bound to fulfil them. \r\n', '(c)  The banking ombudsman can entertain the complaint under the scheme. \r\n', '(d)  Agency functions are outside the purview of the banking ombudsman scheme. ', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(936, 1, 4, 1, 'Can a customer from whose account someone fraudulently has withdrawn money make a complaint before the banking ombudsman? \r\n', '(a)  No, as the offence committed, is of criminal nature, FIR with police has to be filed. \r\n', '(b)  Yes, but if the police authorities who have received the FIR permit filing of the complaint with ombudsman. \r\n', '(c)  Yes, as this aspect comes under the powers of the banking ombudsman. \r\n', '(d)  No, as the loss caused to the customer is of a civil nature for recovery, civil suit is required to be filed.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(937, 1, 4, 2, 'Can the complaint be filed through an advocate as the authorised representative of the complainant? \r\n', '(a)  Advocates are not allowed to act as authorised representatives of the complainants under the scheme. \r\n', '(b)  Advocates can file the complaint, provided he has been given the vakalatnama by the party. \r\n', '(c)  Advocates can appear for the parties as they can present the case well before the banking ombudsman. \r\n', '(d)  Advocates are allowed to appear only if the party does not stay within the jurisdiction of the banking ombudsman. ', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(938, 1, 4, 1, 'Limitation period for filing of the review application against the award given by the banking ombudsman is .............. days. ', '15', '30', '45', '60', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(939, 1, 4, 2, 'A bank has allowed a current A/c holder an ad hoc overdraft of Rs. 15 lakh. The amount is due. Whether this is recoverable under provisions of DRT Act? \r\n', '(a)  No, as it is not a regular loan. \r\n', '(b)  No, as only secured loans can be recovered under the DRT Act. \r\n', '(c)  Yes, as it is a legally recoverable amount by the bank. \r\n', '(d)  Yes, but if the tribunal grants special permission to lodge the case.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(940, 1, 4, 3, 'DRT Act is applicable only if the debt recoverable is above Rs......................... ', 'Rs. 10 lakh', 'Rs. 15 lakh', 'Rs. 17 lakh', 'Rs. 30 lakh', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(941, 1, 4, 1, 'Can the order of Central Government in the appointment of the presiding officer of the tribunal be challenged in any Court? \r\n', '(a)  Yes, before the appellate tribunal. \r\n', '(b)  No. \r\n', '(c)  No, unless the High Court permits for it. \r\n', '(d)  Yes, under Constitution Article 226 before the High Court. ', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(942, 1, 4, 3, 'Debt recovery tribunals are established by........................', 'Jurisdiction of Tribunal; ', 'Appellate Tribunal; ', 'Central Government', 'Chairperson.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(943, 1, 4, 1, 'While filing appeal before the appellate tribunal if any amount is required to be deposited? \r\n', '(a)  No, amount is required to be deposited until the appellate tribunal decides. \r\n', '(b)  Yes, Court-fee on the appeal amount is required to be paid. \r\n', '(c)  Yes, 75 per cent of the amount determined by the tribunal is required to be deposited at the timing of filing of the appeal. \r\n', '(d)  Yes, after admission of the appeal 75 per cent of the amount determined by the tribunal is required to be deposited. ', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(944, 2, 4, 1, 'Since DRT is not a Civil Court it cannot pass interim orders such as attachment, injunction, receiver, etc.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(945, 1, 4, 1, 'A company is under winding up process. Whether High Court permission is required to a bank to proceed against it before DRT? \r\n', '(a)No, as the DRT Act being a special Law having overriding effect over other laws. \r\n', '(b)Yes, as Companies Act specially provides to that effect.      \r\n', '(c)Depends on the stage of winding up process. \r\n', '(d) No permission but concurrence of High Court required.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(946, 2, 4, 1, 'Recovery Officer can ask the defendant to furnish by affidavit particulars of his asset.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(947, 1, 4, 1, 'In a civil suit, to which bank is not a party, one of the parties has produced certified copy of books of account. One party to the suit wants to call bank officer as witness to prove the contents of copy. Can it be done? \r\n', '(a)  Yes, as it is the right of the party to get it reaffirmed in evidence. \r\n', '(b)  No, as the certified copy is a prima facie evidence that is admissible in evidence. \r\n', '(c)  No, unless the bank volunteers to do so. \r\n', '(d)  Yes, but if Court allows the application to call the witness.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(948, 1, 4, 3, 'A certified copy of any entry in a bankers'' Book is received in legal proceeding as  ............................evidence for existence of such entry. ', 'First', 'Certified', 'prima facie', ' inspection', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(949, 2, 4, 2, 'If one party intends to refer the dispute to Lok Adalat, the consent of the other is not required. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(950, 1, 4, 1, ' ''Anand kumar'' has purchased a draft from a bank favouring ''Sanjay Singh''. The draft is lost in transit and for duplicate draft in lieu of first bank need some formalities to be completed by ''Anand kumar.''. Can ''Sanjay Singh'' file a consumer case against the formalities as it is delaying payment to him. \r\n', '(a)  No, as he is not consumer of the bank and is not taking any service from the bank. \r\n', '(b)  No, as he has not paid the demand draft commission. \r\n', '(c)  Yes, as because of bank, his payment is getting delayed. \r\n', '(d)  Yes, his money is lying in the bank, he is deemed as account holder of the bank. ', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(951, 1, 4, 1, 'Who is the Chairman of the Central Consumer Protection Council? \r\n', '(a)  Chief Justice of the Supreme Court. \r\n', '(b)  Judge of the Supreme Court appointed by the Chief Justice of the Supreme Court. \r\n', '(c)  Minister-in-Charge of Law and Judiciary in the Central Government. \r\n', '(d)  Minister-in-Charge of Consumer Affairs in the Central Government.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(952, 2, 9, 2, 'A bill of exchange is not to be dated', '', '', '', '', '', '', '1.00', '0.00', '', 'It must be dated, because as per its definition it must be payable on a certain fixed future date and that is calculated with reference to the date when it is accepted or drawn', '', 'False', '', 'Yes', NULL, NULL),
(953, 1, 9, 3, 'A bill of exchange has ----------parties\r\n', 'a.	Two\r\n', 'b.	Three\r\n', 'c.	Four\r\n', 'd.	Five\r\n', '', '', '1.00', '0.00', '', 'These three parties are Drawer: Who draws the bill. Drawee: on whom the bill is drawn. Payee : who is going to receive the money . sometimes , a drawer and payee may be the same', '3', '', '', 'Yes', NULL, NULL),
(954, 1, 9, 3, 'Every bill is payable on a certain fixed _________ or on demand', 'Future date', 'Due date', 'Maturity', 'Grace', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(955, 1, 9, 3, '. ___________ is a person who obtains the instrument for valuable consideration, becomes the holder before its maturity, and he had no cause to believe that any defect exited in the title of the person from whom the derived his title.', 'Drawee in due course', 'Promisee in due course', 'Holder in due course', 'Promissor in due course', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(956, 1, 9, 2, 'Instruments payable to order can be transferred or negotiated by\r\n\r\n', 'a.	Endorsement & delivery\r\n', 'b.	Mere delivery\r\n', 'c.	Encashment\r\n', 'd.	None of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(957, 1, 9, 2, 'Before the due date of the bill, the holder may endorse the bill in favour of his banker and gets immediate cash from the banker. This is called\r\n', 'a.	Transfer of the bill\r\n\r\n', 'b.	Endorsement of the bill\r\n', 'c.	Purchase of the bill\r\n', 'd.	Discounting the bill', '', '', '0.00', '0.00', '', 'From the bank point of view it is called B/d- bill discounted or B/P bill purchased', '4', '', '', 'Yes', NULL, NULL),
(958, 1, 9, 2, 'When the bill is sent to bank for collection of the amount on behalf of the holder of the bill, it is called:\r\n\r\n', 'a.	Negotiating the bill\r\n', 'b.	Discounting the bill\r\n', 'c.	Sale of the bill\r\n', 'd.	Bill sent for collection', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(959, 2, 9, 3, 'Drawee has the right to discount the bill', '', '', '', '', '', '', '1.00', '0.00', '', 'Only the holder or the payee or the drawer can get the bill discounted', '', 'False', '', 'Yes', NULL, NULL),
(960, 1, 9, 3, 'When a bill of exchange or promissory note has been dishonoured for non-acceptance or non-payment, the holder may, within a reasonable period, cause such dishonour to be noted and certified by a notary public, such a certificate is called __________', 'Dishonour', 'Noting', 'Protest', 'Notary', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(961, 1, 9, 3, '. When a drawee is unable to meet the bill on due date, and he requests the drawer to accept a part of the bill amount in cash and for the balance to draw on him a fresh bill together with interest, it is called:', 'a.	Dishonour of the bill\r\n\r\n', 'b.	Retiring of the bill\r\n', 'c.	Renewal of the bill\r\n', 'd.	Honouring the bill', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(962, 2, 10, 1, 'To appoint a person as President of District Forum, he must be qualified to be a \r\nDistrict Judge.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(963, 1, 10, 2, 'District Forum has passed order to pay compensation. How recovery of the ordered \r\namount is made? \r\n', '(a)  By filing execution in Civil Court. \r\n', '(b)  By filing execution before District Forum. \r\n', '(c)  By filing Civil Suit. \r\n', '(d)  By referring the order to collector for making recovery as if it is land revenue \r\nrecovery. ', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(964, 2, 10, 1, 'A suit on demand promissory note can be filed within three years from the date on which the demand was made.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
