(966, 1, 10, 2, 'Banking Cash Transaction Tax is payable to the credit of the Central Government by \r\n', '(a) 15th day of the next month;  ', '(b) 7th day of the next month; \r\n', '(c) last day of the current month;  ', '(d) 10th day of the next month ', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
