(980, 2, 10, 3, 'The Right to Information Act, 2005 repealed the Freedom of Information Act,2002.', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'True', '', 'Yes', NULL, NULL),
(981, 2, 10, 3, 'Central Public Information Officers are appointed by the Central Government. ', '', '', '', '', '', '', '1.00', '0.00', '', '', '', 'False', '', 'Yes', NULL, NULL),
(982, 1, 10, 3, 'Public authority means \r\n', '(a)  an authority established by the Government; \r\n', '(b)  an authority established by law; \r\n', '(c)  a non Government organisation; \r\n ', '(d) any authority or body or institution of self government established or constituted by or under the Constitution, by any other law made by Parliament; by any other law made by State Legislature; by notification issued or order made by the appropriate Government. ', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(983, 1, 10, 3, 'Right to Information means the right to \r\n', '(a)  inspection of work, documents and records; \r\n', '(b)  taking notes, extracts, or certified copies of documents or records; \r\n', '(c)  taking certified samples of materials; \r\n', '(d)  all the above and obtaining information in the form of diskettes, floppies, etc., of information stored in a computer or in any other device. ', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
