(989, 1, 10, 1, 'Legal & Regulatory Aspects of Banking In securitisation, who is the originator?\r\n', 'a. Borrower\r\n', 'b. Lending Bank\r\n', 'c. Securitisation Company\r\n', 'd. None of the above  ', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(990, 1, 10, 2, 'On sale of security asset, the sale proceeds are appropriated firstly.\r\n', 'a. Towards satisfaction of dues of secured creditor.\r\n', 'b. Towards payment of dues of labour.\r\n', 'c. Towards payment of cost, charges and expenses for preservation and protection of securities,\r\ninsurance premiums, etc\r\n', 'd. Towards payment of legal costs incurred by the creditor for taking possession and for effecting sale.\r\n', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(991, 1, 10, 2, 'After Mardia Chemical Case, the amendment made in the SARFAESI Act stipulates deposit of _______ %\r\nof amount before preferring application to DRT.\r\n', 'a. 25\r\n', 'b. 50\r\n', 'c. 60\r\n', 'd. 75', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(992, 1, 10, 1, 'The bank can seek review of award before;\r\n', 'a. deputy governor of RBI\r\n', 'b. chief justice of supreme court.\r\n', 'c. consumer protection act, 1986\r\n', 'd. none of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(993, 1, 10, 3, 'The banking ombudsman may ask the concerned bank to submit;\r\n', 'a. information on the complaint.\r\n', 'b. evidences and documents in support of the reply to the complaint\r\n', 'c. other related document\r\n', 'd. all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(994, 1, 10, 3, 'Under which provisions, the RBI has introduced the banking regulation act, 1949\r\n', 'a. section 33 of banking ombudsman scheme\r\n', 'b. RBI act, 134\r\n', 'c. consumer protection act, 1986\r\n', 'd. none of the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(995, 1, 10, 1, 'An award of banking ombudsman is;\r\n', 'a. a judicial decision.\r\n', 'b. an arbitrarily order\r\n', 'c. an order on the bank .\r\n', 'd. an appeal to the bank', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(996, 1, 10, 2, 'Under the banking ombudsman scheme a complaint can be lodged with the ombudsman ......\r\n', 'a. within in the specified jurisdiction.\r\n', 'b. with the head office of the bank\r\n', 'c. with the consumer of the bank\r\n', 'd. any of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(997, 1, 10, 2, 'The secretariat staff in the baking ombudsman office will be\r\n', 'a. drawn from banks.\r\n', 'b. drawn from reserve bank\r\n', 'c. directly appointed\r\n', 'd. (a) and (b)', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(998, 1, 10, 2, 'Whether moveable securities in possession of the bank can be sold by the Bank without intervention of\r\nthe Court ?\r\n', 'a. No. The Court order is required to sale the security.\r\n', 'b. Yes. Bank can sell as provided in the Contract ACt, 1872.\r\n', 'c. Yes. As the SARFAESI Act, 2002 has made provisions to that effect.\r\n', 'd. No. Till the account is not declared as NPA by the Bank.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(999, 1, 10, 2, 'As per the laws existing today the mortgaged security cannot be sold without Court intervention. Is this\r\ncorrect ?\r\n', 'a. Yes. Court intervention is required as per the provisions of the Transfer of Properties Act.\r\n', 'b. No. SARFAESI Act, 2002 has now made enabling provisions.\r\n', 'c. Yes. Since the Contract Act has made no provision about any Court intervention.\r\n', 'd. No. Due to recent amendments in the Transfer of Property Act no Court intervention is required.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1000, 1, 10, 2, 'Provisions of SARFAESI Act, 2002 apply to which securities ?\r\n\r\n', 'a. Any moveable or immoveable security charged to the bank or financial institution.', 'b. To mortgage securities only.\r\n', 'c. Where security interests are created for repayment of financial assistance given by bank or financial\r\ninstitution.\r\n', 'd. To the properties owned by defaulter borrower but that area not charged to the bank.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1001, 1, 10, 2, 'The most important characteristic of pledge is ...... of goods.\r\n\r\n', 'a. Assignment\r\n', 'b. Lien\r\n', 'c. Possession\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1002, 1, 10, 1, 'Hypothecation is an implied ...... in cases where constructive possession of goods is given.\r\n', 'a. Lien\r\n', 'b. pledge\r\n', 'c. Assignment\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1003, 1, 10, 2, 'Individual borrowers are governed by the ......\r\n', 'a. RBI Act\r\n', 'b. BR Act\r\n', 'c. Indian contract Act\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1004, 1, 10, 1, 'Banking ombudsman is;`\r\n', 'a. legal machinery established by subordinate legislation to provide an additional but optional legal\r\nremedy\r\n', 'b. a judicial machinery\r\n', 'c. NGO\r\n', 'd. an administrative machinery', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1005, 1, 10, 2, 'The features of the award awarded by banking ombudsman are;\r\n', 'a. it is binding on the banks\r\n', 'b. it is not binding on the complaints unless be accepts it\r\n', 'c. the complaint is free to seed alternative remedies available under general law\r\n', 'd. all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1006, 1, 10, 1, 'What is the tenure of banking ombudsman?\r\n', 'a. 1 years\r\n', 'b. 3 years\r\n', 'c. 5 years\r\n', 'd. no such time limit', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1007, 1, 10, 1, 'What is the provisions of remuneration of the baking ombudsman ?\r\n', 'a. 60 years\r\n', 'b. 62 years\r\n', 'c. 65 years\r\n', 'd. 68 years', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1008, 1, 10, 2, 'What are the provisions of remuneration of the banking ombudsman ?\r\n', 'a. he is eligible for remuneration and other perquisites\r\n', 'b. this will be determined by the RBI\r\n', 'c. this has to be borne by banks proportionately\r\n', 'd. all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1009, 1, 10, 2, 'The necessary requirement for submitting need not contain?\r\n', 'a. it must be in writing and duly signed by the complainant and or authorized person.\r\n', 'b. it should contain the name address of the complainant.\r\n', 'c. it must contain the bank and branch name against which complaint is being made.\r\n', 'd. all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1010, 1, 10, 1, 'The bank is required to comply with the execution of the award of banking ombudsman within the bank\r\nis required to comply with the execution of the award of banking ombudsman within;\r\n', 'a. 7 days\r\n', 'b. 15days\r\n', 'c. 30days\r\n', 'd. 60days', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
