(1016, 1, 10, 2, 'The period stipulated in the Act for filing details of security interest is ___ days.\r\n', 'a. 10 Days\r\n', 'b. 20 Days\r\n', 'c. 30 Days\r\n', 'd. 60 Days', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1017, 1, 10, 1, 'Securitisation or SARFAESI Act is not applicable to assets\r\n', 'A. in possession of the creditor\r\n', 'B. charge on which is in favour of the creditor\r\n', 'C. both\r\n', 'D. none', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1018, 1, 10, 1, 'Who among the following are not included in the Central Board of directors of RBI ?\r\n', 'a. Governor\r\n', 'b. Deputy Governor\r\n', 'c. Directors nominated by Govt\r\n', 'd. Executive Director', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1019, 1, 10, 3, 'At least ...... of the total number of directors of a public company are to be persons whose period of\r\noffice is liable to determination by retirement by rotation.\r\n', 'a. 2\r\n', 'b. 2/3\r\n', 'c. 1/3\r\n', 'd. 5', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1020, 1, 10, 3, 'RBI undertakes banking business for the state govt under the provision of ...\r\n', 'A. Sec 22 of RBI Act\r\n', 'B. Sec 21 of RBI Act\r\n', 'C. Sec 20 of RBI Act\r\n', 'D. Agreement between RBI & Govt u/s 21 A of RBI Act', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1021, 1, 10, 2, 'A Co operative bank can be which of the following ...\r\n', 'A.Primary coop bank\r\n', 'B.District central coop bank\r\n', 'C.State coop bank\r\n', 'D.All the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1022, 1, 10, 3, 'The banking ombudsman scheme covers the following banks;\r\n', 'a. scheduled commercial banks.\r\n', 'b. regional rural banks.\r\n', 'c. co- operative banks.\r\n', 'd. all these', '', '', '1.00', '0.00', '', 'The banking ombudsman is an authority originally established under the Banking Ombudsman Scheme, 1995 by the Reserve Bank of India in exercise of the powers vested in it under Section 35A of the Banking Regulation Act. The scheme aimed at resolution and settlement of complaints of the banking public against the comercial banks.All commercial banks, regional rural banks and scheduled primary co-operative banks are required to comply with the modified scheme.', '4', '', '', 'Yes', NULL, NULL),
(1023, 1, 10, 3, 'Which of the following statements is correct regarding banking ombudsman scheme?\r\n', 'a. it is an opportunity to public to redress their grievances of banking services\r\n', 'b. it is an additional grievances settlement mechanism\r\n', 'c. it is not substitution of consumer protection ant.\r\n', 'd. all the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1024, 1, 10, 3, 'The objectives of the banking ombudsman scheme are;\r\n', 'a. to promote settlement through conciliation\r\n', 'b. prompt settlement of customer grievances .\r\n', 'c. inexpensive settlement of grievances.\r\n', 'd. all the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1025, 1, 10, 2, 'Who can make the complaint to ombudsman?\r\n', 'a. the customer himself\r\n', 'b. the authorized representative of customer.\r\n', 'c. (a) or (b) above\r\n', 'd. all the above', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1026, 1, 10, 3, 'Under what circumstances a complaint can be lodged with the banking ombudsman\r\n', 'a. if the bank has not settled the issue within a period of two months.\r\n', 'b. the bank has rejected the complaint of the customer\r\n', 'c. the reply given by the bank to the customer was not satisfactory.\r\n', 'd. all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1027, 1, 10, 1, 'What is the true limit for a bank to dispose customers complaints?\r\n', 'a. 1 month\r\n', 'b. 2 month\r\n', 'c. 3 month\r\n', 'd. 6 month', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1028, 1, 10, 2, 'What kind of complaint can be lodged with the banking ombudsman?\r\n', 'a. delay in collection of cheques\r\n', 'b. deficiency in cash transaction.\r\n', 'c. non- issue of demand drafts\r\n', 'd. all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1029, 1, 10, 2, 'The role of banking ombudsman is;\r\n', 'a. resolution of complaints against banks regarding deficiency in services\r\n', 'b. it is an external agency includes mediation persuasion and adjudication\r\n', 'c. it is an external agency having independent identity\r\n', 'd. all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1030, 1, 10, 3, 'Section 22 of RBI acts relate which aspects of banking ?\r\n', 'A.RBI authority to regulate credit\r\n', 'B.RBI authority to regulate banking business\r\n', 'C.RBI authority to function as bank for govt business\r\n', 'D.RBI authority to issue & manage currency in India', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1031, 1, 10, 1, 'A Banking co. having operations in India could be constituted as a ...\r\n', 'A. Body corporate under special act\r\n', 'B. Registered under the companies act\r\n', 'C. A Foreign co. under provisions of co. act\r\n', 'D. All the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1032, 1, 10, 1, 'Organisational or constitutional aspects of banking co. are regulated by ...\r\n', 'A.RBI\r\n', 'B.SEBI\r\n', 'C. Authorities under companies act\r\n', 'D.ALL THE ABOVE', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1033, 1, 10, 3, 'Agent can be appointed by ......\r\n', 'a. express appointment\r\n', 'b. implication of law\r\n', 'c. rectification by principal\r\n', 'd. any of the three modes', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1034, 1, 10, 2, '...... is terminated when the buyer gets the possession of the goods\r\n', 'a. agreement\r\n', 'b. lien\r\n', 'c. condition\r\n', 'd. warranty', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1035, 1, 10, 3, 'The SARFAESI Act is applicable to secured creditors only to enforce the securities criteria\r\n', 'A. without the intervention of court or tribunal\r\n', 'B. after taking permission of court or tribunal\r\n', 'C. in case of assets on which charge is registered\r\n', 'D. none of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1036, 1, 10, 2, 'After using the securitisation measures a bank can proceed further in\r\n', 'A. the civil court\r\n', 'B. DRT\r\n', 'C. both as the case may be\r\n', 'D. none', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1037, 1, 10, 3, 'In Mardia case what the Supreme Court declared as invalid ?\r\n', 'a. Entire SARFAESI Act, 2002.\r\n', 'b. Creation of security interest.\r\n', 'c. Formation of Reconstruction Companies.\r\n', 'd. Condition to pay 75 per cent of the amount as pre-condition while preferring appeal to the DRT.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1038, 1, 10, 1, 'When any bank or financial institution creates a charge against property, with which authority the\r\ntransaction will have to be registered under the SARFAESI Act, 2002?\r\n', 'a. With the Central Registry.\r\n', 'b. With the ROC.\r\n', 'c. With the Registrar of Assurances within whose jurisdiction the property lies.\r\n', 'd. With the Reserve Bank of India.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1039, 1, 10, 3, 'When the provisions of SARFAESI Act, 2002 can be invoked for proceeding against the charged\r\nproperty?\r\n', 'a. When the bank feels that it is necessary for the recovery at any time.\r\n', 'b. When the RBI directs to do so.\r\n', 'c. When there is default in repayment by the borrower.\r\n', 'd. When there is default in repayment and the bank declares the account as NPA.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1040, 1, 10, 1, 'Whether existing or future receivables are property?\r\n', 'a. Yes.\r\n', 'b. No.\r\n', 'c. Yes, but if and when charged to the lender.\r\n', 'd. No, if hypothecated to the lender.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1041, 1, 10, 1, 'Asset Reconstruction company has to get registration from\r\n', 'A. RBI\r\n', 'B. its own bank\r\n', 'C. both\r\n', 'D. none', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1042, 1, 10, 1, 'The minimum number of members required in a private company is ......\r\n', 'a. 3\r\n', 'b. 7\r\n', 'c. 12\r\n', 'd. 2', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1043, 1, 10, 1, 'Most of the complaints are settled through;\r\n', 'a. mutual agreement\r\n', 'b. award\r\n', 'c. bank itself\r\n', 'd. before proceeding to agreed stage', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1044, 1, 10, 2, 'Which of the following are the norms of awarding compensation by the banking ombudsman ?\r\n', 'a. banking ombudsman does not have unlimited powers to allow compensation.\r\n', 'b. the maximum limit of compensation is Rs. 10 lac\r\n', 'c. no compensation will be awarded in excess of that which is necessary.\r\n', 'd. all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1045, 1, 10, 1, 'In case of non- compliance of the award by the bank the baking ombudsman will report to;\r\n', 'a. reserve bank of India.\r\n', 'b. supreme court\r\n', 'c. finance ministry\r\n', 'd. consumer protection forum', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1046, 1, 10, 1, 'What is the maximum limit of compensation the baking ombudsman may a award?\r\n', 'a. Rs. 1 lac\r\n', 'b. Rs. 5 lac\r\n', 'c. Rs. 10 lac\r\n', 'd. Rs. No such limit', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1047, 1, 10, 1, 'What is the maximum time for settlement of a claim before passing an award by the banking\r\nombudsman\r\n', 'a. within 15 days from the date of receipt of complaint.\r\n', 'b. within 30 days from the date of receipt of complaint.\r\n', 'c. within 2 months from the date of receipt complaint ,\r\n', 'd. within 3 months from he date of receipt of complaint', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1048, 1, 10, 1, 'What is the time limit to accept the recommendations of baking ombudsman by a bank?\r\n', 'a. one week\r\n', 'b. 2 weeks\r\n', 'c. 3 weeks\r\n', 'd. 4 weeks', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1049, 1, 10, 3, 'The banking ombudsman scheme was implemented in India on;\r\n', 'a. 14.6 .1995\r\n', 'b. 1.1.7.1995\r\n', 'c. 2.10.1995\r\n', 'd. 15.12.1995', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1050, 1, 10, 2, 'The banking ombudsman scheme 1995 was amended in\r\n', 'a. 2000\r\n', 'b. 2001\r\n', 'c. 2002\r\n', 'd. 2004', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1051, 1, 10, 2, 'The usual form of contract of agency is by way of a ......\r\n', 'a. power of attorney\r\n', 'b. indemnity bond\r\n', 'c. guarantee bond\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1052, 1, 10, 2, 'The maximum number of directors in a private company can be ......\r\n', 'a. 3\r\n', 'b. 7\r\n', 'c. 12\r\n', 'd. 5', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1053, 1, 10, 2, 'At least ...... of the total number of directors of a public company are to be persons whose period of\r\noffice is liable to determination by retirement by rotation.\r\n', 'a. 2\r\n', 'b. 7\r\n', 'c. two-third\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1054, 1, 10, 2, 'Every public company, or a private company which is a subsidiary of a public company, having a paid-up\r\nshare capital of Rupees ...... must have a managing or whole-time director or a manager.\r\n', 'a. five crore\r\n', 'b. five lakh\r\n', 'c. one crore\r\n', 'd. one lakh', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
