(1056, 1, 10, 2, 'Trusts of Hindus are governed by the ......\r\n', 'a. Parliament Act\r\n', 'b. Indian Trust Act\r\n', 'c. Wakf Act\r\n', 'd. Religious and Charitable Endowments Act', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1057, 1, 10, 1, 'Trusts of Muslims are governed by the ......\r\n', 'a. Parliament Act\r\n', 'b. Indian Trust Act\r\n', 'c. Wakf Act\r\n', 'd. Religious and Charitable Endowments Act', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1058, 1, 10, 1, 'Cash Credit facility is a ......\r\n', 'a. Fund based facility\r\n', 'b. Non-Fund based facility\r\n', 'c. Either a or b\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1059, 1, 10, 2, 'The banking ombudsman may reject the complaint on the following grounds\r\n', 'a. complaint is without sufficient cause.\r\n', 'b. complaint is not pursued with reasonable diligence.\r\n', 'c. there is no loss or damage or inconvenience suffered by the complainant.\r\n', 'd. any one or all of the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1060, 1, 10, 2, 'Which of the following the banking ombudsman does not cover?\r\n', 'a. financial institutions.\r\n', 'b. non- banking financial companies\r\n', 'c. non- scheduled banks.\r\n', 'd. all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1061, 1, 10, 1, 'The banking ombudsman receives maximum number of complaints in respect of;\r\n', 'a. foreign bank\r\n', 'b. public sector bank\r\n', 'c. regional rural bank\r\n', 'd. co- operative bank', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1062, 1, 10, 2, 'Which of the following are the norms of awarding compensation by the banking ombudsman ?\r\n', 'a. banking ombudsman does not have unlimited powers to allow compensation.\r\n', 'b. the maximum limit of compensation is Rs. 10 lac\r\n', 'c. no compensation will be awarded in excess of that which is necessary.\r\n', 'd. all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
