(1064, 1, 10, 1, 'What is the maximum limit of compensation the baking ombudsman may a award?\r\n', 'a. Rs. 1 lac\r\n', 'b. Rs. 5 lac\r\n', 'c. Rs. 10 lac\r\n', 'd. Rs. No such limit', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
