(1067, 1, 10, 1, 'Limitation period for filing a suit in Term Loans is ...... years from the date of default of installment.\r\n', 'a. 2\r\n', 'b. 3\r\n', 'c. 4\r\n', 'd. 5', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1068, 1, 10, 1, 'Period of repayment in the case of medium-term loan is ......\r\n', 'a. 1 year\r\n', 'b. 2-4 years\r\n', 'c. 5-7 Years\r\n', 'd. More than 7 years', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1069, 1, 10, 1, 'A public company should have a minimum paid-up capital of Rupees ......\r\n', 'a. 1 Crore\r\n', 'b. 5 Crores\r\n', 'c. 1 Lakh\r\n', 'd. 5 Lakhs', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
