(1071, 1, 10, 1, 'Central govt can exempt a banking co. from the provisions of banking regulation act under which of the\r\nfollowing circumstances ...\r\n', 'A. On its own\r\n', 'B. On recommendation of state govt\r\n', 'C. On recommedation of RBI\r\n', 'D. on request from the concerned banking co.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1072, 1, 10, 3, 'What is the necessary condition to be complied with before lodging a complaint to banking ombusman\r\n', 'a. have made a representation to the concerned bank.\r\n', 'b. bank might have reject ed the complaint or not replied the complaint\r\n', 'c. the reply might have not to the satisfaction of complainant.', 'd. all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1073, 1, 10, 1, 'The acceptance of recommendations of the banking ombudsman should be conveyed by the bank\r\nwithin?\r\n', 'a. 7 days\r\n', 'b. 15 days\r\n', 'c. 15days\r\n', 'd. 30days', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1074, 1, 10, 1, 'How many offices the banking ombudsman have at present ?\r\n', 'a. 5\r\n', 'b. 10\r\n', 'c. 21\r\n', 'd. 29', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1075, 1, 10, 3, 'What are the formalities the banking ombudsman will comply before passing an award ?\r\n', 'a. if the complaint is not settled within 2months from the date of receipt of the complaint, the baking\r\nombudsman will inform parties about his intention to pass an award.\r\n', 'b. both the parties may submit further representation or evidences in support their case within 15 days.\r\n', 'c. the banking ombudsman will pass an award.\r\n', 'd. all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1076, 1, 10, 2, 'Before passing an award the banking ombudsman will be guided by\r\n', 'a. evidences produced by the parties.\r\n', 'b. banking law and practice.\r\n', 'c. instructions and guidelines issued by RBI\r\n', 'd. all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1077, 1, 10, 2, 'An award by banking ombudsman will contain;\r\n', 'a. specific performance of operations.\r\n', 'b. loss / cost to be borne by the bank.\r\n', 'c. reasons for making the award.\r\n', 'd. all the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1078, 1, 10, 2, 'An award will be executed the bank in the following manner;\r\n', 'a. complainant must submit acceptance letter within one month he will accept the award in full and final\r\nsettlement\r\n', 'b. the bank shall comply the award within 5 days of receipt of acceptance from the complaint\r\n.', 'c. the bank shall intimate the banking ombudsman about compliances of the award within 15 days.\r\n', 'd. all the above.l', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1079, 1, 10, 2, 'If a civil court has already given a decree then the recovery certificate can be issued by\r\n', 'A. any different court\r\n', 'B. at the request of any of the parties\r\n', 'C. DRT only\r\n', 'D. none', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1080, 1, 10, 2, 'Under the SARFAESI Act who has the power to condone delay in filling of the particulars\r\n', 'A. an arbitrator\r\n', 'B. registrar\r\n', 'C. central registrar\r\n', 'D. registrar of assurances', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1081, 1, 10, 1, 'The owner of a financial asset acquired by a securitisation company is called\r\n', 'A. purchaser\r\n', 'B. seller\r\n', 'C. originator\r\n', 'D. vendor', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1082, 1, 10, 1, 'From the following which function is of securitisation company?\r\n', 'a. Acquisition of loan transaction from the lender.', 'b. Help the lender in recovery by sale of charged property.\r\n', 'c. Take legal steps against the defaulter borrower on behalf of the lender.\r\n', 'd. Acquisition of financial assets from the originator', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL);
