(1083, 1, 10, 1, 'After application of SARFAESI Act what existing companies have to do about registration with RBI?\r\n', 'a. They are automatically deemed to be registered.\r\n', 'b. They are required to stop functioning.\r\n', 'c. Existing companies do not require registration.\r\n', 'd. They have to get registered within six months from commencement of the Act.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1084, 1, 10, 1, 'The maximum number of members in a private company can be ......\r\n', 'a. 7\r\n', 'b. 20\r\n', 'c. 50\r\n', 'd. No Limit', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1085, 1, 10, 1, 'Who issues license to the coop societies to function as coop banks ?\r\n\r\n', 'A. State Govt\r\n', 'B. NABARD\r\n', 'C. Central Govt\r\n', 'D. RBI', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1086, 1, 10, 1, 'Co operative societies that function as banks have been brought to the regulatory framework of RBI for\r\ncertain aspects as a result of ...\r\n', 'A. Section 6 of B R Act\r\n', 'B. Section 43 of RBI Act\r\n', 'C. Section 54 of registered societies act\r\n', 'D. Section 56 of B R Act', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1087, 1, 11, 1, 'Consumer means;\r\n', 'a. any person who buys any goods.\r\n', 'b. any person who hires or avails of any services.\r\n', 'c. any person who makes payment in full or in installments or under hire purchase systems.\r\n', 'd. all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
