(1163, 1, 11, 1, 'In which of the forums appeals can be filed with against the orders of state commission?\r\n', 'a. national commission.\r\n', 'b. high court.\r\n', 'c. central government.\r\n', 'd. any of these.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1164, 1, 11, 1, 'A complaint can be lodged in relation to any goods or services in the following circumstances;\r\n', 'a. loss or damage suffered on account of unfair trade practice.\r\n', 'b. the goods suffer from one a more defects.\r\n', 'c. the services suffer from deficiency in any respect.\r\n', 'd. all the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1165, 1, 11, 2, 'A complaints under the consumer protection act, can be lodged by;\r\n', 'a. consumer himself or one or more consumers having common interest.\r\n', 'b. a recognized consumer association\r\n', 'c. the central of state government\r\n', 'd. any of the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1166, 1, 11, 1, 'What is the limitation period in which, a complaint can be filed with any of the forums?\r\n', 'a. 2 years from the date of cause of action.\r\n', 'b. 1 years from the date of cause of action.\r\n', 'c. 6 months from the date of cause of action.\r\n', 'd. 3 months from the date of cause of action.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1167, 1, 11, 2, 'In how many days the opposite party can give the version of the case?\r\n', 'a. 7 days.\r\n', 'b. 15 days.\r\n', 'c. 30 days.\r\n', 'd. no such time limit.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1168, 1, 11, 2, 'In how many days laboratory should submit its report regarding the defect of the goods?\r\n', 'a. 55days\r\n', 'b. 60days\r\n', 'c. 75days\r\n', 'd. 90 days', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1169, 1, 11, 1, 'What kind of instructions the forum can issue to the opposite party?\r\n', 'a. to remove the defect of the goods.\r\n', 'b. to replace the goods with new goods which shall be free from defect.\r\n', 'c. to return to the complaint the price of goods or charges for se ices\r\n', 'd. any one of the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1170, 1, 11, 1, 'Which of the following instruction the forum is not authorized to issue in case of defects or deficiency in\r\nservice?\r\n', 'a. to return the defected goods along with addition new goods free of cost.\r\n', 'b. to pay compensation for any loss or injury suffered by the consumer.\r\n', 'c. to discontinue the unfair trade practice.\r\n', 'd. to provide for adequate costs to the parties.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1171, 1, 11, 2, 'Memorandum & Articles of any company are available for inspection in\r\n', 'A. the printing press where they are printed\r\n', 'B. SEBI\r\n', 'C. on the notice board of companies\r\n', 'D. office of the Registrar of Companies', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1172, 1, 11, 1, 'Reserve Bank was constituted under ......\r\n', 'a. BR Act\r\n', 'b. RBI Act\r\n', 'c. Companies Act\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1173, 1, 11, 1, 'A Regional Rural Bank is ......\r\n', 'a. A body corporate created under a special statute\r\n', 'b. A cooperative society\r\n', 'c. A Private Bank\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1174, 1, 11, 1, 'Banking companies are licensed by ......\r\n', 'a. Reserve Bank\r\n', 'b. Registrar of companies\r\n', 'c. Company Law Board\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1175, 1, 11, 3, 'Business which a banking company may undertake other than banking is as stipulated by ......\r\n', 'a. Reserve Bank\r\n', 'b. BR Act\r\n', 'c. RBI Act\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1176, 1, 11, 1, 'BR Act was enacted for ...... regulating acceptance of deposits from public.\r\n', 'a. Regulating banking companies\r\n', 'b. Creating Reserve Bank\r\n', 'c. Creating RRBs\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1177, 1, 11, 1, 'Casual vacancies in the board of directors is filled in by the ......\r\n', 'a. promoters\r\n', 'b. underwriters\r\n', 'c. shareholders\r\n', 'd. board of directors', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1178, 1, 11, 1, 'A person resident in India in the preceding in India for more than ...... days in the preceding financial\r\nyear.\r\n', 'a. 180\r\n', 'b. 182\r\n', 'c. 60\r\n', 'd. 62', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1179, 1, 11, 3, 'An Adjudicating Authority can enquire contravention under FEMA only if a complaint is filed by ......\r\n', 'a. RBI\r\n', 'b. High Court\r\n', 'c. Special Director (Appeals)\r\n', 'd. Central Government', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1180, 1, 11, 1, '...... goods means goods identified and agreed upon at the time a contract of sale is made.\r\n', 'a. Future\r\n', 'b. Specific\r\n', 'c. Moveable\r\n', 'd. Immoveable', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1181, 1, 11, 1, 'When a person by his words or conduct appoints someone as his agent it is known as agency by ......\r\n', 'a. promise\r\n', 'b. conduct\r\n', 'c. estoppel\r\n', 'd. action', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1182, 1, 11, 2, 'If the stipulation agreed to between the parties is essential to the main purpose of the contract then\r\nsuch a stipulation is known as a ......\r\n', 'a. condition\r\n', 'b. warranty\r\n', 'c. implied condition\r\n', 'd. guarantee', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1183, 1, 11, 1, 'The maximum number of directors in a public company can be ......\r\n', 'a. 3\r\n', 'b. 7\r\n', 'c. 12\r\n', 'd. 15', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1184, 1, 11, 2, 'Cooperative bank operating in different states are regulated by ...\r\n', 'a. State Cooperative Societies Act\r\n', 'b. Multi-Unit Cooperative Societies Act\r\n', 'c. Banking Laws (application to Cooperative Societies Act)\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1185, 1, 11, 2, 'Government can exempt a bank from provision of BR Act ......\r\n', 'a. On the recommendation of RBI\r\n', 'b. Whenever the government is satisfied\r\n', 'c. If requested by a bank\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1186, 1, 11, 1, 'Which of the following statements, is correct?\r\n', 'a. the secured creditor can take possession of Asset 60 days after giving notice.\r\n', 'b. The Asset can be sold or transferred.\r\n', 'c. It is mandatory for District Magistrate to take possession of Asset once written request is received\r\nfrom secured creditor.\r\n', 'd. All the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1187, 1, 11, 2, 'What is the procedure of acquiring a secured movable Asset?\r\n', 'a. The authorized officer of secured creditor shall prepare a panchnama.\r\n', 'b. The panchnama should be witnessed by two persons.\r\n', 'c. If the property is subject to natural decay, the authorized person may sell it at once.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1188, 1, 11, 1, 'What is process of valuation of movable secured Assets?\r\n', 'a. The authorized officer shall obtain estimated value of asset.\r\n', 'b. Officer can fixed reserve price of Asset to be sold.\r\n', 'c. The borrower need not be involved in the process of valuation.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1189, 1, 11, 2, 'How many days notice is required to be given to borrower for sale of movable secured Asset?\r\n', 'a. 30 days\r\n', 'b. 15 days.\r\n', 'c. 7 days.\r\n', 'd. 3 day.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1190, 1, 11, 3, 'Which of the following are the steps for taking over immovable secured Asset?\r\n', 'a. The authorized person shall take possession by delivering possession notice to the Borrower.\r\n', 'b. A copy of the possession notice shall be affixed on the outdoor of the property.\r\n', 'c. The possession receipt is also required to be published in two leading newspapers locally.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1191, 1, 11, 3, 'Which of the following statements, is correct regarding valuation of immovable secured asset?\r\n', 'a. Authorised officer will obtain estimated value from the approved valuer.\r\n', 'b. The borrower need not involved in the valuation process.\r\n', 'c. Valuation by approved valuer and fixing of reserve price is mandatory incase of immovable Assets.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1192, 1, 11, 1, 'Which of the following is the important provision in respect of immovable property which is subject to\r\nencumbrances?\r\n', 'a. The secured creditor shall vest in the transferee all the right as it the transfer had been made by the\r\nborrower.\r\n', 'b. All encumbrances know to secured creditor must be disclosed in the advertisement.\r\n', 'c. The Authorised officer may allow the purchaser to deposit with him the money required to discharge\r\nthe encumbrances.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1193, 1, 11, 1, 'What are the provisions for appointment of manager for secured Assets:\r\n', 'a. the Board of Directors of secured creditor may appoint a manager in consultation with the borrower\r\nto manage secure assets.\r\n', 'b. The manager will be deemed to be an agent of borrower.\r\n', 'c. The borrower solely would be responsible for the acts of manager.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1194, 1, 11, 1, 'Which of the following arte the powers of manager?\r\n', 'a. To recover any money form any person who has acquired secured asset, from the borrower.\r\n', 'b. Such amount should become due or may become due in future.\r\n', 'c. The manager will give valid discharge to person making payment as if the payment has been made to\r\nthe borrower.\r\n', 'd. All the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1195, 1, 11, 3, 'What are the provisions of depositing 75% amount by the borrower while submitting appeal?\r\n', 'a. No appeal will be entertained unless 75% of the amount is not deposited.\r\n', 'b. DRT an waive or reduce the amount required to be deposited.\r\n', 'c. The amount will include installments which were not due.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1196, 1, 11, 3, 'The essential features of pay through certificates are:\r\n', 'a. It involves specific sale of asset cash flow to sPV.\r\n', 'b. The SPV issues pay through certificates to the investors.\r\n', 'c. The cash is collected by the SPV from the borrower and then distributed\r\n', 'd. the cash is colleted by the SPV from the borrow and then distributed to certificate holders.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1197, 1, 12, 1, 'what are the pre-requistes for formatting a securitized company?\r\n', 'a. it must obtain registration certificate from the RBI.\r\n', 'b. minimum owned funds of Rs. 2 crore.\r\n', 'c. the maximum amount of owned funds should not excel 15% of total financial assets acquired or to be\r\nacquieed.\r\n', 'd. all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1198, 1, 12, 2, 'what are the steps an asspt reconstruction company can take?\r\n', 'a. proper management of he business of the borrow.\r\n', 'b. sale or lease of a part of whole of business of borrower.\r\n', 'c. Re-scheduling the payment of dept.\r\n', 'd. all the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1199, 1, 12, 2, 'which of the following measures the asset reconstruction company can not undertake?\r\n', 'a. it can acquire standand assets of banks.\r\n', 'b. it can enforce security interest.\r\n', 'c. it can settle the dues payable by the borrower.\r\n', 'd. it can take possession of secured assets.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1200, 1, 12, 2, '...... exercises the central banking function in India,\r\n', 'a. State Bank of India\r\n', 'b. Central Bank of India\r\n', 'c. Reserve Bank of India\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1201, 1, 12, 3, 'Company matters of a banking company are regulated by ......\r\n', 'a. Reserve Bank\r\n', 'b. Authorities under Companies Act\r\n', 'c. SEBI\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1202, 1, 12, 2, 'Trading in shares and securities by banks is subject to control by ......\r\n', 'a. Controller of Capital Issues\r\n', 'b. SEBI\r\n', 'c. Company Law Board\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1203, 1, 12, 2, 'There are restrictions on cooperative banks on ...... in other cooperative societies under Section 49 of\r\nthe BR Act.\r\n', 'a. holding of shares\r\n', 'b. keeping deposits\r\n', 'c. acquiring any interested\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1204, 1, 12, 2, 'Central and restrictions on cooperative banks have to submit their returns under Section 31 of BR Act to\r\n......\r\n', 'a. Reserve Bank and National Bank\r\n', 'b. National Bank only\r\n', 'c. Reserve Bank only\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1205, 1, 12, 2, 'Under Section 23 of the BR Act, without the permission of Reserve Bank, a ...... can open a new place of\r\nbusiness within the area of its operation.\r\n', 'a. central cooperative bank\r\n', 'b. state cooperative bank\r\n', 'c. primary cooperative bank\r\n', 'd. None of the above\r\n', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1206, 1, 12, 2, 'Cooperative banks have to prepare their balance sheet and profit and loss account in the forms setout in\r\nthe Third Schedule to ......\r\n', 'a. Banking Regulation Act\r\n', 'b. Reserve Bank of India Act.\r\n', 'c. State cooperative Society Act\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1207, 1, 12, 2, 'when the Rules, framed by the Central Government, under the Act get validity?\r\n', 'a. After the Appellate Tribunal of DRt approves them.\r\n', 'b. On Supreme Court approving the same.\r\n', 'c. Immediately on framing of the Rules by the government and notifying the same.\r\n', 'd. When the both the house of Parliament approve the Rule so framed.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1208, 1, 12, 2, 'What is the object of introducting the Banking Ombudsman Scheme, 2002?\r\n', 'a. For effective monitoring of NPA accounts in the banks.\r\n', 'b. It is RBI agency to regulate the disputes amongst the banks.\r\n', 'c. To enable resolution of complaints relating to banking services.\r\n', 'd. For executing the orders passed by DRT.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1209, 1, 12, 1, 'Can the Banking Ombudsman undertake any other work than of his office?\r\n', 'a. Yes, as the appointment of Banking Ombudsman is honorary.\r\n', 'b. Yes, if RBI permits can undertake honorary work.\r\n', 'c. No.\r\n', 'd. Yes, if the Banking Ombudsman can handle both the jobs property.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1210, 1, 12, 2, 'Can the Banking Ombudsman resolve the dispute between banks or between bank and its customer by\r\nartitration reference?\r\n', 'a. No, the Banking Ombudsman has no arbitral powers.\r\n', 'b. Yes, if Banking Ombudsman himself feels and decides to so.\r\n', 'c. No, as the Banking Ombudsman has no powers of Civil Court.\r\n', 'd. Yes, if both the parties to the complaint agree for the same.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1211, 1, 12, 1, 'Under open cash credit, the goods are taken as security, without transferring\r\n', 'a. ownership of goods\r\n', 'b. possession of goods\r\n', 'c. both are transferred\r\n', 'd. both are not transferred', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1212, 1, 12, 2, 'As per lending policy, repayment of term loan is generally given upto .....\r\n', 'a. 10 years\r\n', 'b. 20 years\r\n', 'c. 7 years\r\n', 'd. 1 year', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1213, 1, 12, 3, 'Which of the following statements, is correct?\r\n', 'a. the qualified investors would be paid out of the realization of Financial Assets.\r\n', 'b. Any dispute between Bank securitization company and qualified institutional investors would be\r\nsettled through arbitration.\r\n', 'c. The lending company sells its loans to the investors through special purpose vehicle.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1214, 1, 12, 2, 'What are the features of asset Reconstruction?\r\n', 'a. The Right or interest of any Bank is acquired for the purpose of realization of such assets.\r\n', 'b. Non-performing assets alone can be acquired for asset re-construction.\r\n', 'c. The assets can be acquired by the Asset Reconstruction Company by issuing Debentures and Bonds or\r\nentering into an arrangement with the Bank.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1215, 1, 12, 3, 'Under what circumstances security can not be enforced?\r\n', 'a. If it is an Agriculture Land.\r\n', 'b. When the amount due is less than Rs. One lac.\r\n', 'c. When the Borrower has repaid more than 80% of principle and interest.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1216, 1, 12, 3, 'Security interest means:\r\n', 'a. Right, title and interest of any kind upon property.\r\n', 'b. Created in favour of any secured creditor.\r\n', 'c. This includes mortgage, hypothecation and assignment.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1217, 1, 12, 3, 'When an action for enforcement of security can be initiated?\r\n', 'a. When a Borrower is under the liability of secured creditor.\r\n.', 'b. Borrower makes a default in payment of principal and interest.\r\n', 'c. The loan account is classified as Non-performing Asset (NPA).\r\n', 'd. All the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1218, 1, 12, 3, 'What is a Non-performing Asset:\r\n', 'a. Where payment of interest or principal or both is in arrears for more than 180 dyas.\r\n', 'b. Where loan account is in default for 90 days and above.\r\n', 'c. Where loan account is classified as sub-standard doubtful or loss Asset by the Bank as per the\r\ndirections of RBI.\r\n', 'd. None of the above.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1219, 1, 12, 3, 'Which of the following are the requirements for finding a notice?\r\n', 'a. It must be in writing giving a borrower time of 60 days to discharge the liability.\r\n', 'b. It must specify that secured creditor has right to exercise any action over the assets.\r\n', 'c. It must give details of amount payable by the borrower and the secured assets intended to the\r\nenforced.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1220, 1, 12, 3, 'Which of the following a notice must specify in case of foreclosed loans?\r\n', 'a. It should cover entire loan liability including instalments not due.\r\n', 'b. It should cover entire loan liability including instalments not due.\r\n', 'c. It must mention future interest payable till the date of repayment.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1221, 1, 12, 3, 'Which of the following are the provisions for joint secured creditors?\r\n', 'a. Individual secured creditors can not take any action unless such right is agreed upon.\r\n', 'b. Decision will be taken jointly by secured creditors having 75 per cent of liability.\r\n', 'c. The decision take as above.(b) will be binding in all the remaining secured creditors.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1222, 1, 12, 3, 'How the amount received from sale of secured assets would be applied?\r\n', 'a. Payment of cash, changes incurred in taking over the assets and maintaining it.\r\n', 'b. Discharge of due of secured creditor.\r\n', 'c. The remaining amount will be paid to the borrower entitled.\r\n', 'd. In the above manner (a), (b) and (c).', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1223, 1, 12, 3, 'Which of the following statements, is correct?\r\n', 'a. Secured creditor may file a case with DRT for the remaining unrealise amount.\r\n', 'b. No suit can be filed against the secured creditor if it has acted in good faith.\r\n', 'c. Action against the secured creditor can be taken only of malafied is alleged and established.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1224, 1, 12, 3, 'Whose assistance can be taken for taking over assets if the borrower resists giving possession of the\r\nasset?\r\n', 'a. Chief Metropolitam Magistrate.\r\n', 'b. District Magistrate.\r\n', 'c. (a) or (b)\r\n', 'd. Superintendent of police.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1225, 1, 12, 3, 'Spurious Goods are defined under\r\n', 'a. sale of Goods act\r\n', 'b. contract act\r\n', 'c. consumer protection act\r\n', 'd. companies act', '', '', '1.00', '0.00', '', '''Spurious goods and services'' means such goods and services which are claimed to be genuine but they are actually not so.', '3', '', '', 'Yes', NULL, NULL),
(1226, 1, 12, 2, 'The document of title to goods enables the holder\r\n', 'a. to transfer the goods\r\n', 'b. ownership by endorsement\r\n', 'c. possession of goods by delivery\r\n', 'd. all of above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1227, 1, 12, 2, 'Non-registration of charge with ROC makes a bank to\r\n', 'a. become unsecured creditor against other charge holders\r\n', 'b. share the securities with other charge holders\r\n', 'c. lose the remedy to file suit for the debt\r\n', 'd. lose both the security and the right to file suit', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1228, 1, 12, 2, 'The majority of shares of subsidiary banks are held by ......\r\n', 'a. Reserve bank\r\n', 'b. Central Government\r\n', 'c. State bank\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1229, 1, 12, 2, 'Regional rural banks operate in .......\r\n', 'a. a notified area\r\n', 'b. the whole of a state\r\n', 'c. only a district\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1230, 1, 12, 1, 'The management of the affairs of a regional rural bank is vested in ......\r\n', 'a. the Sponsor Bank\r\n', 'b. its Board of Directors\r\n', 'c. National Bank\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1231, 1, 12, 1, 'Unless the context otherwise require, the reference to a ...... in the Banking Regulation Act shall be\r\nconstrued as reference to a cooperative bank.\r\n', 'a. cooperative society\r\n', 'b. banking company\r\n', 'c. body corporate\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1232, 1, 12, 2, '...... in relation to a cooperative society, for the puposes of BR Act, includes a member of any committee\r\nor body for the time being vested with the management of the affairs of that society .\r\n', 'a. Director\r\n', 'b. Member\r\n', 'c. Manager\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1233, 1, 12, 2, 'A bank has lent Rs.8 lakhs to a pvt.ltd.co. to purchase a pick up van. Therefore the bank''s charge\r\n', 'a. has to be registered with RTO/ROC\r\n', 'b. need not be registered with ROC\r\n', 'c. registration is optional\r\n', 'd. none of above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL);
