(1234, 1, 12, 1, '...... goods are to be manufactured/produced/acquired by the seller after making of the contract of sale.\r\n', 'a. Future\r\n', 'b. Specific\r\n', 'c. Moveable\r\n', 'd. Immoveable', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1235, 1, 12, 2, 'What are the main features of SARFAESI Act, 2002?\r\n', 'a. To put a legal system for securitization.\r\n', 'b. Empowering banks and financial institutions to take possession of the mortagaged securities.\r\n', 'c. To sell the securities without intervention of court.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1236, 1, 12, 3, 'What are the main issues with which SARFAESI Act, 2002 deals with?\r\n', 'a. Securitisation of Assets.\r\n', 'b. Setting up of an Assets Reconstruction Company.\r\n', 'c. Enforcement of securities.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1237, 1, 12, 1, 'The essential features of securitization are:\r\n', 'a. Acquisition of Financial Assets by a Securitisation or Reconstruction Company.\r\n', 'b. The Assets may be NPA or standard.\r\n', 'c. On sale the Assets goes out of the Books of the originator.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1238, 1, 12, 3, 'What are the main functions of Assets Reconstruction Company?\r\n', 'a. Setting up of a company.\r\n', 'b. Acquiring Assets for Reconstruction.\r\n', 'c. Acquire Assets for Asset Reconstruction.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1239, 1, 12, 2, 'Which of the following is not a function of Asset Reconstruction Company?\r\n', 'a. To acquire pending recovery cases from DRT.\r\n', 'b. Act as an Agent for Recover.\r\n', 'c. Act as Manager.\r\n', 'd. Act as Receiver of Court/Tribunal.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1240, 1, 12, 1, 'The important features of Enforcement of Securities are:\r\n', 'a. take possession of the Secured Assets.\r\n', 'b. Take over management of Secured Assets.\r\n', 'c. To acquire pending recovery cases from DRT.\r\n', 'd. Act as an Agent for Recover.', '', '', '0.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1241, 1, 12, 1, 'The important features of Enforcement of Securities are:\r\n', 'a. take possession of the Secured Assets.\r\n', 'b. Take over management of Secured Assets.\r\n', 'c. Recover dues from the debtors of the borrower\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1242, 1, 12, 2, 'In which of the following Acts. The provisions of Mortgage of an Asset are dealt with?\r\n', 'a. Transfer of Property Act.\r\n', 'b. Sale of Goods Act.\r\n', 'c. Negotiable Instrument Act.\r\n', 'd. Indian Company Law.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1243, 1, 12, 1, 'The bank can enforce the security after giving notice and if Borrower does not repay within:\r\n', 'a. 30 days\r\n', 'b. 60 days\r\n', 'c. 75 days\r\n', 'd. 90 days', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1244, 1, 12, 3, 'The power of enforcement of security are available to:\r\n', 'a. Banking Companies\r\n', 'b. Public Financial Institutions\r\n', 'c. Non-Banking Financial companies\r\n', 'd. (a) and (b)', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1245, 1, 12, 3, 'What are the Rights available to a secured creditor?\r\n', 'a. To sell the Assets.\r\n', 'b. File application with DRT for recovery of full or remaining dues.\r\n', 'c. To proceed against the guarantor.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1246, 1, 12, 1, 'Which of the following is correct?\r\n', 'a. The borrower can file an appeal with the DRT only after the secured creditor takes possession of\r\nAsset.\r\n', 'b. Borrower can not file an appeal in the Civil Court.\r\n', 'c. Writ petition can be filed in the High Court at any time.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1247, 1, 12, 3, 'Which of the following statements, is not correct?\r\n', 'a. the secured creditor has all the Judicial powers.\r\n', 'b. The Borrower can get the possession of Asset back if he succeeds in DRT.\r\n', 'c. The protection of SICA will not be available once the secured creditor takes steps\r\n', 'd. The Borrower can get compensation from the secured creditor if he succeeds in appeal in DRT.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1248, 1, 12, 1, 'Which of the following provisions are correct regarding securitisatin?\r\n', 'a. performing Assets can be securitized.\r\n', 'b. Non-performing assets can also be securitized.\r\n', 'c. A securitization company can also act as Asset Re-construction Company and vice-versa.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1249, 1, 12, 1, 'Which of the following are the requirements of a securitized company?\r\n', 'a. It should be an independent company.\r\n', 'b. It should be registered with RBI.\r\n', 'c. It will be a public financial institution.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1250, 1, 12, 3, 'Which of the following statements, is correct?\r\n', 'a. Securitisation company can acquire only financial assets.\r\n', 'b. The difference between securitization and factoring is that in factoring only existing Receivables can\r\nbe acquired while in securitistion even future Receivables can be acquired.\r\n', 'c. The purpose of Securitisation is to avoid mismatch between Assets and Liabilities.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1251, 1, 12, 3, 'The securitization Company can acquire financial assets from Banks in the following manner:\r\n', 'a. by issuing Debenture or Bonds.\r\n', 'b. By entering into an arrangement with the Bank/Financial Insitution.\r\n', 'c. (a) or (b)\r\n', 'd. (a) and (b)', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1252, 1, 12, 1, 'What is the role of qualified Institution Buyers in the securitization process?\r\n', 'a. The qualified investors would invest in the Financial Asset Scheme.\r\n', 'b. The securitized company issues Security Receipts to qualified investors.\r\n', 'c. The security receipt represents undivided interest in the Financial Asset.\r\n', 'd. The securitized company will realize Financial Assets and redeem the investment.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1253, 1, 12, 1, 'Letter of Credit where in addition to advance payment,the beneficiary is entitled to payment of storage charges is called\r\n', 'a. LC\r\n', 'b. Red clause credit\r\n', 'c. Yellow clause credit\r\n', 'd. Green clause credit', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1254, 1, 12, 1, 'Can a customer from whose account fraudulently someone has withdrawn money make complaint\r\nbefore the Banking Ombudsman?\r\n', 'a. No, as the offence committed is of criminal nature FIR with police has to be filed.\r\n', 'b. Yes, but if the police authoirities who have received FIR permit filing of complaint with Ombudsman.\r\n', 'c. Yes, as this aspect comes under the powers of Banking Ombudsman.\r\n', 'd. No, as the loss caused to the customer is of a civil nature for recovery, civil suit is required to be filed.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1255, 1, 12, 1, 'Once the dispute before the Banking Ombudsman is referred to arbitration can new claim or\r\ncounterclaim be made?\r\n', 'a. No, as the reference on the issues has already been made.\r\n', 'b. Yes, provided the claim and counterclaim are within the terms of reference.\r\n', 'c. Yes, provided additional stamp duty is paid thereon.\r\n', 'd. No, because arbitration is by mutual consent so stage of claim and counter claim does not arise.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1256, 1, 12, 1, 'Section 5(b) of ...... Act gives the definition of the term â€˜Bankingâ€™\r\n', 'a. Contract Act\r\n', 'b. Negotiable Instruments Act\r\n', 'c. Banking Regulation Act\r\n', 'd. Transfer of Property Act', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1257, 1, 12, 1, 'Principle functions of the Bank are:\r\n', 'a. Dispatch of statements\r\n', 'b. Adjustment of Interoffice Transactions\r\n', 'c. Clearing\r\n', 'd. Acceptance of deposits for Lending and investment', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1258, 1, 12, 3, 'In a deposit account the principal relation between Bank and Customer is bank ...... and the Customer\r\n......\r\n', 'a. Agent, Principal\r\n', 'b. Lessor, Lessee\r\n', 'c. Creditor, Debtor\r\n', 'd. Debtor, Creditor', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1259, 1, 12, 1, 'In case of safe custody of articles relation between Bank and Customer is Bank ...... and Customer ......\r\n', 'a. Agent, Principal\r\n', 'b. Lessor, Lessee\r\n', 'c. Bailor, Bailee\r\n', 'd. Debtor, Creditor', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1260, 1, 12, 1, 'Line is a/an ...... of the creditor to retain possession.\r\n', 'a. Obligation\r\n', 'b. Right\r\n', 'c. Interest\r\n', 'd. Protection', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1261, 1, 12, 1, 'The State Bank of India is a ......___ constituted under the State Bank of India Act.\r\n', 'a. banking company\r\n', 'b. body corporate\r\n', 'c. society\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1262, 1, 12, 1, 'The Chairman of the State Bank is appointed by ...... in consultation with the Reserve Bank.\r\n', 'a. the Central Board\r\n', 'b. Banking services Recruitment Board\r\n', 'c. Central Government\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1263, 1, 12, 3, 'State Bank has to act as ...... and carry out Central Government business\r\n', 'a. and other business entrusted by the Reserve Bank.\r\n', 'b. agent of Reserve Bank\r\n', 'c. agent of Central Government\r\n', 'd. advisor to the Central Government', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1264, 1, 12, 1, 'The provision of the ...... are applicable to State Bank as stipulated in Section 51 of the BR Act.\r\n', 'a. RBI Act\r\n', 'b. Banking Regulation Act\r\n', 'c. Companies Act\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1265, 1, 12, 3, 'Where as general lien gives right to retain goods, Bankerâ€™s lien has ...... in case of default.\r\n', 'a. right to create charge\r\n', 'b. right to create mortgage\r\n', 'c. right to sell\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1266, 1, 12, 3, 'General lien gives the creditor right to retain ...... which have come in his possession.\r\n', 'a. all goods\r\n', 'b. Some goods\r\n', 'c. Specific goods\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1267, 1, 12, 3, 'Acts done honestly is called acts done ......\r\n', 'a. without negligence\r\n', 'b. rashly\r\n', 'c. mollified\r\n', 'd. in good faith', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1268, 1, 12, 1, 'Mere signature of the payee on the reverse of the instrument is called ...... endorsement\r\n', 'a. full\r\n', 'b. blank\r\n', 'c. conditional\r\n', 'd. restrictive', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1269, 1, 12, 1, 'â€˜Sans recourseâ€™ means ......\r\n', 'a. I am not afraid\r\n', 'b. Do not touch me\r\n', 'c. ask the drawer\r\n', 'd. without liability to me', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1270, 1, 12, 1, 'In case of safe deposit licker the relation between Bank and Customer is Bank ...... and Customer ......\r\n', 'a. Agent, Principal\r\n', 'b. Lessor, Lessee\r\n', 'c. Creditor, Debtor\r\n', 'd. Debtor, Creditor', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1271, 1, 12, 1, 'When a Bank lends money the relation between Bank and Customer is Bank ......... and Customer ......\r\n', 'a. Agent, Principal\r\n', 'b. Lessor, Lessee\r\n', 'c. Creditor, Debtor\r\n', 'd. Debtor, Creditor', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1272, 1, 12, 1, 'Particular lien gives the creditor right to retain ...... in case the expenses incurred are not paid.\r\n', 'a. All goods\r\n', 'b. Some goods\r\n', 'c. Specific goods\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1273, 1, 12, 1, 'A revocable LC is one which can be amended or cancelled by............without prior notice.\r\n', 'a. Any or all parties of LC\r\n', 'b. The beneficiary\r\n', 'c. The issuing bank\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1274, 1, 12, 1, 'What are the enclosures to Paper Book to be submitted with recovery application to DRT?\r\n', 'a. Statement of loan account.\r\n', 'b. Purpose and circumstances under which loan was disbursed.\r\n', 'c. Reasons for default.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1275, 1, 12, 1, 'Which of the following is not an enclosure to the paper Book which is enclosed to the application with DRT?\r\n', 'a. All the documents based on which the claim is formed.\r\n', 'b. Details of payment of Fee.\r\n', 'c. Application of the Borrower.\r\n', 'd. Affidavit of the Advocate if the case is filed through the Advocate.,\r\n', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1276, 1, 12, 1, 'Which of the following is correct regarding filing a recovery case with DRT?\r\n', 'a. The application for recovery should be filed in 4 copies.\r\n', 'b. The loan documents should not be time barred at the time of filing a case.\r\n', 'c. The Recovery officer has powers like an Income Tax officer.\r\n', 'd. All the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1277, 1, 12, 1, 'Which of the following is not the power of DRT?\r\n', 'a. Presenting a Borrower to submit an appeal against the orders of DRT.\r\n', 'b. Management, protection and Improvement of property attached.\r\n', 'c. Collection of Rent and Profits on the attached property.\r\n', 'd. Distribution of the realization proceeds among secured creditors.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1278, 1, 12, 1, 'What is Lok Adalat?\r\n', 'a. It is an easy process of Settlement of Bank dues.\r\n', 'b. Small loans upto a specified amount can be settled through Lok Adalat.\r\n', 'c. It is a process of mutual settlement.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1279, 1, 12, 3, 'Which of the following are the features of Lok Adalat?\r\n', 'a. Lok Adalat meets on a specified day once a month.\r\n', 'b. The Bank and Borrower can have mutual settlement of their own or through\r\n', 'c. The competent officer of a Bank can present himself in the process.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1280, 1, 12, 1, 'What are the advantages of Lok Adalat?\r\n', 'a. Minimum Fee.\r\n', 'b. Easy and fast Process.\r\n', 'c. Facility of write offs.\r\n', 'd. All these.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1281, 1, 12, 1, 'A Bank officer of the following rank can refer the cases to Lok Adalat:\r\n', 'a. Scale II\r\n', 'b. Scale III\r\n', 'c. Scale IV\r\n', 'd. Scale v', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1282, 1, 12, 1, 'The Scale III officers can participate in Lok Adalat proceedings and may arrive at the compromise where\r\nwrite off amount does not exceed:\r\n', 'a. Rs. 2,500\r\n', 'b. Rs. 5,000\r\n', 'c. Rs. 10,000\r\n', 'd. Rs. 12.500', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1283, 1, 12, 3, 'The decision of the Scale III Bank official in write off the liability will have to be approved by:\r\n', 'a. Chairman\r\n', 'b. General Manager\r\n', 'c. Zonal Manager\r\n', 'd. No rectification is required.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1284, 1, 12, 1, 'Which of the following Committee recommended a separate Act, for Securitisation and Reconstruction\r\nof Financial Assets and Enforcement of Security Interest Act?\r\n', 'a. Rengrajan Commottee.\r\n', 'b. T.R. Andhyarjuna Committee.\r\n', 'c. Narasimham Committee.\r\n', 'd. Nayak Committee.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1285, 1, 12, 3, 'SARFAESI Act, 2002 was made effective on:\r\n', 'a. 21.06.2002.\r\n', 'b. 01.06.2002.\r\n', 'c. 01.04.2002.\r\n', 'd. 15.03.2002.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1286, 1, 12, 1, 'Bailment is the delivery of goods\r\n', 'a. as security\r\n', 'b. for safe custody\r\n', 'c. for using on rent\r\n', 'd. for sale or return\r\n', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1287, 1, 12, 1, 'what are the important features of securitization?\r\n', 'a. It is process through which illiquid Assets are transferred into more liquid from of Assets\r\n', 'b. The lending institution''s Assets are removed from it Balance Sheet\r\n', 'c. These Assets are funded by investors through a negotiable financial instrument\r\n', 'd. All the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1288, 1, 12, 1, 'What is the role of special purchase vehicle (SPV) in the process of securitization?\r\n', 'a. It is an intermediary between seller of financial Assets.\r\n', 'b. SPV receive money from investors and pays to the transferor.\r\n', 'c. The investors are paid out of the Assets realized over a period of time.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1289, 1, 12, 1, 'The essential features of pass through certificate are:\r\n', 'a. A direct, participation in the case flow is sold.\r\n', 'b. Receipt of Asset cash flow is deposited in a designated account.\r\n', 'c. The funds are passed on to certificate holders.\r\n.', 'd. All the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1290, 1, 12, 1, 'Debenture is a document acknowledging\r\n', 'a. Company''s indebtedness\r\n', 'b. Company''s ownership\r\n', 'c. Ownership of machinery\r\n', 'd. none', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1291, 1, 12, 2, 'Under letter of Credit, Bill means\r\n\r\n', 'a. Bill of entry\r\n', 'b. Bill of Lading\r\n', 'c. Bill of exchange\r\n', 'd. Invoice', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1292, 1, 12, 2, 'Income earned by a shareholder on a company shareholding is called\r\n', 'a. Interest\r\n', 'b. Discount\r\n', 'c. Dividend\r\n', 'd. None', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1293, 1, 12, 1, '...... may apply to the High Court for winding up of a banking company under Section 38 of the BR Act.\r\n', 'a. Registrar of Companies\r\n', 'b. Reserve Bank\r\n', 'c. Central Government\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1294, 1, 12, 1, 'The High court shall order winding up of a banking compnay if the banking company is unable to ...... .\r\n', 'a. pay its debts\r\n', 'b. file returns in time\r\n', 'c. eliminate non-performing assets\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1295, 1, 12, 1, 'In winding up proceedings the depositors shall ...... for the amounts shown in the books of the bank\r\nstanding to their credit.\r\n', 'a. be deemed to have filed claim\r\n', 'b. have to file claim\r\n', 'c. have no claim\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1296, 1, 12, 1, 'The ...... may apply to the Central Government for an order of moratorium in respect of a banking\r\ncompany.\r\n', 'a. banking company\r\n', 'b. Registrar of Companies\r\n', 'c. Reserve Bank\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1297, 1, 12, 2, 'The provisions of a scheme of amalgamation sanctioned by the Central Government under Section 45 of\r\nthe BR Act will ......_ the provisions of other laws.\r\n', 'a. not affect\r\n', 'b. have overriding effect on\r\n', 'c. will be subject to\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1298, 1, 12, 1, 'When the LC specifies the Bank that is to negotiate the bills drawn under the LC then the bank is also\r\ncalled ?\r\n', 'a. Confirming Bank\r\n', 'b. Reimbursing Bank\r\n', 'c. Nominated Bank\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
