(1370, 1, 13, 1, 'Which was the first committee recommended for establishment of special Recovery tribunals for Books\r\nand Financial Institution?\r\n', 'a. Tiwari committee.\r\n', 'b. Ojha Committee.\r\n', 'c. Narasimham Committee.\r\n', 'd. Rangrajan Committee.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1371, 1, 13, 1, 'In which year the Tiwari Committee recommended for establishment of Special tribunals for Banks dues\r\nrecovery?\r\n', 'a. 1981\r\n', 'b. 1987\r\n', 'c. 1991\r\n', 'd. 1995', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1372, 1, 13, 1, 'Which of the following committees also recommended the set up of Debit Recovery Tribunals?\r\n', 'a. Committee on Financial Sector Reforms.\r\n', 'b. Committee on Custom Service.\r\n', 'c. Committee on RRBs.\r\n', 'd. None of the above.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1373, 1, 13, 1, 'In which year the Recovery of Debts Due to Banks and Financial Institutions Act. Was enacted?\r\n', 'a. 1991\r\n', 'b. 1993\r\n', 'c. 1994\r\n', 'd. 1995', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1374, 1, 13, 1, 'In which of the following states the Recovery of Debts due Act is under implementation?\r\n', 'a. Selected States of the Country.\r\n', 'b. All the state of Country.\r\n', 'c. All over the country except Jammu & Kashmir.\r\n', 'd. No such restriction.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1375, 1, 13, 1, 'Which of the following cases to the Recovery of Debts due Act, is applicable?\r\n', 'a. Where amount involved is less than Rs. 10 lac.\r\n', 'b. Where amount involved is Rs. 10 lac or above.\r\n', 'c. Where amount involved is upto Rs. 11 lac.\r\n', 'd. No such restriction.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1376, 1, 13, 1, 'The central government has powers to authorize Tribunals to hear cases where amount involved is less\r\nthan Rs. 10 lac but more than:\r\n\r\n', 'a. Rs. 1 lac.\r\n', 'b. Rs. 2 lac\r\n', 'c. Rs. 5 lac.\r\n', 'd. Rs. 7 lac.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1377, 1, 13, 3, 'What central government has powers to authorize Tribunals to hear cases where amount involved is less\r\nthan rs. 10 lac but more than ;\r\n', 'a. To transfer all the cases of Bank recovery from civil court to the tribunals.\r\n', 'b. To set up an exclusive agency for Bank recovery.\r\n', 'c. To set up Special Tribunal which can provide speedy court remedies.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1378, 1, 13, 2, 'What are the various modes available to the Recovery officer for proceeding to recover the amount of\r\ndebt?\r\n', 'a. Attachment or sale of movable or immovable property.\r\n', 'b. Arrest the defendant or detention in jail.\r\n', 'c. Appointing a Receiver for the management of the movable or immovable\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1379, 1, 13, 3, 'How may Debt Recover tribunals have been set up in India?\r\n', 'a. 27\r\n', 'b. 28\r\n', 'c. 29\r\n', 'd. 50', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1380, 1, 13, 1, 'What is the jurisdiction area of a Debt Recovery Tribunal?\r\n', 'a. Each state.\r\n', 'b. One or more states/Union Territories\r\n.', 'c. Throughout the country.\r\n', 'd. No such criteria', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1381, 1, 13, 1, 'Clean Loans are normally ...\r\n', 'a. Secured Loans\r\n', 'b. Unsecured Loans\r\n', 'c. None of the above\r\n', 'd. Any of the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1382, 1, 13, 1, 'What is the maximum limit of compensation the baking ombudsman may a award?\r\n', 'a. Rs. 1 lac\r\n', 'b. Rs. 5 lac\r\n', 'c. Rs. 10 lac\r\n', 'd. Rs. No such limit', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1383, 1, 13, 1, 'In a Bill, a person entitled to receive payment is called\r\n', 'a. Drawer\r\n', 'b. Drawee\r\n', 'c. Payee\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1384, 1, 13, 1, 'The limitation period for filing a suit for sale of mortgaged property form the date mortgage debt\r\nbecomes due is...\r\n', 'a. 12 Years\r\n', 'b. 20 Years\r\n', 'c. 30 Years\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1385, 1, 13, 1, 'Power of attorney is ......\r\n', 'a. Signed letter to the Bank\r\n', 'b. A promissory note\r\n', 'c. Garnishee order\r\n', 'd. Stamped documents', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1386, 1, 13, 1, 'Person to whom a power of attorney is given is called ...... and the person who gives the Power of\r\nattorney is called ......\r\n', 'a. Debtor, Creditor\r\n', 'b. Bailor, Bailee\r\n', 'c. Agent, Principal (donor, donee)\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1387, 1, 13, 1, 'Promissory Notes, Bills of Exchange and cheque are together defined as......\r\n\r\n', 'a. Negotiable instruments\r\n', 'b. Transferred instruments\r\n', 'c. Trust Receipts\r\n', 'd. Documents of Title to goods', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1388, 1, 13, 1, 'In a civil suit to which bank is not a party has produced certified copy of books of account. One party to\r\nthe suit wants to call bank officer as witness to prove the contents of copy. Can it be done?\r\n\r\n', 'a. Yes, as it is right of the party to get it reaffirmed in evidence.\r\n', 'b. No, as the certified copy is a prima facie evidence that is admissible in evidence.\r\n', 'c. No, unless the bank volunteers to do so.\r\n', 'd. Yes, but if Court allows the application to call the witness.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL);
INSERT INTO `questions` (`id`, `qtype_id`, `subject_id`, `diff_id`, `question`, `option1`, `option2`, `option3`, `option4`, `option5`, `option6`, `marks`, `negative_marks`, `hint`, `explanation`, `answer`, `true_false`, `fill_blank`, `status`, `created`, `modified`) VALUES
(1389, 1, 13, 1, 'What are the exceptions of Evidence Act?\r\n', 'a. a certified copy of the original document can be produced in the court of Law if it is permitted by any law.\r\n', 'b. The Bankers Books Evidence act. Is also an exception to the Evidence Act.\r\n', 'c. Both (a) and (b).\r\n', 'd. None of the above.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1390, 1, 13, 2, 'Which of the following is included in the Bankers Book?\r\n', 'a. Ledger and Day Books.\r\n', 'b. Cash Books and Account Books.\r\n', 'c. All other Books used in the ordinary business of a Bank.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1391, 1, 13, 2, 'Which of the following statements, is not correct regarding Bankers Books Evidence Act?\r\n', 'a. The certificate issued by Bank should have signatures of the authorized person and it should be dated.\r\n', 'b. It should be supported by original document.\r\n', 'c. The certified copy will be original document.\r\n', 'd. The Bank will ensure the accuracy of the copy.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1392, 1, 13, 1, 'Which of the following statements, is correct regarding Bankers Books Evidence Act?\r\n', 'a. No officer of a Bank can be compelled to produce any Bankers Books unless it is specially ordered by\r\nthe court.\r\n', 'b. The above provision (a) applies only when the Bank is not a party to the case.\r\n', 'c. An investigating Police officer can compel a Bank officer to produce the Book without court order.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1393, 1, 13, 3, 'Legal proceeding under Bankers Books Evidence Act, signifies:\r\n', 'a. any proceeding or inquiry in which evidence is given\r\n', 'b. an arbitration\r\n', 'c. any investigation under the code of Criminal Procedure, 1973.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1394, 1, 13, 3, 'What are the powers of the court in case of legal proceedings under the Bankers Books Evidence act?\r\n', 'a. permit the affected party to inspect the Books and take copies.\r\n', 'b. Order the Bank to prepare the produce within specified time the certified copies/\r\n', 'c. Order the Bank to prepare certificates as desired under the Law.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1395, 1, 13, 1, '''A'' has purchased a draft from a bank favouring ''B''. The draft is lost in transit and for duplicate draft in\r\nlieu of first bank need some formalities to be completed by ''A''. Can ''B'' file a consumer case against the\r\nformalities as at is delaying payment to him.\r\n\r\n', 'a. No, as he is not consumer of the bank and is not taking any service from the bank.\r\n', 'b. No, as he has not paid the demand draft commission.\r\n', 'c. Yes, as because of bank his payment is getting delayed.\r\n', 'd. Yes, his money is lying in the bank, he is deemed as account holder of the bank.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1396, 1, 13, 1, 'A company which can appoint the majority of directors in another company is called\r\n', 'a. Subsidiary Company\r\n', 'b. Holding Company\r\n', 'c. Foreign Company\r\n', 'd. Existing Company', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1397, 1, 13, 1, 'Who is the Chairman of the Central Consumer Protection Council?\r\n', 'a. Chief Justice of the Supreme Court.\r\n', 'b. Judge of the Supreme Court appointed by the Chief Justice of the Supreme Court.\r\n', 'c. Minister in charge of Law and Judiciary in the Central Government .\r\n', 'd. Minister in charge of consumer affairs in the Central Government', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1398, 1, 13, 1, 'District Forum has passed order to pay compensation. How recovery of the ordered amount is made?\r\n', 'a. By filling execution in Civil Court.\r\n', 'b. By filling execution before District forum.\r\n', 'c. By filling civil Suit.\r\n', 'd. By referring the order toe collector for making recovery as if and revenue recovery.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1399, 1, 13, 1, 'Two parallel transverse lines across the cheque is called ......\r\n', 'a. endorsement\r\n', 'b. transfer\r\n', 'c. assignment\r\n', 'd. crossing', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1400, 1, 13, 1, 'The essentials of valid equitable mortgage is debt, deposit of title deeds and ......\r\n', 'a. Intention as security\r\n', 'b. Intention of sale deposit\r\n', 'c. Either a or b\r\n', 'd. Neither a not b', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1401, 1, 13, 1, 'The maximum number of members in a public company can be ......\r\n\r\n', 'a. 12\r\n', 'b. 50\r\n', 'c. 51\r\n', 'd. any number', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1402, 1, 13, 1, 'In which of the following documents the limitation period is 3 years?\r\n', 'a. Demand Pronote from the date of DP note.\r\n', 'b. Overdrafts - from the date of advances.\r\n', 'c. Term Loan - from the date of default in payment of each installment.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1403, 1, 13, 3, 'Which of the following statements, is correct?\r\n', 'a. There is no period of limitation for sale of pledged goods.\r\n', 'b. In case of Hypothecation the limitation period is 3 years from the date of loan.\r\n', 'c. Bill of exchange has 3 years limitation period from the due date.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1404, 1, 13, 3, 'the process of providing documents to police or CBI is :\r\n', 'a. They may seize a document set for investigation in case of fraud.\r\n', 'b. They may be given certified Xerox copy.\r\n.', 'c. If they insist for original Xerox copy should be retained with the bank.\r\n', 'd. All the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1405, 1, 13, 3, 'Which of the following are the important cash Books being maintained by the Bank?\r\n', 'a. Cash Received the Payment Book.\r\n', 'b. Sectional Cash Book.\r\n', 'c. Cash Balance Book.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1406, 1, 13, 3, 'Which of the following can be proved in the court of Law according to Bankers Books Evidence Act?\r\n', 'a. Existence of a document.\r\n', 'b. Condition of a document.\r\n', 'c. Contents of a document\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1407, 1, 13, 3, 'In which year the Bankers Books Evidence Act was enacted?\r\n', 'a. 1891\r\n', 'b. 1906\r\n', 'c. 1934\r\n', 'd. 1947', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1408, 1, 13, 3, 'Which of the following statements, is correct regarding the Bankers Books Evidence act?\r\n', 'a. It is a special Act which provides certain privileges to Banks.\r\n', 'b. The Act deals in connection with mode of proving of entries in their Books.\r\n', 'c. The act also have provision regarding production of Books in the court of Law.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1409, 1, 13, 3, 'Which of the following are the essential features of Law of Evidence?\r\n', 'a. The conditions and contents of a document can be proved before a court only by producing original\r\ndocument.\r\n', 'b. So long original documents rae available, a copy can not be produced.\r\n', 'c. However there are certain exceptions to the Law.\r\n', 'd. All the above.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1410, 1, 13, 1, 'When the ...... is in possession of goods, a lien can be exercised.\r\n', 'a. seller\r\n', 'b. buyer\r\n', 'c. agent of the buyer\r\n', 'd. carrier', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1411, 1, 13, 1, 'In a contract of indemnity the liability of the indemnifier is\r\n', 'a. Primary\r\n', 'b. Secondary\r\n', 'c. Either Primary or Secondary\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1412, 1, 13, 1, 'In a contract of indemnity the liability of the indemnifier is\r\n', 'a. Primary\r\n', 'b. Secondary\r\n', 'c. Either Primary or Secondary\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1413, 1, 13, 3, 'Crossing is a direction to the ...... bank to pay the cheque to the payee through a bank.1-\r\n', 'a. drawer\r\n', 'b. payee\r\n', 'c. paying\r\n', 'd. collecting', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1414, 1, 13, 1, 'When a cheque is drawn on a bank is called the ......\r\n', 'a. drawer\r\n', 'b. endorser\r\n', 'c. acceptor\r\n', 'd. drawee', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1415, 1, 13, 1, 'Who implemented the banking ombudsman scheme?\r\n', 'a. Indian bank association.\r\n', 'b. Reserve bank of India.\r\n', 'c. National institute of bank management\r\n', 'd. National consumer commission', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1416, 1, 13, 1, 'What kind of complaint can be lodged with the banking ombudsman?\r\n', 'a. Delay in collection of cheques\r\n', 'b. Deficiency in cash transaction\r\n', 'c. Non-issue of demand drafts\r\n', 'd. All the above', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1417, 1, 14, 1, 'Lok Adalats are organised by\r\n', 'a. District/State Authority\r\n', 'b. Supreme Court Legal Services Committee\r\n', 'c. High Court Legal Services Committee\r\n', 'd. All of these.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1418, 1, 14, 3, '"Spurious goods and services" means\r\n', 'a. Genuine goods and services\r\n', 'b. Not Genuine goods and services\r\n', 'c. Claimed to be Genuine but not actually so\r\n', 'd. None of the above', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1419, 1, 14, 1, 'The crossing in a crossed cheque can be cancelled by ......\r\n', 'a. drawer\r\n', 'b. endorser\r\n', 'c. acceptor\r\n', 'd. drawee', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1420, 1, 14, 3, 'A banker on whom a cheque is drawn by customer is ......\r\n', 'a. Collecting banker\r\n', 'b. Paying banker\r\n', 'c. Advising banker\r\n', 'd. Confirming banking', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1421, 1, 14, 2, 'A banker who collects a cheque for and on behalf of his customer is ......\r\n', 'a. Collecting banker\r\n', 'b. Paying banker\r\n', 'c. Advising banker\r\n', 'd. Confirming banking', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1422, 1, 14, 2, 'Section 131 of N.I. Acts extends protection to the ......\r\n', 'a. Collecting banker\r\n', 'b. Paying banker\r\n', 'c. Advising banker\r\n', 'd. Confirming banking', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1423, 1, 14, 3, 'Section 85 of N.I. Acts extends protection to the ......\r\n', 'a. Collecting banker\r\n', 'b. Paying banker\r\n', 'c. Advising banker\r\n', 'd. Confirming banking', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1424, 1, 14, 2, 'One of the condition to honour the cheque by the paying banker is that amount in words and figures\r\nshould ......\r\n\r\n', 'a. differ\r\n', 'b. tally\r\n', 'c. be clear\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1425, 1, 14, 1, 'Delivery of goods by one person to another for some purpose is ......\r\n', 'a. hypothecation\r\n', 'b. mortgage\r\n', 'c. pledge\r\n', 'd. bailment', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1426, 1, 14, 3, 'Whether moveable securities in possession of the bank can be sold by the Bank without intervention of\r\nthe Court?\r\n', 'a. No. The Court order is required to sale the security.\r\n', 'b. Yes. Bank can sell as provided in the Contract ACt, 1872.\r\n', 'c. Yes. As the SARFAESI Act, 2002 has made provisions to that effect.\r\n', 'd. No. Till the account is not declared as NPA by the Bank.', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1427, 1, 14, 3, 'In Mardia case what the Supreme Court declared as invalid ?\r\n', 'a. Entire SARFAESI Act, 2002.\r\n', 'b. Creation of security interest.\r\n', 'c. Formation of Reconstruction Companies.\r\n', 'd. Condition to pay 75 per cent of the amount as pre-condition while preferring appeal to the DRT.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1428, 1, 14, 1, 'Where a customer by a letter has advised the bank directing the banker not to honour / pay a particular\r\ncheque such a letter is called ......\r\n', 'a. letter of authority\r\n', 'b. letter of credit\r\n', 'c. stop payment letter\r\n', 'd. letter of continuity', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1429, 1, 14, 1, 'Where a customer has issued a cheque date of which is yet to come, such a cheque is called ......\r\n', 'a. stale cheque\r\n', 'b. post-dated cheque\r\n', 'c. crossed cheque\r\n', 'd. stolen cheque', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1430, 1, 14, 1, 'When a bank pays a cheque according to the apparent tenor, in good faith and without having reason to\r\ndoubt the bonafide of the presenter, such payment is ......\r\n', 'a. wrong payment\r\n', 'b. late payment\r\n', 'c. future payment\r\n', 'd. payment in due course', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1431, 1, 14, 1, 'To get the protection under S / 131, a collecting bank has to collect a ......for credit of is customer\r\n', 'a. stolen cheque\r\n', 'b. stale cheque\r\n', 'c. postdated cheque\r\n', 'd. crossed cheque', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1432, 1, 14, 2, 'If a cheque is stolen in transit and presented at the drawee bank by a holder in due course case and if\r\nthe cheques is paid by the bank in due course in a case the drawee bank would be ......\r\n', 'a. be held liable\r\n', 'b. would not be held liable\r\n', 'c. would be found guilty\r\n', 'd. None of these', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1433, 1, 14, 2, 'In ...... the ownership of goods is yet to pass from the seller to the buyer.\r\n\r\n', 'a. agreement to sell\r\n', 'b. contract of sale\r\n', 'c. contract of future goods\r\n', 'd. contract of specific goods', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1434, 1, 14, 3, 'If the stipulation agreed to between the parties is essential to the main purpose of the contract then\r\nsuch a stipulation is known as a ......\r\n', 'a. implied condition\r\n', 'b. condition\r\n', 'c. warranty\r\n', 'd. guarantee', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1435, 1, 14, 2, 'A ...... is a stipulation collateral to the main purpose of the contract.\r\n', 'a. condition\r\n', 'b. warranty\r\n', 'c. implied condition\r\n', 'd. guarantee', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1436, 1, 14, 2, 'The power of sale without intervention of the Court is given to the mortgagor in the case of the\r\nfollowing mortgage:\r\n', 'a. Equitable mortgage\r\n', 'b. English mortgage\r\n', 'c. Simple mortgage\r\n', 'd. Usufructuary Mortgage', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1437, 1, 14, 2, 'There is an implied condition on the part of the seller that he has a right to ...... the goods.\r\n', 'a. use\r\n', 'b. sell\r\n', 'c. retain\r\n', 'd. resale', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1438, 1, 14, 2, 'When any bank or financial institution creates a charge against property, with which authority the\r\ntransaction will have to be registered under the\r\nSARFAESI Act, 2002?\r\n', 'a. With the Central Registry.\r\n', 'b. With the ROC.\r\n', 'c. With the Registrar of Assurances within whose jurisdiction the property lies.\r\n', 'd. With the Reserve Bank of India.', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1439, 1, 14, 2, 'When the provisions of SARFAESI Act, 2002 can be invoked for proceeding against the charged\r\nproperty?\r\n', 'a. When the bank feels that it is necessary for the recovery at any time.\r\n', 'b. When the RBI directs to do so.\r\n', 'c. When there is default in repayment by the borrower.\r\n', 'd. When there is default in repayment and the bank declares the account as NPA.', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1440, 1, 14, 2, 'On giving default notice by the creditor, the borrower gives a reply to it. What the creditor should do?\r\n', 'a. Ignore the notice as the law does not provide for any reply option to the bank.\r\n', 'b. Wait till the borrower initiates any legal action based on his reply.\r\n', 'c. Give due consideration to the reply and reply to it.\r\n', 'd. Take the matter before DRT for resolving issues raised in reply.', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
