(1540, 1, 15, 2, 'If the principal debtor and creditor change the terms of guarantee without the consent of surety, the\r\nsurety will be discharged from the liability for....\r\n', 'a. all the debts\r\n', 'b. any future debts\r\n', 'c. either a or b\r\n', 'd. both a and b', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
