(1551, 1, 16, 2, 'Select from the following , a statement which speaks about liabilities of an entity.\r\n\r\n\r\n', '(a)	The liabilities consist of claims of the owners\r\n', '(b)	The liabilities consist of claims of the owners and outsiders\r\n', '(c)	The liabilities consist of claims of the outsiders\r\n', '(d)	 None of the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL);
INSERT INTO `questions` (`id`, `qtype_id`, `subject_id`, `diff_id`, `question`, `option1`, `option2`, `option3`, `option4`, `option5`, `option6`, `marks`, `negative_marks`, `hint`, `explanation`, `answer`, `true_false`, `fill_blank`, `status`, `created`, `modified`) VALUES
(1552, 1, 16, 3, 'If the net worth of the business is Rs.500, fixed assets are Rs. 500, current assets Rs.300, investments Rs.300, current liabilities Rs. Nil, what is the amount of claim to outsiders?\r\n\r\n', '(a)	Rs. Nil\r\n', '(b)	Rs. 1100\r\n', '(c)	Rs.500\r\n', '(d)	Rs.600\r\n', '', '', '1.00', '0.00', '', 'total assets= fixed assets+ current assets=500+500=1000\r\n', '4', '', '', 'Yes', NULL, NULL),
(1553, 1, 16, 2, 'Select from the  following a sentence which is wrong\r\n\r\n', '(a)	If assets increase and liabilities do not , the capital will increase\r\n', '(b)	If assets increase and liabilities also increase by same sum , the capital will remain same\r\n\r\n', '(c)	A reduction in the amount of assets will amount to equivalent reduction in the net worth \r\n', '(d)	An increase in the amount of liabilities with no corresponding increase in liabilities will increase the amount of capital', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1554, 1, 16, 2, 'The firm sells goods on credit for Rs.50000, the cost of the goods sold is Rs.30000.The effect of the transaction is that, the capital of the  firm-----\r\n', '(a)	increases by Rs.50000\r\n', '(b)	reduces by Rs.40000\r\n', '(c)	increases by Rs. 20000\r\n', '(d)	reduces by Rs. 20000\r\n', '', '', '1.00', '0.00', '', 'capital earned=sales-cost of good\r\n                      =50000-30000\r\n                      =20000', '3', '', '', 'Yes', NULL, NULL),
(1555, 1, 16, 1, 'Mr.Ghatge commenced his business on 1st April, 2006 with Capital of Rs.1,00,000. He did good business during the year and earned handsome profit. At the end of 31st March, 2007, his financial position was: Fixed Assets Rs.1, 20,000 and bank balance of Rs.33000 and Creditors Rs.  17000. What was his net profit for the year 05-06?\r\n', '(a)	Rs. 36000\r\n', '(b)	Rs.70000\r\n', '(c)	Rs.53000\r\n', '(d)	None of the above\r\n', '', '', '1.00', '0.00', '', 'The net income formula yields the residual amount of gain or loss remaining after expenses are deducted from revenue.\r\nnet profit=fixed assets+cash at bank-capital -creditor=120000+33000-100000-17000=36000', '1', '', '', 'Yes', NULL, NULL),
(1556, 1, 16, 3, 'One of the pairs given below is wrong. Select the wrong pair.\r\n', '(a)	Outstanding expenses  -  Nominal account\r\n', '(b)	Profit and Loss Account (Dr. balance) â€“ Application of funds\r\n', '(c)	Net worth less reserves & surplus   -  Capital\r\n', '(d)	Balance sheet  -  Financial position \r\n', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1557, 1, 16, 1, 'Choose the sentence which speak about illegal association\r\n', '(a)	The unregistered association of 10 persons to do banking business\r\n', '(b)	The unregistered association of 50 persons to do non banking business\r\n', '(c)	The unregistered association of 20 persons to do business other than banking \r\n', '(d)	The unregistered association of 10 persons to do business other than banking \r\n', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1558, 1, 16, 1, 'From the following ,find a sentence which is false in respect of partnership\r\n', '(a)	If the partnership is following the â€œFixed Capital Account Methodâ€ salary payable to a partner is credited to the partnerâ€™s current account\r\n', '(b)	Drawings made by partners are never entered in the Profit and Loss Appropriation Account. \r\n', '(c)	In the â€œFluctuating Capital Account Methodâ€ the balance in the capital account  always remains the same\r\n', '(d)	The capital account of a partner is required to be opened in both the Fixed Capital Account Method  and Fluctuating Capital Account Method\r\n', '', '', '1.00', '0.00', '', 'Fluctuating Capital Account Method- Under this method, all the transactions relating to a partner are entered in only one capital account maintained for him. No current account is opened as in the Fixed Capital Method.under this method the balance in the capital account varies differently.', '3', '', '', 'Yes', NULL, NULL),
(1559, 1, 16, 2, 'From the account given below, select the account which is  wrongly  included in Profit & Loss Appropriation Account at the debit side \r\n', 'a.	Drawings Account\r\n', 'b.	Partners Salary Account\r\n', 'c.	Interest on Loan Account\r\n', 'd.	Commission to Partners Account\r\n', '', '', '1.00', '0.00', '', 'drawings account are included at the credit side in Profit & Loss Appropriation Account.', '1', '', '', 'Yes', NULL, NULL),
(1560, 1, 16, 1, 'The average net profits expected  are Rs.108000 per annum before charging remuneration of Rs. 18000 to partner . The capital employed in the business is Rs.6,00,000. The rate of return expected on capital employed of a firm is 10%. What is the value of goodwill on the basis of two years purchase of super profits.\r\n', 'a.	Rs.108,000\r\n', 'b.	Rs.60,000\r\n', 'c.	Rs.78,000\r\n', 'd.	None of the above\r\n', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1561, 1, 16, 3, 'A and B are two partners in a firm sharing profits and losses as 2:1. they admitted C as a partner with 25% share in the profits of the firm. Hence , the new profit sharing ratio , after admission of  C would be -----\r\n', '(a)	15:15:10\r\n', '(b)	20:10:10\r\n', '(c)	3:1:1\r\n', '(d)	None of the above\r\n', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1562, 1, 16, 1, '	Mr. Q and Mr. R were partners of a firm sharing profit and losses in the ratio of 3:2. They take S into partnership. It was agreed that S will pay Rs.1,00,000 as his share of goodwill which will be retained in business and also bring  Rs.3,00,000 as capital for one fourth share in the future profits. The book value of the stock was 41,000 but was to be revalued at Rs.50,000, Accountant has passed following entries, but Mr. Q feels that one of the entry is wrong. Select the wrong entry from the following.\r\n', '(a)	Debit cash and credit Goodwill for Rs.1,00,000\r\n', '(b)	Debit cash and credit  Sâ€™s Capital for Rs.3,00,000\r\n', '(c)	Debit Goodwill for Rs.1,00,000 and credit Qâ€™s Capital by Rs. 60000 & Râ€™s Capital by Rs. 40,000\r\n\r\n', '(d)	Debit Stock and credit Profit & Loss Adjustment A/c by Rs.9,000', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1563, 1, 16, 2, 'Read the following four journal entries which are passed to consider revaluation of assets and liabilities at the time of admission of a partner. One of the journal entries is wrong, choose the entry which is wrong.\r\n', '(a)	For increase in the value of assets-Debit Asset Account and Credit Revaluation Account.\r\n', '(b)	For decrease in the value of liabilities- Debit Liabilities Account and Credit Revaluation Account.\r\n', '(c)	 For Profit on revaluation of assets and liabilities â€“ Debit Old Partners Capital Account in old profit sharing ratio and Credit Revaluation Account\r\n', '(d)	For decrease in the value of  assets -Debit Revaluation Account and Credit Asset Account \r\n', '', '', '1.00', '0.00', '', 'For profit on revaluation of assets and liabilities\r\nRevaluation a/c Dr.\r\n              To Old Partners'' Capital a/c (In old profit sharing ratio)\r\n(Being the profit on revaluation of assets and liabilities transferred to partners'' capital accounts)', '3', '', '', 'Yes', NULL, NULL),
(1564, 1, 16, 1, '	Any facts, observations, occurrences are called -----\r\n', '(a)	data\r\n', '(b)	record\r\n', '(c)	file\r\n', '(d)	system	\r\n', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1565, 1, 16, 3, 'In the books of ABC Enterprises, a partnership firm, when Mr. C, a partner decided to resign from the firm, a revaluation of assets and liabilities was done and Revaluation account was prepared which showed the following position: At the credit side of Revaluation Account, Stock  A/c Rs.25000, Premises A/c Rs.52000 and Creditors A/c Rs. 8000 were shown while at debit side of Revaluation Account  Reserve for Doubtful Debts A/c. Rs.15000, Aâ€™s Capital A/c.Rs.20000, Bâ€™s Capital A/c. Rs.20,000 and Câ€™s Capital A/c. Rs.20000 were shown. Accountant has interpreted the Revaluation Account as follows. One of the interpretations by him is incorrect. Select the incorrect sentence.\r\n', '(a)	Stock is revalued upwardly by Rs. 25000\r\n', '(b)	Creditors are revised upwardly by Rs.8000\r\n', '(c)	Premises are revised upwardly by Rs.52000\r\n', '(d)	A provision on debtors of Rs. 15,000 is made for doubtful debts \r\n', '', '', '1.00', '0.00', '', 'Creditors of Rs 8000 are not shown in revaluation account.they are shown at liabilities side of balance sheet.', '2', '', '', 'Yes', NULL, NULL),
(1566, 1, 16, 2, '	Select the True statement from the following\r\n', '(a)	Interest on drawing is an income to the partnership firm\r\n', '(b)	Joint Venture is a permanent partnership firm\r\n', '(c)	Goodwill is a tangible asset of the firm\r\n', '(d)	In the absence of partnership agreement , partners share profit and loss in proportion to the capital contributed by the partners\r\n', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1567, 1, 16, 2, 'Select the incorrect statement in respect of companies.\r\n', '(a)	A member of a company can enter into contract with a company\r\n', '(b)	It is compulsory to register a joint stock company\r\n', '(c)	If  all but one member of a private company becomes insolvent ,it affects the existence of the organisation\r\n\r\n', '(d)	Shareholders are not liable for the acts of the company', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1568, 1, 16, 2, '	Select the incorrect sentence\r\n', '(a)	Whenever, there is no profit or inadequate profit, dividend cannot be declared\r\n', '(b)	The right to claim dividend lapses when there is no profit in case of cumulative preference shares\r\n', '(c)	When the company makes profit , arrears of preference dividend are cleared first\r\n', '(d)	 The Act prohibits the issue of any preference shares which are irredeemable\r\n', '', '', '1.00', '0.00', '', 'cumulative preference shares: a preference share which will have the dividend paid at a later date even if the company is not able to pay a dividend in the current year. So, There will be no right to claim dividend lapses when there is no profit in case of cumulative preference shares.\r\n\r\n\r\n\r\n', '2', '', '', 'Yes', NULL, NULL),
(1569, 1, 16, 2, 'Select the incorrect statement\r\n', '(a)	Authorized capital is the capital with which the company is registered\r\n', '(b)	Issued capital is equal to its authorized capital\r\n', '(c)	Authorized capital, issued capital, subscribed capital, called up capital and paid up capital cannot be same \r\n', '(d)	The amount which the company has asked its shareholders to pay is called up capital of the company.\r\n', '', '', '1.00', '0.00', '', 'Authorized capital, issued capital, subscribed capital, called up capital and paid up capital can be same on  account of the company.', '3', '', '', 'Yes', NULL, NULL),
(1570, 1, 16, 2, 'Following are the journal during the process of application to  allotment stage . One of the entries is wrong. Select the wrong entry.\r\n', '(a)	Debit bank account and credit share application account ( when application money is received)\r\n', '(b)	Debit share application account and  credit share capital account  (application transferred to share capital account)\r\n', '(c)	Debit share capital and credit share allotment account ( for recording allotment money being fallen due )\r\n', '(d)	Debit bank account and credit share allotment account ( for receipt of allotment money)  \r\n', '', '', '1.00', '0.00', '', 'CORRECT ENTRY: Debit- share allotment account \r\n                            Credit- share capital account\r\n', '3', '', '', 'Yes', NULL, NULL),
(1571, 1, 16, 2, 'Select the incorrect statement in respect of calls in advance\r\n\r\n\r\n', '(a)	The company may accept from shareholders , the uncalled amount on shares even before it is fallen due\r\n', '(b)	The article of association must permit such acceptance of advance call money\r\n', '(c)	Interest on calls in advance can be paid but the maximum is upto 6%\r\n', '(d)	The amount of calls in advance is part of the paid up share capital ', '', '', '1.00', '0.00', '', 'The amount of calls in advance is part of the called up share capital', '4', '', '', 'Yes', NULL, NULL),
(1572, 1, 16, 2, 'Select the incorrect statement in respect of utilization of  share premium\r\n\r\n', '(a)	it is used for the purpose of buy back of shares\r\n', '(b)	it used for payment of dividend in case of inadequacy of profits\r\n', '(c)	it is used for writing off  preliminary expenses\r\n', '(d)	it is used for issue of fully paid bonus shares\r\n', '', '', '1.00', '0.00', '', 'it is not used for payment of dividend in case of inadequacy of profits', '2', '', '', 'Yes', NULL, NULL),
(1573, 1, 16, 3, 'Mr. X  was issued 100 shares of Rs.10 each. He failed to pay call money of Rs. 5 per share. The shares were forfeited and re-issued to Mr. Y at Rs.9. When the entry recording the re-issue of shares was passed in all, four accounts were affected.  The debit and credit effect of these four accounts is given below. One of the accounts is given wrong effect.  Select that account from the following.\r\n', '(a)	Debit bank account by Rs.900\r\n', '(b)	Debit forfeited shares by Rs.500\r\n', '(c)	Credit share capital by Rs.1000\r\n', '(d)	Credit forfeited shares by Rs.400\r\n', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1574, 1, 16, 2, 'DT Ltd. issued shares of Rs.10 each at 10 % premium, payable on application Rs.2, on allotment Rs.3 (including premium), on first call Rs.2 and on final call Rs.4. One of the shareholders, applied for 100 shares but fail to pay allotment and first call money. At this stage, the said shares were forfeited. Select the account which was wrongly credited.\r\n', '(a)	Credit Forfeited shares Account by Rs.200\r\n', '(b)	Credit Share allotment Account by Rs.200\r\n', '(c)	Credit share premium Account by Rs.100\r\n', '(d)	Credit Share first call Account by Rs.200\r\n', '', '', '1.00', '0.00', '', 'premium share=10% of issued share\r\n                        =10 divided by 100 x10= Re 1\r\n\r\n allotment share\r\n             ', '3', '', '', 'Yes', NULL, NULL),
(1575, 1, 16, 2, 'Select the source which is not valid for issue of bonus shares\r\n\r\n', '(a)	Share premium \r\n', '(b)	Revaluation reserve created by revaluation of fixed assets\r\n', '(c)	Capital reserve \r\n', '(d)	Capital redemption reserve\r\n', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1576, 1, 16, 3, '	The liability side of the balance sheet of  ABC International Ltd. is showing following position:  Paid up  share capital Rs.25 Lakh ( 25,000 shares of Rs.100 each fully paid up)Share premium Rs.5 Lakh, Capital Reserve Rs. 3 Lakh, General Reserve Rs. 15 Lakh and Profit & Loss account Rs. 15 Lakh .It was decided to use minimum free reserve for issue of 1:1 bonus shares.. The accounts and the amount with which the account is debited are given below in sets. One of the set is correct. Select the same.\r\n\r\n', '(a)	Share Premium Account (Rs.5 Lakh), Capital Reserve Account ( Rs. 1 Lakh), General Reserve Account  (15 Lakh) &  Profit & Loss Account  by Rs. 4 Lakh\r\n', '(b)	Share Premium Account (Rs. Nil Lakh), Capital Reserve Account ( Rs. Nil Lakh), General Reserve Account  (10 Lakh) &  Profit & Loss Account  by Rs. 15 Lakh\r\n', '(c)	Share Premium Account (Rs.5 Lakh), Capital Reserve Account ( Rs. 3 Lakh), General Reserve Account  (15 Lakh) &  Profit & Loss Account  by Rs. 2 Lakh\r\n', '(d)	Share Premium Account (Rs.5 Lakh), Capital Reserve Account ( Rs. 1 Lakh), General Reserve Account  (4 Lakh) &  Profit & Loss Account  by Rs. 15 Lakh\r\n', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1577, 1, 16, 2, '	Select the incorrect statement in case of Share Capital and Reserves and Surplus as shown in the balance sheet.\r\n', '(a)	Under share capital, the following order is maintained: Authorised capital, issued capital, subscribed capital\r\n', '(b)	The called up amount per share is indicated and in the amount column total amount i.e. number of shares multiplied by amount called up per share is shown\r\n', '(c)	The amount of unpaid calls is deducted from (b) above\r\n', '(d)	The amount of forfeited shares account is shown under Reserves & surplus\r\n', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1578, 1, 16, 2, '	Select the incorrect statement in respect of form of balance sheet of companies(Liabilities side).\r\n', '(a)	sinking fund is shown under unsecured loans\r\n', '(b)	Loans and Advances from banks are grouped under the head Secured Loans\r\n', '(c)	Unclaimed Dividend is grouped under the head current liabilities\r\n', '(d)	Proposed dividend is grouped under provisions\r\n', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1579, 1, 16, 2, '	Select the incorrect statement in respect of form of balance sheet of companies ( Asset side).\r\n\r\n', '(a)	Live Stock is  grouped under the head â€˜current Assetâ€™\r\n', '(b)	Balance of unutilized monies raised by issue is  grouped under the head â€˜Investmentsâ€™\r\n', '(c)	Interest paid out of capital during construction is grouped under the head â€˜Miscellaneous Expenditureâ€™\r\n', '(d)	Vehicles  are  grouped under the head â€˜Fixed Assetâ€™', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1580, 1, 16, 2, '	In case any sum has been written off on a reduction of capital or revaluation of assets, each balance sheet subsequent to such reduction or revaluation must show the reduced figures and date of reduction for a period of -----\r\n', '(a)	1 year thereafter\r\n', '(b)	2 years thereafter\r\n', '(c)	3 years thereafter\r\n', '(d)	5 year thereafter\r\n', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1581, 1, 16, 2, '	One of the accounts is wrongly grouped under the head â€œInvestmentsâ€ while preparing the balance sheet of the company. Single out the wrong account.\r\n', '(a)	Investments in government or trust securities\r\n\r\n', '(b)	Investments in shares ,debentures or bonds\r\n', '(c)	Immovable properties\r\n', '(d)	Interest accrued on investments  ', '', '', '1.00', '0.00', '', 'Interest accrued on investments  is shown under current assets of assets side', '4', '', '', 'Yes', NULL, NULL),
(1583, 1, 16, 2, '	One of the accounts is wrongly debited to â€œProfit and Loss Appropriation A/câ€ of a company.  Name the wrong account debited\r\n\r\n', '(a)	Interim dividend\r\n', '(b)	Proposed dividend\r\n', '(c)	Provision for tax\r\n', '(d)	Capital redemption reserve\r\n', '', '', '1.00', '0.00', '', 'Provision for tax is shown on the liabilities side of balance sheet.', '3', '', '', 'Yes', NULL, NULL),
(1584, 1, 16, 2, '	Select the false statement in respect of assets\r\n', '(a)	a banking company is allowed to acquire assets for its own use\r\n', '(b)	a banking company is allowed to grant loans against the security of assets belonging to its customers\r\n', '(c)	a banking company is allowed to take possession of such assets in case of default committed by the borrower\r\n', '(d)	a banking company is not allowed to sale the assets against the security of which it has granted loans\r\n', '', '', '1.00', '0.00', '', '', '4', '', '', 'Yes', NULL, NULL),
(1585, 1, 16, 1, '	The scheduled banks are required by RBI to transfer at least ------ of their disclosed profit after adjustment/provision towards bonus to staff \r\n', 'a.	20%\r\n', 'b.	15%\r\n', 'c.	10%\r\n', 'd.	None of the above\r\n', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1586, 1, 16, 3, '	Select the incorrect statement in respect of â€œ financial Statements of Banksâ€\r\n\r\n', '(a)	a banking company is not required to prepare financial statements in accordance with Schedule VI of the Companies Act , 1956.  \r\n', '(b)	The Act prescribes special forms of balance sheet and profit and loss account for the preparation of its final accounts\r\n', '(c)	These are set out in form A and form B of the first schedule to the Banking regulation Act, 1949\r\n', '(d)	Form A gives format of a balance sheet and form â€œBâ€ gives the format of a profit and loss account', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1587, 1, 16, 2, '	The financial statement of bank consists of ------- schedules\r\n', '(a)	18 Schedules\r\n', '(b)	16 Schedules\r\n', '(c)	17 Schedules\r\n', '(d)	15 Schedules\r\n', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1588, 1, 16, 2, '	Investments, Advances, Fixed Assets and other Assets are part of Schedule Nos.--respectively\r\n', 'a.	6,7,8,9\r\n', 'b.	7,8,9,10\r\n', 'c.	8,9,10,11\r\n', 'd.	9,10,11,12\r\n', '', '', '1.00', '0.00', '', '', '3', '', '', 'Yes', NULL, NULL),
(1589, 1, 16, 2, '	Liability for partially paid investments in respect of banking companies is grouped under the head-----\r\n', '(a)	Investments\r\n', '(b)	Other assets\r\n', '(c)	Other liabilities and provisions\r\n', '(d)	Contingent liabilities \r\n', '', '', '1.00', '0.00', '', 'Contingent Liabilities: Liabilities that will arise on the happening of certain events.\r\naccording to Schedule 12: Contingent Liabilities\r\n(I) Claims against the bank not acknowledged as debts\r\n(II) Liability for partly paid investments\r\n(III) Liability on account of outstanding forward exchange contracts\r\n(IV) Guarantees given on behalf of constituents:\r\n(i) In India (ii)\r\nOutside India\r\n(V) Acceptances, endorsements and other obligations\r\n(VI) Other items for which the bank is contingently liable', '4', '', '', 'Yes', NULL, NULL),
(1590, 1, 16, 3, '.One of the items is a misfit in a group namely â€˜other incomeâ€™ of a banking company. Select this item from the following \r\n', '(a)	Income on Investments\r\n', '(b)	Profit on sale of investments\r\n', '(c)	Profit on revaluation of investments\r\n', '(d)	Profit on exchange transactions \r\n', '', '', '1.00', '0.00', '', 'In Schedule 13 Income on Investments is shown as income earned.it is not the part of other income\r\n', '1', '', '', 'Yes', NULL, NULL),
(1591, 1, 16, 3, 'In banking company, matured term deposit to be shown under-----\r\n', '(a)	demand deposits\r\n', '(b)	saving bank deposits\r\n', '(c)	term deposits\r\n', '(d)	other liabilities and provisions\r\n', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL),
(1592, 1, 16, 1, 'Advances given to a staff by a bank as a employer should be included in-----\r\n', '(a)	other assets\r\n', '(b)	advances \r\n', '(c)	investments\r\n', '(d)	none of the above\r\n', '', '', '1.00', '0.00', '', 'in schedule 11 Advances given to a staff is included under other assets.', '1', '', '', 'Yes', NULL, NULL),
(1593, 1, 16, 1, 'Depreciation on bankâ€™s property is part of â€œOperating Expensesâ€. Some of the items included under this category are listed below. One of the expenses is wrongly included. Identify that item of expense.\r\n', '(a)	depreciation on motor cars\r\n', '(b)	depreciation on stationary and stamps\r\n', '(c)	depreciation on furniture\r\n', '(d)	depreciation on non-banking assets\r\n', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1594, 1, 16, 1, '	Select the correct statement in respect of doubtful debts  \r\n\r\n', '(a)	Which has remained NPA for a period not exceeding 18 months?\r\n', '(b)	Which has remained NPA for a period exceeding 18 months	\r\n', '(c)	Which is considered uncollectible by bank/ internal auditor or RBI Inspection\r\n', '(d)	None of the above', '', '', '1.00', '0.00', '', '', '2', '', '', 'Yes', NULL, NULL),
(1595, 1, 16, 1, '	The provisional requirement for standard asset is-----\r\n\r\n', '(a)	0.40%(revised) of total outstanding\r\n', '(b)	10%(revised) of total outstanding\r\n', '(c)	40%(revised) of total outstanding\r\n', '(d)	100%(revised) of total outstanding', '', '', '1.00', '0.00', '', '', '1', '', '', 'Yes', NULL, NULL);
